(113, 1715, 'Aubière', 'LIMOS', 'Ingénieur de recherche', 'A la fin de mes études, j\'ai effectué un CDD de 5 mois au sein du LIMOS (Laboratoire Informatique, Modélisation et Optimisation des Systèmes) afin d\'améliorer mes compétences en planification et ordonnancement à capacité finie. J\'ai continué par la suite sur une bourse innovation d\'un an financée par la région Auvergne et le FEDER,  Mission : Transfert de compétence entre un laboratoire de recherche public (LIMOS) et une société éditrice d\'ERP : Qualiac sur des outils d\'Ordonnancement et de Planification.', '2011-10-01 00:00:00', 1),
(114, 1715, 'Cournon', 'Qualiac', 'Stratégie Produit', 'J\'ai rejoint la stratégie Produits de Qualiac en mars 2013 suite à la bourse Innovation de la région Auvergne. Nous travaillons essentiellement sur l\'avenir de l\'ERP à court, moyen et long termes en réfléchissant sur l\'opportunité d\'intégration de nouveaux modules, applications , ou partenaires.', '2013-03-04 00:00:00', 1),
