INSERT INTO `message` (`id`, `user_id`, `message`, `date`, `enabled`) VALUES
(3, 1187, 'les chats c\'est bien, mais c\'est encore mieux en vrai: les Paye Ta Mousse c\'est super bien, il faut en refaire!! PLEIN! tous les trimestres! partout en France!', '2015-02-09 11:56:28', 1),
(4, 1189, 'Promis le prochain est bientôt : en Avril avec le début des stages', '2015-02-09 21:14:59', 1),
(5, 172, 'Ah, oui, partout en France et ailleurs ! Mobilisons-nous !', '2015-02-10 17:02:59', 1),
(6, 52, 'Le week-end prochaine je vois des potes ZZ promo 2003. Qu\'est ce que je leur dit pour qu\'ils viennent mettre à jour leur fiche d\'annuaire ? Ils ont forcément reçu un mail avec login/mpd ? C\'est quoi la procédure si c\'est pas le cas. Il y a moyen de savoir qui est à jour et qui ne l\'ai pas ?', '2015-02-10 17:15:50', 1),
(7, 2176, 'David Santiago est beaucoup trop fort', '2015-02-11 17:16:32', 0),
(8, 2256, 'Le mec c\'est un artisan quoi :P', '2015-02-11 18:07:31', 0),
(9, 2368, 'Tu peux leur dire qu\'ils viennent mettre à jour leur fiche sur l\'annuaire. Ils ont pas reçu de mail encore, mais ça ne devrait pas tarder. Si l\'email qu\'ils ont n\'est pas valide, il faut envoyer un mail à support@anelis.org.  Pas de moyen \"public\" pour savoir qui est à jour ou qui ne l\'est pas, mais ça ne va pas tarder :)', '2015-02-15 21:34:39', 1),
(10, 1189, 'yes david, faudra maintenant nous ressortir une liste des personnes à email invalide qu\'on lance le perdu de recherche !!', '2015-02-15 23:12:44', 1),
(11, 585, 'salut les ZZ, ça fait plaisir de venir ici :) bien le bonjour à tous !', '2015-02-17 11:20:07', 1),
(12, 52, 'En souscrivant à un abonnement annuel chez linxo, je suis tombé sur un truc dans paypal qui a l\'air d\'être une sorte de paiement récurrent : ce serait pe pas mal pour le payement de la cotisation annuelle', '2015-02-17 12:56:21', 1),
(13, 1487, '+1 pour l\'idée de Furby !', '2015-02-17 20:00:55', 1),
(14, 1487, '+1 pour l\'idée de Furby !', '2015-02-17 20:06:03', 0),
(15, 1487, 'Bug: Si on appuie sur F5 le message se republie.', '2015-02-17 20:06:35', 1),
(16, 1816, 'David, y a-t-il moyen de trier la liste des parcours par ordre chronologique ?', '2015-02-18 13:32:23', 1),
(17, 2368, 'C\'est déjà le cas non ?', '2015-02-19 09:49:56', 1),
(18, 1715, 'Hello les ZZ, très heureux de revenir sur Anelis. Bravo pour la refonte du site !', '2015-02-20 07:37:57', 1),
(19, 1835, 'Pas mal cette nouvelle version !', '2015-02-20 19:37:10', 1),
(20, 897, 'Hello, ce serait pas mal d\'avoir au moins un tooltip avec le nom et la promo de la personne dans le chat et aussi de \"forcer\" à mettre des photos plutot qu\'un avatar. Merci', '2015-02-23 11:16:08', 1),
(21, 1487, 'Il ne te plait pas mon avatar ?', '2015-02-24 10:39:27', 1),
(22, 172, 'On veut voir ta tête :-)', '2015-02-24 15:02:05', 1),
(23, 1487, 'Voila, j\'ai mis un photo.', '2015-02-24 16:12:19', 1),
(24, 1487, 'Au fait, y\'a plus de forum des élèves ?', '2015-02-24 16:12:38', 1),
(25, 599, 'Je me suis rendu compte que mon mail nom.prenom gmail a ete transformé en nomprenom', '2015-02-27 16:03:06', 1),
(26, 52, 'Salut binôme ! D\'un autre côté, je crois que les mails arrivent quand même sans le point :)', '2015-03-03 14:25:33', 1),
(27, 2063, 'Salut, pour les parcours, ça serait bien d\'avoir un champs à plusieurs lignes pour la description, et également de pouvoir donner une période au lieu d\'une date. Et il n\'y a pas de validation sur les champs requis (pour la description et la ville).', '2015-03-04 17:54:05', 1),
(28, 599, 'Bonjour, reçoit-on toujours des offres emplois comme avant par mail ?', '2015-03-10 14:04:22', 1),
(29, 599, 'ah oui c\'est bon', '2015-03-26 17:33:15', 1),
(30, 2154, 'salut', '2015-05-05 15:54:55', 1),
(31, 2176, 'Il fait un peu mal au yeux ce chat quand meme non ?', '2015-05-05 16:00:42', 0),
(32, 2176, 'Je suis un chat sur un chat, sympa non ?', '2015-05-05 16:06:58', 0),
(33, 2179, 'Entrez votre message ici', '2015-06-03 14:15:09', 1),
(34, 2467, 'Hello all ! Good job pour le site ;-) (PS : pensez à sortir SF du mode dev, c\'est pas beau la barre de debug :P)', '2015-06-10 11:24:12', 1),
(35, 2176, 'Bonjour', '2015-06-16 16:30:19', 1),
(36, 2090, 'Hé', '2015-06-19 11:38:56', 1),
(37, 2090, 'Ça serait cool d\'avoir l\'heure des messages !', '2015-06-19 11:39:14', 1),
(38, 2176, 'Salut patchouli', '2015-08-05 15:53:12', 1),
(39, 1632, 'bonjour', '2015-08-25 13:42:06', 1),
(40, 1632, 'pour le ZZ horloge parlante, nous sommes au timestamp 1440502948', '2015-08-25 13:43:02', 1),
