(56, 2213, 'Et non, les adresses @poste.isima.fr n\'existent plus', '2017-01-15 20:55:17', 1),
(57, 1601, 'Ca pourrait etre bien d\'avoir le nom ou le surnom de la personne qui poste, les photos sont pas toujours ressemblantes', '2017-01-21 13:46:10', 1),
(58, 2387, 'Ce sera dispo sur la prochaine mise à jour ;)', '2017-02-15 07:43:02', 1),
(59, 2387, 'Voilà pour le nom et le surnom et d\'autres correctifs entre autre. Le module cotisation arrivera d\'ici un bon mois normalement. Si vous avez des retours/idées n\'hésitez pas à envoyer à Yoann et à me faire suivre le mail (kevin.bourgeix@gmail.com)', '2017-04-08 15:05:23', 1),
(60, 1129, 'Bonjour, est ce qu\'il y a une adresse pour diffusion des offres d\'emploi. Loic', '2017-05-12 15:44:34', 1),
(61, 2455, 'RDD samedi 30 septembre, la cérémonie commence à 16h au casion de royat :)', '2017-08-02 08:00:58', 1),
(62, 2272, 'Pierre, expert en copié/collé', '2017-08-14 21:18:56', 1);
