INSERT INTO `parameters` (`id`, `name`, `type`, `value`) VALUES
(1, 'anelis.accueil.welcomeText', 'html', 'Salut et bienvenue sur la nouvelle plateforme <strong>ANELIS</strong>, l\'association des <strong>AN</strong>ciens <strong>É</strong>lèves de <strong>L</strong>\'<strong>IS</strong>ima !<br>\r\n                                   <br>\r\n                                   Vous êtes sur la <strong>version bêta</strong> de la plateforme. Si vous trouvez des bugs ou des pistes d\'améliorations, n\'hésitez pas à nous les <a href=\"https://bitbucket.org/Dawlys/plateformeanelis/issues?status=new&status=open\" target=\"_blank\">signaler</a>. \r\n                                   <br><br>\r\n                                   ANELIS lance actuellement une grande <strong>campagne pour retrouver un maximum d\'anciens</strong> dont on a perdu les e-mails. <strong>Nous avons besoin de vous</strong>, alors si vous avez un petit peu de temps, <a href=\"mailto:support@anelis.org\">contactez-nous</a>.\r\n                                   <br><br>\r\n                                   En vous remerciant d\'avance\r\n                                   <br>\r\n                                   L\'équipe ANELIS'),
(2, 'anelis.cotisation.staticCotisationText', 'html', '<h3>Pourquoi Cotiser ?</h3>\r\n Cotiser permet à l\'Anelis de payer ses différents coûts : maintenance et hébergement de cette plateforme, frais bancaires, événements, goodies...\r\n La cotisation minimum demandée (10€) est volontairement très basse, pour permettre au plus grand nombre de cotiser. Il est bien sûr possible de donner davantage, pour aider l\'association à se développer.\r\n La cotisation ouvre droit à différents avantages : accès aux coordonnées sur l\'annuaire, réductions sur les places de galas, frais de ports réduits ou offert sur les ventes de produits, diffusion prioritaire dans les newsletters... Et d\'autres à venir !'),
(3, 'anelis.accueil.isMaintenance', 'boolean', '0'),
(4, 'anelis.cotisation.cotisationEnAttenteText', 'html', 'Vous pouvez payez en ligne par Carte Bancaire ou Paypal en cliquant sur le bouton Paypal ci-dessous. \n\nVous pouvez également régler :\n<ul>\n\n                            <li>Par chèque à l\'ordre de l\'<b>Anelis</b></li>\n\n                            <li>Par virement bancaire (merci de préciser nom et prénom dans l\'objet du virement) : <br/><b>FR76 1680 6050 0066 0746 3319 725</b></li>\n\n                            <li>En espèces, en contactant un membre Anelis </li>\n\n                            </ul>\n                            \n                            \r\n En cas de problèmes ou questions, merci de contacter support@anelis.org\n'),
(5, 'anelis.cotisation.cotisationReduiteText', 'html', 'Votre promotion n\'est pas encore diplomée ou vient de l\'être, vous bénéficiez\n                                  donc du tarif réduit.');
