INSERT INTO `yearbookmessages` (`id`, `yearbook_id`, `message`, `userFrom_id`, `userTo_id`) VALUES
(2, 1, '\"On va au starfood ?\" - Un dimanche comme un autre', 2176, 2154),
(3, 1, 'Look at the sky. We are not alone. The whole universe is friendly to us and conspires only to give the best to those who dream and work.', 2090, 2176),
(5, 1, 'On est quand même mieux ici qu\'en prison non ?', 2176, 2368),
(7, 1, '#LaLune tmtc. \r\nEncore désolé pour le pré-jugement, passe une vie heureuse, au plaisir de repasser des soirées ensemble et à mardi.', 2077, 2233),
(8, 1, 'J\'espère que tu kiffes tes voyages et au plaisir de te revoir à la RDD si t\'arrives à rentrer. \r\nBisoux à mardi', 2077, 2197),
(9, 1, 'Déléguée !!!! \r\nJoyeux diplôme, au plaisir de te recroiser pour discuter et à mardi =)\r\nPS : bon courage avec ton pote ben...', 2077, 2220),
(10, 1, 'QUEEN LATIATIA ! \r\nBisoux joyeux diplôme et au plaisir =)', 2077, 2208),
(11, 1, 'Merci binôme tu m\'a bien sauvé du 0 en théorie des codes.\r\nMerci pour ces moments sympas en cours et en soirées, et au plaisir de refaire des soirées avec toi ^^\r\nBisoux à mardi', 2077, 2177),
(12, 1, 'Bînome ! \r\nJe viendrai pas ce we au RSS mais ça aurait été vraiment de bon cœur si j\'avais pu...\r\nEclate toi bien, et si t\'es embauché sur bordeaux je viendrai ptet à la rentrée te faire un coucou.\r\nJ\'espère que tu profites bien du soleil \r\nEncore merci pour ces 2 années et au plaisir de te revoir =)\r\nBisoux !', 2077, 2185),
(13, 1, 'Toutes mes félicitations cher Parrain pour ton diplôme! Je te souhaite beaucoup de bonheur et de réussite autant sur le plan personnel que professionnel. Je n\'oublierai pas les soirées Isioké et autres soirées au BDE! Et enfin 4 parce que 4! Et à mardi!', 2183, 2077),
(14, 1, 'Bravo le Prezz!! Je te souhaite plein de bonnes choses! a+ BiBi', 2183, 2197),
(15, 1, 'CENDRILLON \r\nPOUR SES 20 VINGT ANS ETAIT LA PLUS HEUREUSE DES F5\r\n(désolé xD) \r\nBon merci de m\'avoir appris à jouer au sudoku, merci d\'avoir fait passer vite tous ces cours de RO et téléphonie en racontant de la merde (et des fois des trucs intelligents) pendant des heures.\r\nCa m\'a presque manqué cette année...\r\nJ\'espère que ton année dans mon pays s\'est bien passée et que la bretonne qui est en toi a su survivre sans pluie ^^\r\nJ\'espère aussi te revoir à l\'occasion si possible =)\r\nGros bisoux, prends soin de toi et à bientôt j\'espère ^^ \r\n\r\nJaffar', 2077, 2166),
(16, 1, 'David David David...\r\n\r\nUn grand cœur, un grand con,\r\nUne grande intelligence, une grande déconne,\r\n\r\nMerci de ton aide pendant 2 ans.\r\n\r\nJ\'espère acheter des pneus Santiago dans 5ans, j\'en serai fier.\r\n\r\nJ\'te souhaite tout le bonheur du monde et qu\'on refera pleins de soirées ensemble. \r\n\r\nDes bisoux mec.', 2077, 2368),
(17, 1, 'Bon fuckin bînome qui pèse, \r\nJe suis content de t\'avoir revu à Lyon même si t\'as fait soirée plan cheu cheu quand t\'es rentré :p\r\nJe suis un peu deg que tu repartes dans ton pays polué, mais j\'espère qu\'on se reverra 1000 fois pour boire du jagger et jouer au bière pong, (ça fait longtemps que j\'ai plus d\'adversaires décents :p) \r\nMerci pour ces bons moments pendant 2 ans et j\'espère que y\'en aura d\'autres après =)\r\nJe te fais pleins de gros bisoux et à très vite j\'espère ^^', 2077, 2167),
(18, 1, 'Merci pour tout ces bons délires en espagnol, tes explications sur l\'associatif et tout le reste.\r\nAu plaisir de te revoir et de refaire des soirées =)\r\nBisoux et à mardi ^^', 2077, 2157),
(19, 1, 'Merci pour tout ces bons moments passés au fond du G32, en cours, en soirées, et à discuter.\r\nJ\'espère que t\'auras ton diplôme et qu\'on te verra à l\'intégration pour refaire des bières pongs et passer de bons moments.\r\nA bientôt bisoux et à mardi ^^', 2077, 2121),
(20, 1, 'Mon cher prezziflan bien débile, mon cher toulousain, content de t\'avoir connu et d\'avoir passé ces 4 années ensemble à faire des trucs débiles. \r\nEn espérant te recroiser dans notre sud ou dans ce nord, j\'te fais pleins de bisoux et à mardi ^^', 2077, 2116),
(21, 1, 'Et enfin le plus gros connard pour la fin. \r\nJ\'ai cru que j\'aurai rien à dire sur cette promo mais heureusement t\'es là. \r\nBeaucoup trop de trips, beaucoup trop d\'engueulades, beaucoup trop de câlins, beaucoup trop de soirées, beaucoup trop d\'events BDE, beaucoup trop de **** sur ta ****... Bref tu sais ce que je pense et c\'est pas une feuille A4 à la con qui va le traduire. \r\nDe rien pour t\'avoir attendu pour faire l\'isima en 4 ans ;). \r\nJ\'espère qu\'on passera une bonne RDD et qu\'on continuera à se parler car même si t\'es un gros con, j\'te kiffe quand même =)\r\nPS : n\'oublie pas, en septembre on chantera ta chanson préférée \"JE SUIS UN Z0 !\" =)\r\nBisoux partout à mardi et on pourra enfin passer le mois de septembre à faire de la merde et fêter ces 4 ans de débilités communes ;D', 2077, 2098),
(22, 1, 'non je suis en sèche', 2154, 2176),
(23, 1, 'Toutes mes félicitations Raf pour ton diplôme! Je te souhaite plein de bonnes choses! Bisous!', 2183, 2256),
(24, 1, 'Félicitations au très bon guitariste des Kiss or Kicks, j\'adore vos morceaux, j\'espère que vous pourrez continuer à jouer l\'an prochain! Muzzicalement!', 2183, 2237),
(25, 1, 'Félicitations au dijonnais qui m\'a emmené quelque fois à Chalon!! Bonne continuation François! :)', 2183, 2180),
(26, 1, 'Félicitations cher binôme!! Je te souhaite bonne continuation!', 2183, 2122),
(27, 1, 'Félicitations à ma covoitureuse de Zumba! Gros bisous!! :)', 2183, 2245),
(28, 1, 'Félicitations à mon covoitureur de Zumba, de piscine qui est de 24 heures plus âgé que moi!! Je te souhaite plein de bonnes choses! :D', 2183, 2153),
(29, 1, 'Félicitations Yoann! Gros bisous!! Tu vas nous manquer au BDE et en accès libre! :)', 2183, 2213),
(30, 1, 'Je te souhaite plein de bonnes choses autant sur le plan personnel que professionnel! Gros bisous Raphy!!', 2183, 2157),
(31, 1, 'Bravo Ben!!Je te souhaite beaucoup de bonheur. Bon courage pour la suite de la part de ta voisine (inutile ^^)', 2183, 2098),
(32, 1, 'Félicitations JP!! Et vive la natation et la F4! :D Bisous!', 2183, 2201),
(33, 1, 'Toutes mes félicitations à mon voisin de résidence :) \r\nJe te souhaite bonne continuation.', 2183, 2519),
(34, 1, 'Félicitations Louis!! Je te souhaite plein de bonnes choses pour la suite :)', 2183, 2161),
(35, 1, 'Félicitations David! Je te souhaite plein de bonnes choses autant sur le plan personnel que professionnel!', 2183, 2368),
(36, 1, 'Yosh ! Félicitations poto ;) (J\'ai failli dire \"gashi\", mais ça sonne trop proche d\'un mot français...) Awasegaga !', 2201, 2235),
(37, 1, 'Coucou ! Mes félicitations, et des bisous, c\'est mérité ;)', 2201, 2245),
(38, 1, 'Félicitations l\'ami ! :)', 2201, 2161),
(39, 1, 'Félicitations le Suisse ;)', 2201, 2153),
(40, 1, 'Félicitations ! Maintenant tu auras du temps pour apprendre le japonais... Petit rappel : tabemasu.', 2201, 2225),
(41, 1, 'Yosh ! Félicitations ;) Bises', 2201, 2156),
(42, 1, 'Gg ! Gl&hf pour tes projets ;) ... Déformation professionnelle. --\'', 2201, 2170),
(43, 1, 'Félicitations, monsieur qui réussit la F4 sans venir de prépa ;) Bises', 2201, 2152),
(45, 1, 'Hey Maxmax ! Félicitations pour le diplôme, des supers moments passés avec un BDE d\'enfer, vous étiez top !  T\'as fait parti des gens que j\'ai fait passé le plus souvent sous le baby : ça crée des liens !\r\n A bientôt au baby, dans le bus ou au Leclerc\r\nTektek', 1912, 2233),
(46, 1, 'Congratulations JP, je te souhaite le meilleur pour la suite ! =)', 2161, 2201),
(47, 1, 'Il me semble que je dois écrire un petit mot par ici... C\'est pour te faire plaisir, Steph\', car je n\'ai aucune envie de le faire ; tu es tellement une insupportable chieuse, toujours à vouloir mettre ton grain de sel partout. Et dire que j\'ai eu la malchance de te rencontrer dès mes premiers jours à l\'ISIMA pour ensuite devoir te côtoyer trois ans durant. J\'aurais pu rester tranquille dans mon coin, suivre les cours calmement ; mais non, il a fallu jouer au Motus et m\'investir dans la vie associative... Et dire que j\'ai rejoint ISIGALA pour t\'aider, bien mal m\'en a pris ; entre les tâches insurmontables et le rôle de vice-prezz, je ne sais pas ce qui était le plus horrible.\r\n\r\nEnfin bon, j\'ai quand même passé des supers années et c\'est en partie grâce à toi, ta bonne humeur, et ton franc-parler. Tous mes compliments pour ton diplôme, je te souhaite plein de réussites pour tes projets futurs et j\'espère que tu auras compris que le premier paragraphe est au second degré ! ^^\r\n\r\nC\'était le petit mot (et le grand Merci) pour mademoiselle la prezz ! ;-)', 2161, 2245),
(48, 1, 'Félicitations Alex ! Tu aurais vu les lapins de Fibonacci ? Je ne les retrouve plus. ^^ Je voulais juste te dire que t\'as un été un super binôme et voisin en première année, je te souhaite le meilleur pour ta vie future ! =)', 2161, 2258),
(49, 1, 'Copain d\'allemand, de ping-pong, et de stages, Anthony, tu es quelqu\'un de bon vivant et on ne s\'ennuie jamais avec toi. Point pour lui ! =) \r\nIch gratuliere dir und zur Zukunft wünsche ich dir viel Glück!', 2161, 2199),
(50, 1, 'Félicitations Antoine ! T\'es un grand ami, toujours prêt à aider quand il le faut ; je te souhaite plein de réussites pour le futur ! =)', 2161, 2155),
(51, 1, 'Salut Camille, j\'ai bien aimé travailler avec toi en tps, tu as toujours de bonnes idées et tu es aussi très sympathique. Je te félicite et te souhaite de créer de supers jeux ! =)', 2161, 2249),
(52, 1, 'Taxi, binôme, adversaire de tennis de table mais surtout grand ami, Flo, t\'es quelqu\'un de génial ! =) Je te félicite et te souhaite le meilleur pour ta vie future (et organise une fête pour ton anniversaire) ! ^^', 2161, 2153),
(53, 1, 'Bouh Mavava, je viens encore t\'embêter ! =) Bien content que tu ais été en F2, sinon ça aurait été moins drôle. En tout cas je suis content d\'avoir pu faire quelques projets en binôme avec toi, c\'était cool. ^^ Congratulations pour le diplôme et je te souhaite de continuer à t\'épanouir dans ta vie future et de danser le plus longtemps possible !', 2161, 2156),
(54, 1, 'En allant à l\'ISIMA je n\'aurais pensé rencontrer un musicien de ton niveau, et pourtant ! Tu es aussi quelqu\'un de très sympathique et un excellent pongiste. Tous mes compliments Tristan, je te félicite encore pour ta formidable performance au gala et je te souhaite le meilleur pour le futur ! =)', 2161, 2162),
(55, 1, 'Félicitation :  \r\n- à un geek parmi d\'autre F4\r\n- à un nageur badmintonien\r\n- à un joueur de tarot exceptionnel, qui prenait sa passion tellement à cœur, qu\'il en oubliait ses cours.\r\n- à Babe, qui un jour, deviendra Roussel ! :p\r\n\r\nEt tout simplement:  félicitation JP !\r\n\r\nEt en bonus: \"Elle est ou la poulette?\"', 2153, 2201),
(56, 1, 'Tu veux savoir si tu auras ton Diplôme? Tu doutes de la bonne foi de ton employeur? De la validation de ton stage ?\r\nEnvois \"Diplome\", W,T,F,  au 71212, un astrologue compétent vous dira tout ce qu\'il y a à savoir sur votre avenir professionnel !  (1000 Euros + prix d\'un sms).\r\n\r\nBravo Steph, tu l\'auras, parce que tu le mérites !\r\n\r\nEt surtout, démolis les tous, au prud\'homme ! (à lire en mode dresseur de pokémon, évidemment)', 2153, 2245),
(57, 1, 'Oh Dieu du Random ! Cheater parmi les cheaters ! Trois années super avec toi à déconner et j\'espère que ça va continuer !!', 2219, 2199),
(59, 1, 'Ô grand Thibaut ! Mon fumeur favori :D \r\nOn a passé quelques temps ensemble, et ces trois années étaient juste mémorables ! \r\nEn espérant te revoir très vite, ainsi que Tristan et Antony !\r\nDes gwos bisous sur la fesse droite :)\r\nRandom.', 2199, 2219),
(60, 1, 'Grâce à toi, les cours d\'espagnol ont été mémorable !!!', 2219, 2098),
(62, 1, 'Pour toutes ces franches rigolades et ces matchs endiablés (point pour Louis !), je te souhaite le meilleur pour l\'avenir !', 2162, 2161),
(63, 1, 'Mon grand Tristan ! Grand musicien et expert du contrepoint !\r\nJ\'ai passé trois années et même plus à tes côtés et c\'était juste génial !! On est passé plein de moments forts, de la facto LU au LAN dans les sous-sols de l\'ISIMA !\r\nJ\'espère que on va se revoir vite avec Antony le Dieu du Random  et Anthony le Roi de l\'harmonica !!\r\nGros bisous oh #grandmaitreduhashtagillisiblecarbeaucouptroplong =D\r\nTon petit coquinou d\'amour préféré <3', 2219, 2162),
(64, 1, 'Anto, très cher Anto ! \r\nUn mot peut très bien résumer ces deux dernières années passées en ta compagnie : \"Tomate\". \r\nJe tiens sincèrement à te remercier. Merci pour ta générosité, pour ta gentillesse, ainsi que ton soutien. \r\nTout cela m\'a été d\'une aide incommensurable. Je suis très heureux d\'avoir pu te rencontrer, et espère du fond du coeur de te recroiser au plus vite.\r\nMerci encore,\r\nDes bisous ! \r\nRandom', 2199, 2200),
(65, 1, 'Salut Tristan, \r\nAprès ces cinq années passées en ta compagnie, il est temps de rentrer dans la grande catégorie des Ingénieurs ! \r\nOn achève cette grande aventure en beauté ! Merci encore pour tout, on a pu passer de formidables moments, et un énorme merci pour ton soutien :) \r\nA très bientôt j\'espère, nos routes se recroiseront !\r\nRandom', 2199, 2162),
(66, 1, 'Ehhh Antony !!! \r\nAprès ces deux ans et demi ensemble, je suis fier de t\'annoncer que nous allons devenir des Ingénieurs ! Et Tristan et Anthony aussi à ce qu\'il paraît ^^\r\nJ\'ai passé de super moment avec toi à bosser ou écouter tes conneries et c\'était mythique ! J\'ai beaucoup aimé nos pseudo disputes sur les accéléromètres et compagnie durant nos projets ! Mais ne t\'inquiète pas, on pourra toujours se disputer de temps à autres !!\r\nJe te fais plein de bisous baveux et te souhaite un avenir radieux !!!! Radieux comme le soleil qui culmine au dessus des pingouins de l\'Antarctique qui jouent à Candy Crash en 3G quand il y a un bon débit !! :D\r\nGros bisous sur la fesse gauche et toute mon amitié à la droite !!!\r\nLe Roi des Phoques.', 2219, 2200),
(67, 1, 'COOOOOOKKKIIIIIIEEEEEEEEEEEE RAAAAIIINNNNNNNNNNNNNN !!!!!!!!!!!!!', 2219, 2200),
(68, 1, 'Il y a cinq ans, tu as annoncé ton désir de dominer le monde. De notre premier partiel d\'algorithmique à l\'IUT, jusqu\'à la programmation parallèle (VOILÀ !), tu n\'as jamais cessé de nous épater. Des projets aux patins à glace, des TPs aux séances de Bowling, du Ping-Pong au Long John, l\'écho de ton rire si communicatif ne cessera jamais de vibrer.\r\n\r\nPour tous ces moments passés ensemble et notre indéfectible Amitié, merci du fond du cœur !', 2162, 2199),
(69, 1, 'Mon petit cul <3 Espèce de vieux tard, t\'auras mis le temps... Félicitations pour ta réussite mon cochon !\r\n\r\nDésolé de pas être là pour ta reudeudeu... \r\n\r\nEn direct de la MaxHouse !', 2066, 2116),
(70, 1, 'Cher Louis,\r\n\r\nComment écrire quelque chose d\'aussi beau que tu l\'as fait ? J\'en ai les larmes aux yeux à chaque lecture...\r\nTu sais que je n\'ai pas une bonne mémoire, mais pourtant, je me souviens des 15 premiers jours à l\'ISIMA en G21, la déception de voir qu\'on ne serait pas dans le même groupe en première année, l\'amitié qui commence, qui s’effrite en milieu d\'année,  toi qui n\'arrive pas à mettre la clefs de ta boite aux lettres dans la serrure de l\'entrée après une soirée BDE où tu as perdu une claquette et où je t\'ai raccompagné, les recrutements difficiles pour IsiGala où on a commencé à se reparler, ton hésitation entre F2 et F4 et moi qui te pousse \"discrètement\" vers la F2 (la meilleure ! J\'espère que tu ne l\'as pas regretté d\'ailleurs.), les retrouvailles en F2, l\'agrandissement du cercle d\'amis avec l\'arrivée de Flo (arf... on aurait mieux fait de se casser une patte ce jour-là ! ^^), J-P, Antoine, Châtaigne, le craquage IsiGala qui te retombe entièrement dessus, les partiels, les motus, nous deux grelottant à l\'entrée de l\'Anatolia le soir du gala, ton spitch au micro que personne n\'a entendu,  les motus, la réflexion sur notre reprise de l\'AssoFi, les projets de Grails et PHP qu\'on a fait \"à deux\" (ouais ouais je m\'en souviens bien de ça ! T\'as commit à 23h54 quelque chose qui a fait planter l\'une des vues principales et on devait rendre à 23h59 impérativement... Je m\'en suis aperçue à 00h03... -_-), les projets de WED entre nous, ... Et la suite ? Elle n\'est pas encore écrite mais j\'espère qu\'elle sera tout aussi passionnante !\r\n\r\nTu vois, je me souviens de presque tout... C\'était super et je suis ravie qu\'on se soit rencontré dès les premiers jours, comme ça on n\'a pas perdu de temps dans nos aventures rocambolesques d\'étudiants !\r\n\r\nEn tout cas, félicitation pour ton diplôme, je n\'irai pas jusqu\'à dire que tu le mérites car tu as toujours trouvé les bons binômes ! :p Mais c\'est déjà une qualité importante de bien savoir s\'entourer ! ;-)\r\n\r\nBravo et au 26 Septembre 2015 !', 2245, 2161),
(71, 1, 'Rhalala, Flo Flo incompréhensible Flo, que dire ? Des comme toi il n\'y en a pas deux ! (Ha j\'ai trouvé une blague de merde à te faire après 3 ans !!!! On te l\'as déjà faite où elle est inédite celle-là ? :-D ) Hum, un peu de sérieux ! Je disais donc, incompréhensible Flo, tu as changé dans ces 3 années à l\'ISIMA. Bon la première on ne se côtoyait pas trop, tu étais avec tes potes F1 (bbbbhhhaaaaa) mais tu es excusé ce n\'étaient pas encore des F1... Mais les 2ème et la 3ème années c\'est une autre paire de manche... J\'ai découvert le Florian, réservé, qui laisse tout faire (ramasser tous les plateaux de la table et chercher l\'eau (à chaque fois)), qui n\'a pas de chance (mais alors vraiment pas : PC qui lâche quand tous les projets sont presque finit et que tu bossais seul sur les deux plus gros..., choix de binôme calamiteux #RIPLouis), qui a un humour.... particulier ! ^^ et qui est très très mauvais vainqueur peu importe le domaine (sport, jeux vidéos, jeux de cartes (bon, là je te laissais pas trop gagner, faut pas abuser, c\'est mon terrain ça !!)). Enfin Flo quoi ! ^^ Mais ça ce n\'est pas tout toi, c\'est une petite partie que tu montres le plus souvent. Tu es aussi quelqu\'un de très gentil, en 3ème année tu as changé et tu ne t\'es plu laissé faire, tu as affirmé ta place dans le groupe et on t\'as redécouvert. Tu nous as invité au ski, tu t\'es impliqué dans les soirées, dans les projets (que tu as arrêté de faire seul dans ton coin !! Bon c\'était pas mieux mais quand même, l\'initiative doit être saluée)... \r\nJe crois que ce que je veux dire c\'est que si tu n\'avais pas été là, tu aurais manqué !\r\n\r\nBoh, pour le diplôme, j\'y reviens pas, tu le mérites au moins 2 fois (pour toi et ton binôme). Mais ficelle de caleçon quand même (elle passe mal à l\'écrit celle-là...)\r\n\r\nBravo et au 26 Septembre 2015 !', 2245, 2153),
(72, 1, 'J-P (alias J-Pounet),\r\n\r\nQue dire ? Quelqu\'un de génial qui a choisi la pire filière... Fallait venir en F2 on était bien nous !! Du coup, on s\'est presque pas côtoyé en ZZ1 et quand on s\'est remarqué l\'un l\'autre on était plu dans la même classe ! Arf, quel dommage... Mais on s\'est pas mal rattrapé sur les soirées et les amphis (ils disaient quoi déjà les profs ? ^^).\r\nT\'es quelqu\'un de génial et tu mérites ton diplôme ! Nan sérieux ! Rien que 2 semaines avec la classe de F4 j\'en aurais tué la moitié... Bravo, vraiment. Je pense que tu peux à peu près tout supporter dans ta vie...\r\n\r\nBravo et au 26 Septembre 2015 !', 2245, 2201),
(73, 1, 'Je garderai longtemps en mémoire le Beach en ZZ1 où tu m\'as aidé à passer par-dessus une barrière de 2m alors qu\'il y avait plus de muscat en moi qu\'il n\'en restait dans la bouteille... Mémorable ! :-)\r\nFélicitations Richard !!', 2245, 2186),
(74, 1, 'Qui aurait pu croire en ZZ1 qu\'on arriverait jusqu\'à la fin de nos études ? ^^ Les deux faux-studieux du premier rang...\r\nFélicitation Noël !', 2245, 2178),
(75, 1, 'A la plus gentille de la promo 15, félicitation, tu le mérite amplement !', 2245, 2166),
(76, 1, 'À mon co-délégué, félicitations, tu le mérites amplement.', 2245, 2199),
(77, 1, 'Kiss Or Kicks for ever !!!!\r\nÀ quelqu\'un de génial qui s\'est donné à fond ces 3 années pour les assos et pour son public !\r\nFélicitations.', 2245, 2237),
(78, 1, 'À mon sous-fifre de licence pro, qui a évolué en super binôme confirmé sans pierre de Lune (#pokémon).\r\nFélicitations, tu le mérite largement ! Je partirai bien dans les éloges mais ça pourrait durer toute la nuit... Gentil, sincère, travailleur, drôle, talentueux, élégant, polyvalent, joyeux, etc. tu vois, on est partit pour la nuit ! ^^ \r\nVraiment c\'est mérité, bravo Tristan.', 2245, 2162),
(79, 1, 'Antoine,\r\n\r\nMes félicitations pour ton diplôme, il est amplement mérité, tu es quelqu\'un de travailleur et je suis sûre que tu réussiras dans tout ce que tu entreprendras.\r\n\r\nBravo et au 26 septembre 2015.', 2245, 2155),
(80, 1, 'Pour un super copain avec qui j\'ai passé des supers moments durant ces 3 ans!\r\nJ\'espère qu\'on continuera à aller voir des matchs ensemble de temps en temps ;)', 2237, 2243),
(81, 1, 'Lolooooo!\r\nMerci pour ces trois années passées avec toi à l\'ISIMA! ça a été vraiment cool!\r\nCRAZY\'MA forever! :)', 2237, 2188),
(82, 1, 'Merci mon petit Foubert pour les 3 années (plus celle de prépa) passée avec toi!\r\nça a vraiment été des super années!\r\nCRAZY\'MA forever! :)', 2237, 2189),
(83, 1, 'Merci mon petit Johan pour ces très bon moments passés pendant les années ISIMA!\r\nça a été vraiment un plaisir de discuter musique, photo et programmation avec toi  :)', 2237, 2179),
(84, 1, 'Pwot pwot pwot!\r\nMerci à Alex le petit poulet pour ces bon délires à l\'ISIMA :)\r\nCRAZY\'MA forever!', 2237, 2258),
(85, 1, 'Eeeh coucou ! :)\r\n\r\nIl parait qu\'il faut \"laisser des messages à vos camarades et à vos amis\".  Pas de bol, je crois que tu rentre dans cette catégorie !\r\n\r\nC\'était grave cool de passer deux ans avec toi à l\'ISIMA, plein de blagues, le projet Harry Potter, les montages vidéos, et surtout ta bonne humeur !', 2179, 2216),
(86, 1, 'Eh coucou :)\r\n\r\nMerci de m\'avoir supporté comme binôme ^^ ça a pas du être facile tout le temps :P ... J\'espère que tu t\'éclates dans ta boite de jeu vidéos ... et à l\'occase je te montrerai comment on joue heavy sur TF2 ;)', 2179, 2249),
(87, 1, 'Salut Gros ! :)\r\n\r\nMerci pour ces deux années à l\'ISIMA :) A l\'occase tu me dis on se refait un tour de vélo direction le plateau de Gergovie :P (voire plus si t\'as la forme).\r\n\r\nJ\'aurais bien envoyé une photo de tarte aux fraises dans ce message mais on peut pas. :)', 2179, 2243),
(88, 1, 'Lauryanne ?\r\n\r\nMEUUUUURS ! :D\r\n\r\nSur ces bonnes paroles,\r\nMerci pour ces années à l\'ISIMA :) Les Crazy\'ma, le parc Asterix, tout ça tout ça :) Et surtout ... j\'ai enfin trouvé quelqu\'un qui fait de la flûte à bec ! :D A l\'occasion faudra enregistrer un morceau :P', 2179, 2188),
(89, 1, 'Pwwoooaat ?\r\n\r\nG11 in da place ! :D\r\n\r\nRhaa la la ! Ca me manque de plus te réveiller en pleine nuit à 15h le dimanche aprem ^^ C\'était grave cool toutes ces années à l\'ISIMA ... J\'espère que tu te fais plezz à Bordeaux ... A l\'occase, si j\'améliore mon Bordelais, je passerai manger une chocolatine, et voir si la ville a la classe :D', 2179, 2185),
(90, 1, 'Pooooat ! :D\r\n\r\nCa fait bizarre d\'écrire dans ce \"yearbook\" ... genre on se verra plus ... alors qu\'on vient de lancer un putain de projet ZZic ! :D\r\n\r\nC\'était super de passer à l\'ISMA en même temps que toi, le parc Asterix, les Crazy\'ma.\r\nBien que tu aies perdu toute dignité dans l\'opération, j\'espère que tu ne garde pas un mauvais souvenir du bloublou ^^. A l\'occase je passerait te rappeler à quel point c\'est terrible cette affaire la ! :D', 2179, 2189),
(91, 1, 'Adrien ?\r\n\r\n __   __  _______  __   __  ______    _______ \r\n|  |_|  ||       ||  | |  ||    _ |  |       |\r\n|       ||    ___||  | |  ||   | ||  |  _____|\r\n|       ||   |___ |  |_|  ||   |_||_ | |_____ \r\n|       ||    ___||       ||    __  ||_____  |\r\n| ||_|| ||   |___ |       ||   |  | | _____| |\r\n|_|   |_||_______||_______||___|  |_||_______|\r\n\r\nBon on verra si ça passe à l\'impression :D Merci pour le tricot, d\'avoir fait plein de truc à Clermont cette année, le café lecture, la super semaine du festival de court métrage, la natation, ... J\'espère que tu gardes un souvenir impérissable du bloublou et que tu vas transmettre la tradition ! :)', 2179, 2221),
(92, 1, 'PWOOOAAAAAAAAAT ! \r\n\r\nAlex ? MEURSSSSSS :D\r\n\r\n<span style=\"color: green; background-color: green\">\r\nBon courage pour lire tout ca :D si les balises fonctionnent !\r\nC\'était des supers années à l\'ISIMA ! Garde ta bonne humeur et ta gentillesse, c\'était bien sympa d\'aller cueillir les champignons avec toi XD, crazy\'ma, ... tout ca tout ca !\r\n</span>', 2179, 2258),
(93, 1, 'POOAAAAT ?\r\nPOOAAAAT ! POOAAAAT !                         ! POOAAAAT !                         ! POOAAAAT ! POOAAAAT ! POOAAAAT ! POOAAAAT ! POOAAAAT ! POOAAAAT !                         ! POOAAAAT !                         ! POOAAAAT ! POOAAAAT !                         ! POOAAAAT !                         ! POOAAAAT ! POOAAAAT ! POOAAAAT ! POOAAAAT !                         ! POOAAAAT ! POOAAAAT !                        ! POOAAAAT !                         ! POOAAAAT ! POOAAAAT !                         ! POOAAAAT !                         ! POOAAAAT ! POOAAAAT ! POOAAAAT ! POOAAAAT !                         ! POOAAAAT ! POOAAAAT !                         ! POOAAAAT !                         ! POOAAAAT ! POOAAAAT !                         ! POOAAAAT !                         ! POOAAAAT ! POOAAAAT !                         !                         ! POOAAAAT !                         ! POOAAAAT !                         ! POOAAAAT !                         ! POOAAAAT ! \r\n\r\nOn verra si ca passe à l\'impression :D Mais je pense tu saisis l\'idée :D C\'était grave cool d\'être à l\'ISIMA, de faire de la musique ensemble, d\'aller au parc Asterix avec une moustache de 15 metres ! (au moins :p) Si je repasse sur Clermont je viendrait te rappeler comment on fait un bloublou dans les rêgles de l\'art ! :D', 2179, 2237),
(94, 1, 'OOOH Bordelais ... euh nan Toulousaing ! :D\r\n\r\nC\'était bien cool de te montrer comment on fait une vrai pizza avec une vraie pate a pizza ! :D A l\'occase faut qu\'on se refasse un peu de ski / snowboard avec un ch\'tit pastis à l\'arrivée :)', 2179, 2205),
(95, 1, 'Bisous Maeva :)\r\n\r\nJ\'espère que tu as trouvé un coin qui te plait et un boulot qui te laisse du temps pour encore améliorer tes supers talents de danseuse. Merci d\'avoir essayé de me faire découvrir cet art que je ne connaissais pas. Et que tu gardes des bons souvenirs de tout ça.\r\n\r\nLa deuxième année est passée tellement vite avec toi :)\r\n\r\nPoyo', 2179, 2156),
(96, 1, 'Salut mon ch\'tit gars ! Je sais pas si on va se voir pour la RDD ... mais c\'était bien cool de passer deux ans avec toi à l\'ISIMA ! :)\r\n\r\nJ\'espère que tu t\'amuses bien au Canada, a l\'occasion si je passe en Picardie, je viendrai te dire bonjour :D', 2179, 2236),
(97, 1, 'Clermont - Lyon, ce n\'est pas loin ;) Bien sur qu\'on continuera à se faire des sorties rugby !\r\nBien sympathique ces 3 années ! ça sera inoubliable !', 2243, 2237),
(98, 1, 'Yo yo yo !\r\n\r\nVélo, brunch, tarte aux fraises, mixe, luge, etc ... :)\r\n3 années de bonheur !', 2243, 2179),
(99, 1, 'Ceci est un message d\'amour et d\'amitié adressé à Maupetit ami (j\'laime pas mal celle-là)\r\nBeaucoup de plaisirs à fréquenter ce cher Johan durant ces deux ans. Mais ne t\'inquiète pas, je serais toujours là ! Je peux popper au coin d\'une rue n\'importe quand, râler et prôner la science suprême de l\'Open Source.\r\nTu es prévenu, reste sur tes gardes ;)', 2216, 2179),
(100, 1, 'Salut,\r\nJ\'ai décidé de partager un peu de bestialité sur cet espace d\'échanges pationnant qu\'est le Yearbook. En espérant que tu vas bien et que tu n\'es pas tombé malade pendant mon absence car nous le savons tous, tout tes tubes de Lysopaine sont vides.\r\nDe gros bisous avec du sirop d\'érable.', 2216, 2190),
(101, 1, 'Bonjour Paul Gaucher,\r\nTu as essayé de m\'avoir sur Skype aujourd\'hui mais malheureusement je me suis endormi sur un stream passionant à propos du décalotage de pois chiches.\r\nEn espérant que ce message intrigant reste à vie dans les bases de données de l\'ISIMA. De gros bisous, en espérant pouvoir m\'enjailler de nouveau avec le gang.', 2216, 2176),
(102, 1, 'Mon cher petit JohnJohn, \r\nJ\'espère que tu vas garder longtemps ce surnom super topmoumoutte en souvenir de moi :p haha\r\nSinon, il faut vite qu\'on aille manger, au bord de la Garonne, une chocolatine gavé bonne, qu\'on mettra dans une poche ;) haha\r\nxoxo\r\nMichèèèèèle', 2214, 2185),
(103, 1, 'He coucou ma ptite Sali!\r\nJ\'espère que tout ira bien pour toi après ces années passées à l\'isima, et qu\'on aura un jour l\'occasion de se recroiser! ;)\r\nBisous\r\nMichèle', 2214, 2085),
(104, 1, 'Je pourrais faire de longs discours, je pourrais faire de courts discours sur les différentes méthodes pour faire tomber une machine, les méthodes les plus optimisées pour faire une bomb fork sur une ferme de calcul, en utilisant aussi le GPU, etc. Tu me trouverais une solution en JavaScript pour ça, pendant que je développerais mon serveur Web en Bash.\r\nMais dans toutes les possibilités que je pourrais évoquer (et l\'ensemble des possibilités que je pourrais proposer changerais de façon aléatoire) nous n\'explorerons qu\'une part infime (elle-même choisie de manière aléatoire mais dans un ensemble pouvant être la fermeture topologique de l\'ensemble précédemment choisi aléatoirement). Et finalement le plus intéressant n\'est pas ce que nous avons et allons explorer mais le fait que quoiqu\'il arrive on peut le faire en Bash car le Bash est Turing-complet ! et que quelque soit l\'heure, c\'est l\'heure de manger ! (j\'ai l\'impression que ce n\'est pas exactement la fin à laquelle j\'espérais dans mon raisonnement)\r\n\r\nBref je finirais avec une phrase contenant le mot bateau (je ne saurais dire s\'il s\'agit ou non d\'une phrase bateau). Qu\'importe ce que nous devenons, si j\'achète ou non un bateau (pour être franc je n\'avais aucune idée de comment placer le mot \"bateau\" dans cette phrase), si tu continueras à améliorer ta typographie, on a passé de très bons moment, souvent avec un pizza, de superbes chansons ou des idées de codes totalement stupides et géniales, je n\'oublierais jamais tous ces moments que nous avons passé sans jamais monter sur un seul bateau (finalement j\'ai réussi à le caser de façon un peu plus logique).', 2204, 2155),
(105, 1, '\" On avance vite mais on avance pas beaucoup ! \" \r\nMerci petite c3 pour ces magnifiques trajets vers l\'Auvergne, merci Mister Santiago pour l\'ambiance de la voiture.  =D', 2300, 2368),
(106, 1, 'Bon route ex-Capitaine :)\r\nBravo pour ta motivation qui a déteint sur nous à chaque fois :p\r\nLe prochain CV que je reçois, je te l\'envoie ! A bientôt je l\'espère :)', 2300, 2186),
(107, 1, 'Il y a des professions où les passeurs sont trackés. Toi tu nous aura été d\'une grande aide. \r\nA bientôt je l\'espère :)', 2300, 2153),
(108, 1, '4 ou 42 ? Telle est la question, ou la réponse ? \r\n*toupie qui tourne*\r\n\r\nJ\'ai toujours kiffé ton état d\'esprit ! En particulier la veille de la rendu d\'un rapport... ou d\'un bière-pong, je sais plus trop :)\r\n\r\nBonne continuation à toi binôme ! La bise !', 2185, 2077),
(109, 1, 'Johan ! Dois-je te surnommer flutiste, pâtissier, cuisinier, photographe, cycliste ou.... REVEIL !\r\n\r\nHaha je garde de supers souvenirs de ces deux ans aux Jardins ! C\'est quand tu veux que tu deviens mon voisin à Bordeaux gars !\r\n\r\nEn attendant je te souhaite bon vent ! \r\n\r\nLa bise au chat =P', 2185, 2179),
(110, 1, 'Le JohnJohn j\'ai adopté, le JohnJohn je garderai !\r\n\r\nMention spéciale aux dessins que tu as disséminé un peu partout dans mes cours. Les révisions auraient été beaucoup plus triste sans !\r\n\r\nEn espérant te revoir (pour de bon cette fois-ci =P), je te souhaite de passer un super stage dans la ville rose. La bise !', 2185, 2214),
(111, 1, 'My Dearest Lolo (tu speak english maintenant non? :p )\r\nCette année sans toi, c\'était quand même pas top moumoutte: tu m\'as trop manqué !! Mais je suis contente de voir que tu t\'es éclatée en Angleterre avec ton beau Foubert. J\'ai hâte qu\'on ai l\'occasion de se refaire l\'intégrale de Sissi en mangeant des pâtes carbo ! <3 <3\r\nJe te souhaite tout ce qu\'il y a de meilleur après notre aventure commune Isimalienne!!! ;) <3\r\nxoxo\r\nMichèle', 2214, 2188),
(112, 1, 'Hey hey m\'sieur Archard,\r\nBoulette ou quoi? L\'ôngin, c\'est fin triste que tu viennes pas chez les nouzôtes, en Calédonie. Mais t\'inquiète: y a toujours d\'la place pour les gôntils zoreilles qui veulent découvrir not\' beeeeaaaauuu caillou.\r\nEt puis, avec un nom pareil, tu verra que tu sera biiiien accueilli ;) :p\r\nBân allé, bisous à toi et à ta vieille!\r\nMichèle (version caldoche)', 2214, 2205),
(113, 1, 'Laëtiii !!\r\nTu es ma sauveteur. Non seulement tu m\'as trouvé un stage, mais en plus, pas n\'importe quel stage: un stage à Toulouse, et avec toi ! Yeay ! Ça va être ... Top Moumoutte !!! \r\nSinon, et bien félicitation pour cette année où tu n\'as pas chômé, et à bientôt dans la ville rose :)\r\nxoxo\r\nMichèle', 2214, 2208),
(114, 1, 'Je regrette de t\'avoir appris le tricot/crochet car tous tes projets ont été une souffrance atroce pour mes yeux ! Aussi je regrette d\'avoir vu tous ces films avec toi vu que tu respires comme un cochon qu\'on égorge pendant toute la séance ! Aussi, la natation j\'y allais seulement parce que je voulais impressionner quelques nageuses par mon imposante musculature et qu\'elle semblait d\'autant plus imposante quand tu m\'accompagnais tant la tienne est RIDICULE ! \r\n\r\nPar contre je ne regrette pas d\'avoir geeké avec toi à LOL car j\'ai pu être l\'heureux spectateur de fails parmi les plus beaux et de feedage intense, que dis-je ? Ce n\'est plus du feedage à ce niveaux, mais du gavage ! Aussi je suis content d\'avoir découvert le bloublou car c\'est marrant sauf quand on le subit.. \r\n\r\nAu final (ou finalement je sais plus très bien), je suis contenant de t\'avoir rencontré car j\'ai pu entendre parler des légendaires, magnifiques, sublimes ou simplement belles (comme indiqué dans leur prénom)  Isabelle et Anabelle dont je n\'ai pu malheureusement faire la connaissance.. \r\n\r\nAh oui et aussi : MEURS !', 2221, 2179),
(115, 1, 'Aaaaaaaaaaah ! Louis ! OO\r\nPour une F2 agréable, il vous faut un Louis. Quelque peu endormi le matin, il reste toujours très bavard et partant pour jouer ou manger ! Merci pour ces années passées ensemble.\r\nOn a passé de bons moment de rigolade. \r\nNe change pas, ou du moins dors plus ! :P', 2156, 2161),
(116, 1, 'Hey mon jumeau de nom et cofillot!\r\nUn peu triste de t\'avoir perdu de vue ces deux dernières années. On était pas mal proche. Malgré ta tendance à embêter les filles, je t\'aime bien ! :)\r\nMême si ça l\'air difficile, essaye de me donner des news. Et je viendrai te rendre visite à l\'occasion ;)\r\nDes bisous', 2156, 2201),
(117, 1, 'Johan,\r\n\r\nTu es le premier à avoir dansé du Modern Jazz avec moi. Merci. Malgré les appréhensions et les erreurs c\'était super. Sans toi ma deuxième année à l\'ISIMA n\'aurait pas été aussi accomplie : en tant que spectacle, montage vidéo, photos, concours ... Sans oublier les TPs et les projets ! :P\r\n\r\nBonne continuation, je te souhaite de trouver le bonheur et la sécurité financière.\r\n\r\nMaëva', 2156, 2179),
(118, 1, 'Chère Michèle chérie,\r\n\r\nTu es la personne la plus gentille et adorée que je connaisse ! <3\r\nJ\'aurais bien voulu que tu sois ma meilleure amie mais les circonstances ainsi que la distance en ont décidé autrement. Nous nous sommes quelque peu perdus. Aux moments où j\'avais besoin d\'être entourée, je me suis senti seule. Pas facile dans ces moments là de n\'être entourée que par des geeks. Tu me manques toujours.\r\n\r\nTu es un soleil à toi toute seule. Difficile de ne pas résister à cette bouille, à ce sourire. Tu égayes notre vie.\r\nJe me souviens des biscuits que tu ramenais à l\'école, sans aucune raison. Adorable et généreuse. \r\n\r\nJe sais que tu vas trouver ta place, accompagnée des bonnes personnes; bas besoin de te le souhaiter.\r\nJ\'espère juste que tu ne m\'oubliera pas. Si l\'envie t\'en prend, la maison est toujours ouverte.\r\n\r\nEn souvenir de notre atelier découverte de nourriture exotique :P\r\n\r\nDes bisous d\'amour,\r\nMaëva', 2156, 2214),
(119, 1, 'Mon allemand préféré !\r\n\r\nTu sais déjà tout ce que je pense de toi : tu es gentil, drôle, intelligent, bavard, curieux, sympa, beau, attachant, adorable... Et tu sais danser ! \r\nNos conversations et nos repas me manquent. Quand est-ce que tu me rends visite ? Tu seras toujours le bienvenu.\r\n\r\nEn souvenir de nos soirée avec Jinpeng et Maxime à manger des fromages et à essayer de bien parler français ! :P Merci d\'avoir été là cette année, d\'être toujours partant pour tout et de me raccompagner chez moi le soir .\r\n\r\nP.S: Y a que les allemands pour faire du rap féministe ! :P\r\n\r\nBisous du Sud de la France,\r\nMaëva', 2156, 2520),
(121, 1, 'Bon ! je pense qu\'un grande partie des coms que tu auras feront références à divers écureuils mais sache qu\'il n\'y en aura pas dans ce qui suit ! =PP\r\n\r\nJe me souviens encore des premières soirées à Clermont, chez toi, dans ce petit appartement sous l\'escalier. C\'était gavé bien !\r\n\r\nJe te souhaite de passer un super stage (à Toulouse si j\'ai bien compris) en attendant de te revoir dans un avenir proche!\r\nJ\'aurais bien aimé finir par une expression ch\'ti mais aucune ne me vient à l\'esprit à part HEEEIN !', 2185, 2236),
(122, 1, 'On l\'a fait ! on l\'a fait !! Quelques moments de doutes mais on l\'a notre diplôme !! :D \r\ndes bonnes années :) et plein de bons souvenirs en TP  haha ^^ \r\n(PS: t\'as vu j\'ai pas fait de blague sur les mamans ! )', 2079, 2237),
(123, 1, 'BAAAAARBUUUUUUUUUUUUUUUUUU! \r\n\r\nT\'es vachement contrariant comme mec, mais c\'était cool de bosser avec toi !  :)', 2079, 2190),
(124, 1, '** WARNING RED BUTTON **\r\n\r\nMon très cher ludo ! Je le répète donc, le plus grand organisateur du WEI de tous les temps couplé à un doigté de guitariste plutôt habile... ou est donc l\'arnaque ? =P\r\n\r\nCreuse bien ton trou à clermont, je passerai certainement en souvenir du bon vieux (pas si vieux mais un peu moins jeune déjà) temps ! (oui j\'avais pas fini ma phrase)\r\n\r\nEn espérant être sous ton commandement lorsque le soulèvement des poules se déclarera, je te souhaite le bon vent !', 2185, 2237),
(125, 1, 'Du beach aux parties de tarot à ISIBOUFFE, j\'ai eu beaucoup de plaisir à te côtoyer!! Bonne continuation Steph!', 2186, 2245),
(126, 1, 'Je ne suis pas spécialement fan de linux, ni de la musique que tu écoutes, ni des jeux de rôles, et pourtant cela a été un vrai plaisir de passer ces trois années en te comptant parmi mes amis. Je garderai en mémoire nos soirées film autour d\'un bon repas avec Touf et Alice. Bonne continuation Maxime!', 2186, 2207),
(127, 1, 'Finalement on ne vendra pas de crêpes tout les deux...mais je garde l\'idée pour une éventuelle reconversion!! Félicitations Thibaud!', 2186, 2235),
(128, 1, 'Le passage en ZZ2 a été un peu difficile mais te voilà maintenant diplômé!! Félicitations Touf !\r\nPS : Prends bien soin de mon parapluie...', 2186, 2257),
(129, 1, 'Flo, Quentin, Sylvain, LE Suisse ou quelque soit ton véritable prénom, ça a été un véritable plaisir de t\'avoir dans l\'équipe de volley et de te compter parmi les inconditionnels des parties de tarot le midi!! Félicitations et bonne continuation!!', 2186, 2153),
(130, 1, '\"Ou rent\' out kaz\", une phrase devenue mythique!! \r\nBonne continuation JT!', 2186, 2224),
(131, 1, 'Tu veux des bonbons piments sans piments ?\r\nBon continuation Ric', 2224, 2186),
(134, 1, '* Gros son lourd *\r\n\r\nLe mec arrive en 207\r\nIl se la pète\r\nelle est vert électrique\r\nt\'as déjà la trique \r\nRom\'s est son blase\r\nZizi Copter au BDE ça jazz \r\nIl ne s\'appelle pas Romain\r\nEt il a fait F1\r\n\r\n* toise la foule d\'un regard menaçant et dit \"SIIIIII SI !\" *', 2079, 2154),
(135, 1, 'Hallo Philip, ich wünsche dich alles gutes! Erasmus Semester mit dir war ganz toll. Ich danke dir dafür. Hoffentlich, dass wir nochmal treffen werden (entweder in Frankreich oder in Deutschland). Bis dann. Marianne', 2183, 2520),
(136, 1, '(de la part de Marine)\r\nYop ! Félicitations pour le diplôme ! Merci pour les soirées cuisines, et d\'avoir joué les chauffeurs, malgré les directions douteuses ^^ \r\nGarde bien tes secrets défenses ;)  \r\nJ\'envoie un câlin au ptit chat ! bon et a celui de ta soeur, si les deux vont toujours ensemble !', 2183, 2224),
(137, 1, 'Jojo chéri !! Euh je veux dire Monsieur l\'Ingénieur ou Monsieur le Cadre,\r\n\r\nFélicitations pour ton année, même si tu as failli louper le jour de ta soutenance :p\r\nMerci pour toutes les soirées cuisines, les soirées en tête-à-tête, les repas en tête-à-tête, la fête de la musique, les remontées de moral et tout en fait ! Reeeeeeste ! \r\n\r\nVoilà ce que  je complotais avec Marianne ! Ah oui, j\'oubliais : oui aux strip-teaseuses !\r\n\r\nLa princesse du Lvdic ;)', 2183, 2222),
(138, 1, 'Félicitations pour ton diplôme ! :)\r\nDe la part de Marine (la matheuse, la squatteuse des concerts à l\'isima, des soirées cuisines chez Jojo, bon j\'aurais bien dit la Marine de  Yoan mais tu avais deviné, non ?) \r\nDu coup, on se recroisera ptet à l\'isima un jour, qui sait ?', 2183, 2225),
(139, 1, 'Félicitations pour ton diplôme ! Bonne continuation ^^\r\nDe la part de Marine \r\nMatheuse, squatteuse occasionnelle à l\'isima, princesse d\'un jour au lvdic, invitée des soirées cuisines chez Jojo, quand tu sortais du chinois tout ça... (oui c\'est ma carte de visite !)', 2183, 2193),
(140, 1, 'Félicitations pour ton diplôme ! :D\r\nTu vas devenir un ZZ4 ! Bouh, le vieux ! (oui j\'ai toujours été pénible je sais)\r\n\r\nDe la part de Marine , \r\nMatheuse, squatteuse occasionnelle à l\'isima, bon j\'dirais bien l\'ex- Marine de Yoan pour que tu comprennes même si..', 2183, 2207),
(141, 1, 'j\'ai bien peur que ta clio ne fasse pas lpoid\r\njuvenil comme un clito qui n\'a pas dpoil\r\n\r\net si les barrières te rendaient si aigri \r\navoue que c\'est parce que tu galères a te garer en épi\r\n\r\njvais arrêter de clasher car tu fais parti de la team F1\r\nbien que ta voiture et ta filière ne se ressemble en rien !\r\n\r\nbraah braah braah', 2154, 2079),
(142, 1, 'AKA l\'arracheur de pek', 2154, 2158),
(144, 1, 'Notre collaboration date d\'il y a maintenant quelques lunes, et je crois que finalement, tout s\'est plutôt bien passé. On pourrait en parler pendant un long moment mais je crois que je vais aller à l\'essentiel en citant quelques-unes de tes indénombrables qualités. Très engagée dans ton travail, la volonté de bien faire et surpréparer les soutenances, je crois que tu possèdes le cocktail parfait pour réussir. La preuve, tu as réussi puisque si tu lis ce message, ça veut dire que tu as ton diplôme. Tu as très largement mérité cette distinction et j\'espère que nos routes se recroiseront très bientôt. Au fait, je prépare ton cadeau pour le Noël 2015 !', 2162, 2245),
(145, 1, 'L\'homme qui ne voyait plus ses pieds à cause de ses pecs !! #Developpé #Couché', 2158, 2154),
(146, 1, '#LIN', 2090, 2154),
(147, 1, 'Je te souhaite également pleines de bonne chance pour la suite ! \r\nEt félicitation pour ton diplôme ! \r\n(T\'inquiête ton pote Ben je le gère au boulot ^^) \r\nA plus ! A mardi comme tu dis !', 2220, 2077),
(148, 1, 'Un petit message pour mon petit Patcho, pour que tu ais une trace de moi et que tu ne m\'oublies pas :P Sauf si bien sur tu le mets à la poubelle ^^\r\nBref juste pour te dire que tu es une personne de bien (malgré tes tendances shlag) et que je t\'apprécie beaucoup mais tu le sais déjà :) \r\nEn espérant ne pas perdre contact avec toi car sinon tu vas me manquer quand même. \r\nEt merci pour m\'avoir aidé pour le TOEIC, c\'est en partie grâce à toi que j\'ai eu mon TOEIC et donc mon diplôme :) \r\n\r\nBisous Bisous', 2220, 2090),
(149, 1, 'Un petit message pour la petite Estelle pour qu\'elle ne m\'oublie pas non plus !  (Oui parce que c\'est elle qui va m\'oublier en premier on est d\'accord héhé)\r\nEt non je rigole, je ne veux pas perdre contact avec toi car malgré mon côté \'schlag\', tu es une des personnes que j\'ai le plus apprécié durant ces 3 années (et tu sais qu\'il y en a pas beaucoup haha) et ça me ferait plaisir qu\'on continue à s\'échanger des nouvelles même si c\'est moins souvent.\r\nEn espérant que tu réussisses ta vie et que tu sois toujours heureuse !\r\n\r\nDes bisous à une femme plus qu\'ordinaire :)', 2090, 2220),
(150, 1, 'YEEEEES I did it! J\'ai cliqué sur le bon bouton! :P\r\nTon message m\'a fait très plaisir mon petit Jon! \r\nÇa a vraiment été un plaisir de te côtoyer pendant ces 3 années. On se sera bien éclaté surtout avec les Crazy\'Ma! :)\r\nSi un jour les poulets attaquent je te choisi comme mon premier lieutenant! On sera les rois de l\'infiltration ;)\r\nJ\'espère vraiment qu\'on gardera le contact longtemps et tu es le bienvenu chez nous si tu reviens sur Clermont.', 2237, 2185),
(151, 1, 'Merci pour ton message qui m\'a fait très plaisir :)\r\nMême si ça a été une brève collaboration, ça a été un plaisir de travailler avec toi pour le gala 2014. \r\nOn espère te revoir à nos concerts! Et surtout,  félicitations pour le diplôme :)', 2237, 2245),
(152, 1, 'Félicitations pour le diplôme ma petite Laetitia!\r\nÇa a été 3 bonnes années passées en ta compagnie (avec notamment un exposé de com géré avec beaucoup de talent ;) )\r\nJ\'espère que je trouverai le temps pour venir te rendre visite à Toulouse. \r\nDes bisous', 2237, 2208),
(153, 1, 'De très bonnes années passées avec mon petit Ludo.\r\nJe me rappelle très bien cet exposé ;)\r\nPlein de bonheur à toi !\r\nBisous !', 2208, 2237),
(154, 1, 'Michèèèèèèle !\r\nTrès heureuse que tu arrives à Toulouse ! Et félicitation à toi pour avoir décroché le stage !\r\nPlein de bonheur pour la suite !\r\nGros bisous :)', 2208, 2214),
(155, 1, 'De bons souvenirs des soirées Isioké :)\r\nBon courage pour la suite !\r\n\r\nLaetitia', 2208, 2077),
(156, 1, 'Cher binôme,\r\nQue de plaisir d\'avoir partagé ces magnifiques TP avec toi. \r\nNous avons su luter et venir à bout de ces durs travaux.\r\nC\'est avec tristesse que je prends conscience de la fin de ce travail collaboratif.\r\n\r\nMais sinon gros bisous quand même et à trèèèèès bientôt  mon Lyonnais préféré !!!! \r\n\r\nLaetitia', 2208, 2243),
(157, 1, 'Une très bonne année passée en double diplôme avec toi (même si devoir te supporter à l\'ISIMA et à l\'IAE n\'a pas toujours était évident... :D)\r\nPlein de bonheur pour la suite et félicitation pour tes diplômes !\r\nBisous\r\n\r\nLaetitia', 2208, 2205),
(158, 1, 'Félicitation pour ton diplôme que tu as dû obtenir haut la main !\r\nJ\'espère qu\'on pourra se revoir, au moins sur Moulins ;)\r\nEt tu viens à Toulouse quand tu veux !\r\n\r\nGros bisous\r\n\r\nLaetitia', 2208, 2213),
(160, 1, 'Félicitation pour ton diplôme ! \r\nJe garde de très bons souvenirs de cette année, surtout ne change pas :)\r\nPlein de bonnes choses pour la suite !\r\nBisous\r\n\r\nLaetitia', 2208, 2233),
(161, 1, 'Félicitation pour ton diplôme Estelle !\r\nDommage que cela se termine, on ne pourra plus raconter de potins :) \r\nPlein de bonheur pour la suite !\r\nBisous\r\n\r\nLaetitia', 2208, 2220),
(162, 1, 'Félicitation pour ton diplôme !\r\nCinq années sympathiques passées en ta compagnie :)\r\nPlein de bonnes choses pour la suite !\r\nBisous\r\n\r\nLaetitia', 2208, 2190),
(163, 1, 'Félication pour ton double diplôme, tu l\'as bien mérité :) \r\nEt oui comme tu dis on ne pourra plus faire nos fouines en cours et chercher de nouveaux potions ! \r\n\r\nBisous et bonne chance sur Toulouse :)', 2220, 2208),
(164, 1, 'Félicitation pour tes deux diplômes !  (Et oui, parce que nous on est comme ça, on se contente pas que d\'un seul ;) )\r\nUne très bonne année passée à l\'IAE, tu m\'auras bien fait rire :)\r\nQue de bonnes choses pour la suite,\r\n\r\nLaetitia', 2208, 2187),
(165, 1, 'Félicitation pour ton diplôme Jerem !\r\nJ\'en profite pour te remercier une dernière fois pour l\'aide que m\'as apportée en cours d\'électronique en première année (et oui je n\'oublie pas ;) )\r\nPlein de bonnes choses pour la suite,\r\nBisous,\r\n\r\nLaetitia', 2208, 2079),
(166, 1, 'Félicitation pour ton diplôme Nico !\r\nJe te souhaite plein de bonnes choses pour la suite :)\r\nBisous\r\n\r\nLaetitia', 2208, 2169),
(167, 1, 'Félicitation pour ton diplôme !\r\nPlein de bonheur pour la suite, de réussite et garde ce magnifique sourire ! :D\r\nGros bisous\r\n\r\nLaetitia', 2208, 2188),
(168, 1, 'Félicitation pour ton diplôme mister Foubert :)\r\nQue du bonheur pour la suite !\r\nBisous\r\n\r\nLaetitia', 2208, 2189),
(169, 1, 'Bravo pour le diplôme et pour la mention ! Tu mérites, t\'es une machine ! ;-) \r\n\r\nMerci pour tout, sans toi, j\'en aurais sans doute bien plus chier pour réussir dans cette école (niveau TPs / Projets et pour certaines matières de ZZ1). Je ne l\'oublierai pas :-)   \r\n\r\nJe te souhaite plein de bonnes choses et beaucoup de réussite pour ta vie future ! J\'espère qu\'on gardera contact, surtout si tu restes dans notre magnifique capitale Arverne ! ahah :-p\r\n\r\nLa bise et chaaampagne !\r\nNicolas', 2169, 2155);
INSERT INTO `yearbookmessages` (`id`, `yearbook_id`, `message`, `userFrom_id`, `userTo_id`) VALUES
(170, 1, 'Dijou, Dijoux, dis jou, dij-ou ou peut importe ton vrai nom, ça a été un véritable plaisir de t\'avoir dans l\'équipe de volley et de te compter parmi les inconditionnels des parties de tarot le midi.\r\nTiens, d’où me vient donc cette soudaine inspiration ....... oh, wait !!\r\n\r\nCette année, on aura essuyé plein de défaite sur le terrain, et on a même perdu contre les STAPS, \r\nmais  finalement, tout se termine sur une victoire de notre capitaine , un diplôme à zero !!!\r\nHail to the captain\' Richard !', 2153, 2186),
(171, 1, 'Ma cher binôme too !!!\r\n\r\nHééééé ouais ... ça passe bien trop vite trois ans finalement ... et la nostalgie prend déjà le dessus ! Mais quelles trois années ... ou plutôt deux ans et demie pour ne pas compter le début de la première année ;)\r\n\r\nBref, trop trop trop trop content d\'avoir partagé tout ce temps avec toi, que ce soit en tp, en soirée, ou en dehors ... Il ne faut pas que l\'on s\'éloigne malgré la distance !\r\n\r\nA trèèèèèèès bientôt ma (peut être) futur collègue ;)\r\n\r\nGrooooos bisous ma blonde préféré (ça reste entre nous ça).', 2243, 2208),
(172, 1, 'Y\'a pas à dire, la première année restera la meilleure de toute.\r\nParce que j\'avais un voisin cool, super intelligent, avec une bonne répartie tu vois le genre?\r\nMême si des fois il donnait l\'impression que Perrona existe vraiment.  ^^.\r\nDeux ans ce sont écoulé depuis, et beaucoup de chose ont changé mais finalement tu as réussi, \r\nFélicitation pour ton diplôme !!\r\nBon maintenant il faut monter une entreprise de 3 personnes, avec une feignasse et une rousse, et un binoclard, bonne chance !\r\n\r\nPS: En souvenir une petite citation d\'une personne célèbre:  \"heureusement que les fantômes peuvent se toucher sinon ils se feraient bien chier !\" PEGUET Florian. Il parait qu\'il vient à la RDD, hésite pas à lui demander un autographe. ^^\r\n( tu aurais été probablement déçu si je n\'avais pas mis de référence, quoique je sais pas trop si tu te souviens de celle blague la ou pas, c\'était un cours de M. Laforet il me semble)', 2153, 2235),
(173, 1, 'je ne suis pas spécialement fan de windows, ni de la musique que tu écoutes, ni de la Réunion et pourtant cela a été un vrai plaisir de passer ces trois années en te comptant parmi mes amis. Je garderai aussi en mémoire nos soirées film autour d\'un bon repas avec Touf et Alice, ainsi que les travaux en binômes que nous avons réalisé. Bonne continuation M. DijouX!  ((avec un X) trolololo)', 2207, 2186),
(174, 1, 'Alala, comme j\'ai jamais su quoi dire dans des circonstances pareilles, j\'ai voulu t\'envoyer une carte mais c\'était galère. Du coup restons simple : わたし の ともだち おめでとう !!!!!!!!', 2235, 2201),
(175, 1, 'Y avait pas trop de suspense en ce qui te concerne mais félicitations à toi tout de même pour le diplôme. ;) \r\nMention spéciale pour ta cuisine réunionnaise.  Avec ou sans piment...', 2235, 2186),
(176, 1, 'Félicitation pour ton diplôme (en plus avec une super moyenne la dernière année ;))\r\nJe te souhaite bien évidemment pleins de bonheur et de réussite pour la suite dans ta vie professionnelle et dans ta vie personnelle ! De toute façon on reste en contact et on essaiera de se revoir sur Paris peut-être ou sur Clermont-Ferrand, ou ailleur ! \r\n\r\nBisous !', 2220, 2166),
(177, 1, 'Merci Jafar pour ton message. Les sudoku en cours de téléphonie m\'ont aussi  manqué cette année. \r\nEn tout cas je te félicite pour ton diplôme et je te souhaite des belles réussites pour la suite. \r\nJ\'espère qu\'on aura l\'occasion de se revoir dans la suite de nos aventures ;)\r\nZZoubi', 2166, 2077),
(178, 1, 'Félicitations pour ton diplôme ainsi que pour ton CDI ;)\r\nJ\'espère que le suite de tes aventures sera remplie de bonheur et de réussite également. \r\nEn espérant pouvoir d’accueillir très prochainement dans un nouveau chez moi :)\r\n\r\nJe t\'embrasse et à bientôt.', 2166, 2220),
(179, 1, 'À mon partenaire de couette de luxe (oula ça sonne bizarre maintenant que je l\'écris! haha),\r\nJ\'espère que cette année s\'est bien passé pour toi, même sans la super partenaire de projet que j\'étais ;) :p haha\r\nJe te souhaite plein de bonnes choses pour la suite! :)\r\nxoxo \r\nMichèle', 2214, 2369),
(180, 1, 'Un grand bravo au meilleur parrain du monde ! Qui a d\'ailleurs énormément de goût quand au choix de son fillot ! Bisous bisous', 2277, 2233),
(181, 1, 'A mon président et parrain présidentiel qui nous a quand même bien manqué pendant deux ans ! J\'espère que le diplôme ce sera en France que tu le fêtera !', 2277, 2197),
(182, 1, '\"Je hais David\", je pense que tu t\'en souviens hein ! Hein que t\'étais chiant pendant les campagnes mon sa**** ! Ahaha ! Mais au fond une seule question est importante CKKP ? Bravo pour ton diplôme Mr Michelin.', 2277, 2368),
(183, 1, 'À mon cher Adrien, le breton le plus chauvin du monde,\r\nJe suis trop trop trop déçue qu\'on ai pas eu l\'idée de commencer un groupe de tricot quand j\'étais encore à Clermont avec vous! Aaaaargh! \r\nMais je me rattraperai avec les nouvelles sessions skype ;) \r\nBon et puis sinon, comme pour tout le monde: tout plein de bonheur, de \"meurt!\", de légumes, de \"poooot pot pot\", et de bébés CMV  ;) \r\nxoxo\r\nMichèle', 2214, 2221),
(184, 1, 'Hello Marion!\r\nBon, alors on s\'est toutes les deux sauvées de l\'Isima pour cette dernière année, et ce faisant, on a complètement affolé les statistiques de % de filles (déjà trèèèès bas): je ne sais pas comment l\'école peut encore tenir debout!! Hahaha, ou plutôt: Jajaja !! ;)\r\nSinon, j\'espère que tu auras eu une aussi bonne (sinon meilleure) expérience que moi à l\'étranger, et qu\'on aura l\'occasion de se recroiser.\r\nxoxo\r\nMichèle', 2214, 2166),
(185, 1, 'Salut Maxime,\r\nBon alors je ne sais pas si tu sera là à la RDD, mais ça serait super chouette vu que ça fait hyyyyyper longtemps que je ne t\'ai pas vu. Bref.\r\nJe garderai toujours un super souvenir de ces premières semaines à l\'Isima avec toi, dans les salles de TP! ☺\r\nJe te souhaite bonne chance pour la suite ☺\r\nxoxo\r\nMichèle', 2214, 2172),
(186, 1, 'Que de chemin parcouru depuis le lycée ! Tâche de représenter dignement l\'ingénierie creusoise partout dans le monde à présent !', 2441, 2247),
(187, 1, 'Bouh! Félicitations pour ton diplôme! Ou, comme disent les allemands, je te gratouille :)\r\nJ\'espère que t\'auras toujours le temps de ... Jouer!\r\n\r\nAdrien J.', 2193, 2199),
(188, 1, 'Félicitations pour ton diplôme! Et merci d\'avoir été un binôme génial, que ce soit en TP ou à Super Smash Bros :)\r\n\r\nAdrien J.', 2193, 2171),
(189, 1, 'Félicitations pour ton diplôme! Je pense que notre groupe de JdR sera d\'accord avec moi pour te décerner en plus un diplôme de MJ.  Masamune, Viktor et Langue d\'Elfe sont aussi d\'accord pour te le donner. Bon il est immatériel mais c\'est l\'intention qui compte ;)\r\n\r\nAdrien', 2193, 2222),
(190, 1, 'Mon très cher Ludo,\r\nMerci infiniment pour ces trois dernières années! Merci pour ton amitié, tes blagues à répétitions et ton amitié... J\'espère qu\'on arrivera à se voir régulièrement dans nos nouvelles vies. En tout cas, je te souhaite tout le bonheur et la réussite du monde. Reste comme tu es! =D\r\nLolo', 2188, 2237),
(191, 1, 'Mon petit Johan,\r\nMerci pour ces trois années!!! Je suis heureuse de t\'avoir vraiment découvert en dernière année car tu es au top!!! Merci pour ton amitié, tes techniques en tout genre, et tes blagues au goût douteux! :p (sans jeux de mots et arrières pensées salasses :D )\r\nTravaille ton souffle pendant que je me remets à la flute et promis on se fait un duo de folie! :p\r\nGros bisous, et à très vite pour de nouvelles aventures! =p\r\nPS: MEEEEEEUUUUURRRRS!!!!!! =D', 2188, 2179),
(192, 1, 'Ma très très très chère Michèle,\r\nQue t\'écrire si ce n\'est tout ce que tu sais déjà... Tu es une personne merveilleuse, et je suis super heureuse de te compter parmi mes amies!!! <3 Tu es absolument parfaite, et je t\'adore énormément!!!! Surtout reste telle que tu es! Réalise tes rêves, et sois heureuse! =D\r\nTu m\'as beaucoup manqué cette dernière année, la vie clermontoise sans toi ça manque de soirées filles! ;) Mais je suis sure qu\'on restera amies encore longtemps!!!! Trop de sentiments! <3\r\nBisous ma belle, je te souhaite que le meilleur <3\r\nTa Lolo <3', 2188, 2214),
(193, 1, 'Ma belle Laeti,\r\nFélicitations pour ton diplôme, avec le management en plus ça a pas du être facile (désolée de t\'avoir abandonnée... :/ ), alors FÉLICITATIONS!!!!!! =D\r\nJe te souhaite que le meilleur, sois heureuse et profite de la vie!\r\nGros bisous, et merci pour ton amitié! <3\r\nLolo', 2188, 2208),
(194, 1, 'Mon beau Foubert, roi de la terre et aussi de l\'univers!!! =D\r\nJe t\'aime plus que tout mon ange! Merci pour ces trois années de folie, pour ton amitié, puis ton amour! Je suis fière de toi, tu es parfait,  drôle, beau, intelligent, patient et tu as une CDI!!! Bref, tu es au top de ta vie, et je te remercie de m\'avoir choisi pour la partager... \r\nI love You more than anything!!! <3 11.11.13\r\nTon Coeur', 2188, 2189),
(195, 1, 'Michèèèle!!\r\n\r\nJe sais pas comment les F5 s\'en sont sortis cette année sans leur super délégué. J\'espère que le Canada t\'a bien accueillie tout comme Barcelone l\'a fait pour moi ;)\r\n\r\nJe te souhaite une bonne continuation et des belles réussites dans tes projets professionnels et personnels.\r\n\r\nMarion', 2166, 2214),
(196, 1, 'Mon cher binôme, tu m\'as bien manqué cette année. En tout cas, j\'ai passé de superbes années avec toi entre les semaines bloquées, la campagne BDE, les matchs de rugby, etc... Ça en fait des souvenirs ^^\r\n\r\nJe te souhaite pleins de belles réussites pour la suite et espère te revoir très vite.\r\n\r\nBisous!\r\nMarion', 2166, 2368),
(197, 1, 'Un petit message pour le plus américain des prezz de l\'ISIMA ;)\r\nJ\'espère que tu prends toujours autant de plaisirs aux states. \r\nEn tout cas les moments passés avec toi à l\'ISIMA (la campagne BDE, les soirées, les weekends ski , etc) resteront. \r\nJe te souhaite pleins de belles aventures pour la suite.\r\nBisous et à bientôt,\r\nMarion', 2166, 2197),
(198, 1, 'Félicitations pour ton diplôme!!!\r\nJe te souhaite plein de réussite dans ta vie professionnelle et personnelle. En tout cas, les souvenirs des moments passé avec toi resteront ;)\r\nJe t\'embrasse et à bientôt,\r\n\r\nMarion', 2166, 2256),
(199, 1, 'Félicitations pour ton diplôme et tes débuts dans la vie active ;)\r\nJe te souhaite plein de réussites pour la suite.  J\'ai passé de bons moments avec toi durant ces dernières années, et entre autre la campagne BDE et le mandat. Et j\'espère m\'être un peu améliorée en orthographe que tu ais pas à corriger (mais c\'est pas sûr ^^)\r\nBisous et à bientôt,\r\n\r\nMarion', 2166, 2157),
(200, 1, 'Félicitations au plus marseillais des ZZ ;)\r\nQue de souvenirs de ces années ZZ avec toi. Merci d\'avoir été la dans les moments difficiles et d\'avoir su m\'ouvrir les yeux quand j\'en avais besoin. Je te souhaite de belles réussites pour la suite. Ne change rien ;)\r\n Bisous et à bientôt,\r\nMarion', 2166, 2233),
(201, 1, 'PETIT COEUR!!!!!!!! (Promis maintenant qu\'on va être diplômés j\'essaierai de ne plus t\'appeler comme ça en public! :p )\r\nToutes mes félicitations pour ton diplôme!!! Merci pour ces deux années de F4 qui ont (finalement) été très sympas, et ce, exclusivement grâce à toi! ;)\r\nJe suis heureuse d\'être ton amie et j\'espère qu\'on gardera encore contact longtemps, même si c\'est difficile de rester aussi proche que lorsqu\'on était partenaires de galère! :p\r\nJe t\'embrasse bien fort Alex! Reste tel que tu es, Aies confiance en toi, et en tes capacités! T\'es le plus fort! =D\r\nLolo (Ta sale F4 préférée :p )', 2188, 2258),
(202, 1, 'Mon cher Adrien!!! =D\r\nÇa y est!!!! Tu en as rêvé, et nous y sommes (enfin)!!!! =) RDD, et petits fours pour repartir avec nos diplômes dans la poche!!! ;)\r\nMerci pour ta merveilleuse amitié, pour tes coups de gueules, tes idées multiples et nos soirées Lafay-JJG! :p\r\nTu fais parti de mes plus belles rencontres à l\'ISIMA, et même si ni toi ni moi ne sommes supers doués pour garder contact avec nos amis quand on est éloigné, j\'espère que cette fois on y arrivera, car je tiens beaucoup à ton amitié! <3\r\nJe te fais d\'énormes bisous! Fais attention à toi, et garde la pêche!!! =D\r\nLolo', 2188, 2221),
(203, 1, 'Mon petit Robinou!!!!\r\nTu es l\'une des premières personnes à qui j\'ai parlé à l\'ISIMA, et je n\'aurais jamais imaginé que ces premiers mots échangés découlerai sur une telle amitié! Je t\'adore fort mon Robinou!!!! Je te souhaite tout le bonheur et la réussite du monde!\r\nCette dernière année sans toi n\'a pas été très très cool (les cours de langues étaient vraiment pourris, avec le G22 en carton)... Mais quand on s\'est revus en décembre, nos relations n\'avaient pas changées!!! Et ça m\'a fait trop plaisir de te retrouver!!! J\'espère qu\'on restera toujours aussi proches! Je te fais de gros bisous! <3\r\nLolo', 2188, 2236),
(204, 1, 'Je suis pas très à l\'aise avec ce genre de trucs donc je dirai simplement :\r\nBravo pour ton diplôme !!!!!!\r\n\r\nAh et je n\'oublierai pas ta dette mais je veux bien la diviser par 2 pour l\'occasion ;) \r\n(oui, oui, un jour d\'intérêt seulement en moins ^^)', 2235, 2153),
(205, 1, 'Camarade de TP (C#, C++, Grille de calcul, imagerie, openGL, SQL, Codeface, Intégration d\'Appli, EJB), ping pong, lindy hop, rock, piscine, jeu de cartes (tarot, belote, crapette), tir à l\'arc, jeux de société (Bang, Colon de Catane, une vie de chien).\r\n\r\nEh ben, on en a fait des conneries en deux ans !!\r\nMais c\'est fini tout ça, maintenant on est des ingénieurs, des vrais, des durs, des vieux !\r\n\r\n\r\nBon aller, je tente une injection de code dans ton cerveau, pour te hacker.\r\n\r\n/*\r\n            @Author: Les carottes, c\'est la vie.\r\n            @Description : Code laissé par un mystérieux jeune homme, hélas peu aimable.\r\n*/\r\n#include \"Louis.h\" //Singleton représentant Louis, parce qu\'il ne peut y en avoir qu\'un\r\n#include <stdlib.h>\r\n#include <stdio.h>\r\n#include \"JAimeLeBasket.h\"\r\n\r\nint main(char * argc, char ** argv )\r\n// NB: ici on fait du C, car il faut adapter le langage du code, à la personne que l\'on veut hacker\r\n{\r\n        // Je jure solennellement que mes intentions sont mauvaises\r\n\r\n          if (Louis.getInstance().hasDiplome())\r\n         {\r\n                  int cpt =0;\r\n                  while( cpt < 2500)\r\n                  {\r\n                      // D\'abord féliciter Louis pour qu\'il baisse sa garde\r\n                      printf(\"Félicitation, pour ton diplôme !\\n\");\r\n                      if (cpt == 1163)\r\n                      {\r\n                                // ensuite lui faire perdre discrètement 500 euros par un code caché\r\n                                Louis.getInstance().donnerArgent(Louis.getInstance().getFrere(), 500);\r\n                      }\r\n                      cpt++;\r\n                  }\r\n         }\r\n\r\n        // MOUUUUUUHAHAHAHAHHAHAHAHAHA\r\n        //méfait accompli\r\n        return 0;\r\n}', 2153, 2161),
(206, 1, 'Félicitations pour ton diplôme!!! \r\nJe te souhaite de belles réussite pour la suite et de continuer à partir à la découverte des villes européennes, parce que mine de rien tu en as fait des kilomètres cette année ;)\r\nBisous et à bientôt,\r\n\r\nMarion', 2166, 2213),
(207, 1, 'Félicitations mon petit P-A. \r\nJ\'espère rapidement venir te rejoindre pour que l\'on reprenne nos petites balades parisiennes, et peut-être aussi des sorties piscine ^^\r\nEn tout cas je te dis à très vite ;)\r\nBisous,\r\nMarion', 2166, 2211),
(208, 1, 'A ma binôme d\'un projet.. absurde mais inoubliable.\r\nJ\'espère que tes différents voyages ont été enrichissants et surtout que tu en as bien profité !\r\nQuelles peuvent bien être tes futures destinations ?!\r\nA  bientôt.\r\nErwan', 2369, 2214),
(209, 1, 'Si ce message est lu, il délivrera l\'information suivante : \r\n\r\nJ\'ai très fortement apprécier le temps que l\'on a passé ensemble, à jouer de la musique ou en partie de JdR (malgré la tentative d\'assassinat manqué ;-) ). Je suis très heureux de te savoir dans le Sud, le vrai ;-) \r\n\r\nJe te souhaite une bonne continuation en thèse et n\'oublie de rappeler à mon père que la bière c\'est au dessus de 6% \r\n\r\nYoan.', 2314, 2207),
(210, 1, 'Tu es le parrain qu\'il me fallait, et je n\'oublierai pas les moments que l\'on a passé ensemble.  \r\n\r\nBon, tu m\'enverras quelques insultes quand même ? ;-)', 2314, 2224),
(211, 1, 'Félicitation à toi aussi ! en même temps je m\'inquiétais pas on est des machines ! :p \r\n\r\nbah tu vois je m\'en souvenais pas, mais c\'était avec plaisir  ^^ ce qui m\'a marqué c\'est tes cours de danse au BDE ahah !\r\n\r\nje te souhaite plein de bonnes choses :)', 2079, 2208),
(212, 1, 'Une belle année d\'alternance de passée :) \r\nEt si on pouvait ajouter des photos je posterais notre super selfie avec le Bib\' :p \r\n\r\nbonne continuation mec ;)', 2079, 2368),
(213, 1, 'Marion marion marion ...\r\nQue dire si ce n\'est que j\'ai passé d\'excellentes années à l\'ISIMA avec toi.\r\nT\'as beau être bretonne, t\'es quand même super-gentille :P\r\nOn se souviendra notamment des perms du vendredi midi où on râlait parce qu\'on faisait toujours tout, c\'était quand même bien ^^\r\n\r\nDe gros bisous Marion, je te souhaite le plus grand bonheur dans la vie professionnelle et personnelle :)', 2368, 2166),
(214, 1, 'Mon petit jérem,\r\n\r\nBonne dernière année à l\'ISIMA, surtout chez Bib. Tes un chic type et tes conseils en automobile sont au top !\r\n\r\nJe te souhaite plein de bonheur, change pas mec !', 2368, 2079),
(215, 1, 'Mon petit Brice,\r\n\r\nTrès bonne scolarité à l\'ISIMA avec toi,  surtout en F5. Tu vois que tu auras réussi à l\'avoir ton diplôme Monsieur je vois tout du mauvais côté. Pour l\'aide que je t\'ai apporté, c\'est rien, c\'était avec plaisir tu sais ^^\r\n\r\nJ\'espère que tu achèteras des pneus Santiago dans qq années.\r\n\r\nDe gros bisous poulet <3', 2368, 2077),
(216, 1, 'Mme Mounier, Mlle Mounier,\r\n\r\nSans mentir, si votre ramage\r\nSe rapporte à votre plumage,\r\nVous êtes le phénix des hôtes de ces bois.\r\n\r\nPlus sérieusement, très bonnes années passées avec toi. Grizzlys, AssoFi toussa toussa.\r\nMême si tu voulais pas (trop) lâcher de l\'argent pour faire des soirées, t\'avais raison ^^\r\n\r\nJe te souhaite plein de bonheur, plein d\'épanouissement sur le plan professionnel et personnel, plein de toussa toussa\r\n\r\nDes bisous tout pleins !!!', 2368, 2220),
(217, 1, 'Monsieur TROUDUKU Avillach,\r\n\r\nj\'ai passées 3 putains de bonnes années avec toi.\r\nT\'as beau être un con-mongol-TROUDUKU, t\'es quelqu\'un en or donc ne change pas stp.\r\nDommage que tu aie perdu ton accent du sud mais je t\'en veux pas trop, tes une salope de tout façon.\r\nJ\'espère que dans qq années tu achèteras des pneus Santiago pour le plus grand bien de ta yaris.\r\n\r\nDes bisous poulet !', 2368, 2233),
(218, 1, 'Ckkp ?', 2368, 2233),
(219, 1, 'Monsieur Gaucher,\r\n\r\nj\'espère qu\'un jour on montera \"get lucky\" en mode HARD.\r\nPlus sérieusement, 3 excellentes années à tes côtés, de bonnes pikolades au compteur, c\'était énorme.\r\nC\'était énorme, le mec qui fait des trucs toujours à l\'avance et qui fait jamais stresser les autres !\r\nC\'était énorme, le mec qui vomissait à côté du BDE.\r\nC\'était énorme, le mec qui me cassait les couilles quand je faisais ISIBOUFFE pour arrêter de strésser ma mère.\r\nC\'était énorme !\r\n\r\nGros bisous poulet !', 2368, 2176),
(220, 1, 'Que dire à Monsieur Alvarez ?\r\n\r\nQue dire au mec qui m\'a cassé les couilles avec mon site BDE fait à la rache ?\r\nQue dire au mec qui n\'a jamais cuisiné à ISIBOUFFE ?\r\nQue dire au mec qui n\'a jamais sû tenir une trésorerie à ISIBOUFFE ?\r\nQue dire au mec qui n\'a jamais bu d\'alcool ?\r\nQue dire au mec qui ma permis de grandir, de me remettre en question, pardon, de me casser les couilles ?\r\nQue dire au mec qui voulait faire la RDD avec un spectable de filles à moitié à poil ?\r\nQue dire au à cette personne là ?\r\n\r\nMerci pour tout ! Tes un mec en or, ne change pas (enfin, si un peu quand même ...).\r\n\r\nDe gros bisous, je te souhaite plein de bonheur !', 2368, 2213),
(221, 1, 'Que dire à ce monsieur Baud ?\r\n\r\nDe formidables années passées avec toi. Heureusement que t\'étais là en cisco, c\'était grave la merde pour moi sinon.\r\n\r\nTes un chic type, félicitation pour ton CDI !\r\n\r\nJe te souhaite plein de bonheur !\r\n\r\nLa bise poulet !', 2368, 2369),
(222, 1, 'Que dire à ce petit Raphounet ?\r\n\r\nBravo pour ton diplôme, d\'abord parce que c\'était pas gagné vu comme tes une grosse merde.\r\n\r\nPlus sérieusement, 3 années magiques à tes côtés, c\'était juste énorme.\r\nOn se souviendra des réunions anti-estelle pour monter des soirées, de cigarettes fumés (légalement) dans le stock du BDE mais aussi du G21 avec michèèèèllleeee !!\r\n\r\nTes un chic type, un mec en or, prends ça comme tu veux, je t\'adore, ne change pas.\r\n\r\nDe gros bisous et je te souhaite tout le bonheur du monde.\r\n\r\nJ\'espère aussi que tu achèteras des pneus Santiago dans quelques années, INTCHALLAH.\r\n\r\nLa bise poulet.', 2368, 2256),
(223, 1, 'Monsieur valade,\r\n\r\nj\'ai une question : CKKP ?\r\n3 bonnes années avec toi, dommage qu\'on ai pas fait une plateforme pour un DJ au BDE et qu\'on ai pas cassé les chiottes pour agrandir le bar, ça aurait pu être énorme.\r\nNéanmoins, on s\'est bien rattrapé avec tes soirées ISIOK, toujours au top le garçon comme on dit chez moi.\r\n\r\nDe gros bisous et tout plein de bonheur poulet !!', 2368, 2116),
(224, 1, 'Michèèèèèèèèèèèèèèèèèèèèèèèèèèlllllllllllllllllllllleeeeeeeeeeeeeeuuuuuuuuuuuuuuuuuuhhhhhhhhhhhhhhh !!!!!!!!!!!!!!!!!!!\r\n\r\nFélicitation pour ton diplôme et pour tes expériences à l\'étranger.\r\nJe te cacherais pas que la F5 sans Michèle, c\'était pas la vraie F5 mais on a fait avec. \r\n\r\nDe super moments partagés avec toi, je te fais de gros bisous et je te souhaite que du bonheur !', 2368, 2214),
(225, 1, 'Mon petit PA,\r\nDe supers moments passés avec toi: Gala, CA, AssoFi ...\r\nTes qq avec la tête sur les épaules et ça c\'est cool.\r\n\r\nDommage que tu sois timides mais j\'ai l\'impression que c\'est pas plus mal pcq je pense que certains en prendraient pour leurs grades sinon.\r\n\r\nDe gros bisous, félicitation pour ton diplôme (même si tu as volé le droite) et plein de bonheur !', 2368, 2211),
(226, 1, 'Monsieur Bevenot,\r\n\r\nfélicitation pour ton diplôme. J\'ai passé 3 excellentes années avec toi, c\'était awesome.\r\nBDE, BNEI, AssoFi, pipi-bar-isima/polytech/ifma toussa toussa\r\n\r\nJe te souhaite plein de bonheur. de gros bisous <3', 2368, 2157),
(227, 1, 'Excusez moi Monsieur , c\'est vous qui en faites beaucoup trop ?\r\nNon parce que pour faire un feu au bord de la plage ACQP vous déterrez des troncs d\'arbres.\r\nEt je parle même pas du père qui fait des paëlla pour nourrir tout le tiers-monde pendant 5 ans.\r\nOn est quand même mieux la qu\'en prison tout de même.', 2176, 2368),
(228, 1, 'Lauuuuuuuuuuuuuuuulauuuuuuuuuuuuuuuuu !!\r\n\r\nBien ou bien ?\r\n3 excellentes années passés avec toi à l\'ISIMA. Toujours la patate, toujours le smile, c\'était génial.\r\n\r\nJe te souhaite tout plein de bonheur, de gros bisous !!!', 2368, 2188),
(229, 1, 'Foubewwwww\r\n\r\nun petit mot pour un F5 qui pèèèèèèèèse dans le milieu.\r\nDe bonnes années passées avec toi, je te souhaite plein de bonheur.\r\n\r\nLa bise poulet !', 2368, 2189),
(230, 1, 'Monsieur Martignoni,\r\n\r\nfélicitation pour votre diplôme !!\r\nje vous souhaite plein de bonheur, j\'espère que votre startup va bien se porter.\r\n\r\nLa bise poulet', 2368, 2178),
(231, 1, 'Monsieur Guyot,\r\n\r\nBravo pour le diplôme, le CDI, le vomi.\r\n\r\nTes quelqu\'un qui pèse dans le milieu (MuZZiK, WEI toussa toussa). Je te souhaite plein de bonheur !\r\n\r\nLa bise poulet', 2368, 2237),
(232, 1, 'J\'en arrive enfin au gros mongol de la promo.\r\nDe bons moments passées avec toi à faire n\'importe quoi !!!\r\nFélicitation pour ton diplôme, je te souhaite plein de bonheur !\r\n\r\nLa bise poulet !', 2368, 2091),
(233, 1, 'Monsieur David Santiago Michelin,\r\n\r\nQue d\'honneur d\'avoir pu entreprendre un bout de chemin à vos côtés. Que votre folie et votre pessance dans le milieu vous mènent le plus loin possible.\r\n\r\nPS : Soyez patient, dans 4-5 ans vous serez directeur de l\'ISIMA. Vous pourrez alors démonter les toilettes du Bureau Des Elèves pour y construire un bar digne de ce nom. Je vous fait confiance.', 2116, 2368),
(234, 1, 'Monsieur Santiago,\r\nMerci à toi pour ta bonne humeur, tes chansons d\'après repas et surtout tout ce que tu as fait pour l\'ISIMA.\r\nBravo pour le diplôme et le boulot décroché chez le Bib, tu pèses beaucoup trop!\r\nLa bise', 2237, 2368),
(235, 1, 'BLBLBLBLBL !!!', 2116, 2098),
(236, 1, 'BLBLBLBLBLBL!!!', 2098, 2116),
(237, 1, 'BLBLBLBLBL!!!', 2098, 2077),
(238, 1, 'Foubeeeeeeeert ! (Alalala, ça fait longtemps que j\'ai pas eu l\'occasion de t\'appeler comme ça :p )\r\nTu peut être fière: à chaque fois que je passe devant une boite de stylos/marqueurs de toutes les couleurs, je pense à toi, et ta trousse arc en ciel ^^ Haha\r\nBon, sinon, j\'espère qu\'avec Lolo vous vous êtes éclatés à Londres, et que un de ces quatre, on pourra se faire un voyage ensemble !!! ☺\r\nBisous xoxo\r\nMichèle', 2214, 2189),
(239, 1, 'Inutile de sa naissance à son yearbook ce mec.', 2077, 2098),
(240, 1, 'MEEEEEEEEEUUUUUURS!!!\r\n(Et sinon félicitation pour le diplôme! :) Ça a été 3 bonnes années passées à ne pas te voir en cours :P)\r\nPlein de bonnes choses pour la suite!\r\nCRAZY\'MA for ever', 2237, 2221),
(241, 1, 'Yooo QV !!!\r\nBon alors je sais plus si je t\'ai déjà écrit … donc tadaaaaaa voilà peut être un 2ème message pour ton yearbook: yeah!\r\nDéjà, félicitation: tu as survécu à  l\'ISIMA, malgré des notes de cours parsemés de  mes gribouillages intempestifs. Il en fallait du courage et de la patience ! ;)  Et puis, et bien profite bien des tes voyages en Thaïlande, et je ne sais où encore. Pense à prendre quelques photos et à nous envoyer hein!?! Ha et puis passe me faire un ptit coucou en Nlle Calédonie si tu passes pas trop loin et que je suis chez moi ☺\r\nBon et puis, à ce qu\'il paraît t\'as plein de choses à me raconter, alors j\'ai hâte de te revoir à la RDD!\r\nBisous bisous\r\nxoxo\r\nMichèle', 2214, 2210),
(242, 1, 'Mon petit Quentin,\r\nFélicitation pour le diplôme! Ça a vraiment été 3 super années, avec plein de super souvenirs en ta compagnie. \r\nJe te souhaite plein de bonnes choses pour la suite!\r\nCRAAZY\'MAAAAA ^^', 2237, 2210),
(243, 1, 'Mon petit Cyril ...\r\n\r\nTout d\'abord, félicitation pour ton diplôme, même si t\'es une grosse salope.\r\n\r\n2 ans avec toi à l\'ISIMA, c\'était top. On a eu le meilleur BDE au monde, et c\'est toi qui l\'a porté (bon hereusement que j\'étais là quand même) donc bravo pour ça.\r\nJ\'espère qu\'on se perdra pas de vue, que je puisse quand même te casser la gueule.\r\n\r\nLa bise mon poulet <3', 2368, 2197),
(244, 1, 'Maevaaa,\r\n\r\nfélicitation pour ton diplôme !!\r\nTu as toujours le sourire, ne change pas!\r\n\r\nJe te souhaite que du bonheur, gros bisous !', 2368, 2156),
(245, 1, 'Naouf le ouf,\r\n\r\nque de bons moments partagés ensemble.\r\nTya beau être un grand malade, ne change pas maggle.\r\n\r\nje te souhaite que du bonheur mon grand gaillard !\r\nLa bise :)', 2368, 2151),
(246, 1, 'RQ Ben, on en parle ?\r\n\r\nFélicitation pour ton diplôme volé !\r\nMême si tu as vomi en amphi garcia et que tu as souvent pétédéplombspourrienjetepardonne\r\n\r\nJe te souhaite que du bonheur !\r\n\r\nLa bise poulet', 2368, 2098),
(247, 1, 'Ah ! Et oui, ces années se terminent. Enfin :P\r\nDe toute façon tu ne pourras jamais me battre à Bravely Default ^^\r\nEnfin toutes mes félicitations également :)\r\nA bientôt !', 2199, 2193),
(248, 1, 'Cher Meurs Michèle,\r\n\r\nC\'est vrai que c\'est pas trop copain que tu n\'es pas pu malheureusement participer à ce merveilleux club de tricot dont avons, en toute ponctualité et toute assiduité, participé à Clermont-Ferrand. Cependant, C\'EST PAS FINI !!! J\'espère que tricoter virtuellement nous gardera un peu en contact ! Au départ je pensais que l\'on pourrait skier tous ensemble tous les ans, et c\'est vrai que ça me chagrine de ne plus te voir dans cette magnifique combinaison qui te seyait à la perfection ! :)\r\n\r\nSinon, à quand la prochaine soirée proto dans l\'herbe ?!?! :)\r\n\r\nAh oui et aussi, MEUUUUUUUUUUUUUURS !!!!', 2221, 2214),
