(264, 1, 'Ma cher Lauryanne,\r\n\r\nSache que, même si le correcteur d\'orthographe ne t\'aime guère et préfère des Laurianne ou des Lauriane, tu es celle de tous ces prénoms que je préfère le plus ! Et pourtant, j\'en connais des L+[au(x)/o(h)/eau(x)]+*[r]+[y/i]+a*[n]+e ! :) C\'est vrai que ça me manque de me plaindre, les soirées JJG, les séances de muscu, s\'occuper de CMV... Mais une chose qui me manque aussi beaucoup c\'est tes histoires ! J\'aime quand tu nous raconte quelque chose, quand on tricote, ou même pendant 5h de covoiturage ! :) J\'espère encore pouvoir les entendre pendant nos séances de tricot virtuels !! J\'espère que ce sera la chose qui nous tiendra tous en contact !!! :) Parce que malheureusement, les Augustes, c\'est finis ! :(((\r\n\r\nBref, en espérant pouvoir encore entendre de tes histoires et tes idées !! Ton amitié m\'est très cher aussi, même si on le dit jamais, c\'est sous-entendu !! :) Meurs bien copine !!!! :)', 2221, 2188),
