(289, 1, 'Félicitions Raphy pour ton diplôme et ton parcours,\r\nC\'était génial de partager cette expérience avec toi.\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2157),
(290, 1, 'Félicitions Ben pour ton diplôme,\r\nJe suis content des moments qu\'on a partagés à l\'ISIMA.\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2098),
(291, 1, 'Félicitions Vavuc pour ton diplôme et ton parcours,\r\nOn a vraiment passé des BLBLBLBL moments.\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2116),
(292, 1, 'Félicitions Alex pour ton diplôme et ton parcours,\r\nCes années à lambadiner avec toi c\'était génial.\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2258),
(293, 1, 'Félicitions David pour ton diplôme et ton parcours,\r\nBravo pour tout ce que tu as fait pour l\'école, je suis très heureux d\'avoir partager ces années avec toi.\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2368),
(294, 1, 'Félicitions John pour ton diplôme et ton parcours,\r\nJe suis content des bons moments qu\'on a passé à l\'école.\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2185),
(295, 1, 'Félicitions Cyril pour ton diplôme et pour ton parcours tant scolaire qu\'associatif,\r\nJe suis très heureux d\'avoir fait ta connaissance à l\'ISIMA et te remercie de tous les moments que l\'on a partagé.\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2197),
(296, 1, 'Félicitions Yoann pour ton diplôme et pour ton parcours tant scolaire qu\'associatif,\r\nC\'était génial de partager ces expériences avec toi : les cours de SdD, Isibouffe, les soirées, les courses, ... Je suppose qu\'il y en aura encore beaucoup d\'autres\r\nQuoi qu\'il en soit, je te souhaite plein de bonnes choses pour la suite !', 2195, 2213),
(297, 1, 'Daviiiiiiiiiiiid !\r\n\r\nVoilà une figure emblématique de l\'ISIMA et de notre promo. Tu me fais marrer et tu fais de grandes choses ! Reste comme tu es et continue de danser !\r\nSi tu organises de grands évènements plus tard je serai ravie de participer !\r\n\r\nP.S : on sait tous que la choré des Crazy\'Ma est mieux que la votre. Il aurait juste fallut que tout le monde la connaisse :P\r\n\r\nBisous\r\nEt à samedi ;)', 2156, 2368),
(298, 1, 'cher petit Brice, \r\n\r\nJe tiens à remercier le seul vrai concurrent de bière pong que tu es. \r\nEn effet, te battre (même facilement) est pour moi un réel plaisirs, \r\ncar il y a plus de challenge qu\'avec les autres. Je considère \r\nque faire un bière pong sans toi, c\'est comme jouer à la pétanque \r\nsans cochonnet : tu es le petit truc qui donne tout son intéret au jeux. \r\nTu fus aussi parfois un excellent partenaire de TP (parfois même on a \r\nréussi à les finir, mais je me souviens plus quand). \r\nBref, merci pour ces deux années et ces moments (soirées, beuvries, ...)\r\net on s\'en referra (surtout si c\'est à base de jaeger)!', 2167, 2077),
(299, 1, 'cher el haddad,\r\n\r\nmerci d\'avoir toujours été présent el hadate prévue (c\'est dans le vielles blagues qu\'on fait es meilleurs pâtés - célèbre proverbe auvergnat-). Merci pour ces quelques années passé à l\'ISIMA. Il faudra qu\'on se refasse des soirées avec annonce, ça me manque un peu!', 2167, 2177),
(300, 1, 'Merci de m\'avoir fait passer en deuxième année! Je crois que je te dois à toi et à Adrien un diplôme! Je vous dois aussi quelques souvenirs (ou pas l\'absence de souvenirs...) de soirées passé ensemble! Bonne chance pour la suite!', 2167, 2227),
(301, 1, 'Il me faut tout comme à Michael, te remercier pour ce diplôme tout beau que l\'on va recevoir et que je n\'ai eu que grâce à vous. 3 années passées ensemble avec quelques soirées, c\'était bien cool!', 2167, 2254),
(302, 1, 'Tyé le meilleur Daoud, on était ensemble dans les meilleurs moments, que de souvenirs....\r\nJ\'espère qu\'on va continuer...\r\n\r\nSinon, on fait un  feu?', 2151, 2368),
(303, 1, 'Rafaeeeeeeel dou Pourtougaaaaaalllll!!!!!\r\n\r\nFélicitations poto et bonne continuation!!!!!', 2151, 2256),
(304, 1, 'Cher Nicolas,\r\n\r\nMerci de m\'avoir soutenu pour la danse et de continuer à écouter mes histoires sans broncher. Tu es le number one sur ma liste d\'invités VIP pour mon grand spectacle. C\'était le deal !\r\nT\'es hyper sympa, dommage que tu restes à Clermont :P Peut-être qu\'une boite anglaise va vouloir t\'embaucher dans un an ou deux, qui sait.\r\nTu pourras venir passer un week-end dans ma future ville ( inconnue jusqu\'à maintenant ) pour des vacances au soleil.\r\n\r\nBisous et bon repas de la RDD ! :D\r\nMaëva', 2156, 2169),
(305, 1, 'Félicitations poto !!\r\n\r\nRPZ le G1!\r\n\r\nOn s\'est bien marré!\r\n\r\nBonne continuation en espérant se revoir à Lyon!', 2151, 2190),
(306, 1, 'Flo, Flo, FLO !\r\n\r\nToi mon endormi favori. Merci d\'être presque aussi fou que moi et surtout merci pour le Grails et le PHP :P\r\nDommage que tu n\'aimes pas Toulouse plus que ça. Je vais peut-être finir là-bas. Tiens-moi au courant de la suite, je peux peut-être te trouver un CDI :P\r\nGarde le smile on t\'aime comme ça :)\r\n\r\nBisous\r\nMaëva', 2156, 2153),
(307, 1, 'Antoiiiine !\r\n\r\nJe n\'ai plus de nouvelles de toi. Mon dernier texto a été sans réponse :(\r\nPas de nouvelles, bonnes nouvelles ?!\r\nJ\'imagine que tu pètes la forme (comme d\'habitude), toujours à bloc de blagues salaces et que tu comptes rester sur Toulouse.\r\nSi je trouve un boulot dans l\'environnement là-bas, j\'irai sûrement !\r\n\r\nDans l\'attente d\'un signe de vie, bisous.\r\nMaëva', 2156, 2205),
(308, 1, 'Félicitations, au plus negro de tous les babtous de retou!!! \r\n\r\n#Escroc\r\n#Touslesbatousnegrosdetchoupiondesgrospecs\r\n#LaseullettrequitemotivecleH\r\n\r\n\"Do not go gentle into that good night; Old age should burn and rave at close of day. Rage, rage against the dying of the light.\"', 2151, 2176),
(309, 1, 'Félicitations à toi chef scoot boulehya!!!\r\n\r\nBonne continuation mon ami!\r\n\r\nAu plaisir de se revoir!', 2151, 2091),
(310, 1, 'Mabrouk ahlyk el diplom!!!!', 2151, 2509),
(311, 1, 'Félicitations Nico!\r\n\r\nJ\'espère qu\'on va pouvoir se revoir et pas à Isswèèèèèr!\r\n\r\nBonne continuation!', 2151, 2169),
(312, 1, 'Félicitations Valou!!!!\r\n\r\n#laboulemagique\r\n#ddouce\r\n#ddure\r\n\r\nAu plaisir de se revoir poto (avec un presse-agrume)!!!', 2151, 2216),
(313, 1, 'LA BOULE MAGIQUE !\r\nMec après le citron, je pense très fort à la Banane. J\'ai envie de devenir un arbre et je vais sans doute prendre racine. Après je sais pas encore où, j\'me tâte.\r\nBonne année et bonne santé, félicitation aussi pour ton diplôme (en fait le mien je l\'ai l\'année prochaine, mais j\'ai l\'impression qui a un bug dans la matrice...). Et puis, à la revoyure ! ;)', 2216, 2151),
(314, 1, 'Mon cher FOUUUUUUUUBBBBEEEERRRTTTT (cri à prononcer avec un ton orgasmique, comme pour se réchauffer le cœur sur le haut des pistes de ski),\r\n\r\nPour être honnête, (ou devrais-je dire sincèrement comme tu dis souvent) je sais pas comment on a eu ce diplôme ?! Je pense qu\'on devrait plutôt être diplômé en vol, et on aurait majoré dans la matière optimisation du temps de travail pour avoir la moyenne :) C\'est con mais ça me manque un peu d\'une certaine manière de plus être en cours à rien branler, et se faire chier, a jouer au scrabble, à la bataille navale, à mater des biatchs sur Tinder (enfin surtout moi), à faire les mots croisés (enfin surtout toi) et par dessus tout, ça me manque de rager sur les profs et leurs cours !!! :)\r\n\r\nOn nous a parfois appelé les Fouberthel mais perso j\'ai toujours préféré Berthel & Co. 3 ans à te supporter c\'était pas tous les jours facile mais on s\'y habitue contrairement à moi qui suis super facile à supporter ! :) Jte jure que c\'est pas facile d\'avoir un voisin qui fait de la glace pilée le soir l :) Tout ces projets, ces rapports, ces présentations, ces TPs.. Ahlala tant de travail en si peu de nuits :) Ballec tout ça c\'est FINI !!!!!!!!!!!!! :)\r\n\r\nC\'est surement mieux la vie d\'adulte à se tuer au travail pour ramener des sous pour payer le loyer et la bouffe. En tout cas sache que tu seras toujours le bienvenu à la maison, si je finis pas SDF, pour faire une soirée JJG, ou Hugues Aufray, ou Renaud, ou même soyons fous, une soirée RAP ! :) (Par contre pour une soirée The Voice tu vas te faire voir !)\r\n\r\nLe tricot, les Scooby Doo, le Rubix Cube, Lafay, Hearthstone, le Basket, le Drive F5, la tarentule (oh je peux encore très bien me rappeler de nos débuts c\'est vachement drôle :)), entendre les imitations de mes TIC de langages, toussa toussa ça me manque quand même... On a quand même bien profité de ces années, faut pas être trop nostalgique mais si on a l\'occasion, on peut se refaire ça quand tu veux !!!! Tu seras toujours le bienvenu si tu ramènes de quoi boire ou :)\r\n\r\nPS : Tu es totalement autorisé à corriger toutes mes fautes de grammaire, d\'orthographe, de conjugaison, de prononciation, d\'idiomatie toussa toussa :)\r\n\r\nAh oui, j\'oubliai presque, MEURS BIEN COPAIN !!!!!', 2221, 2189),
(315, 1, '(à lire en chuchotant) Wesh !\r\n\r\nJ\'espère que t\'aura pas à repasser le CISCO dans ta vie, même si t\'aime ça,  je sais pas comment t\'as pu endurer faire les tests 2 fois dans ta vie. Je pense que je me serai déjà suicidé 3 fois ! :) Bref, cette année en F5 avec toi était bien sympa ! La com c\'était drôle même si j\'entendais pas tout tout le temps ! :)\r\n\r\nBonne continuation et bon courage pour la suite !\r\nF5 un jour F5 toujours ! :)', 2221, 2369),
(316, 1, 'Bien ouej pour le diplôme !\r\n\r\nMerci encore pour les corrections de contrôle ou de CCNA au dernier moment !!! :)\r\n\r\nBallec et vive la F5 !', 2221, 2177),
(317, 1, 'Félicitations pour le diplôme Adrien, merci pour les feuilles de pompe la veille des exams.\r\nBallec et F5 forever ;)', 2177, 2221),
(318, 1, 'Cher Eymery,\r\n\r\nMerci pour toutes ces soirées annoncées (et non annoncées aussi) et ces 3 ans à l\'ISIMA, faut qu\'on se revoies asap.\r\n\r\nFélicitations pour le diplôme ;)', 2177, 2167),
(319, 1, 'Mon grand Eymery,\r\n\r\nIl est fort dommage que nous ayons pas trouvé d\'autres occasion pour se faire un tête à tête fromage baguette et vin, mais je me souviendrai longtemps de cette soirée !! :) Merci aussi pour toutes ces fois ou tu m\'a gentillement ramené à Lafayette !! :)\r\n\r\nBonne continuation pour la suite copain F5 !', 2221, 2167),
(320, 1, 'Félicitations pour le diplôme, et merci pour tous ces moments à l\'ISIMA.\r\n\r\nà mardi ^^', 2177, 2077),
(321, 1, 'Mon petit Denis,\r\n\r\nGG pour le diplôme ! Ce stage à Aberdeen avec toi fut une expérience très intéressante, l’Écosse c\'est quand même quelque chose ! :) \r\n\r\nBonne continuation pour la suite et n\'oublie pas la F5 ! :)', 2221, 2231),
(322, 1, 'FOUBEEEEEEEEERT, félicitations pour le diplôme.\r\nF5 forever ;)', 2177, 2189),
(323, 1, 'Félicitations pour le diplôme John ;)', 2177, 2185),
(324, 1, 'GG pour le diplôme !\r\n\r\nBonne continuation pour la suite ! Et vive la F5 !', 2221, 2077),
(325, 1, 'Félicitations pour ton diplôme Mame et bonne continuation.\r\nAu plaisir de te revoir :)', 2177, 2218),
(326, 1, 'David Santiago, merci pour tout le rêve que tu m\'as vendu pendant ma scolarité à l\'ISIMA :)\r\nFélicitations pour ton diplôme ;)\r\n\r\nwww.youtube.com/watch?v=0Uh249iQyj0 #anaweld', 2177, 2368),
(327, 1, 'Félicitations binôme pour ton diplôme et pour ta mention, au plaisir de te revoir :)', 2177, 2234),
(328, 1, 'Noël,\r\n\r\nQuand tu veux, je suis disponible pour enregistrer un nouvel album de chants de Noël façon Jazz Berbères. Je me souviens encore de : \"Mon beau Cactus, roi du désert !!\" XD En vrai, on a pas passé beaucoup de temps ensemble en dehors des cours, (et le temps passé en cours c\'était pour nous deux pas trop notre point fort) du coup on s\'est pas souvent vu, mais à chaque fois, tu m\'as bien fait tripé ! :) Tu m\'as beaucoup impressionné sur ta répartie en TP de com, ou dans certains cours. J\'attends avec impatience ton one man show en DVD !!! :)\r\n\r\nBonne continuation et bon courage avec ton entreprise où t\'es tout seul parce que ça doit pas être facile de se motiver à travailler avec un patron comme toi ! Et vive la F5 !! :)', 2221, 2178),
(329, 1, 'Chris, merci pour ces 3 ans. Félicitations pour ton diplôme et au plaisir de te revoir ^^', 2177, 2257),
(330, 1, 'Félicitation pour le diplôme !\r\n\r\nBonne continuation pour la suite ! Vive la F5, même si vers la fin, tu nous a un peu délaissé ! :( Marion, tu nous délaisses, ça fait longtemps... :)', 2221, 2166),
(331, 1, 'Bsaaaaaahtek le diplôme Djam ;)', 2177, 2121),
(332, 1, 'Félicitation pour le diplôme !!\r\n\r\nBonne continuation pour la suite ! Vive la F5 et merci encore pour les SMS au dernier moment avant un partiel avec des ébauches de solutions ! :)', 2221, 2218),
(333, 1, 'Félicitation pour le diplôme !\r\n\r\nBonne continuation pour la suite ! Vive la F5 et ce fut un plaisir de bosser avec toi via Google Doc la vielle des partiels ! :)', 2221, 2234),
