(346, 1, 'Ma chère Cuvée,\r\n\r\nToi qui prends toujours ton temps, que dis-je ? qui prends des siècles pour faire quelque chose, je suis assez surpris que tu n\'aies pris que 3 ans pour avoir ton diplôme ! :) Bien ouej ! :) Ça m\'a fait du bien d\'avoir un peu de soutient Breton pendant ces 3 années car c\'était pas facile de comprendre ces autres cultures où ils boivent pas, fument pas, sèchent pas les cours, mangent pas de beurre salé.. Des gens bizarre quoi :)\r\n\r\nQuand est-ce qu\'on bute des Zombies ensemble ?! (STP invite pas John il feed trop ! :)) Toutes ces soirées, jackpot, ski, marches jusqu\'à l\'ISIMA c\'était bien copain mais c\'est finis maintenant :(\r\n\r\nJe t\'avoue que voir ta musculation imposante à la piscine me manque un peu :) Peut être qu\'on aura l\'occasion de se refaire ça :) En tout cas, meurs bien copain !! Et à bientôt j\'espère ! :)', 2221, 2210),
