(373, 1, 'Cher Jeremy, \r\n\r\nJe garde un excellent souvenir du stage de 2ème année.  Merci de m avoir soutenue face à la tyrannie applesque de Zaza. Merci aussi de m avoir partagé ta passion pour les clios! En espérant qu on pourra tous se revoir à l avenir autour d une bouteille (par personne) de jaeger.', 2167, 2079),
(374, 1, 'Félicitation Driss!!\r\n\r\nJe te souhaite beaucoup de bonnes choses pour la suite ;)\r\n\r\nA très bientôt', 2218, 2516),
