(376, 1, 'Félicitation Jean!!\r\n\r\nJe te souhaite beaucoup de bonnes choses pour la suite ;)\r\n\r\nA très bientôt', 2218, 2244),
(377, 1, 'Mon cher David,\r\n\r\nUn grand MERCI pour tout ce que tu as pu faire pour la F5 et pour l\'ISIMA !! Tu as fait tellement en si peu de temps !!!! Tu es parmi ceux qui essaye de faire avancer cette école malgré toutes les difficultés encontrées, et sans râler !! D\'ailleurs je sais pas comment tu peux faire :) Râler c\'est copain ! :)\r\n\r\nJe te remercie encore pour tout ce que tu as fait pour la F5, le Drive, les repas de classes, s\'occuper de nous, récolter nos avis, nos idées d\'amélioration, parler aux profs pour leur dire d\'essayer de se corriger sur certains points, nous aider pour les partiels, toussa toussa.. \r\n\r\nC\'est dommage qu\'on ait pas pu passer plus de temps ensemble en dehors de l\'ISIMA mais tous ces moments étaient vachement sympa. Et je me souviens toujours de : \r\n\r\nYavait de grands éléphants et des Orangutan, des affreux reptiles, des jolis moutons blancs... :)\r\n\r\nBonne continuation pour la suite ! Vive la F5 !!!! A bientôt j\'espère !!! Bon courage, plein de bonnes choses et MERCI encore !!!', 2221, 2368),
(378, 1, 'Félicitations chef ! Bonne chance pour la suite bba Yassine !', 2038, 2177),
(379, 1, 'Hey ! \r\n\r\nJe sais pas si je serai encore capable de boire une bouteille seul ^^ mais je la partagerais avec plaisir ! Ce stage était vraiment une expérience géniale !! \r\nToutes ces soirées au Château restent gravées dans ma mémoire, enfin les parties dont je me souviens mais pour le reste j\'ai des photos o:) \r\n\r\nMorts aux rebords de trottoir et longue vie à Android !', 2079, 2167),
(380, 1, 'Mebrouk bba Amine ;)', 2177, 2508),
(381, 1, 'Cher Adrien,\r\n\r\nSoit certains que je garde ma meilleur bouteille de vin pour la boire avec toi. Pour les aller-retour lafayette isima, ne t\'inquiètes pas, je t enverrai la facture de 3487,39 € chez toi^^. Je te souhaite le meilleur (la fonction public?)pour la suite!', 2167, 2221),
(382, 1, 'Félicitations bba Nabil ;)', 2177, 2513),
(383, 1, 'Félicitations ssi El Gadi', 2177, 2509),
(384, 1, 'Bsaaahtek le diplôme Paul ;)', 2177, 2176),
(385, 1, 'Félicitations Rom\'s ;)', 2177, 2154),
(386, 1, 'Le mec le plus serein que je connaisse, rien ne l\'atteint ! ça m\'a toujours fait rire de te voir arriver sans stylo/trousse/sac pour un partiel que t\'avais pas préparé et d\'être complètement oklm ^^ \r\n\r\nchange pas ;) \r\n\r\n(pense juste à faire attention aux crêpes Wahoo)', 2079, 2176),
(387, 1, 'BEEEEEH ! \r\n\r\n\r\nj\'aurais pu écrire plein d\'autres choses mais je crois que ça résume bien :)', 2079, 2199),
(388, 1, 'Ma chère Gautronchedecon,\r\n\r\nC\'est où la salle de la RDD ? C\'est à quelle heure ? Faut préparer quelque chose ? C\'est où qu\'il faut aller pour choper le diplôme ? Ah... Sans toi je suis vraiment désorienté.. plus d\'agenda.. je ne sais plus quand et où je dois aller.. Même si souvent tu étais inutile car t\'en savais pas plus que moi, au moins je pouvais me défouler sur toi !!! :) Oh comme ça me manque de te faire chier.. Ça doit te faire bizarre de te sentir safe maintenant sans avoir la pression que quelqu\'un te poke soudainement les hanches à gros coup de doigts ! :)\r\n\r\nBon, j\'avoue que tu n\'étais pas seulement ça pour moi, tu étais aussi un GROS FEEDER !!! Oh comme ça me manque de te voir mourir comme une merde sur LOL, sur Hearthstone, sur les Zombies, ou autre.. Tes morts subites étaient tellement drôles ! Même les jeux te trollaient ! :) Ahh.. Ça me manque tout ça.. J\'espère te voir mourir encore des centaines de fois !! Faut pas qu\'on arrête de geeker ensemble !! \r\n\r\nEn vrai, c\'est pas seulement pour ça que je t\'aime bien, c\'est aussi pour tes MAGNIFIQUES que dis-je ? MAGIQUES, INOUBLIABLES, non c\'est pas assez fort, MÉMORABLES, EXTRAORDINAIRES, gamelles en ski !!!! Je pense que je pourrai jamais oublié, cet envolé fulgurant de ta part lors d\'un virage, bah qui en fait n\'en fut pas :) Et ce petit cri, une sorte de YAAAAaaaah... (A faire prononcer par Pichon ça rendra mieux :)) Et le meilleur, la cerise sur le gâteaux, enfin dans ce cas, c\'était un menhir :), l\'atterrissage. Ce ... ah j\'ai pas d\'adjectif pour ça, disons Gautronesque. Ce GAUTRONESQUE plat dans la poudreuse. Une sublime posture, bras et jambes écartés tel une étoile de mer, bouche et yeux ouverts, je suis même presque sûr que la combinaison s\'est ouverte aussi ! :) Et ce silence de quelques secondes, puis mes éclats de rire !!! Puis te voir te relever, tout blanc comme au WEI ! Enfin ça c\'est un peu comme d’habitude en fait.. Oh.. c\'était tellement drôle !!! J\'aimerai tellement le revoir au ralentit en boucle.. Si seulement ça avait été filmé.. On aurait pu le vendre dans le monde entier en tant qu\'anti-dépresseur et faire fortune !! :) Le truc c\'est que je crois que je suis l\'unique témoins de cette scène.. C\'est tellement dommage que je suis incapable de partager ce moment de bonheur avec d\'autres... Ahlala.. Sacré Jonathan !\r\n\r\nPar contre je suis bien content de ne plus avoir à subir tes constantes vibrations.. En vrai tu devrais être super musclé parce que tout tes muscles travaillent non-stop !! :) Mais si c\'est le cas, ça se voit pas trop ^^ \r\n\r\nEn espérant que tu trouves un rousse qui te joue du violon avant de t\'endormir.. Meurs bien copain !!! Bisous à Juju, Sasa et Frédo !!!! :) Et n\'oublies pas, qui aime bien châtie bien ! :)', 2221, 2185),
(389, 1, 'Mon petit Léo,\r\n\r\nJe sais pas pourquoi, mais dans ma vie, Léo est fortement associé à L\'allemand... Sachant l’intérêt que tu as pour cette langues, c\'est d\'autant plus chelou :) Je me dit ça car on a passé de très bons moments ensemble en cours d\'Allemand ! :) En fait c\'était un des seuls cours qu\'on avait ensemble mais je l’appréciais vraiment en ta compagnie ! :) Et de plus, Léo, c\'est le meilleur dictionnaire/traducteur pour l\'Allemand ! \r\n\r\nMême si on a pas forcément pu passer beaucoup de temps ensemble en dehors des cours, c\'était agréable et j\'ai beaucoup apprécié le peu de soirée que l\'on a fait ensemble, c\'était bien sympa :)\r\n\r\nBonne continuation pour la suite !', 2221, 2190),
(390, 1, 'Un petit mot de félicitations à l un des meilleurs prez de l isima! Merci pour tout et bonne chance pour la suite!', 2167, 2197),
(391, 1, 'Je retiens que tu n as pas su faire ce qu il fallait pour mériter ton mug écossais... . Mais on t apprécie quand même! Félicitations pour le diplôme, et bonne chance pour la suite!', 2167, 2154),
(392, 1, 'Monsieur Paquet (tu sais qu\'on a beaucoup pensé à toi en F5 avec tous ces paquets qui circulent de partout ! Tu as une grande familles crois moi :)),\r\n\r\nFélicitations pour le diplôme ! Je pense aussi que tu mérites un diplôme sur LOL car c\'était très agréable de se faire carry par toi les rares fois où on a pu jouer ensemble ! :) \r\n\r\nBonne continuation pour la suite !!', 2221, 2182),
(393, 1, 'Monsieur Dijoux,\r\n\r\nFélicitations pour le diplôme !!\r\n\r\nBonne continuation pour la suite !! 974 RPZ ! :)', 2221, 2186),
(394, 1, 'Mon petit Louis,\r\n\r\nFélicitations pour le diplôme !! C\'est bien dommage qu\'on ait pas pu plus jouer au Basket ensemble mais le peu de fois était très sympathique ! :)\r\n\r\nBonne continuation pour la suite !', 2221, 2161),
(395, 1, 'Ma cher Maëva,\r\n\r\nJ\'espère que tu sais que c\'est en  grande partie grâce à toi que l\'on a pu, en 2ème année, c\'est journée entièrement consacrer à un thème culinaire, accompagnée de PROTO !!! :) Et oui tu étais la seule à nous motiver à bouger nos cul pour préparer à manger et se réveiller pour manger pendant toute une journée du petit déjeuné à la résidence des Jardins ! :)\r\n\r\nC\'est bien dommage que j\'ai pas réussit à instaurer ZZPOMPOM parce que ça aurait été vachement drôle et je pense que tu aurais été une très bonne prof de danse. On aurait fait une chorée de ouf !\r\n\r\nEn tout cas c\'était bien sympa ces années avec toi ! Bonne continuation pour la suite !! Danse bien et meurs bien !!!! :)', 2221, 2156),
(396, 1, 'Monsieur Beyney,\r\n\r\nMerci beaucoup pour tout ce que tu as fait pour l\'ISIMA !! L\'année où vous étiez au BDE était GÉNIALE ! Vous avez su organiser plein de nouvelles choses vraiment agréables !!\r\n\r\nJe te remercie aussi personnellement de m\'avoir conduit à l\'hôpital cet après-midi où je me suis malencontreusement endommagé l\'arcade sourcilière ^^ Merci encore !!\r\n\r\nFélicitations pour le diplôme et bonne continuation pour la suite !!', 2221, 2197),
(397, 1, 'Cher Naoufel,\r\n\r\nAh.. tes altercations avec Tilmant en première année me manquent vraiment.. C\'est bien dommage que t\'ai pas fini en F5 !! :) On aurait bien rit :) \r\n\r\nBien ouej pour le diplôme !! Bonne continuation pour la suite !!', 2221, 2151),
(398, 1, 'Monsieur Bevenot,\r\n\r\nFélicitations pur le diplôme ! C\'est dommage qu\'on ait pas pu faire du Basket un peu plus longtemps ensemble mais c\'était bien sympa !!! Merci encore pour ce que tu as pu faire au BDE ! C\'était bien vraiment bien !!!\r\n\r\nBonne continuation pour la suite !!', 2221, 2157),
(399, 1, 'Cher Mr Kreeps aka FelNa aka Le prince d\'ISIBLED,\r\n\r\nJe tiens à porter plainte.\r\nEn effet il est intolérable que l\'ISIMA vous octroie un diplôme face a tant d\'escroquerie de votre part.\r\nPassons l\'assiduité plutôt douteuse lors de ces 3 dernières années, ou même encore les retards de plus de 3h sur des cours de 2h.\r\nJe parle de la vrai escroquerie: \"Pourquoi la terre est ronde ?\"\r\nVous avez causé énormément de mal à toute une promotion, c\'est depuis ce jour au Cap d\'Agde que la promo 2015 est devenu folle.\r\nFolle au point d\'accepter l\'organisation d\'un combat de boxe clandestin, ou encore même la recherche d\'un émigrée Africain répondant au nom de \"The Night\".\r\n\r\n\"We used to look up at the sky and wonder at our place in the stars, now we just look down and worry about our place in the dirt.\"\r\nSalam fréro.', 2176, 2151),
(400, 1, 'Hommage à l\'homme qui arrive à enchaîner 12 micro siestes en moins de 10 minutes sur un cours d\'allemand.\r\nLe doux son de la climatisation t\'auras vraiment fait du mal mon cher ami.\r\nQue ton futur soit flamboyant, mais évite de mourir au volant d\'un gros bolide quand même.', 2176, 2079),
(401, 1, '\"El Haddad, E-L H-A-D-D-A-D, comme ça se prononce.\"', 2176, 2177),
(402, 1, 'Avillach, AKA l\'homme qui a du coffre.\r\nTu m\'as supporté pendant 3 ans, et rien que pour ça, t\'as du mérite.\r\nPar contre j\'attends toujours le double des clés de ton appart.', 2176, 2233),
(403, 1, 'Coucou Mame,\r\n\r\nFélicitation à toi aussi. C\'est mérité !\r\n\r\nBonne continuation.', 2245, 2218),
(404, 1, 'Monsieur Vermes,\r\n\r\nSale lâcheur !! Comme ça la Canada c\'est mieux ?! C\'est tellement dommage que t\'es pas pu faire cette 3ème année avec nous parce que c\'était bien copain ici !! J\'espère quand même avoir le droit à des imitations d\'écureuil de temps à autres !! :)\r\n\r\nBon courage et bonne continuation pour la suite !!', 2221, 2236),
(405, 1, 'Félicitations pour le diplôme !!\r\n\r\nMerci pour tout ce que tu as pu faire pour l\'ISIMA !! C\'était vraiment sympa !!\r\n\r\nBon courage et bonne continuation pour la suite !!', 2221, 2233),
(406, 1, 'hahaha, je retiens qu\'on a jamais fait de muscu ensemble ! donc je pense que tu es plus faible ! mais félicitation pour ton diplôme aussi ^^', 2154, 2167),
(407, 1, 'Merci mon cher Yassine félicitation à toi aussi', 2154, 2177),
(408, 1, 'Mashallah', 2154, 2151),
(409, 1, 'et ta mère à toi', 2154, 2233),
(410, 1, 'Mon cher Adrien,\r\n\r\nTon message est bourré de fautes, tu n\'as pas changé :P\r\nDire que le souvenir marquant que tu gardes de moi est le samedi où je vous ai empêcher de faire la grasse matinée. Mais je regrette pas, c\'était trop bon, surtout les pancakes avec bacon et œuf. Miam\r\n\r\nDe mon côté, je me rappelle les heures à essayer de vous apprendre la choré des Crazy\'Ma. Sans succès. (ISIPOMPOM aurait été du même niveau) Les repas végétariens qu\'on a partagé après t\'avoir coupé les cheveux. Cette dernière année a été moins marquée en évènements partagées. Mais la fumée ne m\'a pas manquée :D Et surtout j\'ai gravé les rares moments où tu as dansé avec moi ( WEI 2013 <3 ). Parce que oui j\'adore quand tu danses disco. \r\n\r\nTon oreiller rose nous manquera. Donne-moi des news de toi régulièrement.\r\nReste comme tu es (mais fume un peu moins)\r\n\r\nDes bisous du sud ensoleillééééééé', 2156, 2221),
(411, 1, 'Mon petit Raf, tu m\'as quand même bien manqué ! Entre les virées nocturnes, weekends au BDE et j\'en passe, sans parler de ton engagement au sein du BDE et ton joli taff au BREI, je suis heureux d\'avoir fait ta rencontre, partagé ces moments ensemble, et je te souhaite le meilleur pour la suite.\r\nDes bisous mon ami :)', 2197, 2256),
(412, 1, 'Ah le Woooooooooooooolf !\r\n\r\nIH j\'ai peur !\r\n\r\nEn souvenir.\r\nM.R.', 2156, 2225),
(413, 1, 'Bravo à toi aussi pour ces 2 années et réussi bien dans la vie !\r\n\r\nAu plaisir =)', 2077, 2218),
(414, 1, 'WP à toi aussi, VIVA F5 et éclate toi bien dans ta nouvelle vie =)', 2077, 2221),
(415, 1, 'Cher Anthony,\r\n\r\nLe plus gentil de tous selon beaucoup de personnes. Reste aussi gentil, y a trop de gens méchant de ce monde. Mais gentil veut pas dire bonne poire, soyons d\'accord.\r\nEn plus d\'être un super délégué tu es un des meilleurs de la classe et tu aimes les chiens !!! Un mec parfait quoi !\r\nSi un jour tu veux passer dans le Sud, hésite pas ! ;)\r\n\r\nJe te souhaite le meilleur et donc une fille encore plus gentille que toi (si ça existe).\r\nUn conseil : les filles aiment les mecs qui savent ce qu\'ils veulent et qui décident.\r\n\r\nBisous', 2156, 2199),
(416, 1, 'Léo !\r\nSi le souvenir de ces merveilleux cours de soutien de maths en ZZ1 n\'est pas mémorable, je te laisse ce message en te remerciant pour avoir non seulement fait une parfaite mascotte lors des campagnes mais aussi pour ta bonne humeur communicative et sans faille.\r\nLa bise et bon courage pour la suite Grizz\' :)', 2197, 2190),
(417, 1, 'Tu m\'offres un de tes 3 t shirts à la RDD ?', 2154, 2256),
(418, 1, 'Mickaëëël !!\r\n\r\nTu sais déjà tout ce que je pense de toi. Je t\'adore mais tu me fais grave ch***. Oui, parce que tu crois que m\'embêter c\'est cool. Sauf qu\'à force on atteint les limites de Maëva et là c\'est plus drôle. Ces limites ont été pas mal poussées du coup. Je devrais te dire merci ?\r\n\r\nA part ça, tu me fais marrer, t\'es gentil et attentionné en privé. Mais tu fais un blocage sur les filles. Elles ne sont pas toutes comme moi tu sais. Il en existe des gentilles, posées et calmes. Faut chercher. Mais ça se trouve pas dans le monde geek.\r\n\r\nTu m\'as vu craquer cette année, tu ne m\'a pas réconforté mais normal, tu n\'avais pas les clés pour. Tu était là quand je voulais sortir me changer les idées et que personne ne voulait sortir, du moins au début. Pour ça Merci. Merci de me faire rire en cours de chinois. \r\n\r\nNe change pas. Enfin si : donne des news, sors, sois plus sociable ! Viens me voir dans le sud quand tu veux.\r\n\r\nBisous', 2156, 2247),
(419, 1, 'Robiiiiin,\r\n\r\nOn était proche sans vraiment l\'être. Désolé de pas avoir pris la peine de te parler sérieusement mais tu me fais peur. :D Oui, avec ta grande taille, ton air sérieux, je n\'arrive pas à lire en toi. \r\n\r\nJ\'espère que tu rends et que tu rendras Michèle heureuse tant qu\'elle le voudra.\r\n\r\nQuand que tu me fais une démo de la choré des Crazy\'Ma ?\r\n\r\nBonne continuation à toi à Toulouse. Bientôt vous me verrez :P\r\nBisous,\r\nMaëva', 2156, 2236),
(420, 1, 'Cher Ludo,\r\n\r\nLe mec classe des Crazy\'Ma, celui qui porte aussi bien le costard que la guitare électrique. Peut-être moins les cheveux longs. :P Tes blagues sont douteuses mais ton sourire nous font forcément sourire. Les personnes qui allient passion et travail sont rares, et tu le fais avec facilité. Je t\'admire pour ça. Ne regrette rien pour Crazy\'Ma, ce qui devait se passer s\'est passé. Et ça a été une merveilleuse expérience où j\'ai pu vous découvrir un à un. \r\n\r\nQu\'est ce que je pourrais te souhaiter de plus ? Tu as tout pour être heureux.\r\n\r\nBisous,\r\nMaëva', 2156, 2237),
(421, 1, 'Cher Ludo,\r\n\r\nUn petit mot pour ces 3 années passées à l isima. Merci d avoir fait dancer l école pendant les concerts organisé par Muzzic ou ceux de ton groupe. Et merci pour tout le reste, c était bien cool. Bonne continuatuon (chez CGI si j ai bien suivi)!', 2167, 2237),
(422, 1, 'Hey mon fwewe,\r\n\r\nUn message pour la seule personne plus petite que moi au sein de l\'équipe. Merci pour ton engagement au sein du BDE, merci pour ton sens de l\'humour plus développé que le mien ainsi que pour les bons moments que l\'on a pu passer ensemble. Malgré certains hauts et bas tu fais partie des personnes qui me manque à l\'ISIMA, et je te souhaite plein de bonnes choses pour la suite.\r\n\r\nDes bisous mon p\'tit Paul :)', 2197, 2176),
(423, 1, 'Mon cher Laurent, (ça sonne chelou quand même :))\r\n\r\nQuel bonheur ce fut-il d\'apprendre ton départ vers le Canada. Plus de complaintes incessantes à longueurs de journée, plus de vannes pourries, plus de débats sans fin MAC/Windows.. C\'était quand même plus calme à l\'ISIMA :) \r\n\r\nPar contre ce fut aussi un peu triste.. Plus personne pour m\'accompagner lors du festival du court métrage.. Plus personne pour aller avec moi aller boire de la soupe aux orties dans un petit ciné pour aller voir un reportage sur les pesticides... Aussi moins de découvertes artistiques.. Moins de découverte de jeux chelou.. Au total on a passé que 1 an et demi ensemble à l\'ISIMA, mais c\'était quand même vachement bien  :)\r\n\r\nBon courage et bonne continuation pour la suite !! Et MEURS !!!', 2221, 2216),
(424, 1, 'Roms aka Mista P,\r\n\r\nMême si l\'on n\'a pas toujours été sur la même longueur d\'onde au sein du BDE, aujourd\'hui le souvenir des bons moments et soirées passés ensemble passe au-dessus et c\'est le plus important. Belle idée que d\'avoir monté ISIMIX, je ne sais pas si ça a perduré cette année mais c\'était définitivement une bonne chose. J\'espère que tout ira bien pour toi par la suite. A quand un EP/une prochaine prod ?\r\n\r\nLa Bise !', 2197, 2154),
(425, 1, 'Un petit message au plus musicien de toute la promo pour te remercier de tous ces bons concerts que tu as pu organiser avec ton équipe, c\'était un grand plaisir d\'avoir pu faire ça avec toi en tant que BDE. D\'un point de vue personnel, ce fut également un plaisir de t\'avoir rencontré et côtoyé pendant ces deux ans :)\r\n\r\nBon courage pour la suite !', 2197, 2237),
(426, 1, 'J\'ai lancé toute une génération de Dj !! \r\nIls ont même investi dans les même platines que Flo à l\'époque !\r\nen tout cas c’était cool de faire parti du BDE \r\n\r\nBonne chance à toi pour la suite ! et invite moi aux Etats Unis bordel', 2154, 2197),
(427, 1, 'Oyé Oyé cher matelot ! \r\nPetit message pour te féliciter pour ton diplôme, et encore une fois pour tout ce que tu as pu faire avec ton équipe pour la vie associative de l\'ISIMA, vous pouvez être fier de vous.\r\nLa bise grand !', 2197, 2180),
(428, 1, 'MEURS !!!!\r\n\r\nMeurs meurs meurs, meurs meurs. Meurs meurs meurs meurs meurs, meumeurs meurs meumeumeurs !!! Meurs meurs meurs ? Meurs, meurs meurs !!! MEURS meurs meurs !! Meurs meurs meurs meurs meurs meurs meurs, meurs meurs, meurs meurs !! meurs meurs !!! Meurs. Meurs meurs meurs meurs meurs, meumeurs meurs !! Meurs meurs meurs meurs.... Meurs !! Meurs meurs meurs :\r\nMEEEEUUUUUUUUUURRRRSSSS !!!!!!!!!!!!!!!!!!!!!!\r\n\r\nJ\'en resterai bien là, mais ya quand même quelque chose que j\'aimerai graver dans l’histoire de l’écriture. Une anecdote, non pas de la moindre importance... C\'est, personnellement, une de mes plus grandes fierté, je devrais en faire un badge et l\'arborer avec fierté sur ma veste ! J\'en rêve encore parfois, dans mes moments de doute, ou mes coup de blues, je me rassure en me disant, que au moins, j\'ai au moins réussit cette chose dans ma vie. Je me souviens plus très bien quel soir quelles personnes, ni vraiment pourquoi.. t\'avais dû m\'énerver comme tu le fais si bien.. tu l\'avais surement bien mérité, moi qui suis si gentil, sage et pacifique, je n\'aurai pu infliger une telle humiliation à quelqu\'un qui ne l\'aurai pas mérité ! \r\n\r\nJe me souviens... Je me souviens, une soirée dans mon magnifique studio à Lafayette... Nous devions être 5 ou 6... L\'ambiance était agréable, hormis peut-être des désobéissances de ta part, au règlement interne, que tu avais pourtant signé !! Oui, je pense que c\'est à cause de cela que tu as subit cette infâme punition !! Peut-être as tu crié ? Ou gardé tes chaussures ? Ou tapé quelqu\'un ? Bref.. Il commençait à être tard.. Il fallait donc terminer cette soirée pour pouvoir geeker une ou deux parties avant de dormir... Les invités sortaient tranquillement dans le couloir.. On se disait tranquillement meurs dans la joie et la bonne humeur, quand soudainement, enfin, l\'heure de la vengeance sonna !!!!\r\n\r\nTu devais être distrait d\'une certaine manière. Un peu comme tout le temps en fait ! :) Tu regardais quelque part de random.. Et là, oh je me souviens encore du regard de ton pull au vert (jeu de mot de ouf). Il était tout terrorisé ! Contrairement à toi, il l\'a vu venir !! Ouiiiiiii !! Je me revoit encore hésitant à lâcher la pression... Puis, plus d\'hésitation, avec une précision ultime, je tira !!! Oui l\'unique et seul CATAPULTAGE DE CROTTE DE CHENILLE de ma vie à ce jour !!!!!! Et je l\'ai pas raté !! Pil poil sur ton épaule droite !!!! Ah.. Tant de bonheur !! De soulagement !! De Joie !! Je me souvient encore de la trajectoire de la crotte de CMV quittant la cuillère à café !!!! Une parfaite parabole !! Oh.. Un des plus beaux instants de ma vie je pense.. Tellement parfais !!! Et je me souviens encore de comment t\'as fait pour l\'enlever ton ton pull.. MAGNIFIQUE pichenette comme l\'on ferait pour jarter un insecte de soit même. Sauf que ce n\'était pas un insecte, mais une crotte de chenille ! Et les crottes de chenilles, ça tâche !!! Quelle magnifique trace de pneu de crotte de CMV sur l\'épaule droite que tu avais... Il n\'y a pas de mots pour décrire la fierté que j\'ai ressentit à l\'instant présent. Merci encore pour ce moment !! Maintenant MEUUURS !!!\r\n\r\nMEUUUURS MEURS MEURS MEURS !!! MEURS MEEEEEEEEEEEUUUUUUUUUUUUUURRRRRRRS !!!!! \r\nMEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS ! MEURS !', 2221, 2258),
(429, 1, 'Merci pour ton engagement associatif à l\'ISIMA, ce fut un plaisir de te côtoyer pendant ces deux ans.\r\nBon courage pour la suite !', 2197, 2199),
(430, 1, 'OUAIS MORRAY', 2154, 2157),
(431, 1, 'Félicitations pour ton diplôme, et encore merci pour ce beau moment de musique lors du Gala :)\r\nBon courage pour la suite !', 2197, 2162),
(432, 1, 'Big up à la meilleure danseuse de l\'ISIMA ! Félicitations et bon courage pour la suite, que ce soit pour la danse ou pour l\'informatique !', 2197, 2156),
(433, 1, 'Mon petit Yoann !\r\n\r\nMerci pour ton engagement exceptionnel au sein de l\'ISIMA, associatif ou non. Tu es vraiment quelqu\'un de bien, quelqu\'un que je suis ravi d\'avoir pu rencontrer !\r\nFélicitations pour ton diplôme mon ami, ta bonne humeur et ta franchise me manquent !\r\n\r\nDes bisous :)', 2197, 2213),
(434, 1, 'Bonjour, bonsoir, et … C’est déjà un très très bon début !\r\n\r\nEtant donné que je ne sais absolument pas comment écrire dans un Yearbook, je vais te raconter la recette du limoncello :\r\nTout est une question de timing, et bien sûr d’ingrédients, donc tout est une question de tout (ça va de soi) !!\r\nPremièrement, il faut de l’alcool pur, éthylique bien sûr, à plus de 90°. On trouve de genre d’alcools en Italie, et oui là-bas c’est monnaie courante le limoncello maison. Le meilleur étant l’alcool à 96°, car tu peux faire ce que tu veux avec, HAAAAA comme c’est original…\r\n\r\nEnsuite il faut plonger des citrons dedans, MAIS ATTENTION à deux choses importantes :\r\n-	Je ne donnerai pas les quantités car nous sommes sur un Yearbook (et ouais).\r\n-	Il faut mettre UNIQUEMENT le zeste de citron, mais faire attention à ne pas mettre la peau blanche, uniquement la jaune !\r\n\r\nFaire tremper pendant un mois en remuant de temps en temps (aaah p**** je viens de me faire piquer par un moustique). Personnellement j’ai rajouté un bâtonner de cannelle dedans, ça donne du goût.\r\n\r\nEnsuite tu dois récupérer tout cet alcool où les citrons ont bien trempé dedans, et le mettre dans un flacon vide, et compléter avec du sucre de canne liquide et de l’eau. Ensuite attend encore 3 semaines et c’est prêt pour déguster. C’EST TOUT !!!!!!\r\n\r\nBon, sinon, ce fut de supers moments à l’ISIMA, ça ne s’oublie pas ce genre de choses ! Héhé ! ^^ De toute façon on se voit sur Skype et à peu près dès qu’on peut donc ça c’est encore plus méga classe ! ^^\r\nPeut-être rendez-vous à Sophia-Antipolis, ce serait super classe ! ^^', 2200, 2199),
(435, 1, 'Cher cher Léo,\r\nTes snapchat de \"où est caché le chat\" m\'ont manqués, je dois te l\'avouer, mais j\'espère qu\'ils se portent tous très bien, enfoui sous une pile de fringues, dans un coin de ton appart. ☺\r\nMerci surtout, pour avoir été le fournisseur que tu es! ;) \r\nJe souhaite plein de bonnes choses pour la suite.\r\nxoxo\r\nMichèle\r\n\r\nPS: un de ces 4, faudra quand même qu\'on refasse des gâteaux ensemble !! ☺', 2214, 2190),
(436, 1, 'Mon petit Max,\r\n\r\nTout d\'abord merci d\'avoir pu me supporter pendant un an de mandat. Merci pour toute ton aide, sans toi on n\'aurait pas pu porter ce BDE et cette équipe là où on l\'a fait. Mais en dehors du BDE j\'ai surtout rencontré un bon ami. Mes félicitations pour tout. Je te souhaite tout le bonheur et la réussite que tu mérites.\r\n\r\nGros bisous mon ami.', 2197, 2233),
(437, 1, 'LudoOooOOoOOOoOO !\r\nBon d\'abord, félicitation pour ton cdi chez CGI!! (ça fait beaucoup de c et de i …) \r\nEt puis sinon, j\'espère que tu passera de supers mois/années à Clermont avec la jolie Emilie (ne la délaisse pas pendant la coupe du monde hein?!!! :p ).\r\nEt j\'espère aussi que j\'aurai l\'occasion de te revoir en concert, histoire de rattraper mon statut de groupie ! ;)\r\nbisous bisous\r\nxoxo\r\nMichèle', 2214, 2237),
(438, 1, 'Petit message pépooouuuze au pro du Soulja Boy à l\'ISIMA.\r\nFélicitations pour ton diplôme, mais aussi un grand merci pour ton aide au sein du BDE et de la vie associative de l\'ISIMA. Côté personnel j\'ai également rencontré un bon ami avec qui j\'ai de très bons souvenirs pendant ces dernières années de vie étudiante.\r\n\r\nLa bise, et bon courage pour la suite mon grand :)', 2197, 2157),
(439, 1, 'Nom de Zeus Marty!!!\r\nAlors oui il me fallait une intro et je la trouve assez sympa..!\r\nJe viens à l\'instant d\'écrire sur le Yearbook d\'Anthony, je lui ai écrit la recette du limoncello. Décidément j\'ai rien compris à cette histoire de Yearbook..!\r\n\r\nM\'ennnnfin! Oui deux ans passés ensemble à faire des projets, parler de manière très énergique des accéléromètres, et après avoir MIS DES RACLEES A TOUT LE MONDE AU PING PONG !!!! C’est la fin d’année, et la remise des diplômes. C’est une belle page qui se tourne, mais une nouvelle qui s’ouvre et celle-là elle n’est pas faite en papier mâché !! ISIMA ce n’est qu’un début et on se reverra tous, que ce soit sur Skype et en vrai, pour des week-ends kayak et autre ! ^^\r\n\r\nJe te souhaite aussi le meilleur du meilleur, avec pleins d’application mobiles !! Le truc de fou !!!\r\nEt c’est là que je réalise, que l’idée de la clé 3G, c’est révolutionnaire !! Pourquoi me diras-tu ?\r\n\r\nHé bien c’est très simple. Prenons comme exemple, le cas d’Openium !! Ils ont envie de s’exporter à l’international car ils ont une très bonne activité (jusque-là, c’est tout à fait légitime !). Et là, ils souhaitant aller au Canada (je prends ce pays par hasard, mais vraiment pas hasard, vraiment… !). Et c’est là que tu te dis : MAIS je pourrais très bien y aller, et tenir le bureau du Canada !! Quelle bonne idée, oui mais voilà le HIC, un nouveau marché va s’offrir à ce moment-là suite à la fonte des glaces de l’Arctique. Du coup, une nouvelle activité va voir le jour, celle des entreprises dirigées par Mr. Manchus Pentapingus, directement et fondateur du groupe écologique « Nos igloos du monde », designer et constructeur de chambres froides… Du coup, leurs maisons se faisant la malle, et n’ayant pas la 3G, comment veut-tu qu’ils préviennent les autres ??? Personne n’est au courant !! L’entreprise fait faillite, ils ont besoin d’un leader, d’un nouveau souffle, et c’est là qu’Openium Canada Corp. Fait son entrée, en fournissant du 3G+ grâce à ses antennes relais distribuées sous forme de casques ventilateur à nos chers amis les Pingouins de l’Arctique.\r\n\r\n…. Je viens de tout relire et c’est n’importe quoi, j’aime bien ! ^^ Bonne continuation et à très bientôt ! ^^', 2200, 2219),
(440, 1, 'Au meilleur binône/ partenaire de goûter/ commentateur de beau gosse/ expert achats au meilleur prix,\r\nTu m\'as beaucoup beaucoup manqué au Canada!! Personne ne m\'apportait de dragibus ou de miellines en TP là bas ☹ (enfin, ça n\'est pas QUE pour ça que tu m\'a manqué hein! ;) )\r\nMais, bref, j\'espère que tu as passé une super année, et un super stage, et puis, inutile de souhaiter le meilleur pour la suite: je suis sûûûûûre à 100% que quoi que tu fasses, tu saura toujours te débrouiller comme un chef. \r\nJ\'ai hâte de te revoir à la RDD ☺ ☺\r\nxoxo\r\nMichèle', 2214, 2213),
(441, 1, 'Petit <3 !!!\r\nComme je regrette nos heures de japonais : entre l\'atelier coloriage et gribouillage, c\'était vraiment drôle! ☺\r\nBref, à ce qu\'il paraît tu veux retourner en Asie? Si jamais t\'à l\'occasion, passe nous voir en Nlle Calédonie: je te montrerais la plus grosse poule que t\'ai jamais vu! ;)\r\nxoxo\r\nMichèle', 2214, 2258),
(442, 1, 'Merci à toi pour ton message et pour tout ce que tu as fait pour tous les petits ZZs.\r\nLe plaisir a été partagé, tu as été un super Prezz et il faudra un moment avant qu\'une équipe arrive à la cheville des Grizzlys.\r\nJe te souhaites plein de bonnes choses pour la suite en espérant te recroiser à l\'avenir', 2237, 2197),
(443, 1, 'Mon pti Tristan !\r\nJe viens d’écrire à l’instant sur le Yearbook d’Anthony la recette du limoncello, et sur thibaut la théorie de la fonte des glaciers par Mr. Manchus Pentapingus, constructeur et designer de chambres froides et directeur de l’entreprise « Nos igloos du monde ».\r\nEt c’est là que je me dis que je n’ai pas compris le principe du Yearbook ! Bref !\r\n\r\nJe te souhaite aussi une bonne continuation, et j’ai passé de très bons moments en votre compagnie à tous à l’ISIMA ! Comme je le disais, ce n’est qu’un début et on sera amenés à de voir sur Skype et en vrai souvent. Un peu comme le KAYAKKKKK PAR EXEMPLE ???!!!!!!! N’EST-CE PAS ???!!!!!\r\n\r\nNan en fait je dis ça parce qu’il y a Pauline qui a dit aussi à Thibaut : « Nanana tu ne me dis jamais rien je ne savais pas que le kayak avait été prévu et que finalement il a été annulé, Thibaut tu me dis jamais rien, patati patata » (j’espère que personne d’autre ne lira ce message, sinon, je suis un peu mort… non ? NNAAAANNN c’est gentil tout ça ^^) Du coup voilà. (J’aime bien cette conclusion).\r\n\r\nEn tout cas félicitations, tu es devenu ingénieur, et tu as eu ton poste ! ^^ Une concrétisation de plus ! ^^ On est tous devenus ingénieur, ça c’est cool ! ^^', 2200, 2162),
(444, 1, 'Félicitations à toi aussi Mame !\r\n\r\nBonne continuation et de la réussite pour tout le reste en tant qu’ingénieur ! ^^\r\n\r\nA bientôt !', 2200, 2218),
(445, 1, 'Mon grand Maxoo/Chauvet, félicitation pour ce diplôme, mais aussi merci pour ton engagement associatif au sein de l\'école, que ce soit au sein du BDS avec ces évènements mémorables organisés, ou bien avec ISIMIX pour avoir endiablé les soirées au BDE. Sans rancune pour le WE ski j\'espère ? :P\r\nJ\'ai en tout cas été ravi de pouvoir te côtoyer pendant ces deux ans, et je te souhaite tout le bonheur et la réussite que tu mérites mon ami :)\r\n\r\nDes bisous !', 2197, 2243),
(446, 1, 'Hey salut !!\r\n\r\nFélicitations pout ton titre d’ingénieur ! Bonne continuations par la suite et pleins de bonnes choses ! ^^\r\nCe sera moins rigolo quand on devra aller chercher nos diplômes lorsqu’on aura affaire aux secrétaires : \r\n\r\n«  Bonjour, c’est pour QUOI ??????? Ah nan repassez demain hein là on est fermés jusqu’à ce que Christine revienne parce que c’est elle qui s’occupe de tout hein !! Moi je fais le café et je vous envoie chier c’est mon métier, nihahahHAHAHAHAHA ! »…. \r\n\r\nBref, de la rigolade bien sûr ;)\r\n\r\nA bientôt ! ^^', 2200, 2192),
(447, 1, 'Jiitééé!!\r\n\r\nFélicitations en tant qu\'ingénieur!! Et bonne continuation par la suite!! ^^', 2200, 2224),
(448, 1, 'Sacré Naouf ! \r\n\r\nBien joué pour le diplôme tu l\'as (presque) pas volé :-P  ahah\r\n\r\nBonne continuation et tu passes quand tu veux sur Isswèèère ! ;-)', 2169, 2151),
(449, 1, 'Mon cher Chauvet,\r\n\r\nENCOOOOOOREEE !!!!!!!!!!!!!!!!!!!! Ah que j\'adorai prendre du proto avec toi.. Te voir tout excité ! J\'ai jamais vu des jambes battre aussi vite de ma vie !!! T\'aurai pu faire un roulement de tambour avec !! \r\n\r\nJe me souviens encore de tes début sur LOL, ah que tu as bien progressé maintenant.. Tu me dépasserai presque en niveau parfois.. Mais tu feed encore beaucoup !! Et t\'es pas très bon en KS :) J\'espère encore geeker beaucoup avec toi parce que c\'est copain quand même !!! :)\r\n\r\nC\'est dommage qu\'on ait pas partagé la même passion du BDE, on aurait passé un peu plus de temps ensemble. Mais d\'un côté je t\'ai quand même assez vu comme ça ! :) Mix bien mon ptit Chauvet, j\'espère que tu seras mon DJ à mon mariage si jamais ça arrive un jour :)\r\n\r\nBisous à Agathe ! :) Et MEUUUUURRRSSS !!!!!!', 2221, 2243),
(450, 1, 'Bravo Laetis !\r\n\r\nDouble diplômée easy, t\'es vraiment une machine je dois bien l\'avouer :-)\r\n\r\nMerci pour tous les petits moments qu\'on a partagé et surtout pour tous les petits \"gossips\" de l\'ISIMA qui, sans toi, ne seraient surement jamais arrivés jusqu\'à mes oreilles mdr\r\n\r\nBonne continuation et bonne RDD !\r\nNicolas\r\nBisous\r\n\r\nPS : j\'aurais sans doute quelques derniers potins pour toi à la RDD ;-) du bien gratiné t\'inquiètes ahah', 2169, 2208),
(451, 1, 'Michèèèèèèèèèèèèèèèèèèèèèèèle!\r\nMerci pour ton message! :)\r\nJ\'espère te recroiser aussi souvent que possible parce que ça a vraiment été un plaisir de te côtoyer pendant cette année et demi (diantre aussi peu...).\r\nJe te souhaite plein de bonnes choses pour la suite!\r\nDes Bisous!\r\nLudo', 2237, 2214),
(452, 1, 'Bien joué mon petit Max !\r\n\r\nFélicitations pour ce diplôme qui nous a tant fait galérer (quand je repense à la ZZ1... #téééééééééééD\'Péééééééééé ;-) ) !\r\n\r\nOn se revoit quand tu veux (peut être au Michelin ?).\r\nTrès bonne continuation en tout cas et bonne RDD ! :-)\r\n\r\nNicolas', 2169, 2243),
(453, 1, 'Bravo Antho !\r\n\r\nTu l\'as clairement pas volé ce diplôme, une des machines de notre promo de F2 :-)\r\n\r\nBonne continuation et bonne RDD !\r\nLa bise !\r\n\r\nNicolas', 2169, 2199),
(454, 1, 'Yeaaaah bien joué pour le diplôme gros !\r\n\r\nC\'est le moment de s\'faire de la caillasse maintenant, du gros 90K par an svp :P ahah\r\n\r\nBonne continuation et bonne RDD Bobby The Night !^^\r\n\r\nNicolas', 2169, 2223),
(455, 1, 'Mon cher Max,\r\nMerci pour ton message! J\'espère te revoir régulièrement à Clermont et à nos concerts :)\r\nJe passerai surement régulièrement à Lyon si par hasard tu y es toujours.\r\nMerci pour les franches rigolade qu\'on a pu avoir pendant les cours de première années, pendant la campagne des CRAZY\'MAAAAAA et pendant toutes les soirées que l\'on a fait ensemble. :)\r\nJe te souhaites plein de bonnes choses pour la suite!', 2237, 2167),
(456, 1, 'Ma petit Maeva,\r\nÇa a été un véritable plaisir de te côtoyer pendant ces 3 ans et ton message me fait encore regretter de ne plus te croiser tous les jours.\r\nTu es quelqu\'un de génial et une super danseuse! (Emilie et moi avons hâte de voir ton passage à la télé! :) )\r\nJe n\'ai aucun regret pour Crazy\'Ma parce que c\'était quand même une super expérience et que ça m\'a permit de faire le WEI ce qui a été encore mieux parce qu\'on a pu bosser ensemble et qu\'on a tout déchiré cette fois!\r\nJe te souhaite plein de bonnes choses pour la suite!\r\nBisous,\r\nLudo', 2237, 2156),
(457, 1, 'Félicitations pour ton diplôme \"mec\" !\r\n\r\nMaintenant qu\'on en a fini, j\'espère ne plus jamais revoir ta tête, tu travailles où déjà ? :P\r\n\r\nBonne continuation et bonne RDD (te met pas trop mal au cocktail je te connais) ! :-)\r\nNicolas', 2169, 2217),
(458, 1, 'Cher Cyril,\r\n\r\nLe meilleur président BDE que je connaisse. On a été surpris d\'apprendre que ça allait être toi le prez; mais t\'as géré avec la tête bien sur les épaules, ou dans les toilettes. :P\r\n\r\nTu es ambitieux et ça te mènera loin, encore plus loin que les USA et le Canada. Mais je ne parle pas que de distance. ;)\r\n\r\nTu es un mec bourré de qualités, ne change pas. Et je ne parle pas que de ton don pour réaliser un festin de crêpes ! ^^\r\nBonne continuation là où tu auras décidé de te poser.\r\n\r\nBisous\r\nMaëva', 2156, 2197),
(459, 1, 'Félicitations pour ton diplôme! C\'était bien nos séances de piscine et de jeux vidéo, je regrette presque que l\'année soit finie :)\r\n\r\nAdrien J.', 2193, 2229),
(460, 1, 'Félicitations Tristan !\r\n\r\nBravo pour le diplôme et merci de m\'avoir raconté quelques unes de tes anecdotes \"pianistiques\" :-) je suis un peu moins nard en musique grâce à toi^^\r\n\r\nBonne continuation et bonne RDD\r\nNicolas', 2169, 2162),
(461, 1, 'Hello Cyril ! \r\n\r\nFélicitation pour ce diplôme ! En effet seulement 2 bonnes années passé en ta compagnie ... mais quelles années .... Passation BDE, les américains, le puy de dôme, le canoë, le WEI, le ski (sans rancunes t\'inquiète), la soirée mousse, et j\'en passe tellement il y en a ! Bref ce sera juste des moments inoubliable :D\r\n\r\nMerci aussi de nous avoir fait suivre tes road trips pendant ton stage et ton double diplôme. Tu nous en as mis plein les yeux et j\'espère que tu en as profité au max.\r\n\r\nA très bientôt j\'espère ... peut être au coin d\'un stade de rugby héhé :D\r\n\r\nEncore félicitation et bonne continuation pour la suite.\r\n\r\nDes bisous mon p\'tit Cyril !', 2243, 2197),
(462, 1, 'A mon jumeau de buffet et bouffe gratuite bonne continuation ! ;)', 2156, 2191),
(463, 1, 'Adrien est grand, Adrien est blond, Adrien aime rire mais surtout Adrien est un bosseur, très sérieux. C\'est un homme qui allie les gens grâce à son écharpe.\r\n\r\nDommage qu\'on ait as fait plus de soirées ensemble.\r\n\r\nBonne continuation à toi ! ;)\r\n\r\nBisous,\r\nMaëva', 2156, 2229),
(464, 1, 'Cher Corentin,\r\n\r\nOn a jamais été très proche mais cette dernière année a été l\'année on nous t\'avons perdu. Ce qui m\'a impacté; comme tous tes amis. L\'erreur est humaine mais sache que tes amis seront toujours là pour toi si tu les traite en tant que tel.\r\n\r\nJe garde tout de même de bons souvenirs de nos TPs où chacun participait à part égal. Moins les moments où toi et Mickaël me trolliez.\r\n\r\nJ\'espère que tu es heureux et que tu ne manque de rien.\r\n\r\nBisous,\r\nMaëva', 2156, 2203),
(465, 1, 'JT !\r\n\r\nJe ne te ferai pas de déclaration d\'amour, parce que personne ne serait crédule. Et pourtant mon amour est si puissant.\r\nTu as un don pour saouler les filles et surtout moi ! Fais-en bon usage.\r\n\r\nApparemment tu as ton diplôme ? Félicitations ! :P\r\n\r\nBonne continuation à toi,\r\nMaëva', 2156, 2224),
(466, 1, 'Hello mon p\'tit Bethel !\r\n\r\nENCOOOOOOOOOOOOORE ouiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiiii ! J\'espère bien qu\'on aura l\'occasion de se prtotiser tous ensemble. C\'était quand même bien cool. Tout comme ces brunchs ....\r\n\r\nEn tout cas félicitation pour ton diplôme. Il est vrai que quand je t\'ai connu en première année, jamais j\'aurais pensé que tu arrives jusqu\'ici :D vive les rattrapages \\o/. Toutes mes félicitations encore !\r\n\r\nEt oui c\'est vrai que j\'ai découvert LoL avec vous tous quand même. On s\'est bien marré quand même. Des bonnes grosses games jusqu\'à pas d\'heure :D Mais il y a toujours un moment ou l\'élève dépasse le maître ;) (#gold et ouiiii magueule).\r\n\r\nAller mec, j\'espère qu\'on pourra profiter de ces dernière soirée tous ensemble (color party au bde vendredi !) et qu\'on se fera de temps en temps des sorties (randonnées, parc d\'attraction et autre).\r\n\r\nDes bisous mon p\'tit adrien. MEMEMEMEUUuuuuuuuurrrRRRs !', 2243, 2221),
(467, 1, 'Aiiiigth mon p\'tit Nico.\r\n\r\nToutes mes félicitations à toi aussi pour ton diplôme. En effet que de souvenirs entre Aufrère, Lacomme, Duhammel, Mahey. Qu\'est-ce qu\'on se sera bien marré quand même !\r\n\r\nOn se refera bien des p\'tites soirées quand même. C\'était bien cool.\r\nOu au michelin of course.\r\n\r\nAller mec, encore toutes mes félicitations et bonne continuation.\r\nTchou bisous !', 2243, 2169),
(468, 1, 'Félicitations mon Valou !\r\n\r\nBravo pour le diplôme, j\'espère que la suite sera belle pour toi ! Ne m\'oublie pas pour la projection de ton premier film ahah d\'autant plus si ça se passe au festival du cour\' à Clermont :-) (on ne sait jamais, je te le souhaite en tout cas^^)\r\n\r\nBonne continuation et bonne RDD !\r\nNicolas', 2169, 2216),
(469, 1, 'Tristan,\r\n\r\nJe t\'admire. Tu es si calme, rayonnant, sûr de toi. Tu poses tes mains sur un piano et la musique se transforme en velours. Je ne te croyais pas quand tu m\'as dit gérer une école de musique. Que c\'est un impressionnant pour un mec de ton âge ! En plus de cela tu arrives à gérer l\'école et cartonner. Inhumain ? Je dirais plutôt passionné.\r\nLa passion est ce qui aliment l\'âme.\r\n\r\nTu t\'es révélé lors des derniers cours de communication. Porte parole actif d\'un groupe de musique ou participant horripilant d\'une réunion. Une nouvelle facette s\'offre à nous. Tu es plein de mystères.\r\n\r\nMerci d\'avoir partagé ma classe.\r\nBonne continuation.\r\n\r\nBisous,\r\nMaëva', 2156, 2162),
(470, 1, 'Cher Antoine,\r\n\r\nJe ne connais pas plus calme que toi. Tu es si discret mais quand tu prends la parole les mots sont les bons. A travers les TPs j\'ai découvert un homme rieur et quelque peu espiègle doté d\'une grande intelligence logique.\r\n\r\nDommage de ne pas avoir pris le temps de se connaître plus.\r\n\r\nBonne continuation,\r\nMaëva', 2156, 2155),
(471, 1, 'Félicitations pour le diplôme et bonne continuation Michèle !\r\n\r\nNicolas\r\nPS : Merci de m\'avoir fait découvrir \"The Spider Who Couldn\'t Hide\" (https://www.youtube.com/watch?v=rLw-9dpHtcU) :\')', 2169, 2214),
(472, 1, 'Yo,\r\n\r\nToi tu me fais peur. Mais au fond je sais que tu m\'aimes bien.\r\n\r\nBonne continuation dans le monde du travail !\r\nMaëva', 2156, 2217),
(473, 1, 'Alex, non pardon AleC,\r\n\r\nNous étions très proches en deuxième année. Tu t\'es casé et c\'était fini ! ^^ Même si notre relation était étrange c\'est dommage de s\'être perdu de vue. \r\n\r\nJe te souhaite le meilleur et surtout d\'arriver à gérer ton énervement :P\r\nTu le mérites, t\'es un mec génial. ( excepté que tu aimes les chats bahhhh )\r\n\r\nP.S : J\'attends toujours une soirée dansante avec toi et Mike. On fera ça quand vous me rendrez visite dans le Sud ?!\r\n\r\nBisous,\r\nMaëva', 2156, 2198),
(474, 1, 'Adrien,\r\n\r\nTu es si gentil, toujours à l\'écoute et un poil trop feignant pour bosser. :P Et j\'étais là pour te motiver !! Merci d\'avoir été un super binôme cette année. Sans toi mon année aurait été beaucoup plus triste. \r\n\r\nDonne moi régulièrement des nouvelles de toi. \r\n\r\nBonne continuation.\r\n\r\nBisous,\r\nMaëva', 2156, 2193),
(475, 1, 'Maha,\r\n\r\nNotre relation passionnelle a pris fin il y a quelques temps. Je ne regrette rien même si parfois tu me manques. J\'espère que tu es heureuse et que tu le resteras. \r\n\r\nEn souvenir de notre retour à pied du centre-ville et des heures de travail passées à la Cité 1.\r\n\r\nBonne continuation à toi,\r\nMaëva', 2156, 2510),
(476, 1, 'Daaaaaaviiiiiideeeeeeeeeeeuuuuh (on change pas une appellation qui marche hein? ;) )\r\n Toi aussi tu m\'a manqué, mon cher co-délegué: dommage que tu ne sois finalement pas venu au Canada ! Tabernak, ç\'ke ça aurait été l\'fun, sans niaiserie! Mais je suis aussi super contente pour toi, pour ta place chez Michelin. \r\nDonc du coup, au final (:p) je te souhaite que des bonnes choses, à toi qui es si gentil, généreux, et super top moumoutte !! ☺\r\nxoxo\r\nMichèle', 2214, 2368),
(477, 1, 'Carlos aux fraises, (hum que c\'est sexy)\r\n\r\nJ\'espère que tu es heureux et toujours aussi foufou. Tu égayes la vie tristounette de l\'ISIMA. Personne ne te comprend et c\'est peut-être mieux comme ça.\r\n\r\nNe change pas.\r\n\r\nBonne continuation,\r\nMaëva', 2156, 2241),
(478, 1, 'Raphy,\r\n\r\nLa première fois que je t\'ai vu, j\'étais avec Maxime et Vincent, assis sur le canapé devant le BDE. Tu es arrivé en parka en te présentant en tant que première année. Cela tombait bien nous aussi. Notre bande s\'est formé comme ça. Depuis les choses ont beaucoup changé. Je t\'apprécie plus :P et tu fais de grandes choses. Tu es ambitieux et tu ne t\'ennuies jamais. D\'autres choses n\'ont quant à elles pas changé : tu aimes toujours les parkas (dont la mienne), tu es toujours aussi avenant, et tu danses toujours comme ouf. A quand notre prochaine battle ?\r\n\r\nTu es génial, ne change pas.\r\n\r\nBonne continuation.\r\nBisous,\r\nMaëva', 2156, 2157);
INSERT INTO `yearbookmessages` (`id`, `yearbook_id`, `message`, `userFrom_id`, `userTo_id`) VALUES
(479, 1, 'Cher Yoann,\r\n\r\nTu es l\'homme le plus professionnel de la promo (et sûrement de l\'ISIMA). Toujours très carré dans tout ce que tu fais. Je t\'admire pour ça. J\'aimerais être comme toi. Tu as l\'air de réussir tout ce que tu entreprends. \r\n\r\nComme l\'ISIMA : Congrats même si on avait aucune peur pour toi.\r\n\r\nA bientôt à la RDD.\r\nBisous,\r\nMaëva', 2156, 2213),
(480, 1, 'Salut Nico !!\r\nShame on me de ne plus t\'avoir envoyé de petites vidéos: tu devais bien t\'ennuyer le matin, en cours de programmation de je ne sais pas quel compilateur, sans ton petit divertissement quotidien :p\r\nMais promis, je me remet au travail ;)\r\nSinon, félicitation à toi aussi, et j\'espère te revoir un de ces quatre !\r\nxoxo\r\nMichèle', 2214, 2169),
(481, 1, 'Jinpeng,\r\n\r\nGrâce à ce mot tu vas pouvoir travailler ton français. TU sais déjà tout ce que je pense de toi. Tu es mon frère, gentil, attentionné, intelligent, drôle et beau. :D\r\nVivement le TOEIC pour que tu te consacres totalement à l\'apprentissage du français. \r\n\r\nBravo pour ton diplôme et à très bientôt j\'espère.\r\n\r\nBisous,\r\nMaëva', 2156, 2523),
(482, 1, 'Jean, Jean , Jean,\r\n\r\nJean, je t\'adore, tu me fais marrer. Tu as l\'air si calme et posé alors qu\'en fait à l\'intérieur c\'est l\'explosion. Tu es un dieu en langues, dommage que tu te soit restreint au Limos. Tu pourrais faire tellement de choses. Parce que en plus en programmation tu sur-gères.\r\n\r\nEn souvenirs de votre super duo avec Carlos au Karaoké ( aïe mes oreilles !)\r\nMerci d’avoir été là pour me faire rire et me supporter.\r\n\r\nBonne continuation.\r\nBisous,\r\nMaëva', 2156, 2244),
(483, 1, 'Hello hello Raph!\r\nD\'abord, merci merci et encore merci de m\'avoir sauvé la vie l\'année dernière avec ce rapport. Sans toi j\'étais fichue!!\r\nEt puis, bien sûr, félicitation, et bonne continuation ☺\r\nxoxo\r\nMichèle', 2214, 2256),
(484, 1, 'Cher co-fillot,\r\n\r\nCette dernière année, on a pas eu l\'occasion de se voir fréquemment. C\'est dommage mais chacun avait des choses à faire. Merci d\'être venu voir mon spectacle. :) Je te verrai aussi pour le prochain ? :P\r\n\r\nTu es adorable, ne change pas.\r\n\r\nBonne continuation.\r\nBisous,\r\nMaëva', 2156, 2189),
(485, 1, 'À toi, mon cher Paul, je n\'ai qu\'une seule phrase, qui je pense saura tout résumer:\r\n\r\nMay the force be with you.  ;)\r\n\r\nxoxo\r\nMichèle', 2214, 2176),
(486, 1, 'Félicitation Yun !\r\n\r\nBonne continuation à toi.\r\nJe te souhaite le meilleur.\r\n\r\nBisous,\r\nMaëva', 2156, 2181),
(487, 1, 'Maxime,\r\n\r\nSouris à la vie et la vie te sourira. Cette citation te définit bien. Merci d\'avoir organisé l\'accrobranche qui m\'a rapproché de vous. Tu sais être assez sociable pour connaitre et rassembler tout le monde.\r\n\r\nNe change pas mais change de musique ( marre de l\'électro :P )\r\n\r\nBonne continuation,\r\nMaëva', 2156, 2243),
(488, 1, 'Bonne continuation, je te souhaite plein de succès! \r\nEt de bonheur! \r\nEt d\'argent! (Mais est-ce vraiment nécessaire?)', 2244, 2218),
(489, 1, 'Chère Maëva,\r\n\r\nFélicitations pour le diplôme ! T\'as \"plus qu\'à\" gérer MCDT et ce sera l\'année du grand chelem pour toi ahah :-) Bien entendu, j\'espère avoir une place de choix lors des \"primes\" à Paris :P et je ne vais peut être pas rester à Clermont toute ma vie, il ne faut pas exagérer non plus^^ disons que ce sera le point de départ de mes futures aventures :-D \r\n\r\nEn tout cas, si la capitale arverne te manque un jour, tu seras toujours la bienvenue dans mon humble demeure (ou dans celle de mes parents si jamais je pars^^).  Quant à moi, si j\'ai besoin d\'une cure de soleil, je sais vers qui me tourner ;-)\r\n\r\nBonne continuation à toi et que le Dieu de la danse te porte ces prochains jours !\r\nBonne RDD :-)\r\nBisous\r\n\r\nNicolas', 2169, 2156),
(490, 1, 'Alexxxxxxxx,\r\n\r\nQuand je te coupe les cheveux ? :P\r\n\r\nTu es un mec adorable, gentil, intelligent, beau. Reste plus qu\'à trouver une fille. Pour cela, pourquoi ne pas se décoller des soirées entre potes et s’ouvrir à la gente féminine. Je te verrais très bien en train de danser la salsa. Je dis ça je dis rien. \r\n\r\nFélicitation pour ton diplôme, les doigts dans le nez ?\r\n\r\nJe ne te souhaite que le meilleur : réussite, surprises, amour, amis fidèles, santé et bonheur.\r\n\r\nEn souvenir du tournage de notre court-métrage.\r\n\r\nBisous,\r\nMaëva', 2156, 2258),
(492, 1, 'Christelle,\r\n\r\nTu as été ma compagnie féminine en première année et rien que pour ça je te dis Merci ! Parce que, être dans une école de mecs c\'est dur. Parfois il faut un soutien féminin. La confrontation de nos deux caractères n\'as pas était simple à gérer. Et c\'était pire lorsque Corentin et Anaël s\'en mêlaient. Malgré cela, il y a beaucoup de rires, de discussion philosophique ou pas et de partages. Tu mènes ta vie de façon tellement méticuleuse. Je t\'admire pour ça. Je pensais être perfectionniste et tu m\'a montré que non.  \r\n\r\nTu n\'as malheureusement pas pu nous montrer toute l\'étendue de ton talent de chanteuse. Il faudra refaire une soirée karaoké !\r\n\r\nTu es destinée à faire de grandes choses, j\'en suis persuadée.\r\n\r\nBonne continuation.\r\n\r\nBisous,\r\nMaëva', 2156, 2248),
(493, 1, 'Louis,\r\nToutes mes félicitations pour ton diplôme. Je garderai de bons souvenirs des cours, TPs, soirées et parties de tarot passés ensemble.\r\nJe te souhaite une bonne continuation dans le travail et beaucoup de bonheur dans ta vie.\r\nAu plaisir de se revoir,\r\nAntoine.', 2155, 2161),
(494, 1, 'Salut Richou,\r\nFelicitations pour ton diplome et bonne continuation ! :)', 2257, 2186),
(495, 1, 'Nicolas,\r\nToutes mes félicitations pour ton diplôme. Merci aussi pour ces trois années passées en binôme où on a pu gruger sur certains projets, en terminer d\'autres à l\'arrache et tout donner sur ceux qui nous motivait.\r\nJ\'espère qu\'on pourra garder contact !\r\nEncore toutes mes félicitations, je te souhaite plein de réussite et de bonheur dans ta vie.\r\nAu plaisir de se revoir, autour d\'une bière, d\'un repas et/ou de Champagne,\r\nAntoine.', 2155, 2169),
(496, 1, 'Sacré mr El Haddad ^^\r\nGG pour le diplome, bonne continuation ! et ne fais pas la fete tous les soirs, garde un peu la forme pour le reste :D', 2257, 2177),
(497, 1, 'Florian,\r\nToutes mes félicitations pour ton diplôme. Merci pour les cours ennuyeux qui l\'étaient un peu moins grâce à tes dessins, aux soirées, aux parties de tarots et aux vacances au ski.\r\nJe te souhaite beaucoup de réussite et de bonheur dans ta vie.\r\nAu plaisir de se revoir,\r\nAntoine.', 2155, 2153),
(498, 1, 'Salut mon ptit Adrien,\r\net oui vive la F5 ^^, felicitations pour le diplome et bonne continuation pour la suite. \r\nL\'esprit de la licorne rose, qui a une belle criniere de fibres optiques arcenciels, veillera toujours sur toi :p', 2257, 2221),
(499, 1, 'Stéphanie,\r\nFélicitations pour ton diplôme, tu t\'es battue pour l\'avoir et tes efforts ont payé. Ton intelligence et ton courage t\'ont menée jusqu\'ici et te porteront encore dans tout ce que tu entreprends.\r\nJ\'espère que la route à venir sera douce, remplie de bonheur et de réussites.\r\n\r\nMerci pour tous ces souvenirs, merci pour ce que tu as su voir en moi et merci d\'avoir changé ma vie.\r\nAu plaisir de se revoir et d\'avoir de tes nouvelles.\r\nAntoine.', 2155, 2245),
(500, 1, 'Coucou ma grande,\r\n\r\nTout d\'abord félicitations pour ton diplôme et ton offre d\'embauche !\r\nMerci pour tous ces bons moments passés ensemble ces dernières années, que ce soit en tant que talentueuse trésorière du BDE, à croire au financement de gros projets ou à freiner certaines ardeurs, ou surtout et tout simplement en tant qu\'amie.\r\n\r\nJe te fais de gros bisous, et ne peux que te souhaiter le meilleur pour la suite :)', 2197, 2220),
(501, 1, 'Binôme de projet !\r\n\r\nFélicitation pour ce diplôme. J\'espère que tout va bien pour toi et que tu as trouvé (va trouver) un boulot qui te plait. En souvenir de cette délicieuse gestion de temporalité de soin,  je te souhaite plein de bonheur et de réussite pour la suite !\r\n\r\nLa bise :)', 2197, 2211),
(502, 1, 'Mon ptit Ben ! \r\n\r\nFranchement, t\'es pas une merde, ni une belle merde, mais une vieille merde :) En souvenir (ou non) de toutes ces bonnes bières bues ensemble, ces soirées où tu finissais toujours propre (et laissais les lieux propres), ces cours et TPs passés ensemble, ces Macdos et j\'en passe, je te souhaite plein de bonnes choses pour la suite. Et félicitations pour ce diplôme, you made it !\r\n\r\nDes bisous :)', 2197, 2098),
(503, 1, 'Maxime,\r\n\r\nMon franco-vietnamien préféré. Le bogoss de la classe de chinois et de la Chine apparemment. :P Je suis triste de t\'avoir perdu en fin de première année (surtout à cause d\'une fille) et content de t\'avoir retrouvé en troisième année. J\'ai du mal avec le fait que tu n\'agis que par nécessité mais à part ça tu es génial. Ah si y a aussi le fait que t\'es hypra casanier.\r\n\r\nLe premier jour de la rentrée, je me suis assise à côté de toi et nos destins se sont liés. Pas de chichis entre nous, mais une réelle connexion. On se comprend.\r\n\r\nJ\'espère ne plus te reperdre. Te reverrai-je danser ?\r\n\r\nBonne continuation, tu es le bienvenu dans le Sud.\r\nBisous,\r\nMaëva', 2156, 2172),
(504, 1, 'Valou,\r\n\r\nLe foufou dans sa bulle de la bande. Tu es as une personnalité passionnante. Pas toujours facile le matin avant le café, tu es bourré de créativité et de sensibilité. Je suis triste qu\'on se soit perdu de vue. Merci pour ta participation à Crazy\'Ma, sans toi on aurait galéré pour les vidéos de promotion. Et Merci pour le show et les vidéos de mon premier spectacle. Ta blague reste gravée dans les annales. Dommage que tu n\'aies pas pu venir à la session 2015 ! \r\n\r\nFélicitation pour ton diplôme, tu le mérites. Je sais que ça a été difficile.\r\n\r\nEn souvenir de toi en train de danser sur Do the mobot. ^^\r\n\r\nOn se voit à la RDD ;)\r\n\r\nBonne continuation et donne des news.\r\nBisous,\r\nMaëva', 2156, 2216),
(505, 1, 'Maxime,\r\n\r\nHeureuse que tu aies été là pendant ces 3 années pour mettre l\'ambiance, avec tous les autres Grizzly. Garde le smile et continues à faire autant de choses. T\'es sûrement le meilleur danseur de la bande (mais le dis pas). T\'as tout pour toi quoi ! ;)\r\n\r\nBonne continuation et à la RDD.\r\n\r\nBisous, \r\nMaëva', 2156, 2233),
(506, 1, 'Que de souvenirs...\r\nOn dirait bien que nos multiples collaborations ont portées leurs fruits!\r\nA très vite, pourquoi pas au détour des allées Paul Riquet un week-end de 15 Aout ; )\r\nLa bise vieux fou !', 2369, 2368),
(507, 1, '** chuchotements **\r\nSalut copain,\r\nça ping ?\r\nTes mobilisations générales en veilles de partiels, emplies de désespoir ô désespoir, resteront dans ma mémoire pour longtemps ; )\r\nTe côtoyer fut un vrai plaisir ! A très vite !\r\n\r\n                                                    /\r\n                                                  .7\r\n                                       \\       , //\r\n                                       |\\.--._/|//\r\n                                      /\\ ) ) ).\'/\r\n                                     /(  \\  // /\r\n                                    /(   J`((_/ \\\r\n                                   / ) | _\\     /\r\n                                  /|)  \\  eJ    L\r\n                                 |  \\ L \\   L   L\r\n                                /  \\  J  `. J   L\r\n                                |  )   L   \\/   \\\r\n                               /  \\    J   (\\   /\r\n             _....___         |  \\      \\   \\```\r\n      ,.._.-\'        \'\'\'--...-||\\     -. \\   \\\r\n    .\'.=.\'                    `         `.\\ [ Y\r\n   /   /                                  \\]  J\r\n  Y / Y                                    Y   L\r\n  | | |          \\                         |   L\r\n  | | |           Y                        A  J\r\n  |   I           |                       /I\\ /\r\n  |    \\          I             \\        ( |]/|\r\n  J     \\         /._           /        -tI/ |\r\n   L     )       /   /\'-------\'J           `\'-:.\r\n   J   .\'      ,\'  ,\' ,     \\   `\'-.__          \\\r\n    \\ T      ,\'  ,\'   )\\    /|        \';\'---7   /\r\n     \\|    ,\'L  Y...-\' / _.\' /         \\   /   /\r\n      J   Y  |  J    .\'-\'   /         ,--.(   /\r\n       L  |  J   L -\'     .\'         /  |    /\\\r\n       |  J.  L  J     .-;.-/       |    \\ .\' /\r\n       J   L`-J   L____,.-\'`        |  _.-\'   |\r\n        L  J   L  J                  ``  J    |\r\n        J  