(508, 1, 'J\'espère que le libérateur va bien !\r\nJuste un petit mot pour te dire que tu resteras à jamais mon pilote d\'hélicoptère préféré : )\r\nA très vite dans le chaudron !', 2369, 2158),
(509, 1, 'Monsieur le Président je veux te dire Merci,\r\nLes souvenirs sont nombreux depuis le G32,\r\nEt il serait heureux que ce ne soit pas fini !', 2369, 2233),
(510, 1, 'Cher Florian,\r\nTe côtoyer  ces trois années fut un vrai plaisir,\r\nJe te remercie de nous avoir supporté, moi et mon incompétence technique ; )\r\nA très bientôt je l\'espère !', 2369, 2171),
(511, 1, 'Bravo Lætitia pour ton diplôme, et pour avoir contribué au projet secret de colonisation de l\'ISIMA par les Moulinois :) \r\nJe ne doute pas que nos routes se croiseront à l\'avenir, à Moulins, à Clermont, à Toulouse ou ailleurs.... qui sait ?\r\n\r\nJe te souhaite le meilleur pour la suite et à bientôt !', 2213, 2208),
(512, 1, 'Hola guapa!\r\n\r\nBravo pour ton diplôme et pour avoir eu la courage de partir étudier un an à Barcelone :)\r\nJ\'espère bien qu\'on aura l\'occasion de se revoir, à Barcelone ou ailleurs, pour partager de bons moments de convivialité !\r\n\r\nA bientôt,\r\nYoann.', 2213, 2166),
(513, 1, 'Monsieur Michelin, une petite fable pour fêter votre diplôme ;)\r\n\r\nMaître David, sur sa chaise perchée,\r\nTenait en sa main un briquet,\r\nMaître Yoann, par les flammes affolé,\r\nlui tint à peu près ce langage : \r\n\"Hé! Bonjour,  Monsieur Santiago,\r\nQue vous êtes joli ! Que vous me semblez chaud !\r\nSans mentir, si votre lourdeur,\r\nse rapporte à votre grandeur,\r\nVous êtes le Phénix du BDE de l\'ISIMA\".\r\nA ces mots David, ne se sent pas de joie ;\r\nEt pour applaudir de ses dix doigts,\r\nOuvre grand sa main et lâche son briquet.\r\nYoann s\'en saisit, et dit : \"Mon bon Monsieur,\r\nPas d\'incendie ici, ce n\'est pas l\'heure\r\nLes seules flammes dont je n\'ai peur\r\nSont celles de votre cuisine au curry :\r\nCette leçon vaut bien un briquet, mon ami.\"\r\nDavid, honteux et confus,\r\nJura, mais un peu tard, qu\'on ne l\'y prendrait plus.\r\n\r\nJ\'espère que la morale est la bonne, et que tu ne finiras pas en prison pour avoir mis le feu aux Carmes ;) \r\nMerci pour tout mon loulou !\r\n\r\nBisous bisous,\r\nYoann.', 2213, 2368),
(514, 1, 'Merci pour ces deux années pleines de parties et de bons moments. Je n\'oublierai pas les bons conseils donnés en cuisine et surtout que la tomate diminue l\'énergie magique.', 2314, 2222),
(515, 1, 'E-L H-A-D-D-A-D ! Jpense j\'oublierai jamais l\'orthographe ! \r\n\r\nPermet moi de te féliciter à mon tour pour ton diplôme ! \r\n\r\nJe te souhaite une bonne continuation mon gars ! La bise', 2185, 2177),
(516, 1, 'Il est là le coloc ! \r\nMême si l\'appart était grave petit j\'ai GAVAIS kiffé ces 6 mois avec un breton pure souche. \r\n\r\nC\'est dommage que tu n\'es pas pu venir au sun ska c\'était énorme ! Pour mon premier festoche j\'ai vraiment pas été deçu !\r\nD\'ailleurs dès que les choses se seront posées de mon côté je me déplacerai vers chez toi pour découvrir le festival Breton !\r\n\r\nFélicitation pour le diplôme grosse machine ! On se voit autour de la même table à la RDD, la bise, et à bientôt !', 2185, 2210),
(517, 1, 'Merci Mame ! =)\r\n\r\nJe me permet de te retourner les félicitations hehe ! On va pouvoir jeter les chapeaux samedi !\r\n\r\nJe te souhaite une bonne continuation camarade F5 ! Que le ping soit avec toi !', 2185, 2218),
(518, 1, 'Haaaaaa monsieur Berthel ! Alors ça ping ?! (un peu deçu de ne pas trouver dans le roman que tu m\'a écris ce que tu avais instauré si brillamment =P )\r\n\r\nTu me vois ravi d\'avoir réussis à faire rire quelqu\'un avec mes infortunes =P\r\n\r\nMême si personnellement je n\'ai pas respecté le dicton : qui aime bien châtie bien,  j\'ai quand même bien kiffé ces trois ans d\'oppression berthelienne...les zombies, les Lol, les randos, le wei et j\'en passe...\r\n\r\nJe crois pas me tromper en disant que tu es quelqu\'un sur qui on peut compter et ça c\'est quelque chose que je salue ! \r\n\r\nOn se voit à la même table à la RDD pour les moment de gêne ! =P\r\nJe te souhaite le meilleur pour la suite et tu seras grave le bienvenu à Bordeaux dès que l\'occasion se présente ! \r\nLa bise !', 2185, 2221),
(519, 1, 'Cricri ! (flemme de mettre les h)\r\n\r\nJe te félicite pour ce beau diplôme !\r\n En espérant que tout roule de ton côté, je te souhaite une bonne continuation\r\n\r\nF5 un jour, F5 toujours ! La bise gars !', 2185, 2257),
(520, 1, 'Ah ce cher Romain Fouuuuuuuuuubert ! Ca ping ou quoi ?!\r\nJe pense que tu resteras le mec qui est allé au tableau de la manière la plus injuste qui soit ! \r\n\r\nCes années en ta compagnie ont été gavées kiffantes ! \r\n\r\nJe te souhaite de bien creuser ton trou chez les rosbeefs avec ta chère et tendre ! \r\n\r\nF5 un jours, F5 toujours! La bise gros !', 2185, 2189),
(521, 1, 'Hello et merci pour le message !\r\nBravo à toi aussi, je pense qu\'on se reverra dans un autre contexte que scolaire ;)\r\n\r\nPour les secrétaires, j\'imagine bien \"Mais monsieur je ne vous connais pas qui êtes vous ? Vous avez une carte d\'étudiant ? Ah vous n\'êtes pas étudiant ? Il faut remplir un dossier d\'inscription alors, sinon vous n\'avez rien à faire ici, c\'est un secrétariat d\'école !\" et c\'est comme ça que pour avoir notre diplôme il faudra se réinscrire pour 3 ans :p heureusement, ils n\'auront sans doute plus de formulaires d\'inscription, et ce sera fermé vu l\'heure ! Vive l\'administration !\r\n\r\nBonne continuation ;)', 2192, 2200),
(522, 1, 'Félicitation pour ton diplôme !\r\n\r\nJe garde de très bon et nombreux souvenirs de moments passés ensemble durant ces trois années, de la difficile première année à nos repas au RU et au restaurant durant le stage de fin d\'études, en passant par les soirées Pixel... Impossible de tout énumérer ici !\r\n\r\nBonne chance pour la suite, et au plaisir de te revoir très bientôt !', 2234, 2225),
(523, 1, 'Félicitation pour ton diplôme, ami pixelisé !\r\n\r\nDe très bon souvenirs ensemble, notamment lors des soirées de Pixel autour de bonnes pizzas !\r\n\r\nBonne chance pour la suite, et au plaisir de te revoir très bientôt !', 2234, 2192),
(524, 1, 'Félicitation pour ton diplôme !\r\n\r\nJe garde de très bon et nombreux souvenirs de moments passés ensemble durant ces trois années, de la difficile première année à nos repas au restaurant durant le stage de fin d\'études, en passant par les soirées Pixel... Impossible de tout énumérer ici !\r\n\r\nBonne chance pour la suite, et au plaisir de te revoir très bientôt !', 2234, 2122),
(525, 1, 'Félicitation pour ton diplôme !\r\n\r\nJe garde de très bon et nombreux souvenirs de moments passés ensemble durant ces trois années, de la difficile première année à notre fameuse nuit blanche marathonienne passée à rédiger nos rapports de projet de deuxième année, en passant évidemment par les soirées Pixel... Impossible de tout énumérer ici !\r\n\r\nBonne chance pour la suite, et j\'espère te revoir très bientôt !', 2234, 2152),
(526, 1, 'Félicitation !\r\n\r\nCe fut un plaisir de bosser ensemble en F5 grâce notamment à l\'entraide et à la collaboration que tu as su initier via le Drive par exemple :). Merci pour cela !\r\n\r\nVive la F5, bonne continuation pour la suite, et au plaisir de te revoir !', 2234, 2221),
(527, 1, 'Félicitation pour le diplôme !\r\n\r\nCe fut un plaisir de bosser avec toi, que ce soit par exemple sur les TP de F5 ou le projet de ZZ2. Je me souviendrai longtemps entre autres de cette longue nuit blanche marathonienne et finalement plutôt sympathique passée à rédiger le rapport de projet :)\r\n\r\nVive la F5, bonne continuation pour la suite, et au plaisir de te revoir !', 2234, 2257),
(528, 1, 'Hello JonJon :)\r\nFelicitations pour le diplome, merci pour ces 3 ans, bonne continuation et à la prochaine j\'espère :)', 2257, 2185),
(529, 1, 'Félicitations pour ton diplôme! Et merci de m\'avoir motivé quand c\'était nécessaire :)\r\n\r\nBonne continuation à toi aussi.\r\n\r\nAdrien J.', 2193, 2156),
(530, 1, 'Moi aussi je trouve que t\'es une vieille merde. Je me souviendrais longtemps de ton vol de projet de 1ère année. Et du MacDo de 6h du mat\'. Et Isimalt te remercie pour les services que tu as rendu!\r\nToi c\'est pas un vol de diplôme mais presque. T\'as juste géré en allant aux USA, mais je déteste de nous avoir abandonné! L\'important c\'est que tu reviennes.', 2098, 2197),
(531, 1, 'Il y a toujours une raison pour un RQB. Ca a souvent pris la forme d\'un David Santiago sauvage, c\'est tout.\r\nJ\'espère que ta carrière à Michelin va t\'amener à diriger l\'entreprise. Ca fait longtemps qu\'il n\'y a pas eu de Monsieur Michelin a la tête de la boîte.', 2098, 2368),
(532, 1, 'Ô Connard, Ô Salop, tu vas prendre cher, très cher.\r\nComme ta mère.\r\nSur Chatroulette.\r\nElle fait un show avec la mienne.\r\nMais elle va pas tarder à RQMB.\r\n\r\nJe suis pas un mauvais président Isimalt, c\'est juste que je délègue beaucoup. Et puis tu fais ça tellement bien que je pouvais pas t\'en priver.\r\nEt t\'as intérêt à atteindre les 42 ans... et les miens aussi. Sinon j\'irais gerbé sur ta tombe! De toute façon je le ferais quand même. Et toi aussi j\'espère.', 2098, 2077),
(533, 1, 'Copain de projet! On a bien vendu des tapis :) Tes oreilles me manquent!', 2098, 2157),
(534, 1, 'T\'es beau JT!', 2098, 2224),
(535, 1, 'Je te déteste toujours depuis que les gars de l\'ASM sont venus à CGI. A part ça... Je sais que tu vas envoyé du lourd mais pas grand chose de plus.', 2098, 2237),
(536, 1, 'Copain!', 2098, 2200),
(537, 1, 'Félicitations, fillot!', 2098, 2212),
(538, 1, 'Coucou Anthony! Bonjour Anthony!', 2098, 2199),
(539, 1, 'Félicitations pour ton diplôme David ;)', 2098, 2122),
(541, 1, 'Ta photo Anelis est bien trop swag. Et tu joues de l\'ocarina mieux que Link!', 2098, 2162),
(542, 1, 'Mon ptit Yoann. Quand est-ce que tu fais de la politique? Parce que t\'as des idées plutot pas mal et t\'es un orateur (^^) hors-pair!', 2098, 2213),
(543, 1, 'Félicitations pour ce vol de diplome :)', 2098, 2240),
(544, 1, 'Chauveeeeeeex!!!', 2098, 2243),
(545, 1, 'Merci. Grâce à toi j\'ai eu mon diplôme!', 2098, 2227),
(546, 1, 'Ils donnent le diplôme à n\'importe qui... Je me sens moins seul, merci. Va falloir rendre Mickael fier de nous parce que sans lui pas de diplome.', 2098, 2113),
(547, 1, 'Mon petit Erwan,\r\n\r\nComment décrire notre magnifique relation en première année ?\r\nPas facile même si le résultat fu magnifique : 15/20 en projet alors qu\'on a modifié une ligne de code ^^\r\nJ\'ai vu que tu étais pris à Lyon, chez les traitres, mais bon j\'y serais peut-être aussi qui sais !\r\n\r\nBonne chance pour la suite et encore merci pour le projet ;)', 2158, 2369),
(548, 1, 'Joli vol de diplôme! Sinon ces 4 années furent fun. Nos duels au baby vont me manquer. Et je te rappelle que j\'aurais du te passer sous le baby avec Flo Rotagnon (toi t\'étais avec Flo Tanré), mais vous aviez triché comme des gros sales! C\'est obligé tu triche aussi à la boxe de comptoir! Parce que tu es trop fort!', 2098, 2121),
(549, 1, 'Salut Max !\r\n\r\nCe stage de ZZ2 ainsi que le projet tuteuré de ZZ3 étaient vraiment intéressants et nous avons pu passer de bons moments ensemble :) Je me rappellerai longtemps de ton incident sportif :P\r\n\r\nJe te souhaite une excellente réussite dans la suite de tes projets professionnels !\r\n\r\nJ\'espère te revoir très vite autour d\'une bière ou d\'un pastis !\r\n\r\nAnthony', 2199, 2167),
(550, 1, 'Je crois que *baaaahhhh* est le terme le plus adapté à la situation actuelle :P\r\nSinon, je te souhaite une bonne réussite dans tes projets professionnels !\r\nA bientôt :)', 2199, 2079),
(551, 1, 'Salut Nico !\r\nToutes mes félicitations, car toi non plus, tu n\'as pas volé ce diplôme !\r\nJe te souhaite une excellente réussite dans tes projets professionnels !', 2199, 2169),
(552, 1, 'Maëva avec un tréma,\r\n\r\nTu es l\'une des rares personnes à pouvoir s\'amuser dans le cadre de la vie quotidienne et du travail. Et ça, c\'est pas mal.\r\nJ\'espère que tu es très heureuse, et que tu réussiras ta triple-vie d\'ingénieur informatique, de danseuse et de bombe atomique !\r\n\r\nBonne continuation,\r\nCarlos aux fraises', 2241, 2156),
(553, 1, 'Oh Alexis,\r\n\r\nEternel binôme de projet ou de toutes autres conneries, comment oublier ces snapchat controversés ou ces vendredis après-midi consacrés à OSS117 ?! \r\nIl faut l\'avouer, tu m\'as relativement fait chier pendant 2 ans ! Même si bon je l\'admets, je n\'ai pas été de tout repos non plus. J\'espère que tu me pardonneras, j\'aurai dû enregister le rapport de projet de 2eme année avant qu\'on change de poste (#Sharelatex) ^^\r\n\r\nSi on se retrouve dans la même ville pour travailler, sache que j\'ai du coup très peur pour notre avenir ! \r\n\r\nEnfin, je conclurai ce message par une citation de l\'inébranlable philosophe du 92 izi, qui s\'appliquera à nous je l\'espère:\r\n\"Moi et mes kheys on part sur la Lune, amuse-toi bien en Meurthe-et-Moselle/Ma question préférée : qu\'est-ce j\'vais faire de tout cet oseille ?\"', 2158, 2090),
(554, 1, 'Heyy salut Benoit!! \r\n\r\nFélicitations toi aussi, nous sommes tous ingénieur! ^^', 2200, 2098),
(555, 1, 'Hey salut stephanie!!\r\n\r\nFélicitations pour le titre ingénieur ! ^^', 2200, 2245),
(556, 1, 'Hey félicitations pour le titre ingénieur!^^', 2200, 2175),
(557, 1, 'Hey salut Erwan!\r\nFélicitations pour le titre ingénieur ! ^^', 2200, 2369),
(558, 1, 'Hey salut quentin!\r\n\r\nFélicitations pour le titre ingénieur ! ^^', 2200, 2210),
(559, 1, 'Hey salut !\r\nFélicitations pour le titre ingénieur ! ^^', 2200, 2179),
(560, 1, 'Salut flo!\r\n\r\nFélicitations pour le titre ingénieur ! ^^', 2200, 2153),
(561, 1, 'Hey salut ! \r\nFélicitations pour le titre ingénieur ! ^^', 2200, 2225),
(562, 1, 'Hey salut ! \r\nFélicitations pour le titre ingénieur ! ^^', 2200, 2207),
(563, 1, 'Félicitations à toi aussi, partenaire de TP de ZZ1 ;-)', 2175, 2200),
(564, 1, 'Laëtitia !\r\nUn rire et une joie imperturbables, surtout reste comme ça ! Félicitation pour ce diplôme, je te souhaite le meilleur pour la suite :)\r\n\r\nGros bisous !', 2197, 2208),
(565, 1, 'Mon cher Ben,\r\nCela m\'attriste grandement que tu n\'aies pas été présent pour ce truc de ouf ^^ \r\nJe te souhaites une bonne continuation et j\'espère pouvoir continuer à te croiser aux events de l\'ISIMA', 2237, 2098),
(566, 1, 'Cyril,\r\nJ\'espère que tu auras bien profité de cette dernière année mais je pense connaître la réponse ;) Je te souhaite plein de bonnes choses pour la suite cher président :) \r\nBisous,\r\nLaetitia', 2208, 2197),
(567, 1, 'Oh Valentin,\r\n\r\nUn sacré binôme de projet que ce Wallay Billay! Qu\'aurais-je fait sans toi pendant ces deux ans en filière? Je me dois de te remercier pour tous ces fous rires et tous ces moments passés en ta compagnie petit coquin!\r\nJe te pardonne bien évidemment le coup du projet de 2ème année, ça me fait bien marrer quand j\'y repense haha. Et puis tu n\'es pas étranger au fait que j\'ai eu mon diplôme, c\'est sûr! Ça va que c\'est compensé par les leçons de tennis du jeudi matin ^^\r\n\r\nEt si on se retrouve dans la même ville, je pense qu\'au dessus il n\'y aura que le soleil pour commencer et que comme le dit un autre poète français du 21ème siècle :\r\n\"Du biff faut qu\'j\'en gagne, qu\'j\'m’arrache à Dubaï\r\nJ\'pisse du champagne viens boire a la bouteille\"\r\n\r\n#BonjourBonjour #RenéCoty #IlSagiraitDeGrandir #LIN', 2090, 2158),
(568, 1, 'Coucou Lauryanne,\r\n\r\nFélicitation pour ce diplôme, je suis ravi de t\'avoir fait ta rencontre à l\'ISIMA et te souhaite plein de bonnes choses pour la suite :)\r\n\r\nGros bisous !', 2197, 2188),
(569, 1, 'Mon cher David,\r\n\r\nMerci pour ta bonne humeur, ton humour et ton dévouement!!! Tu es quelqu\'un de super, et je suis très heureuse d\'avoir fait ta connaissance! Je te souhaite plein de bonheur et de réussite dans tes projets pro, mais aussi et surtout dans ta vie perso! \r\n\r\nGros bisous,\r\nLauryanne', 2188, 2368),
(570, 1, 'Salut Cyril,\r\n\r\nFélicitations pour ton diplôme!!!! J\'espère que tu as bien profité de tes nombreux voyages!!!! Chanceux va! :p\r\nJe te souhaite plein de bonheur et de réussite dans tes projets professionnels, et dans ta vie en général! \r\n\r\nGros bisous,\r\nLolo\r\n\r\nPS: c\'était super de t\'avoir comme président! ;)', 2188, 2197),
(571, 1, 'Hello Maëva !\r\n\r\nToutes mes félicitations pour ce diplôme. C\'était un plaisir de partager ces 3 années avec toi (soirée, brunch au jardin, accrobranche ...).\r\n\r\nEn effet un DJ reste quand même sur ces préférences. Mais les animations de mariage me font changer de musique héhé.\r\n\r\nEncore félicitation et bonne continuation !', 2243, 2156),
(572, 1, 'Aaaaaaaaah plaît-il !\r\n\r\nMérite ou mérite pas ? Quoi qu\'il en soit, félicitation mec pour ce diplôme ! Tu nous auras bien fait marrer pendant ces 3 années.\r\n\r\nBonne continuation Ben !', 2243, 2098),
(573, 1, 'Salut Djamel!!!\r\n\r\nFélicitations pour ton diplôme!!! C\'était cool de partager ces deux années de F4 avec toi, la force tranquille! ;)\r\nJe te souhaite plein de bonheur et de réussite pour la suite! Et gagne plein de biff au poker! =p\r\n\r\nGros bisous,\r\nLauryanne', 2188, 2121),
(574, 1, 'Ma chère Yun,\r\n\r\nMerci pour ces deux années de F4 passées ensemble. J\'ai vraiment adoré faire ta connaissance! Tu es super, et j\'ai vraiment adoré travailler avec toi! =)\r\nJe te souhaite plein de bonheur et de réussite dans tes projets professionnels , et dans ta vie en général! \r\n\r\nGros bisous,\r\nLauryanne', 2188, 2181),
(575, 1, 'Salut Jean-Paul,\r\n\r\nFélicitations pour ton diplôme (et tes fiançailles)!!! =D\r\nC\'était vraiment cool de partager ces deux années de F4 ensemble, et de faire les commères en cours de méga flux! :p\r\n\r\nBonne continuation, tout plein de bonheur, et à bientôt j\'espère!\r\nLauryanne', 2188, 2201),
(576, 1, 'Salut Luc!!!\r\n\r\nFélicitations pour ton diplôme!!! Merci pour ta bonne humeur et tes coups de gueule! La F4 aurait été différente sans toi! ;)\r\n\r\nGros bisous,\r\nLauryanne', 2188, 2116),
(577, 1, 'Salam Aleykoum Naouf !\r\n\r\nBon je vais essayer de te faire des zephras  pète sa mère !\r\n\r\nEn tout cas, toute mes félicitations pour ton plômedi gros. T\'yé un grand fou quand même. Qu\'est-ce qu\'on se sera marré : BDS, Ski, Assofi, Soirée,  rintu, dôme puy, lavabo, #HARD...! Bref c\'était un honneur de partager ces trois années avec toi, ta joie de vivre, tes idées pète sa mère, ton hard absolu, ta follitude dégantée et j\'en passe ...\r\n\r\nBon j\'te ferai bien une punchline, mais j\'ai toujours pas le veauni, alors je me contenterai, une nouvelle fois, de te féliciter  et de te souhaiter une bonne continuation. Rdv à la DDR ... wéééé gros !\r\n\r\nBeslama', 2243, 2151),
(578, 1, 'Monsieur Pacholik!!!! =D\r\nFélicitations pour ton diplôme!!! J\'espère que tu ne mets pas tes pulls violets vont toujours bien! :p\r\nJe te souhaite plein de bonheur et de réussite dans tes projets pro, et aussi dans ta vie perso! \r\nBisous,\r\nLauryanne', 2188, 2090),
(579, 1, 'Bobbyyyyyyyyyyyyy!!!!!!\r\nFélicitations pour ton diplôme! Bien ouéj, comme on dit dans le métier! xp\r\nJ\'ai adoré \"bosser\" avec toi au BDS, et partager ces deux années de F4 avec toi! =D Reste tel que tu es! Tu es au top!\r\nGros bisous,\r\nLauryanne', 2188, 2223),
(580, 1, 'Mon cher Daniel,\r\nFélicitations pour ton diplôme! =D\r\nJe suis très heureuse d\'avoir fait ta connaissance et de t\'avoir vraiment découvert grace à la F4!!! =D\r\nJe te souhaite plein de bonheur et de réussite dans tes projets professionnels , et dans ta vie privée! \r\nExcellente continuation,\r\nLauryanne', 2188, 2152),
(581, 1, 'Cher Quentin,\r\nFélicitations pour ton diplôme!!! J\'espère que ta future femme et ton bébé se portent bien!\r\nJe te souhaite plein de bonheur et de réussite dans tes projets professionnels, mais aussi et surtout dans ta vie privée! \r\nGros bisous,\r\nLauryanne', 2188, 2170),
(582, 1, 'Salut Camila!\r\nFélicitations pour ton diplôme! J\'espère qu\'il t\'ouvrira pleins de portes et que tu réaliseras tes rêves!\r\nBisous,\r\nLauryanne\r\n\r\nPS: Hakuna matata!!!!! =D', 2188, 2518),
(583, 1, 'Merci Mame, \r\n\r\nMes félicitations pour toi également et bonne continuation  =)\r\n\r\nA très bientôt', 2510, 2218),
(584, 1, 'Mon cher Naouf,\r\nFélicitations pour ton diplôme! J\'espère qu\'il te permettra de réaliser tes rêves, et d\'arriver rapidement  au top de ta vie (grâce à tes Airmax et ta voiture de foooooolie)!!!\r\nMerci pour ton amitié, pour ta spontanéité et tes coups de gueules! Je suis très heureuse d\'avoir fait ta connaissance (merci l\'aventure BDS), et d\'avoir partagé ces deux années de F4 avec toi (même si des fois tu m\'as carrément tapé sur le système =D )\r\nGros check!!!\r\nLolo', 2188, 2151),
(585, 1, 'Hey Billy!\r\nFélicitations pour ton diplôme! C\'était vraiment sympa de partager ces deux années de F4 avec toi, et d\'entendre tous tes petits commentaires pour en rire! xp\r\n Je te souhaite plein de bonheur et de réussite!\r\nBisous,\r\nLauryanne', 2188, 2158),
(586, 1, 'Salut PA!!!\r\nFélicitations pour ton diplôme! Je suis très heureuse d\'avoir fait ta connaissance! :D Finalement, les normands c\'est cooooooool! xp\r\nPleins de bonheur et de réussite!\r\nGros bisous,\r\nLauryanne', 2188, 2211),
(587, 1, 'Salut Jonathan!\r\nFélicitations pour ton diplôme!!!! Je te souhaite de réaliser tes projets les plus fous! Surtout reste tel que tu es, tu es super!!!! Merci de m\'avoir fait partager ton livre préféré!\r\nBonne continuation,\r\nLauryanne', 2188, 2222),
(588, 1, 'Maëva ,\r\nJe tiens à te remercier pour tous ces beaux moments que tu nous a  permis de partager.\r\nToutes mes félicitations !!  Et bonne continuation pour la suite.', 2510, 2156),
(589, 1, 'Maxooooooooooooo!!!!!!!\r\nFélicitations pour ton diplôme!!!! Et merci pour ces trois ans d\'amitié (et celles à venir ;p )!!! Tellement de choses partagées ensemble... Les soirées, le BDS, Astérix... Bref, je t\'adore!\r\nJe te souhaite plein de bonheur et de réussite dans tes projets pro, comme dans ta vie perso!\r\nGros bisoooooooouuuuuus,\r\nLolo', 2188, 2243),
(592, 1, 'Mon cher Yoann,\r\nToutes mes félicitations pour ton diplôme! Merci pour ces trois années à l\'ISIMA, je suis heureuse d\'avoir fait ta connaissance. Je te souhaite plein de bonheur et de réussite dans tes projets professionnels, comme dans ta vie privée!\r\nGros bisous,\r\nLauryanne', 2188, 2213),
(593, 1, 'Salut Maëva!\r\nFélicitations pour ton diplôme! Merci pour tous ces moments girly passés ensemble pendant la campagne (Crazzyma 4ever :p), à la danse, ou pour la soirée chez Michèle! Je suis heureuse d\'avoir fait ta connaissance! Je te souhaite plein de bonheur et de réussite dans tes projets pro (en informatique ou en danse d\'ailleurs), comme dans ta vie perso!\r\nGros bisous,\r\nLauryanne', 2188, 2156),
(594, 1, 'Salut Adrien,\r\nFélicitations pour ton diplôme!!! C\'était cool de te retrouver à l\'ISIMA! Je te souhaite plein de bonheur et de réussite!\r\nGros bisous,\r\nLauryanne', 2188, 2193),
(595, 1, 'Louloooooouuuuuu!!!!!\r\nFélicitations pour ton diplôme!!!! Je suis super heureuse d\'avoir fait ta connaissance! Tu es au top! =D\r\nJe te souhaite plein de bonheur et de réussite dans tes projets pro, comme dans ta vie perso!\r\nGros bisous,\r\nLauryanne', 2188, 2161),
(596, 1, 'Salut Raf!!!\r\nFélicitations pour ton diplôme!!! Je te souhaite plein de bonheur et de réussite dans tes projets pro, comme dans ta vie perso!\r\nGros bisous, \r\nLolo', 2188, 2256),
(597, 1, 'Mon cher colloc!!!\r\nFélicitations pour ton diplôme!!! Tu es au top! Je t\'adore et je suis trop heureuse de te compter parmi mes amis!!! Je te souhaite plein de bonheur et de réussite dans tes projets pro, comme dans ta vie perso! Surtout ne change pas! Garde ton sarcasme et ton humour!\r\nGros bisous,\r\nLolo\r\nPS: La Team Rocket vaincra!!!! :p', 2188, 2190),
(598, 1, 'Merci et félicitations à toi aussi! Bonne continuation. Je te souhaite de pouvoir faire ce que tu aimes.\r\n\r\nAdrien J.', 2193, 2188),
(599, 1, 'Ça joue mon con, deal <3\r\nRoses are red\r\nViolets are blue \r\nL\'isima ça se fait en 4 ans\r\nEt oui, comme nous !', 2077, 2098),
(600, 1, 'Salut Lauryanne !\r\n\r\nMerci (et merci ;) ) et félicitations à ti aussi :)\r\nWé c\'était cool, presque ça va me manquer de critiquer les autres... (bonjour, je rentre de vacances un mercredi, ou j\'arrive à 8h25...)\r\n\r\nTu sais où tu seras ensuite ? Bonne continuation en tout cas, du bonheur, tout ça tout ça... ^^\r\nJP', 2201, 2188),
(601, 1, 'Hello Billy,\r\nFélicitation pour ce diplôme ! Je te souhaite de la réussite pour la suite, sans vraiment me faire de soucis de ce côté là. Merci également pour cette année en tant que BDE !\r\n\r\nLa bise Mister Wei.', 2197, 2158),
(602, 1, 'Naoufel,\r\nJ\'ai été ravi d\'avoir fait ta rencontre et d\'avoir travaillé avec toi pour la vie associative de l\'ISIMA, tu peux être fier de ton BDS.  De bons souvenirs, que ce soit lors des différents évènements ou pendant les chichas nocturnes au BDE. Bon courage pour la suite grand !\r\n\r\nLa bise', 2197, 2151),
(603, 1, 'Un petit message pour te féliciter pour ce diplôme. On y est finalement arrivé après ces 5 années, et pourtant c\'est passé bien vite. Bon courage pour la suite Daniel :)\r\n\r\nLa bise', 2197, 2152),
(604, 1, 'Mon petit Gaultier,\r\nJe te félicites pour ton diplôme, et me réjouis de sortir vivante de ces trois années d\'ISIMA avec toi, malgré les couteaux qui ont volés!!! :p \r\nJ\'espère qu\'on ne t\'a pas déçu avec le BDS, et j\'ai adoré que tu me coach avant les réunions BDS! :p\r\nGros bisous et bonne continuation,\r\nLauryanne', 2188, 2091),
(605, 1, 'Salut Nico!\r\nFélicitations pour ton diplôme! C\'était cool de faire la route avec toi le matin! :D\r\nBonne continuation,\r\nLauryanne', 2188, 2182),
(606, 1, 'Mon cher binôme,\r\nToutes mes félicitations pour ton diplôme tu le mérites tellement!!!! Merci de m\'avoir donné gout à l\'informatique, d\'avoir été mon binôme et de m\'avoir supporté pendant toute la première année!!! Je suis très heureuse d\'avoir fait ta connaissance! Je te souhaite tout le bonheur du monde, et plein de réussite dans tes projets pro, comme dans ta vie perso!\r\nGros bisous,\r\nLolo', 2188, 2199),
(607, 1, 'Salut Flo,\r\nFélicitations pour ton diplôme!!! Et merci pour tes notes de cours!!! :p Tu as sauvé une de mes moyennes! ;)\r\nJe te souhaite plein de bonheur et de réussite dans tes projets professionnels, comme dans ta vie privée.\r\nBisous, \r\nLauryanne', 2188, 2171),
(608, 1, 'Salut Eric,\r\nC\'était un plaisir de partager ces deux années de F4 avec toi! Tu as une personnalité géniale! Surtout ne change pas! :D\r\nJe te souhaite plein de bonheur et de réussite dans tes projets professionnels, comme dans ta vie privée!\r\nBisous,\r\nLauryanne', 2188, 2270),
(609, 1, 'Mon cher Valou!!!\r\nBon ça fait 5 minutes que j\'essaie de te pondre une blague mais je trouve rien!!!! :/ Alors je vais juste te remercier pour ton amitié, pour ta bonne humeur, pour nos multiples conversations et confidences, mais aussi pour tes nombreux coups de gueule ou de stress, et surtout pour toutes tes blagues!!! Les pires comme les meilleures!!! xp Je suis super heureuse d\'avoir fait ta connaissance et de te compter parmi mes amis!!! Je te souhaite beaucoup de bonheur, de réussite, et de bonnes idées de jeux de mots!!! =D\r\nJe t\'embrasse fort,\r\nLolo', 2188, 2216),
(610, 1, 'Mon p\'tit John,\r\nFélicitations pour ton diplôme!!! Merci pour ces trois années passées ensemble!!! Tu es définitivement le roi du dancefloor parmi les meuriens!!! Je te souhaite plein de bonheur et de réussite dans tous tes projets!!!\r\nGros bisous,\r\nLolo\r\n\r\nPS: sans la bague, c\'est mieux pour trouver une chérie! :p', 2188, 2185),
(611, 1, 'Salut Marion,\r\nFélicitations pour ton (double) diplome!!! C\'était vraiment cool de faire la route jusqu\'en Bretagne avec toi! ;)\r\nJe te souhaite plein de bonheur!\r\nBisous,\r\nLolo', 2188, 2166),
(612, 1, 'Mon cher QV,\r\nFélicitations pour ton diplôme!!! Merci pour ton amitié, et pour la patience que tu as eu de me supporter durant toutes ces heures de route!!!! =D\r\nJ\'espère que tu réaliseras tous tes rêves de voyages! Je te souhaite pleins de bonheur! Reste tel que tu es!!! =D\r\nGros bisous,\r\nLolo\r\n\r\nPS: - QV!\r\n- Quoi?\r\n- Pas les pieds sur la table!!!\r\n- Ah oui... Merde!\r\n(Grand moment!!!! ;p )', 2188, 2210),
(613, 1, 'Félicitations toi même Lolo  =P\r\n\r\nTon caractère bien trempé aura marqué l\'esprit de nombreuses personnes pendant ces trois dernière années ! Ça fait plaisir à voir les personnes comme toi ! Change rien !\r\n\r\nJe vous souhaite les meilleurs choses à toi et Romain dans cette belle ville de Londres !(que je viendrai visiter à l\'occasion hehe)\r\n\r\nBisous et merci pour le PS :)', 2185, 2188),
(614, 1, 'Héhé !\r\nBravo à toi, tu as bien mérité ton diplôme !! Je tiens vraiment à te remercier pour toute l\'aide que tu m\'as apportée avec les maths et les trucs dont je ne comprenais absolument rien ^^ Sans toi, je n\'aurais pas validé ma ZZ1.\r\nJ\'espère qu\'on se reverra bientôt :)\r\nEt surtout, prends soin de toi et je te souhaite la meilleure des réussite dans tous tes projets, personnels comme professionnels :)\r\nDes bisouussss !\r\nAnthony', 2199, 2188),
(616, 1, 'Hello Maëva !\r\n\r\nTu as apportée ta joie et ta bonne humeur au sein de la filière, ce qui nous a permis de bien se marrer avec toi en TP :P\r\nJe me souviendrai longtemps du Tamarin glacé, c\'était, disons ... particulier ^^\r\nC\'est pas tous les jours qu\'on rencontre quelqu\'un d\'agréable comme toi ;) Et en plus comme moi, tu aimes les chiens :D\r\n\r\nJe te souhaite une excellente réussite dans tes projets professionnels et personnels !\r\n\r\nPrends soin de toi et à très vite j\'espère :)\r\n\r\nDes bisous :D', 2199, 2156),
(617, 1, 'Chère Lolo,\r\n\r\nFélicitation pour le diplôme ! Et pour réussir à faire ce que tu veux (travailler dans les fêtes foraines). J\'imagine que tu vas nous revenir bilingue. La chance. Tu réussis tout ce que tu entreprends avec ténacité. Même la danse ! :P\r\n\r\nOn s\'est éloigné cette année à cause d\'activités et d\'amis différents, mais on va pouvoir se revoir à la RDD !\r\n\r\nEn souvenir de toi en tutu fait main ! \r\n\r\nBonne continuation, sois heureuse avec Romain.\r\n\r\nBisous,\r\nMaëva', 2156, 2188),
(618, 1, 'Cher Prezz,\r\n\r\nQue de souvenir en commençant par le Beach qui restera gravé dans les mémoires!\r\nOn a fait une super année associative principalement grâce a ton BDE et il sera difficile de faire mieux!\r\nAu plaisir de nous revoir toujours avec autant de bonne humeur!\r\n\r\nA plus mon gro, félicitations pour ton diplôme et fait attention à toi !', 2151, 2197),
(619, 1, 'Ma chère LolodeBrest,\r\n\r\nMerci pour ta franchise,  ta joie de vivre et ton investissement que ce soit au BDS, dans la F4, ou dans toute l\'école! \r\nEncore une fois bravo pour ton excellent week-end ski restera gravé dans les mémoires.\r\nFélicitations pour ton diplôme et je te souhaite que du bonheur pour la suite.\r\n\r\nAu plaisir de se revoir par la suite avec toujours autant de bonne humeur.\r\nChange rien, reste la même.\r\n\r\nPS: On s\'est bien marré dans la C2!!\r\n\r\n@Naoufelofficiel', 2151, 2188),
(620, 1, 'Mabrouk pour ton diplôme poto!\r\n\r\n#LaRochelleCityGang\r\n#AQuandNotrePlaneteRap\r\n#Bsartek\r\n\r\n@NaoufelOfficiel', 2151, 2154),
(621, 1, 'Cher Adrien,\r\n\r\nTon amour pour les légumes restera à jamais dans ma mémoire!\r\nMes clash avec ce sacré Tilmant me manque aussi!\r\n\r\nJ\'espère sincèrement qu\'on se reverra et qu\'on rira autant!\r\n\r\nFélicitations poto pour ton diplôme!\r\n\r\nA+ je l\'espère!\r\n\r\n@NaoufelOfficiel', 2151, 2221),
(622, 1, 'Selmeeeeeeek!\r\n\r\nMabrouk pour ton diplôme!\r\nOn s\'est bien marré pendant tout ce temps passé à l\'ISIMA avec notre drôle de bande!\r\n\r\nEn espérant que celle-ci persiste dans le futur inchaAllah!\r\n\r\nQue Dieu nous guide et à très bientôt inchaAllah.\r\n\r\n@NaoufelOfficiel', 2151, 2177),
(623, 1, 'Aheykoum Salam Maxoo!\r\n\r\nFélicitations pour le plômedi! \r\nQue de bons souvenirs, heureusement que t\'étais la pour réaliser toutes nos idées farfelues: un micro qui descend du plafond, une choré HARD, un ring, une aprem de folie en première année qui a impacté même les K1ri, le beach et  j\'en passe!\r\n\r\nOn avait un sacré BDS avec lequel on a tout détruit et ça restera gravé dans nos mémoires\r\n\r\nReste le même gro, toujours aussi motivé, souriant et plein d\'idée!\r\n\r\nJ\'espère sincèrement qu\'on continuera de se voir fréro!\r\n\r\n@NaoufelOfficiel', 2151, 2243),
(624, 1, 'Félicitations John pour ton diplôme!\r\n\r\nOn s\'est bien marré surtout en première année!!\r\n\r\nJe te souhaite que du bonheur pour la suite et j\'espère qu\'on se reverra !\r\n\r\n@NaoufelOfficiel', 2151, 2185),
(625, 1, 'Mademoiselle Caroff!! \r\n\r\nHaha félicitations pour ton diplôme Lauryanne! Plus de pull violet depuis que le dernier a été trisitement jeté...\r\nJ\'espère que tu es devenue une pro de l\'anglais grâce à ton stage ;). En espérant que ta vie professionnelle soit parsemée de réussite et que ta vie personnelle soit remplie de bonheur, je te fais des bisous !!\r\n\r\nAlexis', 2090, 2188),
(626, 1, 'Oh Bobby !\r\n\r\nFélicitations pour ce diplôme ! Bon courage pour la suite, et surtout garde la pêche !\r\nLa bise, au plaisir de te revoir !', 2197, 2223),
(627, 1, 'Félicitations poto pour ton diplôme!\r\n\r\nUne première année HARD, un G1 qui restera légendaire, un BDS impactant et une promo de dingue, on a beaucoup trop rigolé!\r\n\r\nReste le même! Toujours aussi souriant et sportif!\r\n\r\nJe te souhaite le meilleur pour la suite.\r\n\r\nJ\'espère qu\'on se reverra gro!\r\n\r\n@NaoufelOfficiel', 2151, 2189),
(628, 1, 'Félicitations pour ton diplôme Maxime!\r\n\r\nJe te souhaite le meilleur pour la suite!\r\n\r\nAu plaisir de se revoir et à très bientôt je l\'espère!\r\n\r\n@NaoufelOfficiel', 2151, 2167),
(629, 1, 'Félicitations mon pti stéphanois!\r\n\r\nJe te souhaite le meilleur pour la suite et surtout de devenir supporter d\'une vrai équipe!\r\nÇa ne devrait pas être dure vu que tu vas habiter à Lyon.\r\n\r\nÀ très bientôt je l\'espère et pourquoi pas au prochain derby!\r\n\r\n@NaoufelOfficiel', 2151, 2369),
(630, 1, 'A mon parrain présidentiel, à celui qui m\'a introduit dans LA famille, \r\n\r\nMerci pour nous avoir fait rêver quand on est arrivé à l\'ISIMA, merci pour m\'avoir conforté dans l\'idée de vouloir faire partie du BDE et faire perpétuer cette belle vie associative que l\'on peut avoir, et surtout merci pour tous tes conseils, critiques et autres pendant mon mandat. J\'ai vraiment apprécié te rencontrer et te côtoyer pendant ces deux ans où j\'étais à l\'ISIMA.\r\nFélicitations pour ton diplôme, je te souhaite le meilleur pour la suite.\r\n\r\nLa bise :)', 2197, 2116),
(631, 1, 'Un petit message pour te féliciter pour ce diplôme Alex, je te souhaite plein de bonnes choses pour la suite :)\r\nLa bise !', 2197, 2258),
(632, 1, 'Djameeuul, \r\nC\'était chaud mais tu l\'as fait, félicitations pour ce diplôme ! En souvenir de toutes ces soirées passées ensemble, je te souhaite bon courage pour la suite :)\r\n\r\nLa bise !', 2197, 2121),
(633, 1, 'Mon ptit (grand) Erwan,\r\n\r\nFélicitations pour ce diplôme ! C\'était un plaisir de t\'avoir rencontré et de t\'avoir vu venir de plus en plus en soirée :) Bon courage pour la suite !\r\n\r\nLa bise', 2197, 2369),
(634, 1, 'Hello Adrien,\r\n\r\nMerci pour tous ces compliments, avoir organisé tous ces évènements pour vous était une expérience unique, et la satisfaction des gens était la plus belle des récompenses :) Pas de soucis pour le trajet à l\'hôpital !\r\nFélicitations également pour ton diplôme, je te souhaite le meilleur pour la suite !\r\n\r\nLa bise :)', 2197, 2221),
(635, 1, 'Bon il est temps de laisser un vrai message!\r\n\r\nSeuls les vrais savent qu\'on peut t\'appeler Jo l\'ancien\r\nT\'as été brave ce diplôme est enfin tien\r\nBsahtek il était temps à bientôt 40 ans\r\nBarrons nous de l\'ISIMA tout d\'suite maintenant\r\n\r\nAllez félicitations fraté et merci pour la coloc du #107! On aura passé de sacrés moments pendant ces 3 ans!\r\n\r\nEt je finis en citant bien sûr un grand homme :\r\n\"Vaisseau mère, mets ta ceinture\r\nIls m\'ont rayé la Bentley, j\'dois refaire la peinture\r\nOn est les meilleurs zebi, refrè refrè\r\nJe fais du ffe-bi ffe-bi, j\'suis refait refait\"', 2090, 2154),
(636, 1, 'Merci pour tous ce que tu as fait pour moi !\r\nTu as été un très bon parrain, même si on aurait pu se connaître plus encore :)\r\n\r\nBonne continuation ! Bon courage :)', 2315, 2161);
INSERT INTO `yearbookmessages` (`id`, `yearbook_id`, `message`, `userFrom_id`, `userTo_id`) VALUES
(637, 1, 'Super pote de soirée ! Super câlineur !\r\nChange pas, passe nous voir, et passe me faire des câlins !\r\n\r\nBon courage pour la suite et pour tes mois sabbatiques !\r\nUn pote râleur :)', 2315, 2077),
(638, 1, 'Hoy Lauryanne!\r\n\r\nFélicitations à toi aussi pour ton diplôme! J\'espère que tu réussiras même si je ne me fais pas trop de soucis ;) \r\nMerci pour les prises de tête avec Salim en tout cas !! On aura quand même bien rigolé en com\' ^^\r\n\r\nA+\r\nBisous', 2158, 2188),
(639, 1, 'Ma p\'tite LoLo préféré !\r\n\r\nTout à bord, je tiens à te féliciter pour ton diplôme ! Nous sommes arrivé à bout de ces 3 années intenses et de galère. Place à une nouvelle vie maintenant :)\r\n\r\nJe tiens aussi à te remercié des ces trois années passé à tes côtés. Ton sourire, ta bonne humeur, ta joie de vivre font de toi quelqu\'un d’exceptionnel ! Et tout ces bons moments passé ensemble : BDS et c\'est événements qui auront impactés (comme dit si bien Naouf) l\'ISIMA, les soirée BDE, mais aussi le brunch au jardin et cette sortie au parc astérix ....\r\n\r\nBref encore félicitation, bonne continuation pour  la suite ... et surtout ne change pas LoLo. J\'espère qu\'on continuera à partager plein de chose !\r\n\r\nDes grooooooos bisouuuuuus :)', 2243, 2188),
(640, 1, 'Hey Président\r\n\r\nMerci pour les réunions BDE qui se sont toujours bien passés et surtout pour ton fameux \"laisse nous le trône\", qui aura malheureusement été censuré dans notre rap^^\r\n\r\nPlein de bonheur et de réussite. \r\nLa bise', 2158, 2197),
(641, 1, 'Et oui! ça n\'a pas été facile mais on est arrivé au bout! :)\r\nOui ça a été de très bonnes années et un plaisir de bosser avec toi (en espérant que ça se poursuive ;) )\r\n(PS:C\'est bien je suis fier de toi de ne pas avoir fait de blagues sur ma maman, mais fait gaffe hein? Surtout maintenant que tu as son numéro :p )', 2237, 2079),
(642, 1, 'Bravo pour ce diplôme mon ptit Yassine, et bon courage pour la suite !\r\nLa bise', 2197, 2177),
(643, 1, 'Merci pour ton petit message mon grand, on aura passé de bons moments ensemble ! Félicitations également pour ton diplôme, je te souhaite plein de bonheur et réussite pour la suite !\r\nDes bisous :)', 2197, 2167),
(644, 1, 'Un grand bravo pour ton diplôme ! Il parait que l\'on peut avouer des amours secrets, alors je me lance^^ Ce fut 3 années bien sympathiques avec ses joies et ses quelques chagrins (pauvre Enora...), que des moments qui resteront inoubliables !\r\nEt surtout n\'oublie pas, ils arrivent.\r\nJojo', 2222, 2207),
(645, 1, 'F3? ISE? des mots qui font froid dans le dos… Et pourtant, le bonhomme n’est pas avare. C’est un routard, un voyageur, un entrepreneur et un véritable ami. Cette année à OU n’aurait jamais été aussi magique sans lui. Lui et Jeremy sont presque arrivés à me faire changer d’avis sur les ISE !!! Tous les voyages, toutes les soirées, tous les délires, toutes les conneries (toutes les galères aussi…), rien n’aurait dû être autrement. \r\nEn bref, c’est un grand homme... malgré sa petite taille!', 2095, 2197),
(646, 1, 'Félicitations pour le diplôme ! Trois déjà, et nous allons tous partir de notre côté... mais avant nous ferons la fête comme jamais ! Les souvenirs des cours en amphi resteront à jamais gravés dans ma mémoire :)\r\nBon continuation,\r\nJojo', 2222, 2225),
(647, 1, 'Un grand bravo pour ton diplôme ! Nous allons maintenant tous partir dans la vie active, habiter à l\'autre bout de la France, fonder une famille, vieillir, acheter un chien... mais tout ça est sans importance, on s\'enverra toujours des mails toutes les semaines. Au moins. Je vais devoir me trouver un remplaçant qui écoute toutes mes bêtises, je n\'oublierais jamais les cours de chinois, ça va me manquer. \r\nTu as aussi les félicitations de Meg !\r\nJojo', 2222, 2193),
(648, 1, 'Félicitations pour ton diplôme ! Tu as du me supporter à de nombreuses reprises pendant les projets de ces deux dernières années, mais au final tu m\'as semblé pas trop malheureux, cela veut dire que je ne t\'aurais pas trop embêté ! Bonne continuation pour la suite !\r\nLacomme\'s crew pour toujours,\r\nJojo', 2222, 2241),
(649, 1, 'Ah Naoufel ! Un grand bravo pour ton diplôme !!!\r\n\r\nMerci pour tes apartés humoristiques improvisés qui me faisait bien marrer !\r\n\r\nJe te souhaite le meilleur , surtout au niveau du salaire hein ! =)\r\n\r\nEn espérant te revoir autour d\'un d\'un thé à la menthe maison accompagné de son calumet =P', 2185, 2151),
(650, 1, 'Félicitations pour ce diplôme Romain, j\'ai été ravi de te rencontrer, faire ces campagnes BDE et tous ces évènements BDE et BDS pendant ces deux ans !\r\nBon courage pour la suite grand !\r\n\r\nLa bise :)', 2197, 2189),
(651, 1, 'Bravo pour ton diplôme ! J\'ai passé trois années bien sympathiques, j\'espère que toi aussi tu t\'en souviendras encore quand tu seras vieille et sans dents ! Maintenant il est temps de se lancer dans la vie active !\r\nJojo', 2222, 2188),
(652, 1, 'Coucou mon grand, félicitations pour ce diplôme obtenu :)\r\nPour les voyages je kiffe toujours autant, pas le temps de m\'ennuyer ! Et oui on se voit à la RDD pour célébrer ça :)\r\nBisous !', 2197, 2077),
(653, 1, 'Aleeeeeeex ! \r\n\r\nPour faire dans l\'original je vais en premier lieu te féliciter pour ton diplôme !! \r\n\r\nPour tous les bons moments passés durant ces trois dernières années, je te remercie et te souhaite le meilleur pour la suite !\r\n\r\nBien entendu, je te fais signe dès que mon trou est fait sur Bordeaux histoire de s\'organiser une pitite virée OKLM\r\n\r\nOn se voit à la même table à la RDD ! La bise gros !', 2185, 2258),
(654, 1, 'AIIIIIGHT ! Il est là le pro !\r\n\r\nCommençons par le commencement : félicitation pour le diplôme mon gars ! Pour toutes les soirées où je te voyais bosser comme un taré avec Latatia, je pense que c\'est amplement mérité ! \r\n\r\nJe te remercie pour ces trois années : les sorties que tu as organisées, les services que tu m\'a rendu (notamment pour la fois où tu m\'a ramené d\'une fête intense on va dire =P) et les conseils que tu as pu me donner ! \r\n\r\nJe te souhaite le meilleur pour la suite maxoo ! La bise ! =)', 2185, 2243),
(655, 1, 'Coucou à la meilleure des secrétaires espagnoles :)\r\nPas le temps de m\'ennuyer aux states, beaucoup de voyages et de nouvelles aventures et j\'adore ça, même si vous me manquez tous. J\'espère que la fin de ton année en Espagne s\'est bien passée ! Tant de bons souvenirs avec toi, et j\'espère qu\'il y en aura d\'autres.\r\n \r\nJe te fais de gros bisous et te souhaite tout le bonheur et la réussite que tu mérites ma grande :)', 2197, 2166),
(656, 1, 'Fry,\r\n\r\nMerci pour ces belles félicitations, et bravo à toi pour être devenu Mr Michelin, ça te fait enfin une bonne excuse pour être soit-disant débordé. Ces deux années auront été magnifiques, elles sont malheureusement passées trop vite. On a en effet eu un BDE de folie, tout ça grâce à la belle équipe que j\'ai eu la fierté de porter dans cette aventure.\r\nMerci pour tout, que ce soit pour les séances de révision / apéros en plein été où tu vivais presque au BDE, pour ton investissement hors normes dans la vie associative, pour cette folie qui te caractérise, et enfin pour avoir été un putain d\'ami. \r\n\r\nDe gros bisous, et t\'inquiètes pas, on se perdra pas de vue car il faudra bien que je te défonce quand le besoin s\'en fera sentir.\r\n\r\n<3', 2197, 2368),
(657, 1, 'Mon cher JT, en souvenir entre autre de ces dimanches matins au marché parfois suivi du casse-croûte, je te félicite pour ton diplôme et te souhaite que de bonnes choses pour la suite !\r\n\r\nLa bise', 2197, 2224),
(658, 1, 'Coucou ma chérie !!!!\r\n\r\nMerci pour ce beau message que tu m\'as laissé ! Je t\'aime plus que tout moi aussi et je tiens a te dire que je suis le plus heureux des chéris parce que j\'ai une femme géniale :D\r\n\r\nTu es la plus belle chose qui me soit arrivé et merci d\'etre la pour moi <3 Je serai toujours la pour toi, pour t\'aider et t\'épauler dans toutes les circonstances ;) J\'ai hate qu\'on ait notre maison a tous les deux et qu\'on vive pleinement notre amouuur ahaha :D <3 A ce soir mon ange !\r\n\r\nJe t\'aime !\r\n\r\nTon beau Foubert ;) <3', 2189, 2188),
(659, 1, 'Félicitations fréro!\r\n\r\nÇa fait trop plaisir  après tout le boulot qu\'on a fourni.\r\nJe te souhaite le meilleur pour la suite inchaAllah!!\r\nJ\'espère qu\'on se reverra!\r\nFait attention à toi.\r\n\r\n@NaoufelOfficiel', 2151, 2121),
(660, 1, 'Félicitations pour ton diplôme Yun!\r\n\r\nJe te souhaite que du bonheur pour la suite et j\'espère qu\'on pourra enfin gouter ta cuisine!\r\n\r\n@NaoufelOfficiel', 2151, 2181),
(661, 1, 'Félicitations pour ton diplôme Alex!\r\n\r\nQue du bonheur pour la suite!\r\n\r\nÀ bientôt !\r\n\r\n@NaoufelOfficiel', 2151, 2258),
(662, 1, 'Mabrouk ahlyk el diplom Salim!\r\n\r\nJe te souhaite le meilleur pour la suite inchaAllah!\r\n\r\nÀ bientôt inchaAllah!\r\n\r\n@NaoufelOfficiel', 2151, 2038),
(663, 1, 'Félicitations pour ton diplôme mon ami Eric!!\r\n\r\nJ\'espère qu\'on va rester en contact!\r\nChange rien, reste le même, toujours aussi souriant!\r\nJe te souhaite le meilleur pour la suite si Dieu le veut!\r\n\r\n@NaoufelOfficiel', 2151, 2270),
(664, 1, 'Félicitations pour ton diplôme poto!\r\n\r\nJe te souhaite le meilleur pour la suite!\r\nBonne continuation!\r\n\r\n#F4RPZ\r\n#F4enCeFor\r\n#Vilebrequin\r\n\r\n@NaoufelOfficiel', 2151, 2090),
(665, 1, 'Félicitations pour ton diplôme Marco!\r\n\r\nJe te souhaite le meilleur pour la suite!\r\nEt n\'oublie pas, CUIDADO!!!\r\n\r\nÀ très bientôt je l\'espère!\r\n\r\n@NaoufelOfficiel', 2151, 2519),
(666, 1, 'Hello sweetie !\r\n\r\nCongrats for your diploma !\r\nJ\'espère que tu as apprécié ton séjour aux US et que tu profites toujours autant de la vie !\r\n\r\nHope to see you soon ;)\r\nYoann.', 2213, 2197),
(667, 1, 'Félicitations pour ton diplôme mon pti Ben!\r\n\r\nJe te souhaite le meilleur pour la suite et un avenir en ligue 1 pour le RC Lens!\r\n\r\nÀ bientôt je l\'espère!\r\n\r\n@NaoufelOfficiel', 2151, 2098),
(668, 1, 'Merci infiniment Naoufal ! \r\n\r\nMabrouk alik aussi  :) je te souhaite une bonne chance pour la suite  !', 2038, 2151),
(669, 1, 'Mabrouk ahlyk el diplom Ali!!\r\n\r\nJe te souhaite le meilleur pour la suite inchaAllah!\r\n\r\nÀ bientôt inchaAllah!\r\n\r\n@NaoufelOfficiel', 2151, 2226),
(670, 1, 'Mabrouk ahlyk el diplom Walid!!\r\n\r\nJe te souhaite le meilleur pour la suite inchaAllah!\r\n\r\nÀ bientôt inchaAllah!\r\n\r\n@NaoufelOfficiel', 2151, 2049),
(671, 1, 'Allez Benoît, je te félicite quand même pour ton diplôme :)\r\n\r\nJ\'espère qu\'il t\'apportera sagesse et patience, tu en as grand besoin !\r\n\r\nEt surtout, j\'espère que tu finiras pas apprécier la bonne nourriture, comme la sauce ketchup-mayo !\r\n\r\nBisous bisous,\r\nYoann.', 2213, 2098),
(672, 1, 'Mabrouk ahlyk el diplom M\'Hamed!!\r\n\r\nJe te souhaite le meilleur pour la suite inchaAllah!\r\n\r\nÀ bientôt inchaAllah!\r\n\r\n@NaoufelOfficiel', 2151, 2240),
(673, 1, 'Félicitation pour ton diplôme, ça m\'a fait plaisir de cuisiner avec toi, j\'en garde de bons souvenirs.\r\nBonne chance pour la suite et bon courage !', 2157, 2224),
(674, 1, 'Félicitations pour ton diplôme Antoine!!\r\n\r\nJe te souhaite le meilleur pour la suite!\r\n\r\nÀ très bientôt je l\'espère!\r\n\r\n@NaoufelOfficiel', 2151, 2205),
(675, 1, 'Bravo Maëva  !\r\n\r\nJ\'espère que tu as passée 3 bonnes années à l\'ISIMA ! Tu étais toujours souriante, et très ouverte vers les autres (merci d\'avoir intégré Philippe) et tu es une excellente danseuse. j\'espère que tu continueras à pratiquer, et peut-être aurai-je un jour la chance de te revoir en spectacle !\r\n\r\nNe change rien, \r\nBsisou,\r\nYoann.', 2213, 2156),
(676, 1, 'Merci pour ces 3 ans.\r\nMalgré le recul que tu as pris ces derniers temps tu auras bien marqué ma scolarité à l\'ISIMA. Nos soirées resteront mémorables et c\'était bien le but, bravo pour ton dévouement (notamment pour rendre cocu Chauvet mais chut).  \r\nJ\'espère pouvoir garder contact avec toi dans les années à venir.\r\nBisous bisous !', 2157, 2256),
(677, 1, 'Félicitation pour ton diplôme !\r\nCa m\'a fait plaisir de partager ces quelques moments avec toi, dommage que l\'on ai pas eu l\'occasion de se connaître plus tôt. Bonne continuation à la BNP (ou presque).  \r\nA bientôt !', 2157, 2187),
(678, 1, 'Félicitations mon pti IKEA!\r\nTu m\'as appris beaucoup de choses durant ces trois années et c\'était un réel plaisir de faire de l\'associatif avec toi donc un grand merci.\r\nAu début je croyait qu\'on était opposé mais j\'ai compris qu\'on était complémentaire en réalité.\r\nC\'est pourquoi je te souhaite le meilleur pour la suite et j\'espère sincèrement que l\'on se reverra.\r\nBonne continuation.\r\n@NaoufelOfficiel', 2151, 2213),
(679, 1, 'Félicitations mon p\'tit Raphy!\r\n\r\nOn s\'est bien marré depuis le beach et j\'espère que ça va continuer!\r\nJe te souhaite le meilleur pour la suite inchaAllah en espérant sincèrement qu\'on se reverra pourquoi pas autour d\'un p\'tit NahNah! \r\n\r\nÀ très bientôt!\r\n\r\n@NaoufelOfficiel', 2151, 2157),
(680, 1, 'Salam fréro!\r\n\r\nBsartek le plômedi!!\r\nOn a bien rigolé en F4-47!!! Des gros délires!\r\nJe te souhaite le meilleur pour la suite frangin!\r\nReste le même fils d\'ouvrier marrant et pas mauvais au foot, change rien poto.\r\n\r\nJ\'espère qu\'on va rester en contact!\r\n\r\n#Vile-Bre-Quin\r\n#Bientotnotreplaneterap\r\n#Fuego\r\n#Muerte\r\n#Mektoub.fr\r\n\r\nA+!\r\n\r\n@NaoufelOfficiel', 2151, 2158),
(681, 1, 'Holà senor Maupetit,\r\nRespect à toi, grand joueur de pipeau et pizzaiolo hors pair.\r\nC\'est avec plaisir qu\'on se capte à l\'occaz!\r\nBise du toulousainnnng', 2205, 2179),
(682, 1, 'Coucou Michèle,\r\nMalheureusement, je resterai parmi les miens, les zoreilles!\r\nJe te souhaite plein de voyages et de bonnes choses pour la suite ;-)\r\nBisous!\r\nAntoine', 2205, 2214),
(683, 1, 'Félicitations mon fréro!\r\n\r\nContrairement à ce que je dis d\'habitude, tu le mérites (pas par ton travail tu l\'auras compris, mais par ta personne entière).\r\nReste le même frangin, différent et souriant, ne change rien.\r\nOn a grave rigolé ces 3 ans grâce à toi.\r\nJe te souhaite le meilleur pour la suite en espérant que notre bande va continuer de se voir régulièrement pour continuer l\'expiation débutée en 2012.\r\n\r\nBonne continuation mon fréro.\r\n\r\n#Bobbydiplomé\r\n#Bobbyingénieur\r\n#Bobbyprésident\r\n#BobbyalatetedelONU\r\n#brulelecedosnageur', 2151, 2223),
(684, 1, 'Félicitations LLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLLuc!!!!!!!\r\n\r\nC\'est une catastrophe!!!! T\'es fou ET ingénieur maintenant alors qu\'avant t\'étais juste fou et moi je te souhaite le meilleur pour la suite et surtout le plus important, de rester fou!!!!!\r\nOn a beaucoup rigolé et j\'espère que ça va continuer.\r\nÀ très bientôt.\r\n\r\n@NaoufelOfficiel i.e. le PAS fou', 2151, 2116),
(685, 1, 'Hello Laetichia,\r\n\r\nBravo pour tes diplômes ma gueule. Beaucoup de blagues en dessous de la ceinture avec toi cette année, mais j\'ai l\'habitude je te connais.\r\nJe te souhaite plein de réussite que tu mérites.\r\n\r\nBisous\r\n\r\nAntoine', 2205, 2208),
(686, 1, 'Bravo à toi !\r\nJ\'ai apprécié tes récits de voyages en cours d\'espagnol!\r\nA bientôt.', 2369, 2200),
(687, 1, 'Cyril,\r\nToutes mes félicitations pour ton diplôme ! \r\nTu m\'as appris qu\'un limousin pouvait finir au states,\r\ndorénavant je sais que rien n\'et impossible ; )\r\nA très vite !', 2369, 2197),
(688, 1, 'Salut!\r\nFélicitations pour le titre ingénieur! ^^', 2200, 2247),
(689, 1, 'Oh toi, Jean-Thierry !\r\nJ\'ai passé deux très bonnes années en ta compagnie ! On a bien rigolé ensemble et c\'était vraiment cool ! Je te souhaite plein de bonnes choses pour la suite : un gros salaire, un job cool, une copine génial...\r\nArcelerr Schmital, ex-Nazi de première catégorie :D', 2219, 2224),
(690, 1, 'Bravo à vous !\r\nVous êtes les mecs les plus fous que j\'ai rencontré dans ma vie.\r\nJe sais pas combien vous êtes réellement mais je vous aime tous !\r\nSi seul Allah sait que je ne supporterai jamais votre équipe fétiche, cela ne m’empêche nullement d\'assister à leurs défaites régulières, non sans un malin plaisir ; ) prochain rendez-vous mardi, en virage nord, pour savourer au maximum cette belle fessée qui s\'annonce : )\r\nAu plaisir de vous revoir très vite, à Lyon ou St Pripri !\r\n\r\n♫ Un seul amour éternel ♫\r\n♫ Un seul amour éternel ♫\r\n♫ Un seul amour éternel ♫\r\n♫ Nous sommes pour Saint-Étienne ♫\r\n♫ Nous sommes pour Saint-Étienne ♫\r\n♫ Nous sommes pour Saint-Étienne ♫', 2369, 2151),
(691, 1, 'Ahhh Matthieu !\r\nJ\'ai passé deux bonne années avec toi et je m\'en souviendra très très longtemps ! Je te souhaite plein de bonheur et puisse-tu trouver une banquière afin de sastisfaire tes envies ! \r\nTes envies de bonheur bien sur ;-)', 2219, 2192),
(692, 1, 'Félicitations pour ton diplôme !! Je te souhaite plein de bonheur et de réussite pour ta vie personnel et professionnel ;-)', 2219, 2213),
(693, 1, 'Salut et félicitations pour le diplôme collègue F1! ^^', 2200, 2190),
(694, 1, 'Salut!\r\nFélicitations pour le diplôme collègue F1! ^^', 2200, 2154),
(695, 1, 'Salut!\r\nFélicitations pour le titre ingénieur collègue F1! ^^', 2200, 2176),
(696, 1, 'Tu parais bien trop triste sur ta photo. Ce n\'est pas toi on dirait. Tu ne rayonnes pas comme d\'habitude.\r\nJe te félicite pour ta réussite et ton avenir qui s\'annonce particulièrement brillant.\r\nA bientôt !', 2162, 2098),
(697, 1, 'Salut!\r\nFélicitations pour le diplôme ingénieur, collègue F1! ^^', 2200, 2091),
(698, 1, 'Félicitations pour ton diplôme !!! On s\'est tous accroché en venant de DUT et on est allé jusqu\'au bout ! Je te souhaite tout le meilleur pour la suite ! ;-)\r\nThibaut', 2219, 2369),
(699, 1, 'J\'espère que tu profites bien du Canada !! Garde ta joie de vivre car ça nous gardent heureux et surtout continue de publier sur Facebook parce que ca me fait rire et surtout car c\'est fun !!!!! Plein de bonheur pour la suite !!\r\nThibaut', 2219, 2214),
(700, 1, 'Félicitations PROUT!!!!!\r\n\r\nOn a beaucoup rigolé pendant ces 3 années!\r\nReste la même enfant souriante et gentil, ne change pas.\r\nEn espérant qu\'on se reverra je te souhaite le meilleur pour la suite et une bonne continuation.\r\n\r\n\"Les enfants sont sans passé et c\'est tout le mystère de l\'innocence magique de leur sourire.\"\r\n\r\n#PROUT1\r\n#PROUT2\r\n#PROUT3\r\n\r\n@NaoufelOfficiel', 2151, 2208),
(701, 1, 'Chère Maëva,\r\n\r\nUne artiste dans le corps et l\'esprit. De nombreuses prestations pleines d\'émotions. Je suis fière de connaître une artiste aussi impliquée dans sa passion. Tu es pleine de joie de vivre et c\'est aujourd\'hui trop rare pour ne pas le souligner.\r\n\r\nJe suis fière de ton parcours et te souhaite un excellent avenir !\r\n\r\nBIsous,\r\nTristan', 2162, 2156),
(702, 1, 'Mon cher grand (très grand) Erwan, fidèle compagnon pendant ces trois années. \r\nTu as su montré ton côté barjot (ou fada) au fur et à mesure du temps et on peut maintenant le dire : t\'es un grand malade.\r\nMerci pour tous ces moments et je te confirme qu\'il y en aura d\'autres ;)', 2233, 2369),
(703, 1, 'Félicitations pour ta réussite, un Grizzly comme on les aime ! \r\nJe te souhaite encore beaucoup de bonnes et belles choses pour le futur. :)', 2162, 2197),
(704, 1, 'Maëva merci pour tes danses enflammées et ta bonne humeur constante tout au long de ces trois années. \r\nCe fut un plaisir de partager ces moments avec toi!\r\nEn espérant que tu nous gratifies encore de nombreuses chorées dont tu as le secret lors de la RDD.\r\nBisous,\r\nMaxime', 2233, 2156),
(705, 1, 'Cher Cyril,\r\nTu as laissé un grand vide à l\'ISIMA depuis ton départ, j’espère que l\'on pourra revivre des moments comme on l\'a fait pendant un an et demi. Dans les bons comme dans les mauvais moment notre binôme est incassable.\r\nDe grands bonheurs pour toi.\r\nA jamais GRIZZLYS,\r\nMaxime', 2233, 2197),
(706, 1, 'Bonne journée !', 2162, 2200),
(707, 1, 'Lolo !!!\r\n\r\nHerzlichen Glückwunsch zu deinem Abschluss!\r\nJe te souhaite plein de bonheur et de succès pour la suite !\r\n\r\nBisous bisous,\r\nPA', 2211, 2188),
(708, 1, 'Sacré Adrien, déjà présent dans notre équipe de feu au WEI avec sa bonne humeur.\r\nOn a vécu trois très bonnes années.\r\nFélicitations et plein de bonheur pour la suite.', 2233, 2221),
(709, 1, 'Bsahtek mon ami ! Félicitations pour ton diplôme, que ta vie professionnelle soit réussie au même titre que ta vie personnelle! Tu nous aura fait rêver tout au long de ces 3 années :)\r\n\r\n#F4RPZ\r\n#Vilebrequin\r\n#PasLaMemeCouleurDePeauMaisLaMemePassion\r\n#Psarkoum\r\n\r\nPatcho', 2090, 2151),
(710, 1, 'Sacré Grosse Merde de Paul Gaucher, tu m\'as bien fatigué pendant pendant trois ans. \r\nMais on a quand même fait pas mal de connerie ensemble. J\'oublie pas pour ton polo ;)\r\nPas besoin d\'en dire plus puisqu\'on va se revoir très très vite.', 2233, 2176),
(711, 1, 'Félicitations Estelle!!!!\r\n\r\nJe te souhaite le meilleur pour la suite et une bonne continuation.\r\nOn est tous derrière toi pour l\'élection de Miss Auvergne, surtout Max.\r\nEn espérant qu\'on se reverra pour que je puisse enfin determiner qui est le plus fou entre toi et Bobby.\r\n\r\n#Houstonavouslabase\r\n#Sicetaitdesvideosetpasdesmessagejauraisfaituntoursurmoimemeentraversantlebdeenmontantsurlapointedemonpiedcommedanscassenoisette\r\n#tropenavancedanslafolie\r\n#jelesais\r\n#tusaisquejelesais\r\n#maxlesait\r\n#tusaisquonlesait\r\n#onsaitquetusaisquonlesait', 2151, 2220),
(712, 1, 'Sacré Brice. De très bon moment ensemble, en espérant que ce soit pas fini.\r\nPlein de bonne chose pour la suite, #Lalune', 2233, 2077),
(713, 1, 'Marion !!!\r\n\r\nFélicitation pour ton diplôme :)\r\nJe te souhaite plein de bonheur, de succès et tout et tout !\r\nVivement que tu reviennes à Paris ;)\r\n\r\nBisous bisous,\r\nPA', 2211, 2166),
(714, 1, 'Heureusement que tu étais la pour me soutenir pendant les TP à 8 heures du mat\' et pour me suivre durant mes périodes de chant incontrôlé.\r\nFélicitation à toi, tu le mérites et pleins de jolies choses pour la suite.\r\nDes Bisous,\r\nMax', 2233, 2208),
(715, 1, 'Vieille Merde', 2233, 2154),
(716, 1, 'Mon cher Antony !\r\nPuisque nous conversons ensemble très souvent, je crois que je vais en fait pervertir l\'utilisation de cet espace qui m\'est normalement dédié pour te féliciter de ta réussite. Si nous revenons à la base de la communication, l\'écriture est le moyen que l\'homme a trouvé pour laisser une trace d\'une conversation orale. Ce que nous pouvons déduire, c\'est que cet encadré est un moyen de communication. AHAHAH ! Donc je peux écrire ce message. C\'est curieux, parce que j\'aurai pu m\'en rendre tout de suite lorsque j\'ai écrit \"Mon cher Anthony\". J\'ai l\'impression de parodier ton style alors qu\'en fait je trouve que j\'ai plutôt du talent. Je vais donc continuer ce message avec une blague :\r\n\"Qu\'est-ce qui est noir, blanc, noir, blanc, noir, blanc... ? Une bonne sœur qui déboule les marches. \"\r\nCela peut paraître de mauvais goût mais je trouve ça particulièrement drôle. Y\'en avait une autre avec une histoire de petite fille qui tombe de la balançoire ou d\'un truc qui a deux pattes et qui saigne mais celle-ci est plutôt soft.\r\n\r\nJe vais arrêter ce message parce que je ne sais pas s\'il va rentrer sur la feuille.\r\nJe te félicite pour ton réussissement, et ça a été un véritable plaisir de partager tous ces moments avec toi.\r\nA très bientôt mon cher ami !', 2162, 2200),
(717, 1, 'Cher Thibaut, toutes mes félicitations !\r\nJe te souhaite une très bonne continuation, mais te connaissant je ne me fais absolument aucun soucis !\r\nA bientôt !', 2369, 2219),
(718, 1, 'Ma petite Marion, que de changement pendant ces trois ans mais ce qui n\'a pas changé c\'est toujours ta bonne humeur et aussi tes coups de gueule.\r\nPleins de bons moments passés ensemble, en espérant qu\'il y en est encore beaucoup.\r\nPleins de bonheur pour le futur et surtout continue comme ça :)\r\nPleins de bisous,\r\nMax', 2233, 2166),
(719, 1, 'Coucou Thibaut!!\r\nHaha je suis contente que mes errances sur internet apportent le sourire ! :)\r\nJ\'espère que t\'as passé une super année, avec un stage sympa :)\r\nEt puis bien sûr, félicitation pour avoir survécu aux cours de modélisation du père noël, celui de maths de koko, ... Tu mérite ton diplôme! ;) :p haha\r\nxoxo\r\nMichèle', 2214, 2219),
(720, 1, 'David !!!\r\n\r\nFélicitations pour ton diplôme !\r\nJe te souhaite plein de chouettes trucs pour la suite ;)\r\n\r\nBisous bisous,\r\nPA', 2211, 2368),
(721, 1, 'DAVID TROUDUKU LOURD SANTIAGO MICHELIN, vous êtes un sacré malade dans votre tête et vous avez aussi un gros problèmes avec le feu.\r\nQu\'es ce qu\'on a pu faire des conneries ensemble, heureusement que t\'as été là, sans toi ça aurait été très différent. \r\nMais malheureusement pour toi, je vais encore t\'emmerder pendant de nombreuses années.\r\nla bise PICHE,\r\nMax\r\n\r\nps: T\'es vraiment une salope, les 80kgs t\'attendent à la salle', 2233, 2368),
(722, 1, 'Félicitations pour ton diplôme mon frère! Que ta vie professionnelle soit remplie de réussite! Comme on dit ici-bas, inch\'allah...\r\nOn aura bien rigolé ensemble durant ces 3 ans mon petit Paul, ça m\'a fait plaisir que tu fasses partie du #107 crew ;)\r\n\r\nEt pour finir, la citation qui va bien\r\n\"Tout ce que j\'ai, je l\'ai chié, j\'ai taffé hard comme à l\'usine\r\nMême au tard-mi, j\'pète pas un fusible\r\nDur comme un rocher, difficile à battre comme un gaucher\r\nRap de boucher, résidus de crack dans la cuisine\"', 2090, 2176),
(723, 1, 'El Portuguesh !!!\r\nLa malédiction a fini par te lâché mais tu nous a sacrément fait rire quand même.\r\nOn se retrouve bientôt pour d\'autres aventures comme on en a déja vécus beaucoup depuis 3 ans.\r\nFélicitations pour ton diplôme et pleins de bonnes choses pour la suite.\r\nLa bise,\r\nMax', 2233, 2256),
(724, 1, 'Félicitation Naouf pour ton diplôme ! Et merci pour ton message ! Toi aussi ne change pas et garde ta détermination et ton énergie, elles mènent à de grandes choses :) Honnêtement, qui aurait cru qu\'on organiserait vraiment ce combat de boxe au bde ! Respect !\r\nQue de bonnes choses pour la suite !\r\n\r\nLa rose auvergnate alias prout', 2208, 2151),
(725, 1, 'Yoyo la petite folle,\r\nMalgré ton côté psychorigide on a quand même sacrément rigolé ensemble. Finalement on fait pas un si mauvais binôme tout les deux ;)\r\nEn espérant de nouveaux épisodes de la cage aux folles prochainement.\r\nBisous Bisous,\r\nMax', 2233, 2213),
(726, 1, 'Félicitation pour ton diplôme !\r\nMerci d\'avoir été là pour aider les prépas qui en avait besoin ! On a eu notre diplôme en partie grâce à toi !\r\nBonne continuation.', 2157, 2171),
(727, 1, 'Trois années à se suivre, on s\'en est pas mal sorti finalement tout les deux ;)\r\nPleins de fou rire en cours et en dehors qui resteront dans les mémoires et imprégnés dans les murs de l\'ISIMA.\r\nDommage que tu sois né du mauvais côté de la France.\r\nFélicitations et pleins de bonheur pour ta vie Parisienne.\r\nLa bise,\r\nMax', 2233, 2157),
(728, 1, 'Cyril !!!\r\n\r\nToutes mes félicitations pour ton diplôme !\r\nJ\'espère que tu t\'es éclaté, et que tu t\'éclatera encore, aux US (j\'ai vu des photos sur FB, je ne me fais pas de soucis ;))\r\nJe te souhaite plein de bonheur et de succès !\r\n\r\nBisous bisous,\r\nPA', 2211, 2197),
(729, 1, 'DJ Chauvex !!\r\nMerci pour toute ton aide en cours comme en dehors, je sais pas comment j\'aurais fait sans toi. \r\nReste comme tu es, t\'es au top malgré ton petit( assez gros quand même) côté gênant mais ça fait partie de ton charme ;)\r\nPleins de bonne chose pour ta nouvelle vie Lyonnaise.\r\nLa bise,\r\nMax', 2233, 2243),
(730, 1, 'Tu y aurais cru si on t\'avait dis que tu serais sur Paris à la fin de l\'ISIMA (et que tu veux y rester !) ? On en aura parcouru du chemin depuis cette randonnée d\'inté... Félicitation pour ton diplôme et pour ton parcours. Au plaisir de vous revoir lors de notre pendaison de crémaillère ou avant !', 2157, 2175),
(731, 1, 'Sacré PA, éternel timide mais tu nous as quand même gratifié de grands moments quand tu es sorti de ta réserve. J\'espére que tu vas t\'éclater à Paris.\r\nFélicitations pour ton diplôme et merci pour ta grande aide.\r\nLa bise,\r\nMax', 2233, 2211),
(733, 1, '@NaoufelOfficiel', 2151, 2368),
(734, 1, 'On aura partagé beaucoup de charisme pendant ces 2 ans ensemble à l\'ISIMA. 2 années qui auraient pu se transformer en 3 si tu t\'étais pas barré comme un enfoiré... En tous cas,  on aura partagé beaucoup de discussions fort intéressantes ! T\'as intérêt à garder contact. PS : Mes tubes de Lysopaine ne sont jamais vide.', 2190, 2216),
(735, 1, 'Ben Ben Ben ... que dire à part qu\'on fond de toi t\'es un gros nounours qui nous a fait bien rire. Si seulement tu pouvais être moins borné des fois.\r\nUn grand membre du G32 qui a fait partie de toutes nos aventures.\r\nFélicitations à toi et plein de bonne chose pour la suite ;)\r\nLa bise,\r\nMax', 2233, 2098),
(736, 1, 'En mémoire de nos projets finis à l\'arrache ! On aura fait une belle équipe de choc tous les deux :) J\'espère voir un jour le shiftlight sur ta Clio... ou la Porsche', 2190, 2079),
(737, 1, 'Bon ben tu vois on a finit par y arriver à ce diplôme (on dira pas comment).\r\nMalgré que tu sois un gros Thug on aura quand même bien rigolé.\r\nFélicitations et à la prochaine ;)\r\nMax\r\n\r\nps : j’espère que t\'es pas une salope, il y a les 80 kil qui t\'attendent la semaine prochaine', 2233, 2158),
(738, 1, 'Bobby, l\'homme qui plané au dessus de l\'ISIMA.\r\nHeureusement que tu étais là pour représenté tout les nouar !!\r\nFélicitations Bobby !!!', 2233, 2223),
(739, 1, 'Mon cher Maxime, on a passé tant de bons moments ensemble que je ne saurais tous te les citer.\r\nLa relation d\'amitié que nous avons liée sera gravée en moi à jamais. Tu es une si belle personne!\r\n\r\nMais non je déconne, t\'es qu\'un gros tocard !\r\nSache quand même que tu auras marqué ma scolarité à l\'ISIMA (en bien ou en mal je sais pas trop encore).\r\n\r\nEt pour reprendre une célèbre citation d\'un grand penseur \"si j\'avais su que c\'était ca l\'ISIMA je serai allé en licence\".\r\nLa vérité c\'est que je t\'aurais jamais rencontré si j\'étais pas venu ici, et pour ca, ca valait vraiment le coup de venir.\r\n\r\nJe te kiff grand fou ❤️', 2381, 2233),
(740, 1, 'Bravo pour le diplôme, et surtout bravo pour avoir réussi à supporter la fine équipe du G1 !\r\nCes 5 années seront passées vite ! J\'espère qu\'on gardera contact :)\r\nBises, \r\nLéo', 2190, 2208),
(741, 1, 'Félicitations PA, \r\nc\'était pas gagné pour toi d\'avoir ton diplôme, mais tu as quand même réussi !\r\n\r\nPlus sérieusement, je suis content de t\'avoir connu, on a passé plein de bons moments, que ce soit à l\'ISIMA ou à faire les touristes. J\'espère que ça ne s\'arrêtera pas là, et je pense que d\'autres aventures nous attendent !\r\n\r\nProfite de la vie, elle passe très vite ;)\r\n\r\nYoann.', 2213, 2211),
(742, 1, 'Le G1 était hard. Très très hard.\r\nA base de thé et de chicha, quoi de mieux ?\r\nContinue comme ça l\'Ancien et à très bientôt !', 2190, 2151),
(743, 1, 'Félicitation pour ton diplôme, j\'y croyait pas, tu reviens de loin !\r\nMerci pour ton accompagnement sur ces trois années, et pour les expériences que l\'on a partagé. C\'était un plaisir de partager mon point de vue avec toi sur des sujets aussi bien légers que sérieux.\r\nBonne continuation et à la prochaine !', 2157, 2213),
(744, 1, 'LUUUUUUUUUUUUUUUUUUUUUUUUUUUCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCC BLBLBLBLBLBLBLBLBLBLBLBLBLBLBLBLBLBLBL.\r\nComment aurais-je pu avoir un meilleur parrain pour me lancer dans le grand bain de l\'ISIMA. Tellement fais de connerie ensemble que je pourrais même plus toute te les dire.\r\nT\'as été un mentor pour moi et je t\'en remercie.\r\nFélicitations et pleins de bonne chose pour la suite.\r\nLa bise,\r\nMax', 2233, 2116),
(745, 1, 'Mdr mon petit Naoufel\r\n\r\nOn a plus rigolé qu\'on a bossé mais putain que c\'était bon ^^ Ah base de vilebrequin , d\'énigme en méca flux, de \"panel\" en proba, d\'imitations improbables,... J\'espère bien te revoir si je passe par Yonl !!!!\r\nPleins de bonheur et de réussite parce que certes t\'es un escroc mais t\'es quand même doué (je te pardonne le coup de l\'imprimante en salle d\'accès libre)\r\n\r\nA bientôt\r\n\r\n#75\r\n#4x4NoirVitreFumé\r\n#FouinyBaBe\r\n#Veauche', 2158, 2151),
(746, 1, 'Diplôme empoché avec du mérite, même s\'il y eut un travail d\'équipe à un moment ^^Malgré le fait que tu sois petit et pas très bon au foot, c\'est vrai qu\'on aura bien rigolé et bien bu aussi ;)\r\n\r\nVite samedi qu\'on fête ça. Bisous gros tank\r\n\r\nBilly aka Valentin ALLOT ^^', 2158, 2233),
(747, 1, 'Toi Président, tu maintiendras la cohésion au sein de l\'Assofi ;\r\nToi Président, tu supporteras la rigueur de Yoann et la folie de Naoufel ;\r\nToi Président, tu seras épaulée par une demoiselle charmante ;\r\nToi Président, tu me casseras bien les couilles avec CGI ;\r\nToi Président, tu mettras du jaune partout ;\r\nToi Président, tu empêcheras David de brûler l\'ISIMA.\r\n\r\nContrat remplit, l\'ISIMA est encore là, alors bravo.  \r\n\r\nFélicitations aussi pour ton diplôme. Ce n\'est que le début d\'une autre grande aventure, et je ne doute pas que nos routes se croiseront à nouveau, et pas qu\'une fois.\r\n\r\nBisous bisous,\r\nYoann.', 2213, 2233),
(748, 1, 'Un sacré chemin que l\'on a parcouru depuis la rando de l\'inté... On aura partagé de très bons moments comme des plus mauvais mais c\'était un plaisir de le faire avec toi. \r\nOn s\'en sort très bien quand je vois le niveau qu\'on avait dans le G32 ! Une nouvelle aventure commence, espérons et faisons en sorte qu\'on continue à la partager ensemble.\r\nFélicitations pour tout, bisous bisous.', 2157, 2233),
(749, 1, 'Mon p\'tit Adrien !\r\nLes cours d\'Allemand en ta compagnie auront été bien plus intéressants que si tu n\'avais pas été là !\r\nOn aura peut-être pas fait beaucoup de soirées, mais la qualité prime sur la quantité :)\r\n\r\nBonne continuation et à bientôt j\'espère !', 2190, 2221),
(750, 1, 'Félicitation pour ton diplôme et bonne continuation en France ou au Brésil. Si tu passes vers Paris n\'hésites pas à me faire signe !', 2157, 2514),
(751, 1, 'Petit trap,\r\n\r\nQue de session rap & rnb non stop en indé !!! On aura quand même bien déliré au bde et surtout en vacance avec le fameux tête a tête avec un tronc a 6 feuilles mdr !\r\nJ\'espère qu\'on arrivera à se capter pour sortir un vrai son. \r\nPsartek fraté.\r\n\r\nA+', 2158, 2176),
(752, 1, 'Bon finalement on aura pas eu l\'occasion de former les Hamzoul... Pas faute d\'avoir essayé ! \r\nFélicitation pour ton diplôme, je te souhaite une bonne continuation dans cette nouvelle aventure !', 2157, 2176),
(753, 1, 'Mon cher Naoufel,\r\nj\'avoue que nos profils sont assez différents, mais comme tu l\'as dit, cette différence n\'est pas que de l\'opposition, c\'est aussi une forme de complémentarité. \r\nTel le Ying et le Yang, il me faudrait un peu plus de folie, et toi un peu plus de rigueur ;)\r\n\r\nProfite de la vie, elle passe vite, et comme on dit \"Félicitations mon frère\" !\r\n\r\nYoann.\r\n\r\nPS: Pâtisserie s’épelle \"I-N-F-O-R-M-A-T-I-Q-UE\", fais passer le mot.', 2213, 2151),
(754, 1, 'Ex-Prezz !\r\nAvec tous les hauts et bas qu\'il y aura eu, on aura quand même fait un BDE de folie qui restera à jamais dans les mémoires. Ou dans la mienne en tous cas... Je suis content d\'avoir pu faire partie de cette équipe avec toi et j\'espère pouvoir te recroiser si tu ne décolle pas pour de bon pour les US !\r\n\r\nBonne continuation !', 2190, 2197),
(755, 1, 'Félicitations pour ton diplôme d\'ingénieur en Pâtisserie, j\'ai hâte de goûter à tes gâteaux ;)\r\n\r\nAllez sans rancune,\r\nBisous bisous,\r\nYoann.', 2213, 2223),
(756, 1, '@NaoufelOfficiel ?\r\nQue dire?\r\nJe suis perdu devant tant de folie et de rigolade, qu\'aurais été l\'ISIMA sans toi? Je préfère ne pas l\'imaginé. Plus qu\'un collègue, pus qu\'un pote, plus qu\'un amis, j\'ai trouvé un frère avec toi (malgré que tu sois de type Caucasien, mais bon on va passer outre).\r\nJe ne saurais même pas donné une approximation du nombre d\'expressions, chorées, chansons, blagues que tu nous as transmis.\r\nFélicitation à toi, tu as réussi, t\'as famille peut être fière de toi.\r\nJe finirai simplement par te dire que t\'y es vraiment un grand malade, le plus grand de tous.\r\n\r\nJe suis sur qu\'on va se revoir très bientôt donc je ne te dit pas au revoir mais à bientôt.\r\n\r\n#Fuego\r\n#LaisseNousFaireLePain\r\n#Tusaistrésbienquel\'onsaitcequetusaisqu\'onsait\r\n#j\'aipaspeurdetoi\r\n#j\'aipeurdepersonne\r\n#allezl\'OM !!!!', 2233, 2151),
(757, 1, 'Bravo pour ton diplôme mon petit Raphy. \r\nJ\'espère que ces 3 années t\'auront appris à mieux gérer ton emploi du temps et  à pas faire les choses au dernier moment, comme par exemple laisser un message sur le Yearbook à moins d\'1h de la clôture des mots. \r\nAh merde... j\'ai écrit mon message après toi.... je crois que tu as déteins sur moi... j\'espère que l\'inverse est aussi vraie alors ;)\r\n\r\nAllez, encore félicitations, et je ne doute pas qu\'on se reverra !\r\n\r\nBisous, bisous,\r\nYoann.', 2213, 2157),
(758, 1, 'Merci pour ces moments de fou rire et ces petites piqûres de rappel du bled. Ca me manquera les chicha nahnah au soleil sur les canaps... \r\nInchallah on se reverra (peut être même en Tunisie) mais bon j\'en doute pas ! Ne change pas, reste Schweppes !\r\nPS : Félicitation pour ton hold-up, oui oui je parle de ton diplôme. Heureusement t\'es pas le seul...', 2157, 2151),
(759, 1, 'Viiiiiiiiiiite faut que je te laisse un message sur ton Yearbook avant que ce soit trop tard....\r\n\r\nJe m\'y suis pris au dernier moment alors j\'ai pas le temps de t\'écrire un poème ou une fable, mais je vais quand même m\'attarder sur l\'essentiel : toi ;)\r\nTu es une femme excellente, et Max a beaucoup de chance de t\'avoir. Je trouve que tu as toujours su trouver une position juste et équilibrée, et fournir avis et remarques constructifs. \r\nFélicitations pour tout : ton diplôme, le BDE, l\'Assofi, supporter Max <3... Ne change rien ! (sauf peut-être tes lunettes, parce que visiblement il y a encore des progrès  à faire de ce côté)\r\n\r\nGros poutou,\r\nYoann.', 2213, 2220),
(760, 1, 'Wallai Billy, ouuuu aaaaah.\r\nAu premier jour je te prenais pour un vieux footballeur blond qui en fais beaucoup trop , mais en fait t\'es un vieux footballeur blond qui en fais beaucoup trop et c\'est plutot cool. On se retrouve dans 2-3 ans , on sort album , ca va etre du lourd sa mère.\r\nPasse leur le salam.', 2176, 2158),
(761, 1, 'CKKP ?\r\n\r\nSi je ne devais retenir qu\'un chose de toi ce serait surement ça.\r\nOn a mis du temps à se connaitre, faut avouer que tu es une étrange personne quand même ;). Mais quand on te connait vraiment on sait a quel point t\'es adorable. Oui oui j\'ai bien dit adorable !\r\n\r\nJe te souhaite toute la réussite possible pour la suite M. Santiago.\r\n\r\nKiss kiss love.\r\n\r\nPS: Et les chevaux sont repartis ...', 2381, 2368),
(762, 1, 'Félicitations Lolo ! Te voilà ingénue ! (c\'est pas comme ça qu\'on dit?)\r\n\r\nContinue de profiter de la vie comme tu le fais, car c\'est le plus important !\r\nJe te souhaite de réussir tes projets, personnels comme professionnels et de toujours garder le sourire.\r\n \r\nBisous, bisous,\r\nYoann.', 2213, 2188),
(763, 1, 'Monsieur MICHELIN Santiago, \r\n\r\nJe ne suis point aussi doué que vous pour faire des poemes !!\r\n\r\nCe que je peux te dire c\'est que t\'y es fou et surtout toi et le feu font deux! Mais n\'oublions pas que tu as la formation incendie !! Tu vois ce que je veux dire ou pas?\r\nDe très bons moments avec toi toussa toussa, tu vois ? De la lourdeur, tu vois? de la bonne humeur, tu vois ? Les grizzlys au top, tu vois?\r\n\r\nBravo pour tout le travail que tu as fais pour l\'Assofi et ce magnifiiiique Yearbook ! Pleins de bisous et aussi félicitation pour ton diplôme monsieur le professeur !! \r\n\r\n#tuvois?\r\n#tonaccentdemerdedusud\r\n#feu\r\n#fou', 2220, 2368),
(764, 1, 'Félicitation pour ces 3 années et ce CDI à la clé ! Ca m\'a fait plaisir de passer un bout de chemin avec toi, je te souhaite bonne chance pour la suite et à très bientôt !', 2157, 2211),
(765, 1, 'Putain de sale nazi qui insulte des russes sur CS en dormant sur des taies d\'oreiller SpiderMan. \r\nJe pense j\'ai bien résumé le personnage. \r\nBisous bisous.', 2176, 2090),
(766, 1, '\"Ouai t\'inquiètes Cyril , je la fait dans 10 minutes ma perm \"', 2176, 2197),
(767, 1, 'Pourquoi tu continues le cursus ingenieur  ?  Tu viens du 7-8, lance toi dans le rap bordel.', 2176, 2157),
(768, 1, 'Merci pour ces trois années d\'ondes positives, ça a été un plaisir d\'être partner sur un projet de vendage de tapis, on aura beaucoup appris !\r\nBonne chance pour la suite et j\'espère qu\'on se reverra (au hasard quand t\'es de passage sur Paris).\r\nBisous bisous !', 2157, 2098),
(769, 1, 'Bons gros souvenirs avec le bon vindre!', 2091, 2368),
(770, 1, 'Comment faire cours avec toi ^^\r\nJe préfère assurer le coup avec un petit rap :\r\n\r\nDe la création de ton surnom à la remise de ton diplôme\r\nOn aura quand même fait les cons nous les gros thugs du puy de dôme\r\nSéance de rap avec Luap,djamel, pacho, Naouf et même bobby\r\nJe fais le grand derrière mon mac, mais y\'a une pointe de nostalgie\r\nTu pousses à la salle tu fais pas du pain, \r\nJ\'espère qu\'a Toulouse je serai invité\r\nOn se rappellera de notre voyage à Turin\r\n Et nos drôles d\'envie de \"claqué de l\'enrobé\"\r\n\r\nEncore félicitation mon pote !\r\nA+\r\n\r\n#Pectoraux', 2158, 2154),
(771, 1, 'Bouuuuuuh la jalouse !\r\n\r\nJe te souhaite beaucoup de réussite dans ta vie professionnelle et amoureuse (tu peux surement trouver mieux que le tocard qui te sert de copain actuellement).\r\nJe suis ravi d\'avoir fait ta connaissance Estelle Mounier (même si faut avouer que t\'es un peu bizarre).\r\n\r\nPleins de bisous !', 2381, 2220),
(772, 1, 'Hello ! (ahah tu vois je me mets à l\'anglais) mon petit, \r\n\r\nFélicitation pour ton diplôme même si tu as un peu triché sur la dernière année et que tu as eu la chance de découvrir les magnifiques paysages des States, chanceux !!  Je suis heureuse de t\'avoir connue et d\'avoir partager pleins de bon moments avec toi, le BDE nous a permi cela :) \r\nJ\'espère qu\'il y aura d\'autres bons moments en ta compagnie à commencer par la RDD :) !\r\n\r\nPleins de bisous et à très vite :D\r\nEt tout le bonheur du monde pour la suite :)', 2220, 2197),
(774, 1, 'Bonne route parrain, bisous bisous <3', 2300, 2157),
(775, 1, '<3', 2300, 2116),
(776, 1, 'Bravo Jérémy pour ton diplôme, c\'est bien mérité !\r\nJe n\'oublierai pas nos sympathiques déjeuner en ta compagnie, pendant quelques mois. \r\nJ\'espère que tu trouveras un travail qui te plaît, et que tu garderas la pêche pour la suite !\r\n\r\nBisous bisous,\r\nYoann.', 2213, 2079),
(777, 1, 'Un petit mot quand même à ma voisine de 1ère année et à ma binôme en espagnol ! On aura quand même bien fait nos fouines et surtout bien rigolé avec l\'homme qui convulse quand il compte ^^\r\nPlein de réussite même si je ne suis pas inquiet pour toi.\r\nBisous ma ptite René\r\n\r\n#LaTaupe', 2158, 2220),
(778, 1, 'Le bds c\'était mieux avant, in ratel we trust! Tu t\'es quand même pas trop mal démarré pour ton we ski, grâce à mon coaching solide et efficace!', 2091, 2188),
(779, 1, 'Maêêêeeeêêêêva (avec l\'accent du mouton)\r\n\r\nahha je me disait bien que je te faisais peur! :p\r\nMais saches que ce n\'était pas l\'intention, c\'est juste que j\'ai parfois un humour étrange avec des personnes avec qui je me sens bien\r\nTu fais partie des personnes de l\'isima que j\'ai vraiment appréciées et j\'espère qu\'on aura maintes occasions d\'aller boire un coup (parce que si on boit pas un coup c\'est pas bien !)\r\n\r\nbisous bisous et plein de bonheur et de réussite!', 2236, 2156),
(780, 1, 'Bon pour être honnête (et comme tu le sais déjà :p ) j\'ai grave la flemme d\'écrire ce truc mais vu que t\'as fait un effort je vais le faire aussi. Par contre je risque d\'être beaucoup plus bref et concis que toi :D\r\n\r\nPar ou commencer ? Je crois que je vais faire un remerciement général pour ces 3 années kiffantes qu\'on vient de passer ! Merci pour les délires en cours, mais aussi pour les heures passées a se faire chier : c\'était super de se faire chier avec toi (même si t\'étais pas toujours là hein ;) Moi non plus d\'ailleurs xD )\r\n\r\nMerci aussi de nous avoir motivé pour le tricot cette année, on a vraiment passé une super dernière année grâce à ça et c\'est en grande partie grâce à toi quand même ;)\r\n\r\nBref ça commence a ressembler a des adieux et j\'ai pas trop envie vu qu\'on se reverra dans tous les cas ;) Du coup des gros bisous et ne t\'inquiète pas, même si on rentre dans le monde des grands et des responsabilités on aura toujours le temps de se faire des trucs ;) Au pire on ressassera le bon vieux temps comme des anciens :p\r\n\r\nA bientôt et MEUUUUUUUUURS !!!', 2189, 2221),
(781, 1, 'Hello Mr Berthel!\r\n\r\nA ce que j\'ai pu voir tu as pu passer du temps en Allemagne, et j\'espere que tu a autant envie d\'y vivre que moi! (ca roxx du poney licorne l\'allemagne!)\r\nSinon le Canada, sache que ca n\'est pas mieux qu\'a l\'isima, je me suis souvent dit que j\'aurais voulu passer cette derniere année avec vous, et peut etre aurais tu eu l\'occasion de revoir Anne...\r\n\r\nAmuse toi bien dans ta nouvelle vie d\'ingénieur! A bientot j\'espere!', 2236, 2221),
(782, 1, 'Raphy !!!\r\n\r\nToutes mes félicitations pour ton diplôme !\r\nJe te souhaite plein de bonheur et de succès pour la suite (même si tu nous lâches ;))\r\n\r\nBisous bisous,\r\nPA', 2211, 2157),
(783, 1, 'Coucou la bretonne!\r\n\r\nBah cette année n\'a pas pu etre si terrible que ca! il y avait quand meme petit-coeur!\r\nD\'ailleurs dans mon bureau ya un mec qui s\'appelle Robin et qui ressemble à Mr SuperDechet!\r\nSinon ca m\'a quand meme pas mal manqué de t\'avoir dans ma classe et j\'espere qu\'avec Romain vous finirez à Toulouse! \r\n\r\nEn attendant on se voit dans quelques jours... :)\r\n\r\nBisous Bisous', 2236, 2188),
(784, 1, 'Il ne me reste également plus que quelques minutes pour te laisser un petit message ... la pression ! \r\n\r\nTon d\'abord félicitation pour ton diplôme, et oui sans grande surprise tu as su obtenir ce diplôme haut la main c\'est surement grâce en partie à ton esprit très \"IKEA\" ;P\r\nGrâce à toi la gestion de l\'assofi a été un franc succès, et le fouillis de l\'année dernière n\'a pas fait long feu. Tu as su calmer les ardeurs des nombreux fous de l\'équipe de l\'assofi ;)\r\nJe me souviendrais également de toi pour ton côté chaud lapin envers les beaux mecs (enfin pas toujours beau). Reste comme tu es mais essaie de dormir le matin de temps en temps ^^\r\n\r\nJ\'attends toujours de savoir qui était la personne avec qui tu as fais des cochonneries à l\'ISIMA ! Pleins de bonnes choses pour la suite, en espérant que tu trouves ton bonheur :) \r\n\r\nPleins de bisous !!', 2220, 2213),
(785, 1, 'Yo ch\'Bordelais!\r\n\r\nOuais je me rapelle aussi ces soirées pres du Five, ou avec pichon et malrin on a vomis chacun notre tour aux 3 premieres soirée :)\r\nDu coup je suis bien sur Toulouse pres à faire l\'ecureuil quand tu viendras me rendre visite!\r\n\r\nOn se voit à la RDD!\r\n\r\nA bientot ch\'tot bi! (joue pas trop avec tes oreilles!)', 2236, 2185),
(786, 1, 'Monsieur Avillach.\r\n\r\nUn fillot en or, toujours fidèle et qui ne m\'a jamais réellement déçu. On ne s\'est jamais vraiment séparé, et notre embrigadement mutuel pour les 24h du ZZ marque la force de notre amitié. Je ne sais pas si ça veut dire un truc ce que je viens d\'écrire, mais c\'est jolie.\r\n\r\nQue la suite de ta vie soit la plus heureuse possible si par malheur on se perd de vue.', 2116, 2233),
(787, 1, 'On aura appris pas mal de choses durant ces trois ans,  comment simuler des files d\'attentes en qnap, comment calculer le nombre de flops mais aussi comment mixer. Un plaisir d\'avoir parcouru un bout de chemin avec toi. \r\nBon courage pour la suite !', 2157, 2243),
(788, 1, 'Chère Michèle,\r\nTu es la bienvenue à Lyon pour faire des gâteaux quand tu veux ! Voire même pour un petit ballon ;)\r\nJ\'ai été heureux de pouvoir te rencontrer dans ta petite escale auvergnate entre la Nouvelle Calédonie et le Québec !\r\nBonne continuation, et que du bonheur !\r\nBises,\r\nLéo', 2190, 2214),
(789, 1, 'Hello l\'fluteux!\r\n\r\nLe Canada c\'etait pas mal, mais pas aussi bien que la vie etudiante à l\'isima (par contre les cours petaient leurs meres)\r\nT\'as plutot interet à me faire un bon truc pour la RDD (je parle d\'un plat ou d\'une tarte : J\'AI FAIM apres le canada!)\r\n\r\nAu passage ta nouvelle barbe est vraiment chouette!', 2236, 2179),
(790, 1, 'Félicitation pour le hold-up ! T\'as pas été seul, l\'ISIMA c\'est vraiment une école d\'escroc de toute manière. Je garderai de bons souvenirs des cours qu\'on a eu ensemble !\r\nAu plaisir de te revoir sur Paris !', 2157, 2121),
(791, 1, 'Je prend juste mes covoits,  je pars dans une bière!', 2091, 2176),
(792, 1, 'hello mon ptit Leo!\r\n\r\nJe suis grave a la bourre du coup faut que j\'ecrive plein de trucs a tout le monde!\r\n\r\nEn tout cas cette année sans vous m\'a marqué, c\'etait vraiment moins bien  socialement :p\r\nEt merci pour toutes les capotes que tu nous a filées, j\'oublierai  pas ce geste :p\r\n\r\nJ\'espere qu\'on aura pas mal l\'occasion de se revoir!\r\n\r\nBisous bisous beau barbu!', 2236, 2190);
INSERT INTO `yearbookmessages` (`id`, `yearbook_id`, `message`, `userFrom_id`, `userTo_id`) VALUES
(793, 1, 'Félicitation monsieur le roi des ingénieurs fous.\r\n\r\nEtre à tes côtés ces dernières années a certes aggravé mon état mental, mais ce fut un plaisir. Belle rencontre pour moi qui ne te connaissait que peu avant mon redoublement.\r\n\r\nOn se retrouve dans quelques années pour monter Bobby\'s Life.\r\n\r\nRéussite et folie pour la suite', 2116, 2151),
(794, 1, 'Félicitation Naoufel pour ton diplôme!!!! \r\n\r\nCar oui le plus fou d\'entre nous c\'est bien TOI, il n\'y a pas de doutes !! (suivi de près par ton binome de choc Bobby !!) \r\nPleins de bonnes choses pour la suite, en espérant te revoir après l\'ISIMA, tu auras enfin l\'occasion de te rendre compte que je ne suis pas folle ;)\r\n\r\n@naoufelofficiel\r\n#lefoucesttoi\r\n#maxsaitquecesttoilefouetpasmoi\r\n#F4classedeloubards', 2220, 2151),
(795, 1, 'Hello antoine!\r\n\r\nTu sais quoi? je suis a Toulouse! en Stage, et a cote de ca je fais plein de trucs dans la foret avec des nains et des elfes qui fabriquent des armes pour se taper dessus!\r\n\r\nJ\'espere que tu auras apprécié cette premiere année avec un camarade addicte aux jeux telephones qui est incapable de se concentrer sur le cours!\r\nEn tout cas j\'ai kiffé :p\r\n\r\nBisous bisous', 2236, 2205),
(796, 1, 'Binbin,  si elle te fait chier je la dégomme!', 2091, 2236),
(797, 1, 'Félicitations @Maximeofficiel!\r\n\r\nAvant ty été fou et maintenant tyé fou et ingénieur!!! C\'est vraiment n\'importe quoi!\r\nJe te souhaite donc le meilleur pour la suite (sauf pour l\'OM, j\'espère qu\'ils vont descendre en CFA2), une bonne continuation et surtout de rester fou comme t\'es. Ne change rien.\r\nGeorges Wolinski disait, \"L\'humour est le plus court chemin d\'un homme à un autre.\" Nous on a tellement rigolé ensemble pendant ces 3 années que ce chemin et devenu quasi inexistant et c\'est ce qui fait qu\'on soit aussi proche aujourd\'hui. J\'espère qu\'on le restera.\r\nJe compte sur toi pour compter sur moi\r\nJ\'espère sincèrement qu\'on va continuer à se voir régulièrement et représenter le fuego de partout.\r\n\r\n#maintenantonvafairelepain\r\n#donclaissenousfairelepain\r\n#tyévraimentunmaladeetjesuispretalejurer\r\n#@NaoufelOfficiel?\r\n\r\n@NaoufelOfficiel', 2151, 2233),
(798, 1, 'Yo l\'partenaire de projet de 2e année!\r\n\r\nj\'espere que je t\'ai pas trop manqué cette année (bien que vous vous m\'ayez bien manqué)\r\nen tout cas cette année en F1 avec toi était vraiment chouette!\r\n\r\nPourvu qu\'on puisse se revoir assez souvent!\r\nOn se voit a la RDD! Zoubi', 2236, 2237),
(799, 1, 'On pourrait voir cette ville sans drogue\r\n\r\nEn vérité ils nous en donnent\r\n\r\nCe sera bientôt légalisé\r\n\r\nIls savent très bien qu\'ça nous endort\r\n\r\nParfois j\'oublie le passé, cervelle cassée\r\n\r\nMoi j\'vis sans trop d\'logique\r\n\r\nEncore un son qu\'faudrait placer sur Skunk Anthologie\r\n\r\nY\'a du shit quand y\'a plus de zeb face au verre on tise cul sec\r\n\r\nFumette et buvette, nous on s\'en pète du haut du Q7\r\n\r\nParfois pressé, toujours précis, j\'opère à la NIP Tuck, collage despi dans l\'bâtiment c\'est la cannabis cup\r\n\r\nDéfoncé comme ma plume, les ongles noir, des joues d\'s\'quelettes, une sale allure, j\'suis comme la lune j\'me couche à l\'heure ou l\'jour se lève\r\n\r\nSi t\'as finis ton verre a l\'aise, on remet ça comme la danette, une vie pas nette, là c\'est l\'étrange noël de Mr Jack Daniels\r\n\r\nSi tu l\'savais depuis tout l\'temps à faire de la merde, les flics te sentent, mec tu vas t\'perdre trop vite si tu vend, si tu t\'la pète depuis q\'tu vend, j’ai plus de polia, jdédis du clan, voit le pera en tutu blanc, jsuis pire que l\'orage, jsuis a l\'aise a leur age, avance dans le rap en titubant\r\n\r\nDans la tete c\'est gauche droite, des pochtars, des grosses barres; pas d\'galettes des rois ici ya qu\'la galette des clochards\r\n\r\nSous les grave, ya d\'la haine sous les doigts, c\'est bientôt l\'examen du foie, on revise tout les soirs\r\n\r\nils veulent nous trainer dans la boue, on a le blues, les poumons calcinés, d\'mande à nounours c\'est pas toujours d\'la bouffe qu\'il y a sur la gazinière\r\n\r\nQuand les cendars s\'entassent, le foie est plein d\'entaille, moi et ma teille c\'est l\'grand amour et tout les soirs c\'est la Saint Ballentine\'s\r\n\r\nY\'a plus une ville sans drogues, en vérité ils nous en donnent, ce sera bientôt légaliser, ils savent tres bien que ça nous endort\r\nParfois j\'oublie le passé, cervelle cassée, moi j\'vis sans trop de logique. Encore un son qu’faudrait passer sur skunk anthologie', 2176, 2098),
(800, 1, 'Que dire que dire sur monsieur Beyney...\r\n\r\nFélicitation d\'abord pour ce diplôme. Ensuite merci pour la confiance et l\'écoute dont tu as fait preuve lors de ton mandat BDE. Et enfin, BLBLBLBLBL. \r\n\r\nIl est tard, les mots ne viennent pas mais les pensées sont là.\r\n\r\nLa bisette', 2116, 2197),
(801, 1, 'BLLLA la tete de MALADE sur le yearbook!\r\n\r\nj\'espere que tu va bien Super D.! et que tu arretes de te casser des os et des trucs comme ca;..\r\nCa m\'a manqué les cours d\'allemand avec Lauryanne et toi...\r\nOn se voit a la RDD! \r\nbisous bisous et MEUUURS BIEN SA MERE8!!!', 2236, 2258),
(802, 1, 'Co-filloooot ! Félicitation pour ton diplôme, ça m\'a fait plaisir d\'être dans la même famille que toi même si c\'est pas celle rêvée.. J\'espère te revoir sur Paris à l\'occasion !', 2157, 2369),
(803, 1, 'Félicitation pour ton diplôme collègue de G31!\r\n\r\nEn effet on aura eu de bons délires surtout lorsqu\'il s\'agit de se moquer des autres et surtout de notre super pote (Pacome <3) et ses réactions chelou! A ne pas oublier ton pote d\'espagnol qui était fou d\'amour pour toi (Quentin <3) et puis surtout tu es une bonne fouine, presque pire que moi !\r\n\r\nPleins de bonnes choses pour la suite ! \r\nBisous', 2220, 2158),
(804, 1, 'Max, \r\nTyé  fada hein......! \r\n\r\nQue de bon souvenir, en cours, en association, en soirée, en sortie, en sport... Bref c\'était vraiment cool d\'avoir pu partager ces 3 ans avec  toi ! Et c\'est pas fini. \r\n\r\nJ\'espère qu\'on pourra continuer à partager ces moments pendant de nombreuses années. \r\n\r\nLa bises mec. \r\nDJ Chauvex', 2243, 2233),
(805, 1, 'L\'Bon Bobby!\r\n\r\nJ\'etais bien loin cette année et c\'etait malheureux!\r\n\r\nEn tout cas tu restes un des personnages marquants de ma scolarité à l\'isima et j\'espere qu\'on se reverra!\r\n\r\nBisous bisous!', 2236, 2223),
(806, 1, 'Yo Naouf le ouf!\r\n\r\nJ\'espere que ca va bien pour toi!\r\nJ\'etais pas la la derniere année mais t\'es un des gars les plus appréciables que j\'ai rencontré!\r\nPuisse-t-on se revoir!\r\n\r\nBye!', 2236, 2151),
(807, 1, 'Gautrooooooon! \r\n\r\nToutes mes félicitations mec pour ton diplôme. Tu le mérites entièrement ça. \r\n\r\nJe tiens aussi à te remercier pour ces 3 années passé à tes côtés.  C\'était franchement sympa de partager tous ces moments avec toi ! \r\n\r\nEn espérant se retrouver autour d\'un brunch, proto ou platine.... \r\n\r\nLa bise. \r\nDJ CHAUVEX', 2243, 2185),
(808, 1, 'MAX\r\n\r\nBravo pour ton diplôme ! (comme quoi tout arrive ^^ ;))\r\nJe te souhaites plein de bonheur et (d\'autres) succès pour la suite !\r\n\r\nBisous bisous,\r\nPA', 2211, 2233),
(809, 1, 'Félicitations pour ton diplôme Raphy. Merci également pour ces trois années passé avec toi ! Merci pour ton apport dans le monde de l\'associatif. Tu nous auras permis de découvert plein de nouvelle choses. \r\n\r\nBonne continuation le parigot HAHA. \r\nDJ Chauvex', 2243, 2157),
(810, 1, 'Monsieur Berthel,\r\nJe me rappellerai toujours des premiers TPs à l\'ISIMA où l\'on s\'envoyait des mails avec des scripts... Elle est bien loin cette époque...\r\nCa a été un plaisir de vous affronter pendant les campagnes BDE, j\'en garderai de très bons souvenirs !\r\nFélicitation pour ton parcours et félicitation pour ton diplôme.', 2157, 2221),
(811, 1, 'Yo FOUBEEEERT!\r\n\r\nAlors ce stage en Angleterre?\r\nEn tout cas ne pas etre avec vous cette derniere année, c\'etait pas tres chouette!\r\nmais bon au moins j\'ai vu des ours!\r\nPrend soin de ma tchote lolo! On svoit ce WE à la RDD!\r\n\r\nZoubi!', 2236, 2189),
(812, 1, 'Je pourrais dire plein de chose sur vous, monsieur Chauvet, mais je me limiterais à un BLBLBLBLBL qui veut à la fois rien et tout dire.\r\n\r\nPS : J\'espère que tu es en forme pour ce soir, car quand tu seras au platine je ne veux pas te voir avec le même verre plus de 15 min.', 2116, 2243),
(813, 1, 'Félicitation pour ton diplôme collègue de F3! \r\n\r\nMerci pour toute l\'aide que tu as pu m\'apporter pour les fameux TP de notre cher ami Lacomme !\r\nEn dehors de ça tu es une très bonne personne et je suis heureuse de t\'avoir rencontrée, tu as su mettre l\'ambiance au bde grâce à tes platines (même si toutes les chorés à la suite c\'est parfois éprouvant ^^) \r\n\r\nPleins de bonnes choses pour la suite, surement à Lyon!\r\nEn espérant te revoir, \r\n\r\nBisous bisous', 2220, 2243),
(814, 1, 'Félicitation pour ton diplôme, on est parti de loin mais on a réussi :p\r\nA bientôt je l\'espère pour une petite session Chicha/Nahnah/Raï\'n\'B !\r\nBonne continuation et à bientôt sur Paris (Inchallah)', 2157, 2177),
(815, 1, 'Estelle, \r\n\r\nToutes mes félicitations pour ce diplôme. C\'était un plaisir de partager ces 3 années avec. Ta bonne humeur et ton sourire resteront gravé. \r\n\r\nBonne continuation pour la suite. \r\nLa bises. \r\n\r\nDJ Chauvex', 2243, 2220),
(816, 1, 'Yo partenaire de galère ^^\r\nBien sûr que tu m\'as manqué, ce n\'était pas pareil la F1 sans toi. Ça a été un plaisir de te côtoyer pendant cette 2 années. :)\r\nOn essayera de se voir le plus souvent possible! ;)\r\nEn tout cas si tu repasses à Clermont tu es le bienvenu chez nous!\r\nDes bisous!', 2237, 2236),
(817, 1, 'Gaultier faut se calmer!\r\nQuand elle était en Australie t\'as rien fait et pourtant tu l\'avais promi! :p\r\nBon je suis content que tu n\'aies rien fait finalement, de toute facon je me doutais que tu n\'etais pas serieux, surtout vu ton état...\r\n\r\npuisse-t-on rester sur toulouse et se la coller tous les we!', 2236, 2091),
(818, 1, 'Yaaaaaa\r\n\r\nToutes mes félicitations et encore merci pour ces 3 années. C\'était un plaisir de t\'avoir connu. Changes pas t\'es au top. \r\n\r\nBonne continuation. \r\nLa bise \r\n\r\nDJ Chauvex', 2243, 2258),
(819, 1, 'LATIATIA !!!\r\n\r\nUne mascotte ISIOKE au top. Vavuc se serait senti bien seul sans toi. Félicitation pour ton diplôme et je te souhaite plein de bonheur pour la suite.', 2116, 2208),
(820, 1, 'Monchhhhiiiiiiieur Luc.\r\n\r\nJe te l\'ai jamais dit alors j\'en profites pour le faire ici. J\'ai toujours été bluffé par l\'amour que tu portes aux élèves de cette école et tout ce que tu as pu faire pour eux.\r\n\r\nJe te souhaite le meilleur Luc.\r\n\r\n<3', 2381, 2116),
(821, 1, 'Félicitation pour ton diplôme, on en a fait du chemin depuis notre entrée en ZZ0. Je nous revois encore à 4 lors des premières pauses. C\'est fait en tout cas !\r\nBonne chance pour cette nouvelle aventure et au plaisir de te revoir sur Paris !', 2157, 2172),
(822, 1, 'Félicitation pour ton diplome sale merde (ceci est pour toute les fois où tu m\'as fais chier :))\r\n\r\nJe te souhaite pleins de bonnes choses pour la suite et j\'attends toujours mon invitation à Toulouse city gang! \r\nMalgré ta petite taille, tes grosses boules (#max) et ton crâne chelou tu es une personne avec un grand coeur mais souvent tête en l\'air :) \r\n\r\nEn espérant que tu restes en contact avec nous et en espérant te voir à Toulouse!\r\nLa bise et prend soin du maillot jaune :)', 2220, 2176),
(823, 1, 'Je ne l\'ai pas encore assez dit, donc BLBLBLBLBL', 2116, 2098),
(824, 1, 'Je me contenterais de l\'essentiel : BLBLBLBLBL\r\n\r\nLa bisette, et à mardi', 2116, 2077),
(825, 1, 'LUUUUUC !\r\ntu es fou mais Félicitation pour ton diplôme et surtout BLBLBLBLBL\r\nTu as également eu du courage d\'avoir Max en fillot ^^\r\n\r\nPleins de bonnes choses pour la suite ! BLBLBL \r\nBisous Mr Isioké', 2220, 2116),
(826, 1, 'Vilebrequuuiiiiiiinnnn !!!!', 2116, 2158),
(827, 1, 'Elle veut quoi l\'aveugle la ?\r\nAvec ton mec vous êtes le pire tas de caca que j\'ai jamais vu de ma vie.\r\nCa va que ton sac à main il est joli, autrement je te cracherais à la figure.\r\nMême question qu\'a ta moitié de caca, c\'est pour quand le double de clé ?', 2176, 2220),
(828, 1, 'Maxime, Maxime, Maxime...\r\n\r\nTe regarder danser aura illuminer certaines de mes soirées ^^. Félicitation pour ton diplôme.', 2116, 2167),
(829, 1, 'Alala Naouf, @naoufelofficiel !\r\n\r\nJ\'aurais tellement de choses à te dire,  je pourrais écrire des pages et des pages. Mais je vais essayer d de rester bref.\r\n\r\nTu es le genre de personnes que n\'importe qui rêverait de rencontrer, et je pèse mes mots.\r\nTu fais parti des meilleurs souvenirs que je garderai de cette école et tu es sans doute la personne qui m\'a fait le plus rire dans la vie.\r\n\r\nJe te souhaite le meilleur dans la vie, tu le mérites vraiment. \r\n\r\n@matthieubasseofficiel', 2381, 2151),
(830, 1, 'Félicitations pour le diplôme Kévin :)\r\nC\'était un plaisir de bosser avec toi pendant ces 2 années de F5. \r\nA bientôt j\'espère ! d\'ici la : très bonne continuation et profites bien de cet accomplissement  ;)', 2257, 2234),
(831, 1, 'Estelle MMMMoooouuuuuunier,\r\n\r\nJ\'espère qu\'un jour tu sortiras un DVD de tes chorées endiablées, je serais le premier acheteur. Et comme il se fait tard, que je suis fatigué et tout ça tout ça, je comblerais par un BLBLBLBLBL évocateur.\r\n\r\nJe compte sur toi pour prendre soin de mon fillot, et donc bon courage.', 2116, 2220),
(832, 1, 'Yoyo, mon Yoyo,\r\n\r\nOn s\'est rencontré quand j\'étais encore en DUT et tu m\'avais laissé une mauvaise impression.\r\nAujourd\'hui les choses ont bien changées et je t\'apprécies beaucoup.\r\nJe te souhaite de la réussite dans ta vie professionnelle et du bonheur dans ta vie amoureuse.\r\n\r\nBisous bisous !!!!', 2381, 2213),
(833, 1, 'PPPPPPPPPPPauuuuuullllllllllllllllllllllll.\r\n\r\nFélicitation pour ton diplôme posey. Et... voili voilou !', 2116, 2176),
(834, 1, 'Salut Robin!!!\r\n\r\nJ\'espère que tu vas bien et que toi aussi tu auras ton diplôme!\r\nL\'expérience qu\'on a partagé à travers le BDS m\'a vraiment marqué et jeu beaucoup apprécié discuter avec toi et j\'espère qu\'on aura l\'occasion de le refaire quand tu reviendras du Canada!\r\n\r\nÀ très bientôt je l\'espère !\r\n\r\n @ NaoufelOfficiel', 2151, 2236),
(835, 1, 'Luuuuc !\r\nFélicitation pour ton diplôme ! Plein de bonnes choses pour la suite et longue vie à Isioké :)\r\nBisous', 2208, 2116),
(836, 1, 'M. Chauvet, M. Gênant,\r\n\r\nJe suis ravi d\'avoir fait ta connaissance. Je te souhaite la réussite professionnelle et du bonheur avec Mme la secrétaire du BDE.\r\n\r\nPS: Tu me dois un cadeau d\'anniversaire, et le mien était plutôt balaise ;)', 2381, 2243),
(837, 1, 'Ma p\'tite Lauryanne !\r\nVous avez beau être partis en Angleterre, c\'est pas la manche qui va m\'arrêter ! Je suis venu vous voir une fois, et rien ne m\'empêchera de recommencer !\r\nJe suis heureux qu\'on ait pu se rencontrer, et je le serai encore plus à chaque fois qu\'on se reverra après le diplôme !\r\nJe vous souhaite que du bonheur au pays du beau temps !\r\nGros bisous,\r\nLéo.\r\nPS : Passe le bonjour à Bob de ma part', 2190, 2188),
(838, 1, 'Une chose que t\'auras appris à l\'ISIMA et c\'est déjà pas mal, c\'est de faire attention à ton orthographe (et ta grammaire et ta syntaxe).  Rassure toi, tu n\'es pas la seule à en faire.\r\nCa m\'a fait plaisir de partager ces trois années avec toi, on en aura vécu des choses (en accéléré). Merci pour ton implication tout au long du mandat, ça nous motiver avec Max !\r\nJe te souhaite bonne chance pour tes recherches (Ahah double sens), et plein de bonheur !', 2157, 2166),
(839, 1, '....................................................................\r\n....................................................................\r\n....................................................................\r\nDésolé.... Je pensais à des langoustes......\r\nVous nous aurez bien manqué cette année les canadiens... Mais j\'imagine qu\'on aura tout le temps de se rattraper plus tard !\r\nEt je suis plus que ravi d\'avoir pu contribuer à une relation saine entre vous deux en fournissant le nécessaire :)\r\nA très bientôt j\'espère !\r\nGros bisous mon lapin !', 2190, 2236),
(840, 1, 'Benoît Plateel,\r\n\r\nJe suis surement pas le premier, et encore moins le dernier, à te dire ça, mais t\'es le plus gros rageux que j\'ai jamais rencontré ;)\r\nMalgré ça je t\'apprécies beaucoup.\r\n\r\nBisous Ben.', 2381, 2098),
(841, 1, 'Hey Anthony !\r\nOn aura passé deux années bien sympa en F1 à galérer tous ensemble sur des TP douteux !\r\nBon courage pour la suite !', 2190, 2200),
(842, 1, 'Félicitation pour ton diplôme, ça m\'a fait plaisir de partagé ces quelques cours avec toi. \r\nBonne chance pour la suite et n\'hésites pas à me prévenir si tu passes sur Paris ;)\r\nA la proxima vez (ou un truc comme ça, j\'ai pas le TOEIC espagnol)', 2157, 2077),
(843, 1, 'Félicitation ma petite trésorière ! Un plaisir d\'avoir fait ces deux mandats avec toi. Je te souhaite plein de bonheur pour la suite !\r\nBisous bisous !', 2157, 2220),
(844, 1, 'Bravo, ingénieur Jonathan ! Et merci ! Nous avons travaillé ensemble sur nos projets et sur quelques TP, c\'est donc en partie ensemble que nous avons obtenu ce diplôme. De plus, j\'ai essayé d\'être intelligent tout seul, mais c\'était plus facile à tes côtés.\r\nJe te souhaite le meilleur pour la suite !\r\nCarlos', 2241, 2222),
(845, 1, 'Oh mon Bobby,\r\n\r\nLe plus grand voleur de l\'histoire de cet école. T\'as fait le taf et t\'as réussi.\r\n\r\nBonne continuation Bobby The Night', 2381, 2223),
(846, 1, 'Cyril, \r\n\r\nOn se connait vraiment très peu mais je sais que tu es une belle personne et je te remercie pour tout ce que tu as fait pour le BDE ISIMA.\r\n\r\nJe te souhaites le meilleur.', 2381, 2197),
(847, 1, 'Que de souvenirs durant ces trois ans... Tu es l\'une des premières personnes à qui j\'ai parlé, c\'était une belle rencontre ! Dommage que nos chemins ce soient légèrement séparés..\r\nCa m\'a fait plaisir d\'assister à tes spectacles, tu as raison de vivre ta passion à fond et ça s\'est vu. Continue à communiquer cette passion qui t\'anime, ça touche vraiment. \r\nOn aura sûrement plus beaucoup d\'occasion de se faire de battle mais c\'est sûr que maintenant je suis ridicule à côté de toi !\r\nFélicitation pour ton diplôme et bonne continuation, préviens moi si tu passes sur Paris !', 2157, 2156),
(848, 1, 'Merci pour ces trois années pleines de fou-rire et de conneries ! Merci de les avoir rendu moins monotones ! Un plaisir d\'avoir partagé la plupart des activités avec toi. \r\nAu plaisir de te revoir à l\'occasion !\r\nBisous bisous !', 2157, 2368),
(849, 1, 'Félicitation à toi mon petit Raphy pour ce diplome! Je suis heureuse d\'avoir appris à te connaitre et de t\'avoir cotoyé pendant 3 ans que ce soit en cours, pendant l\'associatif et en dehors !\r\n\r\nPleins de bonheur et de réussites,\r\nA bientot\r\nBisous bisous', 2220, 2157),
(850, 1, 'GROS POUUUUUUTTTTTCCCCCHHHHHHH !!!!!! \r\nJE T\'AIIIIIIIIIIIIIIMMMMMMMMMMEEEEEEEEEE !!!!!!!', 2233, 2220),
(851, 1, 'Gros poutchou d\'amour tu es vraiment vraiment trop bete !! \r\n\r\nI LOOOVE YOUUU !! <3\r\nBig bisous, big bisous', 2220, 2233),
(852, 1, 'Luuuuuuuuuuuuuuuuuuuuuuuuuuuuuuuuuuuuuuc\r\nBLBLBLBLBLBLBLBLBLBL \r\n\r\nça pourrait suffir comme message non ? hahaha GRAND FOU !\r\n\r\nFélicitation pour ton diplôme. Très ravis de t\'avoir connu et d\'avoir partagé toutes ces années avec toi. On se sera bien marré quand même :D\r\n\r\nBonne continuation.\r\nLa bise\r\nDJ CHAUVEX \r\n\r\nPS : challenge accepted !', 2243, 2116),
(853, 1, 'Last but not least ! \r\nC\'est un plaisir de t\'avoir rencontré et de t\'avoir accompagné au BDE. Ca fait partie des expériences qui m\'ont le plus rapproché des gens de l\'ISIMA et tu es en grande partie responsable. Merci d\'avoir eu les épaules pour maintenir le BDE et d\'avoir relancé la vie associative. \r\nJe doute pas qu\'on gardera contact et qu\'on aura des occasions pour se revoir à l\'avenir !\r\nFélicitation pour ton parcours.\r\nBisous bisous !', 2157, 2197),
(854, 1, 'Naliiiiice ! \r\n\r\nToutes mes félicitations pour ta réussite pour ce diplôme. Je suis aussi très content de t\'avoir connu et d\'avoir pu partager ces moments avec toi, d\'avoir pu découvrir la culture brésilienne !\r\n\r\nEn espérant te revoir ... au brésil peut être :)\r\nBisous bisous \r\n\r\nMaxime', 2243, 2514),
(855, 1, 'Yoann ! \r\n\r\nFélicitations pour ce magnifique diplôme. Merci pour tout ce que tu as pu apporter à l\'école, à la vie associative et j\'en passe. C\'était un honneur de partager tout ça avec toi.\r\n\r\nEn espérant pouvoir se croiser toujours, je te souhaite une bonne continuation.\r\nLa bise\r\n\r\nDJ CHAUVEX', 2243, 2213),
(856, 1, 'Michèèèèèèle \r\n\r\nToutes mes félicitations ! c\'était un honneur de te rencontrer et d\'avoir partagé tout ce temps avec toi.\r\n\r\nNe changes pas et garde ta bonne humeur avec toi.\r\n\r\nDes bisous !\r\nMaxime', 2243, 2214),
(863, 2, 'Amateur de bonne bouffe et de musique forte. Inventeur du Lénaic : unité de temps représentant environ 1h30. \r\nMais surtout un bon déconneur !\r\nGG pour ces 3 ans Petit Homme =)\r\n\r\n\r\nGrand Homme', 2286, 2312),
(864, 2, 'Vu ;)', 2286, 2283),
(865, 2, 'Mon petit Chanteloube,\r\nMerci pour ces 3 années, c\'était quand même bien sympa ^^ Quelque conneries, des moment de rage contre l\'école, des TPs et un projet, quelques bons petits plats etc.. on aura passé quand même pas mal de temps ensemble. Espérons que ça ne s\'arrête pas là au pire on bosse pas bien loin l\'un de l\'autre ;p \r\n\r\nLa bise, \r\nBagouett\'', 2286, 2289),
(866, 2, 'Mister CCF (Copier Coller-Fiedler ?)\r\n\r\nJe ne dirait pas que c\'est enfin fini, il parait que tu en redemande une année supplémentaire ;) \r\nMerci pour la quantité d\'info que j\'ai pu apprendre de toi durant cette année ainsi que les bons moments passés ensemble. En espérant continuer à croiser ta route régulièrement  =)  \r\n\r\nSylvain.', 2286, 2242),
(867, 2, 'Mon Gueleraud ! \r\n\r\nBon bah ça y est je crois qu\'on arrive au bout... 3 années agitées pleines de bons souvenirs et de moins bons. On en aura quand même bavé ^^ c\'était sympa de discuter de comment améliorer l\'école mais personnellement je suis heureux d\'en sortir ^^ \r\nJe ne doute pas que l\'on continuera à se voir et a déconner encore un moment ;)\r\n\r\nLA LOURDEUR VAINCRA ! \r\n\r\nBagouett\'', 2286, 2301),
(868, 2, 'Ma petite Bagouet\',\r\n\r\nJe ne trouve pas mieux que répéter cette phrase tellement vraie te concernant : \"Ils foutent tout le temps le bordel mais ils bossent ces cons\". C\'est pour des potes comme toi et toute la clique que je ne regrette pas d\'avoir connu l\'ISIMA malgré la déception niveau cours. Et c\'est pas fini collègue québecois ;)\r\n\r\nQuentin', 2289, 2286),
(869, 2, 'Grand vainqueur du jeu du \"Vu\" (après harmonisation).', 2283, 2323),
(870, 2, 'Très cher(e?) Palourde, \r\n\r\nJe ne sais même pas si tu auras ce message compte tenu de la situation ^^ \r\nC\'était quand même long un an sans t\'avoir avec nous pour porter la lourdeur... heureux d\'avoir pu te retrouver en espérant qu\'on continuera de se croiser malgré la distance.\r\n\r\nLa bise ! \r\n\r\nBagouett\'', 2286, 2274),
(872, 2, 'Hello Michel ! \r\n\r\nBinôme de choc tant dans l\'ambiance parfois tendue, parfois sérieuse, parfois moins. Au final on s\'en est bien tirés ;) \r\nOn en sort enfin !!! \r\nMerci d\'avoir était un fervent défenseur de la Lourdeur, on se recroisera probablement  ;) \r\n\r\n\r\nSylvain', 2286, 2330),
(873, 2, 'Mon cher Alex,\r\n\r\nje ne sais pas si tu liras cela toutefois je voulais te dire que je suis heureux d\'avoir pu te connaitre mieux durant ces 3 années et de te compter parmi mes amis. \r\nEn espérant voir ta tête près d\'ici même si je pense tu aura l\'occasion de te bouger pas mal aux 4 coins du monde =) \r\nEn tout cas on aura réussi à s\'en sortir et ça c\'est déjà énorme ^^ \r\n\r\nA la prochaine ;) \r\n\r\nSylvain', 2286, 2278),
(874, 2, 'Mon cher Prof de math particulier dédié aux révisions et rattrapages. \r\n\r\nHeureux d\'avoir pu faire ta connaissance et encore merci de l\'aide que tu nous as apporté mathématiquement parlant ;) \r\nBonne chance pour la suite ! \r\n\r\nSylvain', 2286, 2311),
(875, 2, 'Cher Po, \r\n\r\nMerci d\'avoir animer ses cours de chinois en cette dernière année ainsi que pour toutes les discussions loufoques auxquelles tu as participé ^^ \r\nOn se recroisera peut-être ;)\r\n\r\nBon Courage pour la suite,\r\nSylvain', 2286, 2160),
(876, 2, 'Ahhhhh Can\' !! \r\nMon Superviseur ! \r\n\r\nQuelqu\'un sur qui on peut compter, toujours bienveillant et prêt à aider. Parmi les premiers pour déconner ou aller se boire une bière  ! Putain si il pouvait y avoir plus de gens comme toi  dans ce monde ça serait formidable.\r\nMerci pour tous ces bons moments partagés et j\'espère qu\'on continuera à se croiser même sans l\'Isima. \r\nHeureux d\'en voir  enfin le bout et qu\'on en sorte enfin mais on aura quand même bien déconné ^^ \r\n\r\nLa bise !\r\n\r\nBqgouett\'', 2286, 2302),
(877, 2, 'Une pensée pour PJ et les QCM (ou pas) de Java Pro ;)', 2286, 2287),
(878, 2, 'Bon mon Canoë ... \r\nJe ne sais pas si tu liras se message cette année ou même si tu l\'auras tout court \r\n\r\nEn tout cas tu fais parti de ceux que je suis heureux d\'avoir rencontré durant ces trois années (tout pd) \r\nUn bro\' comme on les aime et qui à déjà prouvé qu\'il en était un... \r\nBref !\r\nMerci presidente canoë de la Parka ! \r\nEt avoue t\'es un peu devenu Auvergnat ;p \r\n\r\nLa bise !! \r\nBagouett\'', 2286, 2272),
(879, 2, 'Mon cher Silvain ? Sylvain ? Silvayn ?\r\n\r\nOn ne sait jamais ... Évidemment que je vais te lire, et il est hors de question que je ne te réponde pas. \r\nJ\'ai été très content de t\'avoir à mes côtés sur les bancs de l\'Isima, surtout en première année et certains souvenir resterons à jamais.  Grâce à toi, la tanche, poisson d\'eau douce, ne cessera jamais de me faire penser à toi. En parlant de penser, ta mémoire, surtout en chinois n\'arrêtera jamais de m\'émerveiller. On s\'est connu à l\'IUT et tu es toujours resté un ami fidèle prêt à partager une salade et un éclair entre midi et deux avec un hearstone en fond. \r\nMerci pour ton amitié et merci de m\'avoir accompagné jusqu\'ici. \r\nJ\'espère que tu me rejoindras au bout du monde un de ces jours,  il y a toujours un peu plus de couleurs quand tu es là. \r\nPrends soin de toi, \r\n\r\nAlex', 2278, 2286),
(880, 2, 'DISCLAIMER : Ce message est écrit avec plein de niaiserie / ou pas, dans un français qui m\'est propre #JEcrisCommeJeParle. De plus, toutes les fotes de grammaire / orthographe ne sont pas intentionnelles, je reporte la faute sur l\'éducation nationale qui m\'a laissé passer au collège avec des 0 en dictées.\r\n\r\nChaton !!!, \r\n\r\nAh non merde c\'est Bagouette, d’ailleurs pourquoi Chaton ? Faudra qu\'on en parle autour d\'un verre ou deux ou trois (4 ne serait pas raisonnable.... quoi que ??).\r\n\r\nSinon mon Bagouette, ce fut un plaisir de te rencontrer (t’inquiète pas, je ne te fais pas mes adieux), je te décrirais comme un camarade d\'une rare franchise, travailleur, mais qui sait prendre du bon temps, un partenaire fiable au beer-pong (critère important de savoir vivre de nos jours) qui sait viser les bons trous (j\'ai demandé à Mymy, elle a confirmé). Donc c\'est avec la plus grande conviction et le plus grand plaisir que je te souhaite le meilleur, pour toi et toute ta famille. Et OUI, on se verra en dehors de l\'Isima, comme si on ne le faisait déjà pas ?\r\n \r\nJe suis fière de pouvoir dire que t\'es un ami, \r\n Plein d\'amitié, ton Can\'\r\n\r\nCe message n\'était pas du tout sponsorisé par IsiNiaiserie Corp.®, la filiale niaise d\'IsiLoudeur™', 2302, 2286),
