(883, 2, 'DISCLAIMER : Ce message est écrit avec plein de niaiserie / ou pas, dans un français qui m\'est propre #JEcrisCommeJeParle. De plus, toutes les fotes de grammaire / orthographe ne sont pas intentionnelles, je reporte la faute sur l\'éducation nationale qui m\'a laissé passer au collège avec des 0 en dictées.\r\n\r\nMr Chanteloube, aka Chante le Loup, not aka le Mammouth, \r\n\r\nJe t\'avoue que je sais pas trop quoi dire au mec qui a son CDI, une tv, une Xbox et surtout un putain de setup pour jouer aux jeux de courses (N.B. : que j\'ai toujours pas testé d\'ailleurs) si ce n\'est que je te souhaite le meilleur, à toi et toute ta famille. Je ne me fais pas de soucis, je sais qu\'on gardera le contact (\" LA \" Convers #NoSpoil).\r\n\r\nPlein d\'amitié, Can\'\r\n\r\nCe message n\'était pas du tout sponsorisé par IsiNiaiserie Corp.®, la filiale niaise d\'IsiLoudeur™', 2302, 2289),
(884, 2, 'DISCLAIMER : Ce message est écrit avec plein de niaiserie / ou pas, dans un français qui m\'est propre #JEcrisCommeJeParle. De plus, toutes les fotes de grammaire / orthographe ne sont pas intentionnelles, je reporte la faute sur l\'éducation nationale qui m\'a laissé passer au collège avec des 0 en dictées.\r\n\r\nChe Gueleraud,\r\n\r\nMon gars, je vais pas y aller par 4 chemins, mais par 42. \r\nJe te souhaite tout le bonheur du monde \r\nEt que quelqu\'un te tende la main (mais pas un mec sinon ça fait tout PD)\r\nQue ton chemin évite les bombes (vaut mieux, c\'est plutôt chiant, les prothèses) \r\nQu\'il mène vers de calmes jardins (acqp celui des tuileries a Paris est sympa : )\r\nJe te souhaite tout le bonheur du monde (refrain...)\r\nPour aujourd\'hui, comme pour demain (mais pas hier)\r\nQue ton soleil éclaircisse l\'ombre (typiquement à 8h du mat après Isioke)\r\nQu\'il brille d\'amour au quotidien  (NIAISERIE)\r\n\r\nToute une vie s\'offre devant toi (enfin, au mieux quelques années, la cirrhose n\'est pas loin)\r\nTant de rêves à vivre jusqu\'au bout (je suis pas très inspiré pour cette ligne donc je me contenterai d\'un Antoine, Ta Gueule !)\r\nSûrement tant de joies au rendez-vous (je ne te souhaite que ça)\r\n\r\nPlein d\'amitié, Can\' & sinsemilia\r\n\r\nCe message n\'était pas du tout sponsorisé par IsiNiaiserie Corp.®, la filiale niaise d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™\r\nMais par IsiSpam®, la filiale lourde d\'IsiLoudeur™', 2302, 2301),
(885, 2, 'Félicitations Rikou pour ton diplôme et merci pour tout ce que tu as fait pour l\'école ! Je te souhaite le meilleur pour ce qui suit !', 2195, 2277),
(886, 2, 'Félicitations Godbert ! Du premier jour au dernier, on aura passé quatre ans ensemble et on se sera bien amusé ! Maintenant la vie sérieuse approche (ou pas) et je t\'y souhaite une grande réussite !', 2195, 2202),
(887, 2, 'Félicitations Thomas pour ton diplôme !\r\nJe te souhaite tout le meilleur pour l', 2195, 2309),
(888, 2, 'Félicitations Thomas pour ton diplôme !\r\nJe te souhaite tout le meilleur pour la suite !', 2195, 2309),
(889, 2, 'Félicitations pour ton diplôme Johan !\r\nBravo aussi et merci pour ce que tu as fait pour la vie associative pendant ces trois années.\r\nJe te souhaite le meilleur pour la suite !', 2195, 2320),
(890, 2, 'Félicitation Mitch pour ton diplôme !\r\nJe te souhaite le meilleur pour la suite !', 2195, 2321),
(891, 2, 'Toutes mes félicitations pour ton diplôme mon fillot !\r\nJ\'espère que ton parrain a contribué à ce que ces trois années d\'école d\'ingénieur soient remplies de bons souvenirs.\r\nLa bise fillot et je te souhaite le meilleur pour la suite !', 2195, 2336),
(892, 2, 'Félicitations pour ton diplôme Sylvain !\r\nJe te souhaite le meilleur pour la suite !', 2195, 2286),
(893, 2, 'Félicitations Quentin pour ton diplôme !\r\nMerci pour toutes tes contributions dans la vie associative de l\'école !\r\nJe te souhaite le meilleur pour la suite !', 2195, 2289),
(894, 2, 'Félicitations à toi aussi vavou =) \r\nBon courage pour la suite =) \r\n\r\nBises', 2286, 2195),
(895, 2, 'Félicitations Chaton pour ton diplôme !\r\nJ\'ai été très heureux de faire ta connaissance et de partager quelques cours (-) et soirées (+++) avec toi !\r\nJe te souhaite le meilleur pour la suite !', 2195, 2299),
(896, 2, 'Félicitations Antoine pour ton diplome !\r\nJ\'ai adoré faire ta connaissance et faire la fête avec toi !\r\nJe te souhaite le meilleur pour la suite !', 2195, 2301),
(897, 2, 'Félicitations Colas pour ton diplôme !\r\nJ\'ai aimé faire partie de l\'équipe de volley et progresser avec ton équipe !\r\nJe te souhaite le meilleur pour la suite !', 2195, 2330),
(898, 2, 'Félicitations Kiki pour ton diplôme !\r\nJe te souhaite le meilleur pour la suite !', 2195, 2335),
(899, 2, 'Félicitations Coco pour ton diplôme !\r\nJe te souhaite tout ce qu\'il y a de mieux pour la suite !', 2195, 2284),
(900, 2, 'Félicitations Coutcout pour ton diplôme !\r\nJe te souhaite le meilleur pour la suite !', 2195, 2194),
(901, 2, 'Félicitations Juju pour ton diplôme !\r\nPeut-être qu\'avec ça tu gagnera enfin en maturité et cessera tes enfantillages...\r\nCœur cœur love ma grande !', 2195, 2294),
(902, 2, 'Félicitations pour ton diplôme Déborah !\r\nJe te souhaite pleins de bonnes choses pour la suite !', 2195, 2292),
(903, 2, 'LuLuuuuuuu ! \r\nAprès que tu aies repris mon assoc\', on a partagé une équipe de volley, une promo, des clubs, une expérience ERASMUS et même un appart !! \r\nMaintenant tu es grande, ingénieure et avec un Master alors félicitations !!\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2300),
(904, 2, 'Félicitations Peace pour ton diplôme !\r\nIl va falloir qu\'on retourne fêter ça en boîte à Barcelone !\r\nJe te souhaite tout plein de bonnes choses pour la suite !', 2195, 2313),
(905, 2, 'Félicitations Mapate pour ton diplôme !\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2326),
(906, 2, 'Félicitations Clément pour ton diplôme ! \r\nOn s\'est connu le premier jour du DUT et on finit diplomé ensemble malgré des parcours un peu différents ^^\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2328),
(907, 2, 'Félicitations Nico pour ton diplôme !\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2315);
INSERT INTO `yearbookmessages` (`id`, `yearbook_id`, `message`, `userFrom_id`, `userTo_id`) VALUES
(908, 2, 'Babouuuuuuuu !\r\nFélicitations pour ton diplôme ! Quand tu es arrivé, ton parcours n\'était pas tout tracé mais finalement tu as su t\'épanouir et profiter d\'autres opportunités pour kiffer ces trois années, bravo !\r\nTu es un mec génial et peu importe où que tu sois l\'an prochain, j\'espère qu\'on ne se perdra pas de vue.\r\nJe te souhaite le meilleur pour la suite !\r\n*Smack*', 2195, 2334),
(909, 2, 'Zouzou !\r\nDire que je t\'ai connu si petit et que maintenant tu es ingénieur... Félicitations demi-fillot !!!\r\nT\'as intérêt de donner des nouvelles et en tout cas je te souhaite le meilleur pour la suite !', 2195, 2339),
(910, 2, 'Ah Marianne, sacrée Marianne,\r\nJe te félicite de tout cœur pour ton diplôme et te souhaite tout ce qu\'il y a de mieux pour la suite !', 2195, 2183),
(911, 2, 'Félicitations pour ton diplôme Vince !\r\nJe suis très heureux d\'avoir fait ta connaissance à l\'école et enchanté d\'avoir pu partager pleins de bons moments avec toi et les autres : on aura peut être pas trouvé la méthode de révision optimale pour les partiels mais on aura bien ri ! \r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2232),
(912, 2, 'Félicitations Po pour ton diplôme !\r\nComme pour moi, ça n\'a pas toujours été facile mais on sort ainsi de l\'école renforcés. Tu un gars super donc je ne mais pas de soucis pour toi mais je te souhaite quand même le meilleur pour la suite !', 2195, 2160),
(913, 2, 'Félicitations el payaso pour ton diplôme !\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2316),
(914, 2, 'Félicitations Jimmy pour ton diplôme !\r\nComme quoi notre travail en web services a payé !\r\nJe te souhaite plein de bonnes choses pour la suite !', 2195, 2308),
(915, 2, 'Fillot !!!\r\nJe te félicite pour ton diplôme ! Et dire que je t\'ai connu si petit, maintenant tu es ingénieur... J\'espère que mon parrainage a contribué à faire de ces trois années des années pleines de bons souvenirs ! En tout cas moi j\'étais très heureux de faire ta connaissance et j\'espère que t\'oublieras pas ton parrain !\r\nJe te souhaite tout ce qu\'il y a de mieux pour la suite *smack*', 2195, 2298),
(916, 2, 'Notre histoire a commencé par une histoire de pizza mangé sur un parking à une heure peu raisonnable. Elle a continué par la reprise d\'isibouffe et des soirées à chanter faux...  Le wei, l\'assofi, les soirées, les \"discussions\" à l\'ifma, bref on a bien profité pendant ces trois années, tu m\'as fait découvrir l\'école et sans toi ça aurait assurément  été différent ! \r\nBonne chance pour la suite !\r\n\r\nTon fillot, toujours là pour faire la fête ;)', 2298, 2195),
(917, 2, 'Félicitations Pichon hurleur pour ton diplôme !\r\nJ\'ai été super content de passer ces quatre années à tes côtés mais par contre je ne recomenderais pas nos méthodes de révision de partiels ^^\r\nJe te souhaite le meilleur pour la suite !\r\nAaaaahhhhhhhhhh', 2195, 2228),
(918, 2, 'De gros bisous Vavou pour te souhaiter bon courage dans ta vie professionnelle. Et surtout vive isibouffe, gozzip et tous ces moment passés ensemble au BDE à boire des verres. C\'était très agréable de te voir revenir de Barcelone pour un petit week-end, une petite soirée à Clermont. Le WED était juste super. Encore des bisous.\r\nTa Marianne adorée', 2183, 2195),
(920, 2, 'Très cher cofillot. Bravo pour ce diplôme. De gros bisous. Je n\'oublierai pas ces moments passés ensemble au BDE. Ta ptite cofillote. Marianne', 2183, 2202),
(921, 2, 'Toutes mes félicitations Cédric. Merci pour ces 4 ans passés en ta compagnie. C\'est toujours sympa de boire le café avec toi. Des bisous. Marianne', 2183, 2242),
(922, 2, 'Très agréable moment passé avec toi à Regensburg. J\'ai apprécié la visite des châteaux et de Walhalla. Je te souhaite bonne continuation. Marianne', 2183, 2296),
(924, 2, 'Et voila un petit mot pour te souhaiter plein de bonnes choses. Beaucoup à dire ! \r\nZZ1 : C\'était cool d\'être dans ta classe et de faire ce projet avec toi et maman Chabrol.\r\nZZ2 : dommage tu changes de groupe mais on se voit au bde. :)\r\nZZ3 : pareil que zz2. Super WED avec toi et Perrine.\r\n\r\nTout ça pour te dire que ces 3 ans étaient super cool avec toi. Contente d\'être ta marraine. En te souhaitant bonne continuation !\r\nBisous de ta MIMI.', 2183, 2328),
(925, 2, 'Très cher binôme! Merci pour ces trois années en ta compagnie et nos deux supers projets. C\'était un plaisir de les faire avec toi. Bonne chance pour la musique et bonne continuation', 2183, 2314),
(926, 2, 'Ro cette tête de mangeur de caca! Bonne continuation et des bisous!', 2183, 2308),
(927, 2, 'Bon, je vais t\'appeler Loïc, je te confonds tout le temps avec Canoë.  Elle est pas douée cette fille !!\r\nMerci pour tous ces moments passés à Clermont et à Lyon. Boire toutes ces bières (et il y en a un certain nombre) a toujours été un immense plaisir, je te remercie pour avoir toujours été là pendant ces 3 années. Des gros bisous en attendant la prochaine soirée picole avec toi seul ou toi + d\'autres ZZs.\r\nMarianne', 2183, 2302),
(928, 2, 'Beaucoup trop de choses à dire dans ce simple message.\r\nC\'était un plaisir d\'être ta voisine autant à la gare qu\'à Lafayette et de fréquenter également certains cours ensemble. \r\nMerci pour tes conseils en C et en C++. (NON, je ne t\'appellerai pas Monsieur cpp)\r\nBref, je ne sais plus quoi dire d\'autre de plus.\r\nAh si, système continu à éléments discrets !\r\nPouik!\r\nBonne chance et bonne continuation!\r\nBisous, \r\nMarianne', 2183, 2173),
(929, 2, 'Félicitations pour ton diplôme grand Parrain <3 Ta lourdeur va manquer dans l\'école et dans le BDE... Bonne continuation et gros bisous !', 2721, 2289),
(930, 2, 'Félicitations Vavou pour tes diplômes !\r\nMerci pour ces quatre années de délires et pour nos méthodes de révision je pense qu\'il fallait en passer par là pour savoir que ce n\'était pas une bonne idée ^^\r\nJe te souhaite bien du courage pour la suite !\r\nYaaaaaaaaaaaaaaahhhhhhhhhh !!!', 2228, 2195),
(931, 2, 'Félicitations pour ton diplôme ! ISIMA c\'est 4 ans !\r\nOn a fini par y arriver :D \r\nJe te souhaite bonne chance pour la suite !  - Vague 10 \r\nYaaaaaaaahhhhhhhhhh !!', 2228, 2232),
(932, 2, 'Jimbo aka jacky (ou johnny, je sais plus) les gros doigts aka Jimmy,\r\n\r\nEn fait je t\'écris ce message pour deux raisons :\r\nLa première étant de faire chier parce que ça va t\'envoyer un mail et que tu vas devoir venir sur le site lire le message.\r\nEt la seconde était pour te dire qu\'on a quand même passé deux années bien marrantes et qu\'on aura bien rigolé en cours quand même.\r\n\r\nBeaucoup trop de swag sur ta photo, by the way.\r\n\r\nCan\'\r\n\r\nDISCLAIMER : Ce message est écrit avec plein de niaiserie / ou pas, dans un français qui m\'est propre #JEcrisCommeJeParle. De plus, toutes les fotes de grammaire / orthographe ne sont pas intentionnelles, je reporte la faute sur l\'éducation nationale qui m\'a laissé passer au collège avec des 0 en dictées.', 2302, 2308),
(933, 2, 'Salut mon parrain ! \r\nJe te remercie pour ces trois années passées avec toi à ISIMA. Tu as été un super parrain, merci pour tout ce que tu as pu m\'apporter (l\'intégration, ta bonne humeur, ...)\r\nJ\'espère que tout se passera bien pour toi dans la nouvelle voie que tu t\'apprêtes à emprunter.\r\nJe te souhaite plein de bonheur pour la suite.\r\nPlein de bisous\r\n\r\nTon fillot (le meilleur)\r\n\r\nPS : J\'ai toujours mon biberon MOI !', 2336, 2195),
(934, 2, 'Quand je vois ta photo sur le Yearbook j\'ai même plus envie de te laisser de mot ! T\'as changé Mitch, tu n\'es plus ce que tu étais....\r\n\r\nJe te félicites quand même pour ton diplôme parce que bon, t\'es quand même sacrément taud-cos ! Et en plus, t\'es la seule personne qui a été dans la même classe que moi pendant les 3 ans. J\'espère ne pas t\'avoir autant soûlé  que toi tu m\'as soûlé ! \r\n\r\nBonne chance pour la suite.\r\nBisous de moi.\r\n\r\nBeubeu', 2336, 2321),
(935, 2, 'Félicitations pour ton diplôme gros sauc\' ! Tu l\'auras bien volé ! \r\nJ\'espère qu\'on se reverra pour que je puisse continuer à te faire rager ! HOULOULOULOULOU !\r\n\r\nDes bisous , \r\nBeubeu', 2336, 2277),
(936, 2, 'Content que nos études soient terminées pour ne plus avoir à te supporter,  le gros lourd, en cours. \r\nSinon on a quand même passé de bons moments ensemble, félicitations encore pour ton diplôme. Je te souhaite plein de belles choses pour ton avenir.\r\n\r\nBeubeu', 2336, 2320),
(937, 2, 'Frère Chaton,\r\n\r\nJ\'espère que ces trois années en ma compagnie ne t\'auront pas trop déçu. J\'ai été ravi de te rencontrer car tu es très beau. Et en plus tu es très charismatique. Enfin moi je suis plus beau et charismatique que toi mais t\'es quand même pas mal même si t\'es pas au top niveau (je t\'ai emboucané ou pas ?). Tu pèses pas mal lourd dans le game.\r\n\r\nBon trêve de bavardages ! J\'espère qu\'on se reverra. Je te souhaite bonne chance pour ton entreprise. Et bien sur félicitations pour ton diplôme mon petit chaton !\r\n\r\nChaton n°2 (mais number one dans les coeurs)', 2336, 2299),
(938, 2, 'Wech Kiki ! \r\nJ\'espère ne pas t\'avoir trop soûlé durant ces 3 années. Félicitations pour ton diplôme. J\'espère bien qu\'on se reverra assez souvent. \r\n\r\nJe te fais un petit baise-main pour te dire au revoir.\r\nLa plus belle fille de la soirée alias Beubeu\r\n\r\nPS : protège tes couilles', 2336, 2335),
(939, 2, 'DISCLAIMER : Ce message est écrit avec plein de niaiserie / ou pas, dans un français qui m\'est propre #JEcrisCommeJeParle. De plus, toutes les fotes de grammaires / orthographes ne sont pas intentionnelles, je reporte la faute sur l\'éducation nationale qui m\'a laissé passer au collège avec des 0 en dictées.\r\n\r\nMa petite Marianne,\r\nDéjà merci à toi aussi pour tous les moments passés ensemble, je me suis bien amusés avec toi (et m\'amuse toujours). Il est vrai qu\'on a bu de bonnes bières. Ce fut un plaisir de passer du temps avec toi, même dans les moments difficiles. J\'attends avec impatience nos prochaines soirées.\r\n\r\nGros bisous,\r\nLoïc', 2302, 2183),
(940, 2, 'Yo,\r\nJe t\'envoi juste un message pour te casser les couilles comme tu vas recevoir un mail et devoir venir ici lire le message, donc ne rage pas. \r\nSinon bonne continuation et vient te la coller le 2 septembre.\r\n\r\nCan\'', 2302, 2323),
(941, 2, 'Yo,\r\nJe t\'envoi juste un message pour te casser les couilles comme tu vas recevoir un mail et devoir venir ici lire le message, donc ne rage pas. \r\n\r\nSinon bonne continuation et vient te la coller le 2 septembre si t\'es de retour du Brazil!!!!!!!!!!!!!.\r\n\r\nCan\'', 2302, 2228),
(942, 2, 'Bonjour Clément,\r\n\r\nil me fallait commencer à écrire à quelqu\'un, je ne savais pas forcément à qui, et je t\'ai choisi toi car tout simplement les choses ont fait que tu es l\'un des premiers que j\'ai rencontrés et avec qui j\'ai parlé. Même si par la suite nous nous sommes éloigné, tu es quelqu\'un de bien et qui mérite d\'être connu.\r\n\r\nJe te félicite pour ton diplôme et je suis jaloux de ton année au Canada ^^ !!\r\n\r\nLa Biz, BABOU', 2334, 2274),
(943, 2, 'Bonjour Monsieur Lucas,\r\n\r\nJe me permets de vous écrire un petit sympathique sur votre petit yearbook, puisque vous êtes pour moi une personne qui a compté pour moi durant ces petites années ^^\r\nLol je vais arrêter mes phrases bizarres.\r\n\r\nBref Merci d\'avoir toujours été là au top du top pour moi en tant que Farmerzz, Assofi, Wei et surtout en tant qu\'ami. Tu es quelqu\'un de bien malgré ton addiction au site de rencontres. Je te souhaite le meilleur pour la suite.\r\n\r\nFelicitation pour ton diplôme !!\r\n\r\nBabou\r\n\r\nPs : je compte refair eun exposé en espagnol, on le fais ensemble et sur la colombie ?', 2334, 2316),
(944, 2, 'Salut partenaire de filière !\r\n\r\nEt bien félicitation pour ton diplôme ! Je te souhaite de trouver un boulot qui te plait. Attention de bien mener les réunions sinonn Mouzat ne va pas être contente !!!!! :D\r\n\r\nBon courage pour la suite, montre au monde entier que la filière F1 est la meilleure filière du monde !\r\n\r\nAu plaisir de se revoir,\r\n\r\nRémi (Rikou)', 2277, 2281),
(945, 2, 'Oh GODDDDDBERT !!! \r\n\r\nEcoute ce fût un plaisir de partager 3 ans avec toi, on a passé de sympa petit moment très verdoyant :D\r\n\r\nAu plaisir de se revoir un jour,\r\n\r\nBon courage pour la suite,\r\n\r\nRémi (Rikou)', 2277, 2202),
(946, 2, 'Bonjour benjamin , \r\n\r\nje te félicite pour ton dîplome, et je te souhaite le meilleur pour la suite. \r\nje te remercie d\'avoir fait autant pour nous en temps que Farmerzz et à ISIGALA. C\'était un plaisir de travailler avec toi.\r\n\r\nBonne continuation et faisons un peu la fête pour notre dîplome \r\n\r\nLa biz, Babou', 2334, 2331),
(947, 2, 'Alors c\'est l\'histoire d\'un pet qui rigolait. Et c\'est bien la première fois qu\'un pet rit ! \r\n\r\nOk c\'est nul, mais laisse moi profiter de ma dernière blague ! \r\n\r\nBon allez,  félicitation pour ton diplôme ! Je te souhaite de trouver un boulot qui te plait. Attention de bien mener les réunions sinonn Mouzat ne va pas être contente !!!!! :D\r\n\r\nBon courage pour la suite, montre au monde entier que la filière F1 est la meilleure filière du monde !\r\n\r\nAu plaisir de se revoir,\r\n\r\nRémi (Rikou)', 2277, 2309),
(948, 2, 'Mousmous, \r\n\r\nOn a bien rigolé en espagnol avce toi et alex ^^ !! je te souhaite bonne chanc epour la suite. Félicitation pour ton dîplome\r\n\r\nLa biz, BABOU', 2334, 2306),
(949, 2, 'Mon petit Lénaic !\r\n\r\nCe fût un plaisir de partager ces années avec toi :) Que des bons moments : cours d\'allemand, interro d\'allemand, passage à l\'oral en allemand... Ralalala, tout ça va me manquer :P\r\n\r\nPlus sérieusement,  félicitation pour ton diplôme ! Je te souhaite de trouver un boulot qui te plait. Attention de bien mener les réunions sinonn Mouzat ne va pas être contente !!!!! :D\r\n\r\nBon courage pour la suite, montre au monde entier que la filière F1 est la meilleure filière du monde !\r\n\r\nAu plaisir de se revoir,\r\n\r\nRémi (Rikou)', 2277, 2312),
(950, 2, 'Salut partenaire de filière !\r\n\r\nJe pense qu\'on peut espérer tout les deux ne plus jamais faire de projet ensemble ahaha. Je suis pas sûr mais je crois pas qu\'on a été au top niveau dans la discipline x).\r\n\r\nEn tout cas félicitation pour ton diplôme ! Je te souhaite de trouver un boulot qui te plait.\r\n\r\nBon courage pour la suite, montre au monde entier que la filière F1 est la meilleure filière du monde !\r\n\r\nAu plaisir de se revoir,\r\n\r\nRémi (Rikou)', 2277, 2319),
(951, 2, 'Salut mon ptit Johan.\r\n\r\nJe crois que je pouvais difficilement partir sans laisser un bon gros message sur ton YearBook et sur celui de notre petit Mitch préféré.\r\n\r\nMerci pour ces 3 années qu\'on a passé ensemble, j\'ai passé de super moments avec toi. Ne m\'en veut pas pour toutes les fois où je t\'ai ragé dessus, je t\'aime quand même :D\r\n\r\nJ\'espère vraiment qu\'on aura l\'occasion de se revoir, avec Mitch, etc... Et se racontait nos nouvelles vies qui vont commencer bientôt.\r\n\r\nEn tout cas, je n\'oublierais pas tout ces petits moments, ces petits WEI, ces soirées GEEK sur League Of Legends ou sur Ark :D On a été premier du serveur putin !!!!!!!\r\n\r\nBon courage pour la suite ! On va au WEI jusqu\'à nos 30 ans tu te souviens ? ;)\r\n\r\nBisous mon jojo,\r\n\r\nRikou', 2277, 2320),
(952, 2, 'Jimmy !!!!!!\r\nOh my god, cette photo de toi horrible ! Je me demande encore si tu l\'as fait sans tricherie ou avec des effets spéciaux ! Bref, passons ...\r\n\r\nQui l\'aurait cru, Jimmy qui rejoignait une association à ISIMA, déjà pas moi et plus une association où il y a le plus de boulot ^^ bref, merci d\'avoir assuré pendant cette année avec tous les événements ^^ . Même si des fois ce n\'est pas toujours facile.\r\n\r\nje te souhaite le meilleur pour la suite, et félicitation pour ton diplôme\r\n\r\nBisous de moi, \r\n\r\nBabou\r\n\r\nPs: Merci pour les cours de réseaux en deuxième année, je n\'aurais jamais eu la matière sino!!\r\nPs2: Tu es un Farmerzz pour moi\r\nPS3: J\'aimerais que tu avoues enfin devant tout le monde que je suis meilleur que toi au Babyfoot', 2334, 2308),
(953, 2, 'Coucou Michou,\r\n\r\nBon c\'est toujours triste de se faire des petits adieux comme ça... En tout cas j\'ai passé 3 années exceptionnelles avec toi, c\'était au top. Merci d\'avoir rejoins la meilleure liste de l\'univers lol.\r\n\r\nJ\'espère vraiment qu\'on aura l\'occasion de se revoir pour se raconter un peu comment se passe nos nouvelles vies respectives :) Et histoire de se remémorer toutes les conneries qu\'on a pu faire en école.\r\n\r\nBravo pour ton diplôme et j\'espère que tout va rouler pour toi par la suite :)\r\n\r\nBisous,\r\n\r\nRikou', 2277, 2321),
(954, 2, 'Salut partenaire de filière !\r\n\r\nEt bien félicitation pour ton diplôme ! Je te souhaite de trouver un boulot qui te plait. Attention de bien mener les réunions sinonn Mouzat ne va pas être contente !!!!! :D\r\n\r\nBon courage pour la suite, montre au monde entier que la filière F1 est la meilleure filière du monde !\r\n\r\nAu plaisir de se revoir (peut-être chez Avanade ? :D)\r\n\r\nRémi (Rikou)', 2277, 2325),
(955, 2, 'Bon allez ! Faut pas déconner, le petit Beubeu il mérite un jolie mot sur son YearBook.\r\n\r\nEcoute bro\', j\'ai passé deux excellentes années avec toi ! ET OUAIS PAS TROIS ! On s\'aimait pas avant je te signal !\r\n\r\nEn tout cas, ça m\'a vraiment fait plaisir de ton rencontrer, de passer tout ces cours MEGA CHIANT à tes côtés, je crois que ça serait pas passé aussi vite à côté de Perreda (mais j\'en suis pas certain hein).\r\n\r\nExcuse moi pour toutes les fois où je t\'ai un peu (beaucoup) ragé sur toi ahaha. Mais tu me connais, je changerais pas ;D\r\n\r\nBref, je te souhaite le meilleur pour la suite, je te souhaite d\'avoir un boulot qui te plait et qu\'il ne t\'arrive que des bons moments. Et j\'espère qu\'on aura l\'occasion de se revoir un jour !\r\n\r\nFélicitation pour ton diplôme ma poule,\r\n\r\nF1 FOREVER,\r\n\r\nBisous,\r\n\r\nRikou', 2277, 2336),
(956, 2, 'Loïc !\r\n\r\nBon premier chose, tu as vraiment été ISILOUDEUR avec ton acolyte Matthieu Aimé en fin de soirée Féria ( la soirée passation)! Donc ta mission est réussie ^^\r\n\r\nBref merci pour les bons moments de rigolade durant ces années. Je vous remercie, vous et une petite partie des Heroezz pour avoir effacé vite les appriori des uns et des autres pour qu\'on puisse passer de belle années.\r\n\r\nMerci à toi, bon courage pour la suite\r\nFélicition pour ton diplôme!!!\r\n\r\nbisous de moi, Babou !\r\nPs: je suid obligé d\'en mettre au moins un\r\nPS2: voire deux\r\nPs3: voire trois\r\nPS4: parce que 4', 2334, 2302),
(957, 2, 'Ouesh Sylvain !\r\n\r\nFélicitation pour ton diplôme !\r\n\r\nRendez-vous à la prochaine DevCon ! (Jdéconne DefCon :D) Merci de m\'avoir emmener à cette fameuse avec Brennan Heart et de m\'avoir fait découvrir le Moulin, probablement la meilleure soirée de ma vie.\r\n\r\nBon courage pour la suite,\r\n\r\nRikou', 2277, 2286),
(958, 2, 'Merci rikou, \r\n\r\nFélicitations à toi aussi et bonne chance pour la suite =)) \r\nC\'était quand même une fat soirée ^^\r\n\r\n\r\nSylvain', 2286, 2277),
(959, 2, 'Yoooooooooooooo !\r\n\r\nBon mon petit noob de bronze V, félicitation pour ton diplôme !\r\n\r\nJe te souhaite de devenir méga barraque (ahaha), et de devenir pro-player sur LoL pour gagner des millions d\'euros ! \r\n\r\nAllez plus sérieusement, ça m\'a fait plaisir de te connaitre ! Merci pour tout ce que tu as fais pour le BDE avec la meilleure des listes.\r\n\r\nJe te souhaite que tu trouves un bon job et que tu kiffes les années à venir.\r\n\r\nEn espérant avoir l\'occasion de te revoir,\r\n\r\nRikou', 2277, 2323),
(960, 2, 'YO LE LOURD !\r\n\r\nBon Antoine, je pense qu\'il faut bien que je te le dise un jour, merci pour tout ce que tu as fait pendant notre mandat BDE. Je me souviens encore du nombre incalculables de fois où l\'on s\'est prit la tête, mais comme on dit il n\'y a que  ceux qui ne font rien qui ne font pas d\'erreur. \r\n\r\nMerci pour tout Antoine et félicitation pour ton diplôme,\r\n\r\nJ\'espère qu\'on aura l\'occasion de se revoir et que tu me feras l\'éloge de ta lourdeur <4.\r\n\r\nBon courage pour la suite,\r\n\r\nRikou', 2277, 2301),
(961, 2, 'Salut Cédric,\r\n\r\nFéliciation pour ton diplôme,\r\n\r\nJe te souhaite d\'avoir un bon boulot et de faire les meilleurs RoadTrip du monde avec ta belle bécane :p\r\n\r\nAu plaisir de se revoir,\r\n\r\nRikou', 2277, 2299),
(962, 2, 'Salut Vavou !\r\n\r\nFélicitation pour ton diplôme,\r\n\r\nMerci à toi aussi pour tout ce que tu as fait pour l\'école, pour Isibouffe, pour le WEI et surtout pour le WED qu\'on a organisé ensemble. J\'aurais pas réussi sans toi et Lulu.\r\n\r\nJe te souhaite de profiter au maximum des années qui arrivent,\r\n\r\nAu plaisir de se revoir à LaMente (Je sais même plus si on écrit ça comme ça :D)\r\n\r\nBisous,\r\n\r\nRikou', 2277, 2195),
(963, 2, 'Bonjour Quentin,\r\n\r\nMerci pour tout ce que tu as fait pour l\'école et plus particulièrement pour ta trésorerie infaillible !\r\n\r\nJe pense qu\'on se souviendra toute notre vie de cette belle odeur qui était présente dans la chambre que l\'on partageait au WED :D #MerciQui #MerciJohan\r\n\r\nFéliciation pour ton diplôme et bon courage pour la suite,\r\n\r\nRikou', 2277, 2289),
(964, 2, 'Maxime, \r\n\r\nJe ne sais quoi te dire pour que tu comprennes, STOP STOP avec ce live PDE ! ^^\r\n\r\nJe ne suis pas l\'ami le plus exemplaire, peu de nouvelles, peu de message, d\'appel et de tout mais voilà c\'est comme ça c\'est moi ! Tu es quelqu\'un qui mérite d\'être connu et qui donne toujours beaucoup même trop, parfois un peu trop rancunié ( on ne parlera pas de l\'incident sur le bar du BDE^^) et trop tranché sur des questions mais c\'est ça qui te rend atypique et attachant. Je me souviendrais toujours des soirées ensemble au BDE quand tu finissais mal comme un chien ^^ et que tu draguais comme un peintre en bâtiment ^^ LOOOOLLL (bon tu en as quand même piqué un à Vavou !)\r\nMerci pour ta fidélité à moi, avec toutes les associations que l\'on a partagées ^^! Tu ne m\'as jamais dit non et pourtant tu aurais dû et pus ^^ ! Quand tu vois que j\'ai des idées farfelues pour refaire un deuxième WEI, il faut m\'engueuler ^^!\r\n\r\nJe te souhaite le meilleur pour la suite, continue à être comme ça et tu verras la vie, les filles tout te souriront ^^! \r\n\r\nBonne continuation et bon courage pour la suite.\r\n\r\nFélicitaion pour ton diplôme !\r\n\r\nLa Biz, Babou\r\n\r\nPs: On n\'a pas eu ISIOKE ensemble, mais ça aurait pu être drôle!!', 2334, 2298),
(965, 2, 'Rikouuuuu!\r\nFélicitations pour ton diplôme volé et en espérant te (re)voir plus souvent au Del.', 2098, 2277),
(966, 2, 'Bravo Godinou pour un magnifique dilpôme en 4 ans. C\'est la marque des meilleurs!', 2098, 2202),
(967, 2, 'Féliciations Ptit FIllot!', 2098, 2312),
(968, 2, 'T\'as fait honneur à ta lignée de très haute qualité. Félicitations', 2098, 2321),
