(971, 2, 'Vavouuuuuuu <3 Tu l\'auras quand même eu ce diplôme. Le Chili t\'as réussi!\r\nJ\'espère tout va continuer comme tu le souhaite et que tu seras le meilleur infirmier du monde! (et ça m\'arrangerait de ne jamais te rencontrer dans le cadre de ton futur taf :D)', 2098, 2195),
(972, 2, 'Philou t\'auras bien entrainé depuis la soirée \"Winter is coming\". Tu n\'as plus (trop) refait des coups comme dans le bus pour aller à cette soirée. Et heureusement :)\r\nFélicitations', 2098, 2301),
(973, 2, 'Bravo Kiki!', 2098, 2335),
