(975, 2, 'Félicitations Babou! Nouveau Monsieur Michelin?', 2098, 2334),
(976, 2, 'T\'as fini par l\'avoir ce diplôme! Fallait pas stresser comme ça. C\'est dommage que ça soit en F4... Maintenant que tu es partie, qui va renverser les pâtes à Isibouffe?', 2098, 2183),
