(979, 2, 'PO PO PO PO PO PO PO PO PO !!\r\n\r\nFélicitation pour ton dîplome ^^, je tiens à te remercier ce que tu as fait pour AssoFinale et pour notre intégration quand tu étais BDE c\'était de la folie ^^ Merci les GriZZly !!\r\n\r\nLe truc que je retiendrais le plus de toi, c\'est quand je suis en soirée stressé et toujours en train de regardais à droite à gauche !! Et tu arrive, Babou boit un coup de je ne jamais quoi mais c\'est toujours trés bon ^^\r\n\r\nBonne continuation et bon courage \r\n\r\nBisous de moi, \r\n\r\nBabou', 2334, 2160),
(980, 2, 'Salut Yoyoanan !!\r\n\r\nFélicitation  et Bonn courage pour la suite !! ne change pas trop surtout pendane les soirées Muzzic à l\'ISIMA !!! Tu m\'as fait toujours rire quand tu secouais ta tête ^^\r\n\r\nBiz, Babou', 2334, 2314),
(981, 2, 'Marianne, \r\n\r\nque puis-je d\'écrire ^^ !\r\n\r\nMarianne incarne la République française et ses valeurs contenues dans la devise : \" Liberté, Égalité, Fraternité \". Finalement tes parents ne sont pas trop trompés sur ton prénom, ce sont des vraies valeurs que tu as sues nous partager durant ces trois ans. Tu essayes toujours de faire tout ce qui faut, de la meilleure façon possible et pour faire plaisir à tout le monde . Tu nous en as parfaitement montré l\'exemple pour le calendrier des filles ^^.\r\n\r\nNotre petite Marianne à nous a aussi un coeur d\'Artichaut ^^ avec ses histoires de coeur et de cours. Et maintenant je ne veux plus te voir STRESSER ! Tu as ton diplôme et tu le mérites largement.\r\n\r\nFélicitation et Bonne Continuation!!\r\n\r\nPS : Merci à vous les GriZZly pour notre intégration ^^', 2334, 2183),
(982, 2, 'Justine, \r\n\r\nJe pense que tu es une princesse et une princesse c\'est :\r\n\r\nP de Princesse\r\nR de pRincesse\r\nI de prIncesse\r\nN de priNcesse\r\nC de prinCesse\r\nE de princEsse\r\nS de princeSse\r\nS de princesSE\r\nE de princessE\r\n\r\nFélictation, \r\n\r\nBabou \r\n\r\nPS : Tu auras droit à un deuxiéme mot quand même', 2334, 2294),
(983, 2, 'Zouzou!!!!,\r\n\r\nQui l\'aurait cru toi diplômer même moi je pensais que tu devais te faire virer !\r\nNon mais en tout merci pour tous les bons moments où tu m\'as fait vivre ! Les fourire avec les mégas blagues de Zouzou ! Les soirées arrosées !\r\n\r\nMerci pour m\'avoir fait confiance durant ces 3 ans pour les Farmerzz et le Wei et l\'Asso finale et encore le Wei ( et le BDS mais c\'était Kiki) ! Merci pour tout d\'avoir été autant généreux ^^Je n\'ai pas fait une crêpe des campagnes ^^\r\n\r\nJe t\'ai écrit une petite chanson pour que tu n\'oublies pas certains moments de ta vie !\r\n\r\nBonne continuation et félicitation pour ton diplôme ^^\r\n\r\nBisous de moi, Babou \r\n\r\nSur ma route, oui\r\nIl y a eu Zouzou, oui\r\nDe l\'aventure dans l\'movie\r\nUne vie trop cool\r\nSur ma route, oui\r\nJe n\'compte plus les vomis\r\nDe quoi devenir fou, oui\r\nUne vie de loose  (X2 le paragraphe)\r\n\r\nSur notre route (x4)\r\n\r\nA l\'école, aucun des moments de doute\r\nOn marchais direction le BDE,  onétais têtu rien à foutre\r\nSur ma route, j\'avais pas d\'bagage en soute\r\nEt, dans ma poche, pas un sou, juste les farmerzz, entre nous\r\nSur Toute nos teilles, y\'avaient plus d\'bouchons\r\nLa vérité, j\'ai souvent du terminer\r\nEst-ce que tu sais que quand tu touches le fond\r\nIl y a toujours une portiére pour tout deglutiné?\r\nTu peux compter que sur tes chers parrains\r\nParce que les farmerss, eux, te font boire  un par un\r\nOui, il m\'arrive d\'avoir le front au sol\r\nParce que j\'ai mal aux jambes et, non on est seul, tu es un farmerzz \r\n\r\n....', 2334, 2339),
(984, 2, 'AH Mapate Mapate, \r\n\r\nLe trublion de la classe, la gentillesse incarné, extrême dans toute sa splendeur, ... Voilà ce que je retiens de toi, un sale caractère au coeur en or !\r\n\r\nTu nous as toujours fait rire avec ta manière de toujours avoir raison ^^ ! \r\n\r\nSurement la personne la plus travailleuse de l\'ISIMA, le plus stressé, le plus inquiet et qui a toujours des bons plans. Bon plan que tu as su partager avec moi surtout, merci je n\'aurais jamais pu avoir mon année sans toi ^^. Reste le même, ne change pas tu es quelqu\'un qui mérite d\'être connu et qui est toujours au top!\r\n\r\nJuste un mot : NE STRESSE plus comme tu l\'as fait pour les résultats de rattrapage de première année, on t\'avait dit oui et tu étais quand même stressé LOOOOOLLL ^^ ( je te comprends un peu quand même)\r\n\r\nFélicitation pour ton diplôme, tu es celui qui le mérite le plus et bonne continuation !\r\n\r\nBisous de moi, Babou\r\n\r\nPs : on a survécu quand même au Gala des 20 ans ^^', 2334, 2326),
(986, 2, 'CLEMENT PETITITITITIT, \r\n\r\nJe vais faire court et précis !\r\nUn souvenir : WEI 2014, clément avec un trou dans les cheveux !!\r\nUne qualité : la réflexion et la gentillesse\r\nUne association  : le ludique\r\nUn défaut : forte tête\r\nune remarque: ton nom ne va pas avec ton 1m90 ( voir plus )\r\n\r\nFélicitation pour ton dîplome !! Bon courage pour la suite mais bon je m\'en inquiéte pas ça !!\r\n\r\nBiz, Babou', 2334, 2328),
(987, 2, 'DISCLAIMER : Ce message est écrit avec plein de niaiserie / ou pas, dans un français qui m\'est propre #JEcrisCommeJeParle. De plus, toutes les fotes de grammaire / orthographe ne sont pas intentionnelles, je reporte la faute sur l\'éducation nationale qui m\'a laissé passer au collège avec des 0 en dictées.\r\n\r\nHola Babou,\r\n\r\nTout d\'abord merci pour ton message, ça fait plaisir. Aussi félicitation pour ton diplôme (je ne doute pas que tu vas l\'avoir EASY). Je peux dire que j\'ai vraiment passé 3 bonnes années à l\'ISIMA et ce grâce à tout le monde.\r\nAlors certes j\'ai pas forcément d\'affiné avec tout le monde (et c\'est réciproque, ce qui me va parfaitement comme ça) mais ça nous ne a pas empêché de bien se marrer.  \r\n\r\nBonne chance dans tes projets futurs\r\nAmicalement, Loïc.\r\n\r\nCe message n\'était pas du tout sponsorisé par IsiNiaiserie Corp.®, la filiale niaise d\'IsiLoudeur™\r\n\r\nP.S. : Parce qu\'il en faut 1\r\nP.S. 2 : Je ne rappelle pas de la soirée féria', 2302, 2334),
(988, 2, 'TOUT MAIS PAS CA!!!!!!!!!!!!!!!!!!!!!!!!!\r\n IsiNiaiserie Corp.®, la filiale niaise d\'IsiLoudeur™', 2334, 2302),
(989, 2, 'Salut partenaire de filière !\r\n\r\nMerci pour ce petit mot ^^\r\n\r\nTout d\'abord félicitations pour ton diplôme ! J\'espère que tu as pu choisir entre CGI et Avanade =P. Attention à toi aussi aux réunions, je serai là pour rapporter à Mouzat si tu respectes son enseignement =P\r\n\r\nBon courage  à toi aussi pour la suite & évidemment que la F1 est la meilleure filière du monde !!!\r\n\r\nA très bientôt (peut-être chez Avanade ? :D ou même à MX =)) )\r\n\r\nEdwige', 2325, 2277),
(990, 2, 'Coucou fillot,\r\n\r\nPetite message que j\'espère tu liras sur papier dans un très joyeux moment convivial et festif. En attendant donnes tout ce que tu peux pour avoir l\'autre bout de papier beaucoup plus important ;)\r\nJe te fais dans tous les cas d\'énormes poutous, je te souhaite bon courage, et je te dis à bientôt. \r\n\r\nCe qui te sert de parrain', 2077, 2202),
(991, 2, 'Coucou fillote\r\n\r\nJe suis fier de toi, tu as bien grandi ces dernières années, tu deviens une vraie femme. Je te félicite pour ton parcours et tes exams, reste plus qu\'à valider ton stage et après ce sera fini =)\r\nJe te fais d\'énormes bisoux et je suis ravis de t\'avoir rencontré et d\'avoir partagé tout ces moments avec toi ^^\r\n\r\nCe qui te sert de parrain', 2077, 2183),
(992, 2, 'Yeap fillot\r\n\r\nToutes mes félicitations pour ton génie récursif et ton diplôme même si t\'as pas voulu respecter la tradition. Au moins maintenant tu peux être tranquille et serin ^^\r\nJe te souhaite une très bonne continuation dans la vie et t\'embrasse fort =)\r\n\r\nCe qui te sert de parrain', 2077, 2302),
(993, 2, 'Yosh Marianne ! Félicitations pour ton diplôme :-) Des bisous et prends soin de ti, on se voit au mariage ;-)', 2201, 2183),
(994, 2, 'Salut Guilhem,\r\n\r\nFélicitation pour ton diplôme ! Et encore merci pour tout ce que tu as fait pour le BDE.\r\n\r\nC\'était un plaisir de t\'avoir rencontré,\r\n\r\nBon courage pour la suite. \r\n\r\nRémi (Rikou)', 2277, 2293),
(995, 2, 'Coucou Pô !\r\n\r\nFéliciation pour ton diplôme ! :)\r\n\r\nNe soit pas énervé hein ! #PoMad  ahaha\r\n\r\nJ\'espère qu\'on se verra au prochain WEI, celui de 2015 était bien énorme non ? :p\r\n\r\n\"Pourquoi le mec il range le tuyau ?\" #TMTC\r\n\r\nBisous,\r\n\r\nRikou', 2277, 2160),
(996, 2, 'Coucou ma poule !\r\n\r\nBon écoute, félicitation pour ton diplôme,\r\n\r\nC\'est un plaisir d\'avoir partagé avec toi toutes ces aventures verdoyantes ;D\r\n\r\nJ\'espère qu\'on restera en contact et qu\'on trouvera un bon MMO à farmer ensemble soon, que je te montre c\'est qui le papa !!!\r\n\r\nA bientôt bro,\r\n\r\nRikou', 2277, 2232),
(997, 2, 'Coucou-tier !\r\n\r\nBon si je te l\'avais pa sfaite celle-là, je pense que tu aurais été bien déçu, donc ne me remercie pas, c\'est K-DO !\r\n\r\nFélicitation pour ton diplôme et pour ton CDI chez Sopra ;)\r\n\r\nJ\'espère qu\'entre le temps ou j\'écris ce mot et la remise des diplomes on aura choper le compte de CorruptAccro que tu parraisses un peu moins noob sur Magic Rush ahahah !! !! \r\n\r\nBon et puis j\'espère qu\'on jour on trouvera le temps de se motiver pour trouver un bon gros MMO style Dofus pour se lancer dans une méga aventure (gratuite) où on pourra être les rois du serveur sans pour autant avoir mit de fric dans un jeu mdr\r\n\r\nSinon ça m\'a fait plaisir de passer du temps avec toi, j\'espère qu\'on aura des occasions de se revoir, pourquoi pas à des festivals partout en France,\r\n\r\nBon courage pour la suite bro\',\r\n\r\nBisous,\r\n\r\nRikou', 2277, 2194),
(998, 2, 'Tu rêves pour avoir un mot ^^ !!!', 2334, 2194),
(999, 2, 'Alors alors alos, mon petit Babou,\r\n\r\nBon je pense que tu vas détenir le record du mot le plus long parce qu\'il y a pas mal de choses à dire.\r\n\r\nEcoute, plus j\'y repense et plus je regrette ce qui a pu passer en première année. Je crois que je me suis beaucoup laissé emporter par cette compétition. Tu le sais je pense, je n\'aime pas perdre :D #DemandeAEmma. \r\n\r\nJe ne sais pas si je te l\'ai déjà dit, mais j\'ai jamais voulu faire BDE avant que Lulu vienne me prendre de haut en me demandant de faire une liste pour qu\'il y ai de la compétition parce qu\'elle ne voulait pas gagner trop facilement. Je pense qu\'à partir du moment où j\'ai monté une liste juste pour faire chier Lulu c\'était déjà mal parti pour faire une campagne fairplay... \r\n\r\nEncore une fois je suis vraiment désolé. Surtout qu\'en plus on peut pas dire que la moitié de mon équipe était vraiment au taquet, et peut-être que si on avait eu moins d\'honneur tous les deux, on aurait peut-être été capable de faire une liste All-Stars et de faire un bien meilleur mandat que celui que ma liste a faite.\r\n\r\nBref, arrètons de parler des campagnes, je voulais te remercier parce que j\'ai bien remarqué que si aujourd\'hui on se parle, on rigole ensemble, on passe des soirées ensemble c\'est uniquement grâce à toi. On peut pas dire que j\'ai fait beaucoup d\'efforts...\r\n\r\nEnfin voilà Babou, c\'est un plaisir aujourd\'hui d\'être un de tes amis et de partager du temps avec toi. Ca me fait penser que je dois te dire que Dj Snake est numéro 1 ! peut-être que tu le sais pas et que comme on est potes, je me dois de le dire ahhaha\r\n\r\nBref, j\'espère que tu resteras à Clermont, et qu\'on aura l\'occasion de continuer à passer ensemble d\'excellentes soirées :D Peut-être même que tu me suivras jusqu\'au WEI jusqu\'à 30 ans ? :D\r\n\r\nEn tout cas, félicitation pour ton diplôme Babou. Maintenant la vie active commence :D Espérons que nos poches sont rempliront très très vite ahaha !\r\n\r\nMerci pour tout ce que tu as fait pour l\'école mon petit Babou,\r\n\r\nPs : Ne rage pas trop pour mon dracolosse :D Je t\'en donnerais un promis :D\r\n\r\nBisous,\r\n\r\nRikou', 2277, 2334),
(1000, 2, 'Mon cher président BDE préférer. \r\nJe vous laisse ce message dans le but de vous rem...\r\n\r\nMerci pour ses trois années gros.\r\nEn vrai, j\'adore quand tu rages. On a bien geeké ensemble.\r\nJ\'espère franchement te revoir, car dans mon cœur tu resteras à jamais mon président (comme le fromage).\r\nJe pense pas pouvoir laisser un message digne de ses trois années passé mais en gros c\'était génial. Merci du fond du cœur.\r\n\r\n\r\n\r\nJohan (secrétaire)', 2320, 2277),
(1001, 2, 'Merci pour ton message qui m\'a fait grandement plaisir.\r\nMerci également pour ces trois années géniales. Toutes mes félicitations pour ce magnifique diplôme. Je te souhaite beaucoup de bonheur.\r\nDes bisous!\r\n\r\nMarianne.\r\n\r\nPS : Merci pour Gozzip.', 2183, 2334),
(1002, 2, 'Jojo !\r\n\r\nFélicitaion pour ton diplôme !\r\n\r\nJe me souviendrais toujours de toi au WEI pour deux choses. La première c\'est ta bonne humeur permanente et le second c\'est le Wei où tu étais totalement bourré ! Honnêtement tu nous faisais chier au WEI, tu venais sans cesse nous embêter. On te couchait, tu revenais (toujours avec le sourire) ^^ ! Le problème est que tu souriais tout le temps et que tu étais super gentil, du coup ben ça me faisait sourire et rigolait ^^ et je ne pouvais pas m\'énerver contre toi ^^ :) \r\n\r\nJojo, bonne continuation \r\nLa Biz, Babou', 2334, 2324),
(1003, 2, 'Nico, \r\n\r\nQuoi dire à Nicolas, même moi je sais par où commencer pour parler de toi tellement yen a à dire. Je pourrais en faire un roman que j\'intitulerais \" la naissance d\'un râleur \" . \r\n\r\nNon bref, tout le monde va te dire que tu râles, ce n\'est pas très original puis on ne peut pas te résumer à ça ! Tu es quelqu\'un fan de pokémon aussi et un tongueman ^^ ... Non mais surtout quelqu\'un au grand coeur qui ne dévoile que rarement ces émotions, toujours là pour ses amis, serviable, ... quelqu\'un qui mérite d\'être connu !\r\n\r\nTrois ans où on est dans la même classe, qu\'on se supporte, et pourtant on se parle encore ^^ un miracle au vu de nos deux caractères ! Je te remercie d\'avoir fait partie des Farmerzz and Co, toujours là pour nous soutenir pendant les campagnes, à rejoindre les équipes WEI, pas une mais deux fois en plus ! Bref, merci de m\'avoir fait confiance dans l\'association et d\'avoir toujours été là pendant ces moments.\r\n\r\nJe te souhaite le meilleur par la suite,\r\nBonne continuation et je ne te souhaite pas de bonne chance, car sans aucun doute tu es quelqu\'un qui réussira ce qu\'il entreprend.\r\n\r\nBisous de moi, Babou\r\n\r\nPs : si tu veux écrire un livre s\'intitulant \" le secret d\'un bon râleur \", je te présente un éditeur ^^ je suis sûre que ça marchera ^^', 2334, 2315),
(1004, 2, 'Matthieu Lepaix, \r\n\r\nDéjà trois ans que l\'on se connaît, je me dis encore aujourd\'hui comment ça se fait que je lui parle encore, un gros naze comme lui qui tape tout le monde en boîte, qui écoute Jackie ta 4L ou encore qui se fait des chichas pure whisky ^^! Quelle idée j\'ai dans la tête pour te parler encore et en plus d\'écrire un mot à Matthieu Lepaix. Tout le monde est formel sur le sujet, on me dit que je suis fada de parler avec un gros naze comme lui ^^ ! \r\n\r\nNon plus sérieusement, merci pour ces merveilleux moments et nanianianian ... ( on va s\'en dormir je ne vais pas écrire un mot avec des coeurs love non plus)\r\n\r\nUne chose est sûre, je ne pensais pas rencontrer des gens comme les farmerzz and Co avant de venir à ISIMA, je te remercie d\'avoir toujours cru en moi, malgré nos désaccords ( #lacolocensemblecestunemauvaiseidée) ! que tu reviens faire un deuxième WEI, alors qu\'on était parti pas en très bons termes, ça m\'a énormément fait plaisir ! Même si l\'on n\'a pas gagné ce BDE, j\'ai gagné beaucoup plus, des amis et trois ans de rigolade. J\'en espère plein d\'autres encore. ( Mais plus de PQ dans mon appartement et de vomi ^^ )\r\n\r\nJuste il faut me promettre une chose, on doit aller à électro beach un jour et on reprendra des teqpaf sur le toit de ma baniole puis sans oublier un tour à la marina ^^\r\n\r\nMême pas besoin de te dire bonne continuation et bon courage pour la suite, je n\'en doute pas une seconde que tu sauras toujours t\'en sortir ^^ Félicitation pour non pas un mais tes deux dîplomes ^^\r\n\r\nBisous de moi, Babou\r\n\r\nPS1: Farmerzz pour toujours\r\nPS2: en cadeau les paroles de loco à apprendre par coeur\r\n\r\nAll dressed up and ready to party\r\nCruising down the boulevard, a rooftop down, yeah\r\nWelcome to the club, get into the sound\r\nMr DJ put your record on and spin it around and round\r\nWe\'re gonna burn this club to the ground\r\n\r\nWhat\'cha gonna do when the club goes lo-o-o-o-o-co\r\nSo put your hands up high gonna blow your mind\r\nWhen the club goes lo-o-o-o-o-co\r\nWhat\'cha gonna do when the club goes lo-o-o-o-o-co\r\nWhat\'cha gonna do?\r\nWhat\'cha gonna do?\r\nDo you like it?\r\n(I like it)\r\n\r\n(Loco, loco)\r\n\r\nPut your feet on the ground move up on the dance floor\r\nAddicted to the sound, Mr DJ\'s gonna give you some more\r\nSpeakers gonna blow up like dynamite\r\nParty detected by satellites\r\nWe\'re gonna burn this club to the ground\r\n\r\nWhat\'cha gonna do when the club goes lo-o-o-o-o-co\r\nSo put your hands up high, gonna blow your mind\r\nWhen the club goes lo-o-o-o-o-co\r\nWhat\'cha gonna do when the club goes lo-o-o-o-o-co\r\nWhat\'cha gonna do?\r\nWhat\'cha gonna do?\r\nDo you like it?\r\n(I like it)\r\n\r\n(Loco, loco)\r\n\r\n(Lo-o-o-o-o-co)\r\n\r\nIt\'s cool, you know, we\'ve gotta going on\r\nUp on the dance floor oh (oh), just get in the floor\r\nHey Mr DJ, gotta give me an earthquake\r\nWhy don\'t you play me the last and the best of Rick Astley\r\n\r\nWhat\'cha gonna do when the club goes lo-o-o-o-o-co\r\nSo put your hands up high, gonna blow your mind\r\nWhen the club goes lo-o-o-o-o-co\r\nWhat\'cha gonna do when the club goes lo-o-o-o-o-co\r\nWhat\'cha gonna do?\r\nWhat\'cha gonna do?\r\nDo you like it?\r\n(I like it)\r\n\r\n(Loco, loco)\r\n\r\n(Lo-o-o-o-o-co)', 2334, 2313),
(1005, 2, 'Je te souhaite bonne continuation et félicitation pour ton dîplome d\'ingénieur.\r\n\r\nBiz, Babou', 2334, 2307),
(1006, 2, 'Babbbbooouuu,\r\nentre nous ça a commencé dès le premier jour ! Je me souviens très bien de ces premiers croque-monsieur chez Justine. \r\n\r\nDes aventures par milliers, des services par milliers, des soirées par milliers, des associations par milliers, des filles PAS par milliers ^^ On aura bien rigoler et galérer ensemble, je n\'oublierai jamais ton cœur en OR (notamment des vacances de Toussaint géniales) et tes conneries de mongol ;) \r\n\r\nJ\'espère qu\'on restera en contact et qu\'on fera la fête encore de nombreuses fois. Je trouve pas les mots pour te dire à quel point je te kiff : wwowowowowwooooooooooow !!!!', 2298, 2334),
(1007, 2, 'Hans, Ya ! \r\nUne première année à manger des pizzas et boire de l\'alcool ! Et ça, tu sais bien faire ;)', 2298, 2288),
(1008, 2, 'On peut dire que je t\'en aurais fait baver pendant 3 ans entre la trésorerie et des TP à finir !!! \r\nJ\'espère ne pas t\'avoir trop traumatiser quand même et qui sait peut être qu\'un jour, on se retrouvera à cuire des kilos de viande ensemble !', 2298, 2289),
(1009, 2, 'Wesshhh grosse ! On s\'est rencontré grâce à Vavou et je pense qu\'on lui a fait honneur !\r\nDes conneries, on en aura fait ! L\'histoire se rappellera qu\'on a gagné le jeu de voiture en Italie.\r\n\r\nOn se retrouve très bientôt pour aller \"voir\" l\'ifma ;)', 2298, 2336),
(1010, 2, 'Chatttonnn ! \r\n3 bonnes années passés avec toi, tu m\'as permis de faire un projet image, de montée en compétence, de faire du tennis, de faire la fête (dont plusieurs dont je ne me souviens pas).\r\nOn aura bien rigoler, je te souhaite bonne continuation dans tous tes projets et je sais que tu en as de nombreux !', 2298, 2299),
(1011, 2, 'Bon Antoine va falloir arrêter les conneries maintenant, tu deviens grand maintenant ! \r\n\r\nPour un mec qui aimait pas l\'école, tu en auras passer du temps à s\'y investir et à discuter pour ne rien dire après les cours sur sa gestion ^^ \r\n\r\nAllez, bonne continuation !', 2298, 2301),
(1012, 2, 'Merci beaucoup! :) Bravo à toi aussi pour le diplôme ! \r\nPour FarmerZZ et le Gala ça m\'a fait plaisir ;)\r\n\r\nHâte d\'être à la RDD aussi :D\r\n\r\nA+, Benjamin', 2331, 2334),
(1013, 2, 'Tout mes vœux de réussite à toi Pierre ! Plein de start-up, plein de robots et plein de succès !', 2441, 2305),
(1014, 2, 'Bonne continuation à toi Quentin ! J\'espère que la lourdeur perdurera longtemps grâce à toi.', 2441, 2289),
(1015, 2, 'Ça y\'est mon parrain, te voilà ingénieur ! Tu es maintenant une personne digne de confiance, responsable et intègre. N\'oublie pas d\'arroser tout ceci régulièrement, et avec tes fillots !', 2441, 2288),
(1016, 2, 'Merci à toi Cedric pour tout ce que tu as fait pour IMAGE et pour m\'avoir conseillé pour le stage à Karlsruhe. Très bonne continuation dans ta thèse ! J\'ai hâte de lire tes publications !', 2441, 2242),
(1017, 2, 'Merci Cédric pour ton implication au sein d\'IMAGE, je te souhaite plein de réussite dans la suite de ta carrière !', 2441, 2299),
(1018, 2, 'Bravo Monsieur le Lourd ! Vous voilà Ingénieur désormais ! Merci Antoine de m\'avoir préparé au stage de Cardiff, et de m\'avoir adoubé en tant que Lourd. Bonne continuation, toujours plus internationale !', 2441, 2301),
(1019, 2, 'Salut Lulu ! Je te souhaites plein de réussite en tant qu\'ingénieur diplômé d\'état !', 2441, 2317),
(1020, 2, 'Merci pour ce que tu as fait pour IMAGE et pour l\'aide que tu nous as apportée. Bravo à toi pour le diplôme ! Je te souhaite plein de réussite, de succès et d\'argent !', 2441, 2315),
(1021, 2, 'Bravo Marianne ! Te voilà ingénieure diplômée désormais ! Je te souhaite plein de réussite !', 2441, 2183),
(1022, 2, 'Bravo Yoan ! Te voilà désormais ingénieur ! Voilà qui s\'arrose avec un bon rhum pirate. Plein de réussite et bonne continuation !', 2441, 2314),
(1023, 2, 'Yo c\'est can !!!!! \r\n\r\nComme tu n\'as pas de photo sur l\'Anelis j\'ai failli oublié de t\'écrire un petit mot sur ton yearbook...\r\n\r\nAlors on commence par la phrase traditionelle : Félicitation pour ton diplome Can\' !!!!! Tu l\'as bien volé celui-là. En même temps t\'as un peu prit la filière la plus pourrie de l\'ISIMA quoi. Même la F4 es mieux :D\r\n\r\nEt sinon mec, merci pour tout ton soutien pendant notre mandat BDE, merci de ton investissement, des moments qu\'on a passé ensemble en tant que BDE mais aussi à côté ! Tout ces Beers Pong ou je t\'ai lamentablement battu. J\'espère que tu en resortiras que plus fort :D\r\n\r\nJ\'attends toujours de gouter la truffade de ta maman hein ! On a fait Fajitas maintenant faut faire Truffade !!!\r\n\r\nBref, j\'espère que l\'on aura l\'occasion de se revoir, boire une bière ensemble parler du bon temps et pourquoi pas que je te détruises une fois de plus au BeerPong :D \r\n\r\nCa m\'a fait vraiment plaisir de te rencontrer, j\'espère que l\'on aura l\'occaz de rester en contact.\r\n\r\nBon courage pour la suite,\r\n\r\nBisous - Rikou', 2277, 2302);
INSERT INTO `yearbookmessages` (`id`, `yearbook_id`, `message`, `userFrom_id`, `userTo_id`) VALUES
(1024, 2, 'DISCLAIMER : Ce message est écrit avec plein de niaiserie / ou pas, dans un français qui m\'est propre #JEcrisCommeJeParle. De plus, toutes les fotes de grammaire / orthographe ne sont pas intentionnelles, je reporte la faute sur l\'éducation nationale qui m\'a laissé passer au collège avec des 0 en dictées.\r\n\r\nHola Rikou, \r\n\r\nMon gars, je vais pas y aller par 4 chemins, mais par 42.\r\n\r\nPour commencer : merci pour ton message, ça fait plaisir, je t\'ai pas écrit avant parce que rapport, soutenance et autres détails.\r\nConcernant la photo : j\'hésite a mettre une photo troll donc je sais pas encore quoi mettre.\r\nConcernant mon diplôme : j\'assume complètement ce vol, que je qualifierai même de casse du siècle. \r\nConcernant ton diplôme (que t\'auras sans aucun doute, escroc que tu es) : Congrats, you deserved it bro! (#Bilinguality)\r\nConcernant les bières pong : la prochaine fois que je te vois je t\'ampute les bras de 10 cm, c\'est de la triche, bras déplié t\'arrives à la moitié de la table. Bon je reconnais aussi que t\'es pas mauvais (c\'est un compliment).\r\nConcernant les bons moments et le BDE : je ne peux pas mieux le dire que toi, c\'était vraiment sympa.\r\n\r\nEt je vais finir par une petite chansonnette (enfin une partie pck flemme de tout écrire) :\r\n\r\n\"Bruit d\'éclaircissement de gorge\" \r\n(Imagine que je chante de ma plus belle voix)\r\n \r\nJe te souhaite tout le bonheur du monde \r\nEt que quelqu\'un te tende la main (mais pas un mec sinon ça fait tout PD)\r\nQue ton chemin évite les bombes (vaut mieux, c\'est plutôt chiant les prothèses) \r\nQu\'il mène vers de calmes jardins (acqp celui des tuileries a Paris est sympa)\r\nJe te souhaite tout le bonheur du monde (refrain...)\r\nPour aujourd\'hui, comme pour demain (mais pas hier)\r\nQue ton soleil éclaircisse l\'ombre (typiquement à 8h du mat après Isioke)\r\nQu\'il brille d\'amour au quotidien  (NIAISERIE)\r\n\r\nToute une vie s\'offre devant toi (enfin, au mieux quelques années, la cirrhose n\'est pas loin)\r\nTant de rêves à vivre jusqu\'au bout (je suis pas très inspiré pour cette ligne donc je me contenterai de têtes qui dancent           ♪┏ ( ･o･) ┛♪┗ (･o･ ) ┓♪┏(･o･)┛♪  -> imagine Bartoli en mode Sarkozy )\r\nSûrement tant de joies au rendez-vous (je ne te souhaite que ça)\r\n\r\nPlein d\'amitié, Can\' & Sinsemilia (je suis obligé de les citer pour des raisons de copyright)', 2302, 2277),
(1025, 2, 'Yo, \r\nJe te rend la pareil :p, je serais la le 2.\r\n\r\nBon courage pour la suite :D', 2228, 2302),
(1026, 2, 'Félicitations pour ton diplôme Coco ! J\'espère que tout se passera bien pour toi à Michelin.  On aura quand même bien rigolé durant ces années ! \r\nJ\'espère qu\'on se reverra.\r\n\r\nBeubeu le BG', 2336, 2284),
(1027, 2, 'Je me souviens de la première fois où on a vraiment commencé à se parler, c\'était durant une soirée à ISIMA, la fameuse fois ou tu es tombé dans un terrier. Qui aurait pensé qu\'on se soient suffisamment bien entendus pour prendre une coloc\' ensemble ?\r\nJ\'espère ne pas t\'avoir trop soûlé à la coloc\' et j\'espère que mes talents culinaires auront su satisfaire tes papilles. J\'espère que nos petits instants d\'égarement (comme crier dans la coloc\' sans raison) ne te manqueront pas trop #balayer! #nettoyer! \r\nJe te remercie pour tous les bons moments et tous les délires qu\'on a partagé. J\'espère qu\'on se reverra sur Lyon.\r\n\r\nT\'es vraiment un mec super sympa, j’espère que tout se passera bien pour toi à Sopra et surtout félicitations pour ton diplôme !\r\n\r\nBisous, \r\nTon amant Beubeu', 2336, 2194),
(1028, 2, 'Wech grosse sauc\' !\r\n\r\nMerci pour ces trois années passées à tes cotés ! On aura vraiment bien rigolé et je garderai des supers souvenirs de toi. Je serai toujours à tes côtés pour montrer à qui appartient le dancefloor ou pour faire une visite du toit de l\'ISIMA à 1h du mat\'.\r\n\r\nJ\'espère que tu réussiras à aboutir au projet professionnel dont tu rêves : devenir la productrice de Flo La Mich #izziblague.\r\n\r\nUn peu de sérieux quand même : félicitations pour ton diplôme ! Plein de belles choses pour ton avenir ! \r\n\r\nGros bisous\r\nBeubeu #loucarrelache', 2336, 2294),
(1029, 2, 'En tant que lyonnais, il est assez difficile pour moi de laisser un mot sur ton yearbook... Mais bon je ravale ma fierté !\r\n\r\nFélicitations en tout cas pour ton DOUBLE diplôme ! \r\nVoici un petit dessin personnalisé juste pour toi !\r\n\r\n __  __ __  __\r\nl                           l                           l                  \r\nl                           l                           l   \r\nl                           l                           l   \r\nl                           l                           l   \r\nl                           l                           l   \r\nl __ __ __ __ _l                           l__  __ __ __                  \r\n\r\nBeubeu le bad gone OL 69 la trick', 2336, 2313),
(1030, 2, 'Félicitation pour ton diplôme Beubeu !\r\nOn s\'est bien marré, je te souhaite le meilleur pour la suite.\r\n\r\nBisou bisou', 2284, 2336),
(1031, 2, 'Félicitation pour ton diplôme Vavou!\r\n\r\nJ\'espère que tu as collé beaucoup de petite en Espagne et te souhaite le meilleur pour la suite.\r\n\r\nMuchos besos', 2284, 2195),
(1032, 2, 'Félicitation pour ton diplôme Cédric !\r\n\r\nFélicitation pour ton projet ! J\'espère que tout se passera bien et te souhaite le meilleur possible !\r\n\r\nBisou bisou', 2284, 2299),
(1033, 2, 'Félicitation pour ton diplôme Matthieu!\r\n\r\nOn s\'est bien marré pendant ces trois années. Rappelle toi que les coincoins ça fait effet et pas rien comme tu disais !\r\n\r\nBisou bisou', 2284, 2313),
(1034, 2, 'Félicitation pour tes deux diplômes Babou!\r\n\r\nOn s\'est bien marré, je retiendrai de toi la purée mousseline en particulier. Les campagnes c\'était le feu, dommage on a perdu ! \r\n\r\nBisous bisous', 2284, 2334),
(1035, 2, 'Félicitation pour ton diplôme Kiki!\r\n\r\nMême si tu supportes Monaco, je te souhaite le meilleur pour la suite. \r\n\r\nJ\'espère que l\'on se reverra !\r\n\r\nBisou bisou', 2284, 2335),
(1036, 2, 'Salut BG !\r\n\r\nFélicitation pour ton diplôme, je te souhaite le meilleur pour la suite ! \r\n\r\nNos sessions Tinder vont me manquer !\r\n\r\nCiao', 2284, 2316),
(1037, 2, 'Hello hello,\r\n\r\nUn petit, non un moyen, non un énorme message pour Lulu car il y a de quoi dit à propos de LULU.\r\n\r\nTout d\'abord, merci Lulu pour avoir égayé nos deux années a l\'ISIMA. Toujours là pour mettre l\'ambiance, avec des histoires d\'amour et de CULs, des histoires de chevaux, des histoires d\'association, des histoires ... et surtout TES RALERIES ^^ qui nous ont toujours fait bien rire ^^ même celle pour la machine à Mousse avec le recul j\'espère que tu en rigoles ^^. \r\n\r\nBref Loulou, je voulais également te dire que même si tu es relou, ( voire très ... ) et même si tu es une CASSE BONBON, tu as toujours été là pour les farmerzz dans chacune des Assos où je suis passé, dans chaque bon moment à ISIMA ... et je t\'en remercie! Surtout au WEI, où l\'on a tout déchiré et où l\'on a assuré comme des bêtes ^^. Enfin tu as perdu le chéquier quand même! Ahahhahhhahahhahah .\r\nDonc merci pour ça, pour m\'avoir fait confiance. Tu n\'aurais pas toujours dû\r\nFélicitation pour ton diplôme, tu le mérites ça n\'a pas toujours été facile ( bon en cours tu assures, mais niveau morale, je sais que ça n\'a pas toujours été évident) ! \r\nJ\'espère qu\'on se verra par la suite\r\nBonne continuation\r\nBisous de moi, Babou\r\n\r\nPs: Je te déteste pour la vidéo en boxer de papa Noël pour les campagnes\r\nPs2: ISIOKE c\'est la vie\r\nPS3 : veux-tu m\'épouser . \r\nPS4: Arrête de râler \r\nPS5 : parce que 5 \r\nPS 6 : PS ISIOKE\r\nPS7: Lulu et Clément Grégoire for ever\r\nPS8: Lulu en soutif dans le BDE\r\nPS9: Lulu, la beauté numérique\r\nPS10: tous à poil et on se caresse\r\nPS11: LOCO ...\r\nPS12: parce que 4 fois 3, ça fait 12\r\nPS13: Comme les farmerzz\r\nPS26 : comme le nombre de mecs que tu as choppé à ISIMA\r\nPS49 : LOULOU la meilleure', 2334, 2300),
(1038, 2, 'Vavou ou le seul mec à écrire dès l\'ouverture des Yearbooks !\r\nJe tiens vraiment à te féliciter pour ton diplôme, tu le mérites même si tu restes assez pénible comme garçon ! \r\nSurtout garde la pêche et si t\'as besoin d\'un cobaye pour ta nouvelle école, ne me demande pas :P\r\nJe te kiffe quand même, trop de love entre nous :D', 2294, 2195),
(1039, 2, 'Mon petit Babou :\r\n\r\nBonheur\r\nAmour\r\nBordélique\r\nOh que t\'es beau\r\nUnique\r\n\r\nAutant de mots pour te décrire ! Ces trois ans ont passé beaucoup trop vite, trop de fêtes, de délires et de conneries (qui resteront secrets) !!!\r\nT\'es quand même la première personne avec qui j\'ai parlé et ça ne s\'oublie pas hein :D\r\n\r\nTrop de love baby boy ! \r\nBisous d\'une vraie Princesse :)\r\n\r\nPS : 16h55 fin du boulot, le mot s\'arrête la, j\'ai déjà fait des heures supp\' pour toi !', 2294, 2334),
(1040, 2, 'Wesh gros sauc\' (désolé je t\'ai copié un peu) ! \r\n\r\nJe commence par la chose la plus importante avant de passer aux conneries et de l\'oublier : FELICITATIONS pour ton diplôme !!! Des bosseurs comme toi il n\'y en a pas deux franchement, c\'est quoi qui a le plus travaillé à l\'ISIMA :P\r\n\r\nQuand je pense à toi et aux trois années qu\'on a passé à déconner :\r\n- je pense à Flo La Mich\', ses baskets, sa dégaine et surtout sa danse de folie :D\r\n- je pense à notre séjour à Europapark, plutôt mouvementé avec une belle panne de voiture, notre vie mise en DANGER mais on a survécu et surtout bien rigolé\r\n- je pense à toutes les soirées de oufffff qu\'on a fait et aussi toutes les personnes dont on s\'est moqué ^^\r\n\r\nEnjoy your new life !\r\n\r\nPlein de bisous petit Beubeu, \r\nEt Vive le Portouuuuugalll !!!!\r\nJuju :)', 2294, 2336),
(1041, 2, 'Je te félicite pour ton dîplome et bon courage pour la suite !! N\'oublie pas la F3, on est les meilleurs\r\n\r\nBabou', 2334, 2296),
(1042, 2, 'Justine, ( je ne t\'appelerais pas princesse)\r\n\r\nIl est temps pour moi de faire une pause dans mon travail, sachant que j\'ai deux soutenances à préparer ! J\'en ai déjà marre !\r\n\r\nBref je te préviens ce message sera long intense en fautes d\'orthographe et surtout GENIAL ! GENIAL ( avec les deux pouces en l\'air et une tête de raton)\r\n\r\nHonnêtement, disons-nous la vérité tu as très mal commencé l\'année de ZZ1. Rencontrer Chauvet, boubouaoouboauua l\'ERREUR! Heureusement que c\'est la seule erreur sur ton parcours déjà qu\'elle te coûte chere. Puis les FARMERZZ, ça rattrape les erreurs du passé. Les farmerzz en forme comme toujours avec quelques personnes plein de sauces : Benoît chaton, Maxime forest, Dehbia, Zouzou et Lulu... Finalement, c\'est une deuxième erreur cette équipe ! \r\n\r\nTu nous auras bien fait rire pendant ces campagnes entre les foutus crêpes ( il faut me dompter cette nature ! ) et le foutu jeu des glaçons sur le bar^^, on en a bien rit!\r\n\r\nPuis on a perdu ... oin  mais on avait encore un nouveau jeu Ouoauouaouoauouaouaouaouau ooooooo merci la forêt (lalallalal, bon j\'arrête les blagues nulles). on a passé les 6 derniers mois non-stop ON fire avec des \"on n\'entend pas dehbia se fissurait\" et des gens momifiés en PQ, on aura fait n\'importe quoi en cette fin d\'année de ZZ1.\r\n\r\nJe ne vais pas continuer sur la deuxième et la troisième année, sinon on en finira pas. Juste, à la coinché on aurait gagné le tournoi si tu étais resté le week-end avec moi ^^. \r\n\r\nMerci pour tous les bons moments, les mauvais aussi et les trop bien. Merci de m\'avoir toujours fait confiance et suivie dans toutes mes aventures les plus folles ( WEI, FARMERZZ et Assofinale et encore WEI) . On n\'aurait jamais pu faire une soirée comme ça sans la mousse ^^ et je t\'en remercie ( d\'avoir fait chier Lulu aussi) !\r\n\r\nOn a commencé à 4 avec Coco et coutcout et je suis heureux que nous n\'aillons pas perdu notre amitié au milieu de la guerre des mâles. (Normal tu es une princesse et une connasse) . Je sais que tu réussiras de grande chose, car tu es la plus maline de nous tous!! \r\n\r\nFélicitaion et bon courage pour la suite !!\r\n\r\nBisous de moi, babou \r\n\r\nJTM JTM JTM COEUR COEUEUEUR LOVE \r\nLOVE DE COEUR\r\nLOVE LOVE LOVE COEUR \r\nBEST FRIEND FOR EVER ^^ COEUR COEUR\r\n\r\nPS: On va retourner le WEI\r\nPrincesse on fire ^^', 2334, 2294),
(1043, 2, 'Deborah,\r\n\r\nTu as choisi d\'intégrer la grande aventure QUALIAC garanti 100% français ^^ !\r\nJe te souhaite le meilleur pour la suite et je te remercie pour tout ce que tu as apporté à nos années d\'ingénieurs. Par exemple, des moments de rigolade, de déboche et le WEI 2014 sans oublier le 2015. ( et le bedo du WEI)\r\n\r\nFélicitation pour ton diplôme, même ton double diplôme! Dit toi juste que tu as eu de la chance : je me tape deux soutenances! Une aujourd\'hui et une demain avec Ralet ^^ Super !\r\n\r\nPS: ne bois pas trop pour fêter ça ! écrivez ici...', 2334, 2292),
(1044, 2, 'Encore bravo pour ton diplôme ! Trois ans ça passe trop vite !', 2222, 2314),
(1045, 2, 'Pauline, \r\n\r\nACQP (a ce qui parait) tu n\'es plus avec ton copain ? J\'ai entendu ça dans les couloirs ^^ !!! LOOLOLOLOL\r\n\r\nJe te souhaite bon ocurage pour la suite, et encore félicitation pour ton dîplome ^^ la premiére de la classe F3 for ever ^^ et ton autre dîplome MAE ^^\r\n\r\nBonne continuation et à bientôt \r\n\r\nBisous de moi, BABOU !!!', 2334, 2291),
(1046, 2, 'Pauline, \r\n\r\nACQP (a ce qui parait) tu n\'es plus avec ton copain ? J\'ai entendu ça dans les couloirs ^^ !!! LOOLOLOLOL\r\n\r\nJe te souhaite bon ocurage pour la suite, et encore félicitation pour ton dîplome ^^ la premiére de la classe F3 for ever ^^ et ton autre dîplome MAE ^^\r\n\r\nBonne continuation et à bientôt \r\n\r\nBisous de moi, BABOU !!!', 2334, 2291),
