(1050, 2, 'MVP du championnat universitaire de basket du campus de Clermont-Ferrand deux années à la suite au poste de pivot, Jimmy Hoang suit les traces de son cousin Yao Ming et attend prochainement son transfert en NBA. Je lui souhaite une carrière professionnelle auréolée de succès.', 2498, 2308),
(1051, 2, 'Que de souvenirs partagés à l\'ISIMA pendant ces 3 ans : des journées, des soirées, des nuits et des week-ends... Tout cela pour travailler sur autant de projets utiles qu\'inutiles mais sur lesquels nous avons su relever les défis et les porter à l\'extérieur. \r\nJ\'espère bien que ce n\'est pas encore fini. Bonne continuation.', 2305, 2327),
(1053, 2, 'DISCLAIMER : Ce message est écrit avec plein de niaiserie / ou pas, dans un français qui m\'est propre #JEcrisCommeJeParle. De plus, toutes les fotes de grammaire / orthographe ne sont pas intentionnelles, je reporte la faute sur l\'éducation nationale qui m\'a laissé passer au collège avec des 0 en dictées.\r\n\r\nYo Jo,\r\n\r\nDéjà sache que je t\'envoie ce message pour te faire chier, tu vas recevoir un mail et devoir venir ici pour le lire. Aussi, j\'aimerais te dire qu\'on ce sera quand même bien marré pendant 3 ans.\r\n\r\nAmicalement, Can\'.', 2302, 2320),
(1054, 2, 'DISCLAIMER : Ce message est écrit avec plein de niaiserie / ou pas, dans un français qui m\'est propre #JEcrisCommeJeParle. De plus, toutes les fotes de grammaire / orthographe ne sont pas intentionnelles, je reporte la faute sur l\'éducation nationale qui m\'a laissé passer au collège avec des 0 en dictées.\r\n\r\nYo Godberito,\r\n\r\nDéjà sache que je t\'envoie ce message pour te faire chier, tu vas recevoir un mail et devoir venir ici pour le lire.  Franchement t\'es mauvais au beer-pong (enfin pas tant que ça) et faut qu\'on s\'améliore si tu vois ce que je veux dire. Aussi, j\'aimerais te dire qu\'on ce sera quand même bien marré pendant 3 ans.\r\n\r\nAmicalement, Can\'', 2302, 2202),
(1055, 2, 'Et voilà, il est temps de t\'écrire un mot. \r\n\r\nDepuis le début je n\'ai pas envie de m\'y mettre car ça va être sûrement le plus long, le plus chiant, le plus niais des messages ^^ mais bon écrivons. \r\n\r\nCommençons par le commencement, dis-moi ce qui nous est arrivé pour venir dans une école d\'Ingénieurs en informatique, dans le nord de la FRANCE. Moi limite je n\'ai pas eu trop le choix mais toi ... allalallala\r\nPuis au final, tu as redoublé encore une fois ! Une habitude pour vous COUTCOUT mais ce qui n\'a pas déplu aux FARMERZZ ! D\'ailleurs le mec fait les campagnes BDE avec nous alors qu\'il a redoublé ... #grossemerde ^^. Heureusement que tu étais là, tu nous auras bien fait rire et bien aider pour qu\'on perde lamentablement^^ ! on aura quand même bien rigolé avant ces campagnes, avec ces foutus (il faut qu\'on me dompte cette nature) soirée BBOX, surtout celle avant le WEI #Tropcondelalife\r\n\r\nBref, je voulais également te signaler qu\'en cette première année, tu m\'as mis une quinzaine de fois l\'appartement en bordel avec ton pq, mais bon je t\'y avais enfermé dedans LOOOOOLLLLLL... moment de rigolade ! OUa OUA oua OUAOUOAUOAUOAUOZUOUAOUOUOZAUUOAUU ( Laforet) ^^ \r\n\r\nQuand on était en deuxième année avec tous les autres bouffons ^^ Nous on n\'a pas fait les bouffons, on a fait quoi ... \r\n\r\n\r\nDES VACANCES AU BRESIL ! On aura tellement rit là-bas ^^ et on a vu en avant-première le monde de DORY et aussi PACO PIGALLE ^^ et également Léandre et Mélina ... Les glaces ACAI dégueulassent. \r\nSurtout que parfois tu n\'avais plus vraiment de place pour bouger ^^ ( foutu train de la mine). Une bonne viande avec Estelle à Rio la folie ^^ vivement qu\'on y retourne !!!\r\n\r\nEt cette dernière année, encore une coloc on en PARLE OU PAS, quelle idée de te suivre partout ^^ j\'en peux plus ^^ vivement que tu te casses à LYON ^^ et que je vienne d\'embêter tous les week-ends sans exception ! \r\n\r\n\r\n Félicitation quand même mon coutcout pour ton diplôme que tu as mérité ou pas trop ^^ mais bon c\'est plus mérité que moi ^^ Bonne continuation pour après ^^ \r\n\r\n( il est tant du message nian nian) \r\n\r\nJe tiens juste à te remercier pour tout ce que tu as fait pour moi durant ces trois années, ton soutien m\'a été très précieux pour les associations et ma vie privée. Tu me l\'as encore montré en ce mois d\'aout! Je serais toujours le copinou de plus chiant du monde, de l\'espace, de la galaxie ^^ qui t\'emmerdera avec ces câlins jusqu\'au bout de ta life ^^ #soitpasdeg\r\n\r\nBisous de moi Babou\r\n\r\nPS : Ce message est sur le ton de l\'humour mon cher ^^', 2334, 2194),
(1056, 2, 'Félicitations fillotte pour ton diplôme, je te souhaite une bonne continuation et plein de réussite aussi bien dans ta vie professionnelle que personnelle :)', 2177, 2325),
(1057, 2, 'Félicitations Vavou pour ce diplôme et bonne chance dans l\'obtention du prochain !!\r\nBises Tibo', 2194, 2195),
(1058, 2, 'Felicitaciones por su diploma Vavou ( je ne sais pas parler en espagnol en fait lol)\r\nBonne continuation :)', 2177, 2195),
(1059, 2, 'Félicitations pour ton diplôme Coco, bonne continuation :)', 2177, 2284),
(1061, 2, 'Rikou,\r\n\r\nQui l\'aurait cru qu\'on allait passer du bon temps ensemble quand on était en première année ?? Pour tout te dire quand j\'ai vu les fréquentations que tu avais et quand tu parlais c\'était toujours de LOL, je t\'avais blacklisté de ouf !!!\r\n\r\nAu final, bon délires, des sujets de discussion de l\'humour de gros lourd (je rigole) et des soirées, manque plus qu\'on se fasse un petit festival !!\r\n\r\nSinon félicitation pour ton diplôme, tu le mérites psq t\'es un mec en or. Je te souhaite tout le bonheur du monde pour la suite et tu m\'iniviteras dans ta maison avec pisicne à pont du chateau !!\r\n\r\nLa bise gros \r\nTibo', 2194, 2277),
(1062, 2, 'Juju la terreur, El Haddad te félicite pour ton diplôme et te souhaite plein de réussite dans ta vie professionnelle. \r\nOn se voit très bientôt ;) Bisous de moi <3', 2177, 2294),
(1063, 2, 'Félicitations pour ton diplôme Bba Ismail ;)', 2177, 2296),
(1064, 2, 'Hey El Payé !\r\n\r\nMon petit sénégalais, j\'ai passé 3 super années avec toi ! Tu m\'auras bien fait rire sur bien des choses !\r\n\r\nJe te souhaite le meilleur pour la suite, à Panam, Grenoble ou Marseille, à toi de choisir !\r\n\r\nCiao ;)', 2284, 2326),
(1065, 2, 'Hey ! COCO\r\n\r\nON VA FAIRE NOTRE PREMIER WEI SANS L\'ORGANISER OU ETRE BIZZUTER ^^ On est les champions, on est les champions, ... . Bref il faut qu\'on en reparle d\'ailleurs. \r\n\r\nBon déjà quoi te dire, merci pour tout ce que tu as fait pour les farmerzz et pour moi ^^ tu m\'as suivi dans deux associations assez folles ^^ Je me rappellerai surement toujours de cette soirée de passation chez toi avec tous ce popper de partout oulalallala en fait je ne m\'en souviendrais jamais du début ^^ On a perdu mais honnêtement tant mieux, avec beaucoup de prétention l\'ISIMA ne nous méritait pas ^^ LOL LOL Mdr Mdr OUAOUOUUAUAUAOAUO OUOUAOUAOUA ( Laforet) ! \r\n\r\nMerci pour le début de première année où l\'on a eu des purs moments de délire au BBOX ou avec dehbia qu\'on n\'attend pas de se fissurer ^^ ou encor epikachu ou goupix ^^ Bref souvenir ... et ton petit dodo dans la rue\r\nFélicitation pour ton diplôme et ton CDI ^^ je te souhaite le meilleur pour la suite \r\nBisous de moi, Babou', 2334, 2284),
(1066, 2, '\"Je vais te défoncer\" \"Moi je te casse la tête\" Voilà 3 ans de bien résumé ^^', 2298, 2284),
(1067, 2, 'Babou le barbare, je tiens à te féliciter pour ton diplôme mais aussi pour ton grand investissement dans la vie associative de l\'école, ton organisation de soirées  énormes et j\'en passe ... :) Je te souhaite aussi bon courage pour ta recherche d\'emploi et j\'espère qu\'on se reverra bientôt pour chanter \"I\'m not cerf, i\'m rabbit\" :D \r\n\r\nBisous bisous.\r\n\r\nEL HADDAD.', 2177, 2334),
