(1074, 2, 'Félicitations pour ton diplôme mon CoutCout, nous avons passés des moments tth à l\'école, mais comme dit un vieux proverbe Auvegnat \"Toutes les bonnes choses ont une fin\" (tadadaaam). \r\nJe suis très content pour toi, et pour ton diplôme car il ne manquait plus que toi dans la bande, et pour ton embauche à Lyon car on aura l\'occasion de faire des trucs encore plus tth. #tmtc\r\n\r\nJe te fais plein de bisous et à bientôt pour de nouvelles aventures amalgamaa ;)', 2177, 2194),
