(1078, 2, 'BALAYER !!!!!\r\n\r\nEncor un putin de délire qui vole haut. Benoit Suslec aka le mec qui trou ses tee shirt en mettant ses doigts devant, aka le mec qui fait des haricots à la poele avec des lardons de la crème, aka le mec qui a jamais vomi, aka le mec qui a défoncé son lit en mettant une cheville n\'importe comment, ...\r\n\r\nSinon de gros délires, des soirées de ouf avec ta meuf trop fraiche pour ramener les déchets de la coloc ! Félicitation pour ton diplome, c\'est l\'heure de bosser pour de vrai. \r\n\r\nps: On a pas finit de se voir, acqp je suis sur Lyon !!\r\n\r\nLa bise gros\r\nLe bg de la coloc', 2194, 2336),
