(1086, 2, 'LULU !!!!!\r\n\r\nÇa fait un petit moment qu\'on s\'est pas vu dit donc ! 2 ans avec toi, c\'était cool ! Même si t\'es un peu chiante sur les bords :D\r\n\r\nles campagnes c\'était cool, même si on a perdu. Foutus Herozz !\r\n\r\nFélicitations pour ton double diplôme !\r\n\r\nBisous', 2284, 2300),
(1087, 2, 'Yo Coco !\r\nRo Plo Plo !\r\n\r\nFéloch pour ton année, ton diplôme et ton CDI :)\r\nBonne continuation dans la vie !\r\n\r\nTcho !\r\nNico.', 2315, 2284),
(1088, 2, 'KIKI, \r\n\r\ndéjà mais c\'est quoi cette photo non mais ça va plus, c\'est le début de la fin là !\r\nBref passons, ^^ Kiki mon président BDS, toujours au top de la forme pour faire du sport euh ... plutôt supporter MONACO, cette équipe immonde avec comme seul supporteur KIKI ^^ YOUPI! Même si de temps en temps vous battez le PSG pour mon grand bonheur, cette équipe n\'est pas digne de toi ^^.\r\n\r\nBon bref, parlons peu parlons bien ! Je te félicite pour ton diplôme que tu as eu finger in The noise et bon courage pour la suite ^^. Je te remercie de m\'avoir suivi pour le WEI et même deux fois ! Cette année on va en faire un sans organiser ni se bizuter et tu seras là j\'espère ^^! merci de nous avoir toujours supporté en farmerzz et merci pour tout ce que tu as apporté à ISIMA en tant que IMAGE est surtout avec le site digne de ce nom qu\'on a enfin à ISIMA ^^\r\n\r\nBisous de moi, BABOU\r\n\r\nPs : J\'aimerais que tu avous publiquement que le roi dess pissettes c\'est MOI et que je suis ton maître  dans ce domaine là !!', 2334, 2335),
(1089, 2, 'Merde et voilà, je me suis trompé le maître des reprises ^^', 2334, 2335),
(1090, 2, 'Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin Miss Potin  ... Oui, je me fait chier !', 2297, 2292),
(1091, 2, 'J\'espère pour toi que tu vas t\'éclater dans ta future vie !\r\nJ\'ai apprécié les moments que l\'on a pu passé ensemble :)\r\n\r\nFélicitation à toi !\r\nMange un peu plus, et surtout plus varié !\r\nYo !\r\nNico.', 2315, 2291),
